-- Table structure for p_goods
-- ----------------------------
DROP TABLE IF EXISTS `p_goods`;
CREATE TABLE `p_goods`  (
  `id` int NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `old_id` int NOT NULL DEFAULT 0 COMMENT '老库商品ID',
  `user_id` int NOT NULL DEFAULT 0 COMMENT '用户ID',
  `goods_name` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '商品名称',
  `goods_image` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '图片地址',
  `one_cate_id` int NOT NULL DEFAULT 0 COMMENT '一级分类ID',
  `two_cate_id` int NOT NULL DEFAULT 0 COMMENT '二级分类ID',
  `three_cate_id` int NOT NULL DEFAULT 0 COMMENT '三级分类ID',
  `four_cate_id` int NOT NULL DEFAULT 0 COMMENT '四级分类ID',
  `category_id` int NOT NULL DEFAULT 0 COMMENT '商品分类ID',
  `style_id` int NOT NULL DEFAULT 0 COMMENT '风格ID',
  `brand_id` int NOT NULL DEFAULT 0 COMMENT '品牌ID',
  `color` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '颜色',
  `mater` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '材质',
  `model` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '型号',
  `attributes` varchar(5000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '[]' COMMENT '商品属性',
  `body` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '商品详情（装修）',
  `remark` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '描述',
  `market_ratio` decimal(5, 2) NOT NULL DEFAULT 3.00 COMMENT '市场价倍率',
  `min_factory_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '最低出厂价',
  `min_size_id` int NOT NULL DEFAULT 0 COMMENT '最低尺寸ID',
  `max_factory_price` decimal(10, 2) NOT NULL DEFAULT 0.00 COMMENT '最高出厂价',
  `max_size_id` int NOT NULL DEFAULT 0 COMMENT '最高尺寸ID',
  `click_count` int NOT NULL DEFAULT 0 COMMENT '点击数量',
  `collect_count` int NOT NULL DEFAULT 0 COMMENT '收藏数量',
  `sales_count` int NOT NULL DEFAULT 0 COMMENT '销售数量',
  `score` decimal(3, 1) NOT NULL DEFAULT 0.0 COMMENT '评分',
  `rate_count` int NOT NULL DEFAULT 0 COMMENT '评价数量',
  `role_id` tinyint NOT NULL DEFAULT 1 COMMENT '分类:1=工厂,2=商家',
  `isdraw` tinyint NOT NULL DEFAULT 1 COMMENT '画图:1=显示,0=禁用',
  `status` tinyint NOT NULL DEFAULT 1 COMMENT '状态:1=显示,0=禁用',
  `is_hot` tinyint NULL DEFAULT 0 COMMENT '是否火爆:0=否,1=是',
  `machine_draw_pic2` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '机器白底图地址',
  `machine_draw_pic` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '机器白底图地址',
  `is_machine_draw_pic` tinyint NULL DEFAULT 0 COMMENT '是否用机器跑过白底图:0=否,1=是',
  `hot_time` int NULL DEFAULT 0 COMMENT '设置火爆时间',
  `create_time` int NOT NULL DEFAULT 0 COMMENT '创建时间',
  `update_time` int NOT NULL DEFAULT 0 COMMENT '更新时间',
  `draw_image` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '画图图片地址',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `u_r`(`user_id`, `role_id`) USING BTREE,
  INDEX `cate2`(`two_cate_id`) USING BTREE,
  INDEX `cate3`(`three_cate_id`) USING BTREE,
  INDEX `cate4`(`four_cate_id`) USING BTREE,
  INDEX `cate1`(`one_cate_id`) USING BTREE,
  INDEX `ut`(`update_time`) USING BTREE,
  INDEX `b_i_s`(`brand_id`, `goods_image`, `status`) USING BTREE,
  INDEX `cate_brand`(`category_id`, `brand_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1813049 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '商品表' ROW_FORMAT = COMPACT;

