INSERT INTO `p_brand` VALUES (9, 8, 'YS', 5, '严树', 'https://oss.yiwofa.com/brand/20200515/4797c003199a8e8f481a440e6953056f.png', 'https://oss.yiwofa.com/brand_banner/20200903/561387e0864ad62a0048d64aa8b1a3cc.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/305d2ecd362f424e4e982136e4075d81.jpg,https://oss.yiwofa.com/brand_banner/20201031/7fd4a9fd5c6faea3a08406ec66234210.jpg,https://oss.yiwofa.com/brand_banner/20201031/18186650591af785d69272477cabd534.jpg', '经营范围：家具\n旗下品牌：严树', 3.00, 1, 12, 26, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1589534623, 1604117517);
INSERT INTO `p_brand` VALUES (10, 9, 'RLAJ', 16, '瑞丽爱家', 'https://oss.yiwofa.com/brand/20200518/fb3bf5cbb4a74f3219b1360cf035a1be.png', 'https://oss.yiwofa.com/brand_banner/20200930/09b1587f4c9f718d4a059a35856a181d.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/e8ecd46627b18742f05effe729500801.jpg,https://oss.yiwofa.com/brand_banner/20201031/212c05ccc68e92c086d339bfff5ac89e.jpg,https://oss.yiwofa.com/brand_banner/20201031/25d4a5cedd7bcebf17ea0eab88919997.jpg', '爱家，一个高端时尚的新星家居品牌，创立于2010年， 集研发，生产，销售，售前，售后的一站式家居服务企业， 主营高端时尚的布艺家居，真皮家居，实木家居，包括美式 现代，北欧简约，意大利华贵，品牌产品涵盖4大基材、5大 空间、6大风格及20个系列，主要包括床，沙发，餐桌，电视 柜，床头柜，饰品等。所有产品均已达到国家标准或更高的 环保标准，让顾客买得放心，用得舒心。 爱丽家具工厂占地面积20亩，建筑面积9630m²。现有大型 车间两个，80余名员工，年产值达4000多万，另有入驻天猫 家居旗舰店两家，京东家具旗舰店一家。 　爱家市场覆盖率达国内外上千个城市，覆盖了国内的三十 多个省级行政区域，每年为我国数万家庭提供家居整体解决 方案，创新引领时尚健康新生活。 我们致力于打造中国最好的时尚家居品牌，通过公司的不 断努力，让每一个家庭因我们而变得无限美好', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 1, 0, 0.012, 1, 1, 1, '', 1589766765, 1612260237);
INSERT INTO `p_brand` VALUES (11, 10, 'LSP', 1, '翡丽尚品', 'https://oss.yiwofa.com/brand/20200518/b599720e9b223068c2be4bfac7d47787.png', 'https://oss.yiwofa.com/brand_banner/20200827/40a280bc60789464ed2570b2a10f991f.jpg', '', '佛山市翡丽尚品家具有限公司是等产品专业生产加工的公司，拥有完整、科学的质量管理体系。佛山市翡丽尚品家具有限公司的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 1, 12, 26, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1589767765, 1601432317);
INSERT INTO `p_brand` VALUES (12, 11, 'KDJJ', 1, '卡迪娅家居', 'https://oss.yiwofa.com/brand/20200519/06d0891ba332cf065ae88da355be8cec.png', 'https://oss.yiwofa.com/brand_banner/20200930/71241e9d8a498c46031eb68a41b36c0c.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/0e359510407c69640b0aa4c4e87fbacc.jpg,https://oss.yiwofa.com/brand_banner/20201031/3d6f30c80a9c6c6d23829a94878a528a.jpg,https://oss.yiwofa.com/brand_banner/20201031/97ae141a344555f66673e13c3d99e24a.jpg', '深圳市卡迪娅家居饰品有限公司成立于2008年，长期服务于国内、国外一线家具品牌，地产公司，家居饰品生活馆，设计公司和国内外经销商。 我们提供：专业的陈列摆场，合理的搭配指导，全套软装设计。 作为美学的传播者，我们始终坚持艺术精美、实用的设计开发理念，诠释出低调奢华、美好恬淡的生活意境。\"', 3.00, 3, 133, 150, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1589852771, 1604133142);
INSERT INTO `p_brand` VALUES (13, 12, 'MT', 1, '摩图', 'https://oss.yiwofa.com/brand/20200519/637d3efec516c4964022b1492136bdec.png', 'https://oss.yiwofa.com/brand_banner/20200827/44aecea3f1dbd177c584a835ab14c9fe.jpg', '', '佛山市美未央家具有限公司成立于2009年，是一家集设计、研发、生产、销售、电子商务等于一体的大型家居服务企业。从成立到品牌的建立，短短几年的时间里，我们一直艰苦奋斗，披荆斩棘，以发展的眼光看待问题，不断发展壮大。从最初的不足百人的小工厂再到如今拥有20000多平方制造基地的先进企业，这一切有赖于“美未央”全体员工的努力和客户的信赖。 我们正在努力打造个性化、智能化定制家居，不断创新、坚持不懈，为大众创造更美好的家居生活。展望未来，我们还有很长的路要走，但我们都相信：只要我们手拉手齐心向前，就没有人能让我们后退！', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1589855417, 1601432418);
