INSERT INTO `p_brand` VALUES (18, 18, 'ASN', 7, '艾森娜', 'https://oss.yiwofa.com/brand/20200526/3ebbadce234026bdcba1f35c90005f8c.png', 'https://oss.yiwofa.com/brand_banner/20200903/459d53d8d328f7524a25e526a09ab124.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/828f5e4aa4f098fb3499acd65690d06b.jpg,https://oss.yiwofa.com/brand_banner/20201031/3049c6e66e34591bd1b6a7f7065fddc7.jpg,https://oss.yiwofa.com/brand_banner/20201031/9e1af45cca4202c81c0b4267c98e8519.jpg', '东莞市山乔家具有限公司创立于2012年,2017年成立鸿开家具分公司, 2018年成立宏乔家具分公司,一直致力于豪华星级酒店家私、高档民用家私的专业开发、生产与销售，产品主要以实木家具为主体，是一家多元化经营的综合性经济实体, 是国内一家集设计、生产、销售于一体的大型、规范化家具企业。拥有全套意大利、德国、日本、台湾进口的先进精密机械设备和一支经验丰富的工程设计与生产队伍，拥有成熟、精巧、细致的生产工艺以及现代化的标准厂房，创造出的产品，以其高雅的设计、流行的款式、独特的风格、精湛的工艺畅销全国各地，成为众多星级酒店、高级会所、样板楼盘的配套家具，公司已通过ISO9000 质量体系认证,经过全体员工的不懈努力和业界人士的大力支持，山乔家具正稳步、快速发展，在国内建有多个特许经营店，产品已远销美国、日本、澳大利亚、中东、新加坡、韩国以及台湾、香港等二十多个国家和地区。及\"\"行业驰名商标\"\"、\"\"质量环保产品认证证书\"\"、专利产品三十多项。2012 年 5 月山乔家具以雄厚的实力收购“艾森娜”品牌。 山乔家具有限公司在职员工 300 多名，拥有 2 个家具生产基地，建筑面积 30000 多', 3.00, 1, 13, 41, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1590457203, 1604135923);
