INSERT INTO `p_brand` VALUES (72, 29, 'BFD', 2, '布凡迪', 'https://oss.yiwofa.com/brand/20200603/228c9ef6e2dd337560494ad35af432bf.png', 'https://oss.yiwofa.com/brand_banner/20200828/7e6adcddbc95c443f1d65cd5d9049205.jpg', 'https://oss.yiwofa.com/brand_banner/20201023/401d6dd8f3972de7fb555d9b427e274e.jpg,https://oss.yiwofa.com/brand_banner/20201023/a32b5673b313c681db8750658b190994.jpg,https://oss.yiwofa.com/brand_banner/20201023/c02c669a62082b3bd50029cf51d6dc9d.jpg', '舒奢家居在创建之初就以敬畏之心，奉献精神作为企业立命之本！以探索之心、工匠精神成就于每个幸福家庭、富贵人家！匠心精神是舒奢家居的品牌基因，也是舒奢家居的信仰与追求，并把这种信仰与追求提炼至舒奢家居乃至整个中国家居行业界的楷模与标杆！是匠心精神的真正领悟与践行品牌，舒奢家居是当之无愧的匠心家居创导品牌！', 3.00, 1, 14, 54, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1591169818, 1603437566);
INSERT INTO `p_brand` VALUES (73, 30, 'SCJJ', 3, '盛驰家居', 'https://oss.yiwofa.com/brand/20200604/f06dbb3b68b8df1ccedf919d68b6dcfc.png', 'https://oss.yiwofa.com/brand_banner/20200827/03790e781d0f9bb55a1b3dca0258b54d.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/72e6ca5599deb824d68321f2f1549003.png,https://oss.yiwofa.com/brand_banner/20201030/06bf9d88922404996e352ebb8e66b2bb.jpg,https://oss.yiwofa.com/brand_banner/20201030/61402382dfb06aecd04afd16c5f4add6.jpg', '东莞市盛驰家居有限公司致力于以提供高性价比小户型实木家具为主要经营方向，适用于：开发商拎包入住项目、出租公寓楼、老年公寓、民宿、精品酒店、咖啡厅、酒楼、书吧、销售中心、公共区域、软饰配套、精致小户家庭。\n国内展贸中心位于国际家具采购中心-广东省东莞市厚街镇，海外生产基地位于越南和马来西亚两处。\n    目前在国内拥有6000平米仓储中心，所有产品均配有安全库存，以做到当天订货当天发货无忧销售。  \n\"', 3.00, 1, 13, 41, 0, 1, 0, 1, 100, 19, 0, 0.012, 1, 1, 1, '', 1591259840, 1614756560);
INSERT INTO `p_brand` VALUES (74, 31, 'juyiJY', 1, 'juyi巨一', 'https://oss.yiwofa.com/brand/20200605/8513ab64a1db44f28ac31272450d7eec.png', 'https://oss.yiwofa.com/brand_banner/20200827/86ad5f2d82d2889ddda03ec9a12fcfc8.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/a903439a238e20cee772ce4a001d5176.jpg,https://oss.yiwofa.com/brand_banner/20201104/6eb8476b66dee810d9c15a75f6c568c3.jpg,https://oss.yiwofa.com/brand_banner/20201104/e6cbb79e845f6e51fd8be8f408669be0.jpg', '山市巨一家具有限公司座落于亚洲最大的家\n具生产基地—顺德龙江，公司是一家专业从事\n高端意式极简家具的大型制造企业，拥有二个\n大型的厂房、软体厂房和木制厂房，综合能力\n优秀的生产技术人才和管理人才，拥有2万5千\n平方的生产基地，软体厂房1万2千平，木制厂\n房1万3千平，2千方的家居体验馆，在研发方面\n企业拥有专业、创新、精堪的意大利SFRE设计\n公司研发团队，在营销方面企业拥有专业的营\n销团队和完善的营销体系，集研发、生产、销\n售、服务于一体的家具企业。\"', 3.00, 1, 14, 54, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1591342735, 1604476505);
