INSERT INTO `p_brand` VALUES (80, 36, 'NJHW', 1, '宁居户外', 'https://oss.yiwofa.com/brand/20200608/c3e8e301f8a251df1e4af3395592532b.png', 'https://oss.yiwofa.com/brand_banner/20200827/c322db5451e84c08bee117c1d8dc0d43.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/8215ed4a9fc28b230b8ef4ccc18da0d6.jpg,https://oss.yiwofa.com/brand_banner/20201104/7eac2a45130a1d6d48f047077f236e84.jpg,https://oss.yiwofa.com/brand_banner/20201104/9f2886c0b023e5ba6c18b3be4589a7a4.jpg', '佛山市宁居（博美户外）家具位于中国家具之都广东顺德乐从，专业生产户外室内家具家私，娱乐场所藤铁、钢藤、的独资企业，经济实力雄厚，是一家名优企业。经营产品主要有：酒店家具、藤椅、秋千、凉亭、公园椅、体育藤器、铸铝、木制休闲桌椅、沙发、和吧台椅等藤铁合一的家具，款款新颖、物美价廉、具有完美的构思，精致和外观，能为你营造一个合适并富有艺术感染力的理想生活空间，给你带来富有诗意的绝美世界。\n工厂先后引进了多套先进的机械生产设备和各种技术以及管理人才，实现了“质量高、服务好”的服务承诺的基础进一步扩大生产线，扩较大了产品的研发力度，十年来产品远销欧美、日本、中东等十几个国家和地区。一直备受广大海内外客户认可和喜爱！\n\"', 3.00, 1, 20, 87, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1591600369, 1604483936);
