INSERT INTO `p_brand` VALUES (86, 43, 'JHYM', 1, '匠和原美', 'https://oss.yiwofa.com/brand/20200615/11ecee52a33a9f38dd13ccd1d0025b2b.png', 'https://oss.yiwofa.com/brand_banner/20200827/fbfaa05c16d2feed075574f2fc2ce877.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/652fd4924f384e74809eb1f52847975a.jpg,https://oss.yiwofa.com/brand_banner/20201104/7949c2b3717843630cccc71544078927.jpg,https://oss.yiwofa.com/brand_banner/20201104/a0d3a76af3de58ecde32aa17159761ec.jpg', '中山市缔烁照明有限公司前身是中山市古镇灯道灯饰厂,成立于2007年1月，公司前期主要从事简单的灯具OEM加工。但随着时间的推移，这家小小的家庭式作坊逐渐成长壮大成为一家代表时尚设计的现代家居制造企业，为国内外众多客户提供了专业灯具配套服务。 \\&amp;#39;诚信经营\\&amp;#39;将是我司立业之本，同时；“品质、效率、价格、服务”，构成我司屹立于灯饰之都之基石。 缔烁体现了时尚视觉艺术，外观及光影的完美结合，以简洁，舒适，令人惊奇的创作作品打动人心。在飞利浦-斯达克等设计大师们的超群智慧和卓越想象力的启发下,未来的日子里我们会不断创造并更新自己的设计,使我们的客户能够享受到真正的高质量空间照明', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592185574, 1604485205);
