INSERT INTO `p_brand` VALUES (94, 49, 'YPBY', 1, '壹品布艺', 'https://oss.yiwofa.com/brand/20200616/320b720ec9dccd2b6eedeb6b71033e07.png', 'https://oss.yiwofa.com/brand_banner/20200930/53586679c197bd603227b7aca072c186.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/3ad9fbf5491c1e6a822bcf3020845495.jpg,https://oss.yiwofa.com/brand_banner/20201104/9c4914164cdbc78af2f0635cd956c348.jpg,https://oss.yiwofa.com/brand_banner/20201104/44f41cd4c52300a0240dc538ed749d5f.png', '圳市壹品布艺有限公司是一家集设计、生产、加工、安装及售后服务为一体的布艺(窗帘、床品、抱枕系列、配饰)专业化公司。公司拥有完善的设备及经验丰富的设计师，可根据样板房、售楼部、会所、酒店、民宿、餐厅、家庭、写字楼的装修风格和色调设计出高档的窗帘、床品、布艺沙发、椅套、台布、布艺装饰等布艺类用品，以从整体上作出非常和谐美观的效果。公司拥有国产和进口面料，花色品种非常齐全，价格非常具有竞争力。公司与全国上百家知名房地产公司和连锁酒店合作，质量和效果深受客户好评。以专业的服务和有竞争力的价格，是我司持之以恒的经营概念。深圳壹品布艺有限公司实行严格的质量管理，以高档、优质的产品，良好的售后服务，真诚的与您合作。公司愿以多年积累的经验和热诚的态度为广大客户提供优质服务。', 3.00, 7, 231, 0, 0, 1, 0, 1, 100, 114, 0, 0.012, 1, 1, 1, '', 1592274533, 1614765527);
INSERT INTO `p_brand` VALUES (95, 50, 'MYB.YS', 1, '美依宝.亦奢', 'https://oss.yiwofa.com/brand/20200616/650a183df04535d244bc31d3bb78edae.png', 'https://oss.yiwofa.com/brand_banner/20200827/305f7972e5508ca489c59c26ddf08f5a.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/7878c04a2f8ddf4642ea539d514bbc98.jpg,https://oss.yiwofa.com/brand_banner/20201105/de5c80a250f03c3f5cae47a764c3e3a8.jpg,https://oss.yiwofa.com/brand_banner/20201105/abbd08d0a28f668d0a2c33aedda11223.jpg', '美依宝亦奢家具品牌创立于2012年，其坐落于中国最大的家具成产基地——中国广东省顺德龙江，紧邻乐从国际家具城。是集设计、研发、生产、销售为一体的家具企业，我们秉承着“设计源于生活而高于生活”的设计理念，始终相信设计在于创造，勇于创新、设计的实现，必须依托于现实。设计源于生活，细节成就品质！美依宝亦奢是典型的家居企业，是国际家具行业里的领域者。公司一直追求自己的设计风格，简约而庄重，前卫且经典，一直保持着对现代风尚生活的敏锐触角。现代化、量化的生产模式让它在现代生产中脱颖而出。\n  秉承“简约而不简单，为年轻而设计”的设计理念，简洁明快，色彩靓丽，轻松自然，品味超然的设计风格，使意式的现代设计艺术与国内的现代生活潮流完美的结合起来，从而营造出了新生活、新色彩、新享受的新一代高品味生活的美好形象。\n    公司秉承“诚信为本，求实创新”的经营理念，开拓进取，锲而不舍的精神，立志为广大客户提供优质的产品和服务！\"', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592276264, 1604541825);
