INSERT INTO `p_brand` VALUES (102, 57, 'OTSUN', 4, 'OTSUN', 'https://oss.yiwofa.com/brand/20200618/1286e384bbdbd1a2f2e38327b0f3af20.jpg', 'https://oss.yiwofa.com/brand_banner/20200930/f8d4ad2a33ea4055382132417228def2.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/3045dac258361c2095ea8f94d1ba94ec.jpg,https://oss.yiwofa.com/brand_banner/20201030/0aef2395abda16dea5373344e261b82d.jpg,https://oss.yiwofa.com/brand_banner/20201030/6e77d1381af1b9722eec7f9b757dc767.jpg', '好美佳智能家居股份有限公司成立于2005年，是一家集产研销的户外休闲家居一站式定制化服务商，其前身是创立于1997年的深圳市雅美乐家具有限公司。20年来在欧美休闲家居市场中深耕细作，坚持原创设计和纯手工制作，用产品征服欧美顶级家具服务商和老牌户外家居企业。近年来将在国内市场打造一片新天地。旗下高端定制品牌OTSUN把握传统精髓结合现代工业风，以混搭的方式打造轻松的空间氛围，倡导“sunshine always free”的休闲文化，推动新时代的休闲消费模式。子公司第一艺术户外家具品牌TYARD庭漾，将艺术的理念融入家具，于有限的空间营造无限想像，体会天地之间的自然之妙、艺术之美。简约，舒适，时尚 ，是我们的一贯作风，凝结，专注，工匠精神，是我们永远的追求。', 3.00, 9, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592469065, 1604044773);
