INSERT INTO `p_brand` VALUES (105, 60, 'MATTEODSDZ', 1, 'MATTEO灯饰订制', 'https://oss.yiwofa.com/brand/20200619/5fc86237cdd99d188737ce7ba0134885.png', 'https://oss.yiwofa.com/brand_banner/20200827/57f138b9f4d6450780a5227e6e3131bc.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/6bbc7a66b3128f5c281cb13c4a08c953.jpg,https://oss.yiwofa.com/brand_banner/20201105/6d2e7c3f3dec42a44b1593fbeb57c0c1.jpg,https://oss.yiwofa.com/brand_banner/20201105/27c2f4abca5dac150898c7154f59e48b.jpg', '馨诺是以灯饰艺术、装置艺术、雕塑、绘画为一体的创意性企业，公司有自己的研发、生产、安装和售后一体化的团队，并定期赴国内外学习，积极参与各种艺术展览沟通与交流。MATTEO是馨诺旗下的品牌之一；注重形、色、光、影和动力的交融结合，从而艺术化、市场化。', 3.00, 2, 105, 114, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592536721, 1604548110);
