INSERT INTO `p_brand` VALUES (107, 62, 'WQ-NKMJ', 1, '无器-尼可美家', 'https://oss.yiwofa.com/brand/20200619/50fd181c7f679075ed43f1ed673b7282.png', 'https://oss.yiwofa.com/brand_banner/20200930/8fc4f401cf9076eb39f56e590ac41958.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/c4179a2f736960593d282c4e72d206c6.jpg,https://oss.yiwofa.com/brand_banner/20201031/8ec74d85d627ae7db7b8d145e045102c.jpg,https://oss.yiwofa.com/brand_banner/20201031/46a1d64c2c126772bacc598b3c80ccb8.jpg', '我们品牌是专业做艺术陶瓷和东方花艺造景，为美学空间提供素材，所有产品的设计都将艺术和生活相结合，让艺术生活化，增添我们的生活色彩，提高审美品位。 我们是集生产开发销售服务为一体的工艺饰品品牌，由专业的四川美院老师带团队创作，产品特色鲜明，将传统陶瓷与现代时尚元素相结合，让陶瓷不再沉闷。同时我们的东方花艺造景，打破传统的花艺技巧，用少即是多的理念打造出最具东方审美的禅意插花。让花艺不再重于形式而是自我内心意境的表达。', 3.00, 3, 133, 150, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592556872, 1604109234);
INSERT INTO `p_brand` VALUES (108, 63, 'YLJJ', 1, '雅琅家居', 'https://oss.yiwofa.com/brand/20200620/fced81e1e6354a64f195789a552f03a2.png', 'https://oss.yiwofa.com/brand_banner/20200827/1fbbb5e540b99801b5659c7319393af8.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/2239dc702f877409edc81c8ab48a1a6b.jpg,https://oss.yiwofa.com/brand_banner/20201105/4245150c35d249183e30e16bfe4a53b8.jpg,https://oss.yiwofa.com/brand_banner/20201105/38b08272b146fce7a6331031f3b7d65c.jpg', '深圳市雅琅家居饰品有限公司，成立于2014年，工厂位于中国著名侨乡广东省潮州市枫溪区。是集研发、生产、营销、服务为一体的综合性家居陶瓷饰品公司。雅琅家居主要销售工艺品陶瓷，商品种类多样，包括有壁挂工艺品、摆件工艺品、吊饰工艺品等等。工艺创新，时尚潮流，让每件产品在市场上都具备强大的魅力和吸引力，深受消费者的喜爱。', 3.00, 3, 141, 181, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592635118, 1604549165);
INSERT INTO `p_brand` VALUES (109, 64, 'BT（BT）TY', 5, 'BT（博太）陶艺', 'https://oss.yiwofa.com/brand/20200620/cac54a95ebc9fc6baa47fd4445987293.png', 'https://oss.yiwofa.com/brand_banner/20200930/d1f677501cbe993cb4c34dee4480d37f.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/7e9fdf8d82af8733430b638d84eeb384.jpg,https://oss.yiwofa.com/brand_banner/20201031/330f28e67aea8c239bca95a190afd892.jpg,https://oss.yiwofa.com/brand_banner/20201031/5b7b3a14cda21460fd057abb750d2f3e.jpg', '本工厂专业设计生产陶瓷花瓶，摆件，30年历史了\n经营范围： 家具\n旗下品牌： BT（博太）陶艺', 3.00, 3, 141, 181, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592637553, 1606288979);
INSERT INTO `p_brand` VALUES (110, 65, 'ZCDS', 2, '致诚灯饰', 'https://oss.yiwofa.com/brand/20200622/59daa0b436bc13ffb1740ba1048678ba.png', 'https://oss.yiwofa.com/brand_banner/20200827/021385863aaa2d942da9ca9e148bb6f9.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/2131597a132d3e81af6ecd674e8519ba.jpg,https://oss.yiwofa.com/brand_banner/20201105/5fc50ad7df47b0d6dbb83ed0c32348ec.jpg,https://oss.yiwofa.com/brand_banner/20201105/94eb4767d3ab77396435baec1850e4b0.jpg', '公司以铁艺/铜灯（北欧、轻奢水晶灯风格为主）', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592791336, 1604561028);
INSERT INTO `p_brand` VALUES (112, 67, 'HTDT', 7, '宏泰地毯', 'https://oss.yiwofa.com/brand/20200622/631f5419bc93cb62a8e169322fd9ee6b.png', 'https://oss.yiwofa.com/brand_banner/20200930/88b751c9238726ba036fbb41e2d2ed4b.jpg', 'https://oss.yiwofa.com/brand_banner/20201203/f074da0c927a3f9c96fd9c40bc37284a.jpg,https://oss.yiwofa.com/goods/20200622/dc11a9187c2bf98a961c0d2782d8d78b.jpg,https://oss.yiwofa.com/goods/20200622/17a59899d73b8b009b1497005aff5435.jpg', '\"2005年广州宏芝泰贸易有限公司由专业技术团队组建,并创立了旗下《宏泰》《方圆》 《波斯王国》《荷赛》等品牌。传神创新的设计广受国内外著名室内设计师建筑师赞誉。 我们为全球各地客户提供全套专业服务:从概念到实际方案、样板制作、造价预算、效 果预览、生产图纸至铺装之全过程。我们的产品多样:晴纶、国毛、新毛、尼龙、真丝等 胶背手工满铺及工艺地毯,并超5万平方实物库存国内外精品配饰地毯、挂毯,图案 丰富，古典风格、欧美风格、波斯情调风格、抽象现代风格、高贵皇族风格，实用与专 业的完美结合。 高品质生活是我们对每一位尊贵客户的承诺，所有的产品都经过严格的质量控制以 满足客户的要求。本公司拥有完整科学的质量管理体系，以诚信、实力、品质赢得广 大客户的认同及肯定。 欢迎各界朋友莅临参观指导及业务治谈\"', 3.00, 4, 215, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592810256, 1606979438);
INSERT INTO `p_brand` VALUES (114, 68, 'BT', 1, '本土', 'https://oss.yiwofa.com/brand/20200623/860c7786fd94ed54f8d4699499708eaa.png', 'https://oss.yiwofa.com/brand_banner/20200827/517857c2e0c9584a86805a66d8b92533.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/5a77cce9764496b50eb206ba004770c7.jpg,https://oss.yiwofa.com/brand_banner/20201105/32cdc5371fe8537bec260446af4900b4.jpg,https://oss.yiwofa.com/brand_banner/20201105/d6e25e800cfb119755b4330683b78e1e.jpg', '聚名家居开创于1998年,是一家集设计研发、生产制造、销售服务于一体的原创家居饰用品公司，主营陶瓷类的家居日用品、装饰品、布艺类的生活用品等。20年来一直专注于家居用品行业，致力为消费者提供优质、时尚、独特的家饰品和服务。公司旗下已拥有三大独立品牌和丰富的产品延伸线，满足了不同顾客和经营的需求，实现了居家生活、功能装饰与商业销售多重功能性的完美统一。', 3.00, 3, 141, 181, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592877079, 1604561721);
INSERT INTO `p_brand` VALUES (115, 69, 'KL', 1, '卡罗', 'https://oss.yiwofa.com/brand/20200623/b99c6a9cd958e12d78959ae49e989e61.png', 'https://oss.yiwofa.com/brand_banner/20200930/a384bf197ffd5b1a21add9fc34a0dbe9.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/89bd8e3a34e9e103ab2b913a4c11cc56.jpg,https://oss.yiwofa.com/brand_banner/20201031/813e2b4d9d4e34673f9c2242722accd8.jpg,https://oss.yiwofa.com/brand_banner/20201031/6d11347ccd008f0cd8dbac39e7233bfd.jpg', '\"深圳市梵可迪家居制品有限公司。使创于2009年，旗下员工120余人，占地面积5000平方，是集研发、生产、营销、服务为一体的大型综合性家居饰品企业，通过精益求精的经营理念与“全心全意为消费者服务”的服务宗旨。 　梵可迪家居商品种类多样，主要以小美家居饰品、时尚简欧家居饰品、轻奢饰品、中式/新中式饰品、现代、北欧饰品产品为主。 　 梵可迪家居开创未来，以“物美、价优、以人为本”的服务宗旨，发展家居产品直销事业，不断剔除中间环节成本，并提供丰富的产品选择，承诺为客户提供高品质的商品、高水准的服务、最实惠的价格。 　　企业理念 　　专业：以专业的技术、专业的品质，不断自我完善和挑战。 　　创新：持续改进产品和服务，以最适合最新颖的方式诠释产品; 　企业文化 执行-敢于担当，按规定时间，高质量地完成预定结果 学习-始终保持学习心态，不断完善提升自我 管理-增强大局观，双赢思维，注重沟通调研，形成方法论计划-合理规划，严谨有序，要事第一，黄金时间办要事 　　 品质-精心设计，注重细节，一次性把事做对 　　 道德-正直诚信，恪守、监督并打击损害公司利益的行为 梦想-持之以恒、真正为实现梦想而奋斗', 3.00, 3, 133, 151, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592882258, 1604110677);
INSERT INTO `p_brand` VALUES (116, 70, 'NBDSKJJYPYXGS', 1, '宁波迪斯凯家居用品有限公司', 'https://oss.yiwofa.com/brand/20200623/e6ab9e046bff3212fe3e808566f7cb29.png', 'https://oss.yiwofa.com/brand_banner/20201230/8ede2d01bed4c931c6078544ffabf4cc.png', 'https://oss.yiwofa.com/brand_banner/20201230/d950ac90c7f98eb09e8ce26828e7c711.png,https://oss.yiwofa.com/brand_banner/20201230/8b1524797b0767af876f5d85ba7cefc9.png,https://oss.yiwofa.com/brand_banner/20201230/0e2d54da2c2d5e1c427917db1a741ba7.png', '宁波迪斯凯家居用品有限公司 经销批发的装饰、家具、家居用品、摆件、工艺品、礼品、装饰、家具、家居用品、摆件、工艺品、礼品畅销消费者市场，在消费者当中享有较高的地位，公司与多家零售商和代理商建立了长期稳定的合作关系。宁波迪斯凯家居用品有限公司经销的装饰、家具、家居用品、摆件、工艺品、礼品、装饰、家具、家居用品、摆件、工艺品、礼品品种齐全、价格合理。宁波迪斯凯家居用品有限公司实力雄厚，重信用、守合同、保证产品质量，以多品种经营特色和薄利多销的原则，赢得了广大客户的信任。', 3.00, 3, 141, 183, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592897733, 1609339696);
INSERT INTO `p_brand` VALUES (117, 71, 'BJJJ', 3, '北境家具', 'https://oss.yiwofa.com/brand/20200624/fac7296c7c5782ece83aa6469d2e282d.jpg', 'https://oss.yiwofa.com/brand_banner/20200930/cee45ca8d94f31fe5275ab713846ad85.jpg', 'https://oss.yiwofa.com/brand_banner/20201105/1db65bef08a7ab0f14e235c2d6e0eedd.JPG,https://oss.yiwofa.com/brand_banner/20201105/523924eb5a1d9f19ccb7f7817f79d2fe.JPG,https://oss.yiwofa.com/brand_banner/20201105/3186c8669c0d8c954858e1dc33ac73c8.JPG', '苏州北境家具股份有限公司成立于2017年，是欧宝家居集团旗下子公司，北境家具系列融合了北欧简约与中式内敛的风格，主打实木家具。北境的设计师追求质朴的生活美学，将现代生活讲究舒适、摩登与古典、优雅的生活情怀融入其中，用各种元素来勾勒构造更具审美品味的现代生活空间。无论是从理念、设计、材料选择、制作工艺，北境都追求极致的完美。北境考虑符合各种人体工学的功能和细节，为喜欢自然、简约生活的家庭提供家居产品与服务。', 3.00, 1, 13, 38, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1592979617, 1604562910);
