INSERT INTO `p_brand` VALUES (119, 73, 'CJLY', 3, '成家立业', 'https://oss.yiwofa.com/brand/20200627/2991e23b2a2cfaa8f8398ee60f215e33.png', 'https://oss.yiwofa.com/brand_banner/20200930/8c8868ab69112de74af99dffdbc9896c.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/fdfe4356f63841487484d4b3fd2149db.jpg,https://oss.yiwofa.com/brand_banner/20201031/64d83fc5f84cfa2a5c92171a2e1f6c20.jpg,https://oss.yiwofa.com/brand_banner/20201031/f9d6a291b1459d63342c4ce7f244c75a.jpg', '专做马来西亚进口橡胶木简约北欧风格全屋家具\n经营范围： 家具\n旗下品牌： 成家立业', 3.00, 1, 14, 47, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593223453, 1604115088);
