INSERT INTO `p_brand` VALUES (122, 75, 'SLMW', 7, '森林木屋', 'https://oss.yiwofa.com/brand/20200627/2d74d5425175017a4855291028589f43.png', 'https://oss.yiwofa.com/brand_banner/20200930/7ddc793a387d7c51cdae906e45f3ba21.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/7208b3c53a080200ef6bf0d3b7df6fb6.jpg,https://oss.yiwofa.com/brand_banner/20201031/0932aa95fab36f62c8ad33dcb80e84ed.jpg,https://oss.yiwofa.com/brand_banner/20201031/181b30e3b7d926f71fbdc0efced8f925.jpg', '隆腾美居家具总部位于佛山市禅城区南庄镇，是一家集家具研发设计、生产、制造、全球销售与售后服务于一体的中国最具规模的家具生产和出口企业。旗下有“森林木屋”全实木青少年家具品牌，全国现有专卖店100多家！', 3.00, 1, 16, 64, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593247022, 1604116361);
INSERT INTO `p_brand` VALUES (123, 76, 'WABOWB', 1, 'WABO瓦博', 'https://oss.yiwofa.com/brand/20200628/937d7b44102a5201ffc1dbe9e126f671.png', 'https://oss.yiwofa.com/brand_banner/20200930/8a8e98dbf4b2b6d1991367535fd153c5.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/499e2e8a0842c600d15c70b7837c6ee6.jpg,https://oss.yiwofa.com/brand_banner/20201031/9193a64521af75b998565ad8cfcce4d4.jpg,https://oss.yiwofa.com/brand_banner/20201031/34da6daa19c994ea27bf41274a0b3dd1.jpg', '佛山市幻向家具有限公司 公司成立2012年，旗下品牌WABO瓦博；幻向空间。 瓦博家居创立主要对外出口家具。2015年转向国内市场，打造高端客餐厅配套家居（茶几、电视柜、餐台、餐椅、沙发等）。 产品风格：现代休闲系列；时尚极简系列；实用意大利风格系列。 瓦博家具产品主要材料：出色的天然木皮工艺（烟熏色、非洲胡桃木皮色、胡桃色、黑色等），天然水性油漆，国际标准E1级环保板材，结合天然大理石以及最新的工艺玻璃。生产出时尚环保的实用家具。 瓦博家具致力于为大众创作更美好的日常生活，提供优质的家居用品。 主要经营瓦博家具 专业生产高端客餐厅配套家居（茶几、电视柜、餐台、餐椅、沙发等） 坚持自主设计研发,为大众创造更美好的日常生活,提供优质的家居用品。。 单位注册资金单位注册资金人民币 100 万元以下。 我司是一家集产品研发，生产，销售和服务于一体的专业家具企业，是经相关部门批准注册的企业。同时，公司还汇集了一支优秀的专业营销、管理、技术人才队伍，在现代化的企业运作模式下，公司规模不断发展壮大，产品遍布国内市场并远销欧洲、澳洲等多个。我们始终坚持服务贡献为发展理念，以双赢互惠为开创精神，科学管', 3.00, 1, 12, 34, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593310755, 1604116770);
