INSERT INTO `p_brand` VALUES (125, 78, '\"SSBM-XS  WJ\"', 5, '\"时尚北美-乡墅  唯见\"', 'https://oss.yiwofa.com/brand/20200628/26ff6c44363bf5550d3c53afb747ccec.png', 'https://oss.yiwofa.com/brand_banner/20200930/279ea2870d783ff139cb06209091dd3f.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/380802fb6afdb38f579f1852ad07be86.jpg,https://oss.yiwofa.com/brand_banner/20201031/e7d344c7e5fa0e5229f4abd6150dac79.jpg,https://oss.yiwofa.com/brand_banner/20201031/d1739b77250becbc2b239ad87538f1b1.jpg', '佛山福德（伟盛嘉）家具实业有限公司，是一家集研发、生产和销售为一体的大型现代化家具企业，先后通过了ISO9001:2000质量管理体系、ISO14001:2004环境管理体系认证及ISO14024中国质量环保认证、OHSAS18001职业健康安全管理体系认证。2009年创立于广东省佛山市高明区，成立之初主营客厅家具的研发、制造及销售，凭借良好的信誉及质量，成立当年就受到国内及国外市场热烈欢迎。2013年公司决定在广东省佛山市南海区成立佛山福德（伟盛嘉）家具实业有限公司第二分厂，当年推出法式浪漫系列“法艺公馆”风靡一时、2015年公司推出经典现代简美板木结合系列“时尚北美”，2016年公司正式更名为“福德家具有限公司”并推出全实木珍珠亮光白法式系列“艾菲庄园”。2017年2月公司应市场潮流和公司营销发展需要，投入巨资通过专业设计、研发、产样、评审、筛选，年底正式将成系列“时尚北美.乡墅”胡桃色全实木美式套房投入生产、销售，2019年6月设计研发“唯见”系列 现代实木极简轻奢-乌金木，2020年3月正式推出市场。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593331648, 1604904972);
