INSERT INTO `p_brand` VALUES (127, 80, 'AS', 2, '艾缇莎', 'https://oss.yiwofa.com/brand/20200629/e75d6f4d1c2b1da1e625f4bd3ef45f0b.png', 'https://oss.yiwofa.com/brand_banner/20200902/b627b5c6b11c1c860ea951f749a755c6.jpg', 'https://oss.yiwofa.com/brand_banner/20201028/7090f46338ea4b3f4ed9afe10cab0c58.jpg,https://oss.yiwofa.com/brand_banner/20201028/9ae8d4efbf3a1c72ad5a7d1f91668b59.jpg,https://oss.yiwofa.com/brand_banner/20201028/207b9a1138d15b515076419a4eb75d06.jpg', '玉环君源家具厂是一家研发及生产销售为一体的家具公司，产品有轻奢系列家具，新古典系列家具，法式系列家具和欧式系列家具等产品，产品种类很多，每个系列都包含了卧室、客厅、餐厅等一系列完整的家用家具。我们从白坯打样到成品有专业的研发人员和技术师傅，拥有完整、科学的质量管理体系。我们的客户都是全国各地的经销商，我们的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593398093, 1603874264);
