INSERT INTO `p_brand` VALUES (129, 83, 'JZJJ', 3, '集质家居', 'https://oss.yiwofa.com/brand/20200831/8feb266621a05eeda89d4d5dc6a966a9.png', 'https://oss.yiwofa.com/brand_banner/20200930/ca71d13d4207b103c4f24ee315f5ea42.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/b0255bed710498d8b715562c21a334c4.jpg,https://oss.yiwofa.com/brand_banner/20201103/bb53a386c3d3a03f0877453102aaa542.jpg,https://oss.yiwofa.com/brand_banner/20201103/3f993150800f06f1df95e8c8fdd3d3d9.jpg', 'J&amp;amp;amp;amp;amp;amp;amp;ZZ HOME 集质家居是一个富有故事性的文化创意家居品牌，通过发现寻常生活之美，以简而含趣的沟通语言，让家具能够由心思考，并带来会心一笑的共鸣。集质相信，即使再小的空间，也值得被善待。', 2.00, 3, 144, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, '', 1593585494, 1604390022);
INSERT INTO `p_brand` VALUES (130, 84, 'MHX/XM', 8, '木槿花香/羡木', 'https://oss.yiwofa.com/brand/20200701/a92a97b28ae782560be574821f8f25b9.png', 'https://oss.yiwofa.com/brand_banner/20200826/d81d87ba4c7879dbc2f665f62589c15a.jpg', 'https://oss.yiwofa.com/brand_banner/20201022/07c2669860f65b5142a62dcc9230fa45.jpg,https://oss.yiwofa.com/brand_banner/20201022/7a7fe694d12ad45c48ec1336084fc479.jpg,https://oss.yiwofa.com/brand_banner/20201022/034d9f1fc8f636f5f69189b6c07d0388.jpg', '专业生产销售：浪漫婚恋家具（欧式、韩式）卧室套房，客厅套、餐厅套、书房套...应有尽有。高品质的家具，浪漫、闲舒的田园生活。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593588155, 1606270402);
INSERT INTO `p_brand` VALUES (131, 28, 'YGYS', 5, '易观云上', 'https://oss.yiwofa.com/brand/20200702/48e6959bc82af71a5887ef6ed0b4801a.png', 'https://oss.yiwofa.com/brand_banner/20200827/97076692cb6e32ef23c35a90cc69fb22.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/44e145e8c90193961b64f1b607727070.jpg,https://oss.yiwofa.com/brand_banner/20201104/0b6ac397dfbec7b0e429ff695b1b7bf4.jpg,https://oss.yiwofa.com/brand_banner/20201104/f8523ddec0e7667c9d21cf4a7e05f23e.jpg', '观云上创立于2008年，是一家集设计、研发、生产、销售为一体的禅意中式空间品牌，产品涵盖：灯饰、家具、茶器、香器、空间陈设艺术品，以“空即是有，少即是多”禅思的设计理念，来表达当代语境下对东方美学的理解。\n\n易观云上通过意境的营造，\n把禅宗的仪式感，内外兼修的生活态度，\n融入到来去匆匆的当下，\n让人们的生活脚步慢下来，带出轻、静、柔的品质。\n\n以当今社会领英阶层的视角，演绎古典风骨与禅意。，\n以对中式文化独到的见解，推出了一系列兼具传统精神与现代风范的作品，每一个产品都象征着\n一种质朴、本真、纯粹的意境。\"', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593653620, 1604474206);
INSERT INTO `p_brand` VALUES (132, 85, 'MKL', 1, '米卡洛', 'https://oss.yiwofa.com/brand/20200702/17cc76520e035e49d74addeae26d706e.png', 'https://oss.yiwofa.com/brand_banner/20200826/86cef585c466888f2effe9c1e0b431d1.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/0ef993367029de250e0f82dbb9cb6032.jpg,https://oss.yiwofa.com/brand_banner/20201103/1c7ef96bdf53126059a1a13afe5703ca.jpg,https://oss.yiwofa.com/brand_banner/20201103/49ef6abb78d2f3c37754ce7320e6d8a6.jpg', '深圳市尊达家具有限公司坐落于中国家具设计之都--深圳，是一家集家具设计研发、生产、 销售及售后服务为一体的现代化家具民营企业。\n公司现有10000平米的高科技生产基地和现代化的办公场所及配套的产品展示区。 完善的设备、卓越的团队，完善的管理体系等，是创造高标准的产品和服务品质的基石。\n公司自创建至今，一直秉承为消费者打造轻松愉悦的家居生活理念，创造国内客厅文化的新高度。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593672910, 1604390191);
INSERT INTO `p_brand` VALUES (133, 86, 'KSWW', 1, '卡莎维维', 'https://oss.yiwofa.com/brand/20200702/8ff2522ed0d6d10f9f09bf3101ae293c.png', 'https://oss.yiwofa.com/brand_banner/20200930/60fc7d95be04f9dc16ed89a495a2c4a1.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/e53be1f9a420edf18e7560fa0c06f923.jpg,https://oss.yiwofa.com/brand_banner/20201103/588bde7467ac86a27732f1afbff273bc.jpg,https://oss.yiwofa.com/brand_banner/20201103/cd7a42877542898039dd311381517657.jpg', '\"辉扬陶艺制作有限公司是一家以手工陶艺制作为主的生产厂家，本公司自2003年注册至今已有13年的时间，厂房面积约3.2万平方，员工150人左右，年产量数量在80万只以上，产品风格独特，以复古做旧，私人高端定制为主，受到国外各知名品牌的青睐，一直以来长期合作的有美国的Potterybarn，西班牙Zara，法国Masion，澳洲Freedom 等。 本着田园家居陶器艺术创作的理念，公司于2014年创立了旗下新品牌——卡莎维维，有着服务多家国家知名品牌的合作经验，凭借国际化视野，整合全球资源，努力打造一个新的产品设计平台。\"', 3.00, 3, 141, 181, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593677120, 1604390603);
INSERT INTO `p_brand` VALUES (134, 87, 'YMYJ', 5, '依曼艺家', 'https://oss.yiwofa.com/brand/20200703/e85b6d13d739949b797437b5732c187e.png', 'https://oss.yiwofa.com/brand_banner/20200930/13eef1b7539db5ca36aa8a022bd1e6b9.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/087c85de8b8949180e3569cf102ba08b.png,https://oss.yiwofa.com/brand_banner/20201103/cefc5a0e556c16713382ba1e41a87f3b.png,https://oss.yiwofa.com/brand_banner/20201103/e6705d195e5b2d3181e06cdf0fd40c28.png', '佛山市铭庐锋有限公司——依曼艺家        佛山市铭庐锋有限公司成立于2008年，专注实木家具，坐落于中国家具重镇、物流发达的佛山市顺德区乐从镇，铭庐锋家具是一家集研发、生产、销售、服务于一体的现代企业。拥有现代化车间，引进国内外最为先进的机械设备，拥有一批专业的高素质管理团队及技术人员。铭庐锋家具总占地面积约2.5万平米、一线员工160余人，最低产能保证达600万/月，全国加盟商有100余家。', 3.00, 1, 14, 47, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593746999, 1604391447);
INSERT INTO `p_brand` VALUES (135, 88, 'WMJJ', 1, '沃玛家具', 'https://oss.yiwofa.com/brand/20200703/f57af1f01df231345ad86a26fa36c50b.png', 'https://oss.yiwofa.com/brand_banner/20200930/afb5788d0010f8eccde98acbca37085c.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/82504e43584ed2a2440278833ff0553f.jpg,https://oss.yiwofa.com/brand_banner/20201103/520a7bb332a684e33d5506edee359c56.jpg,https://oss.yiwofa.com/brand_banner/20201103/237628a7bef1d5ed73590a8516d19475.jpg', '江苏沃玛家具有限公司，创建于2008年。是一家具有十多年 家具设计、开发、生产、销售和售后服务为一体的家具大型企业 ，是目前国内销售网络广泛、市场占有率大、产品色系多、工艺 稳定、产品系列化组合最优、售后服务体系完善的板式实木家具 生产厂家之一。公司总部坐落于环境优美、交通便利的幸福之城 ——无锡市江阴工业区。 江江苏苏沃沃玛玛家家具具有有限限公公司司是是一一家家大大型型专专业业生生产产家家具具企企业业，，成成立立 以来，拥有国内外先进的生产机器设备，成为集家具设计、开发 、生产、销售和售后服务为一体的大型生产企业，公司产品出口 美国、日本、新加坡、德国等。国内专卖店主要分部在红星美凯 龙、居然之家、第六空间等大型家具卖场。产品销往国内外市场 ，取得各界人士好评。 江江苏苏沃沃玛玛家家具具管管理理模模式式与与时时俱俱进进，，积积极极导导入入IISSOO99000011——22001155 质量管理体系，实行科学化、规范化管理，并于2004年获 ISO9000国际质量体系认证。我们崇尚的设计理念：“以家具设 计为支撑”的创新思维模式，并从意大利、德国等欧洲国家引进 先进的自动化生产设备建', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1593766167, 1604391686);
