INSERT INTO `p_brand` VALUES (142, 95, 'YC', 1, '漾驰', 'https://oss.yiwofa.com/brand/20200708/8d8be06b878069865f999c3fd08a8d31.png', 'https://oss.yiwofa.com/brand_banner/20200826/3a72da4a7754b453993af9bb9643ddf0.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/68c97e0d100ae0de9673207738487d81.jpg,https://oss.yiwofa.com/brand_banner/20201103/4cdfb4d12c6ec6663a3cb531b15bc44b.jpg,https://oss.yiwofa.com/brand_banner/20201103/2b107db91d7be449bba398cd029ace09.png', '\"公司简介：东莞市漾驰家居有限公司成立\n于2017年，企业前身是一是一家专注于家\n具设计、研发、生产与销售的专业性企业\n,2008年东莞沙田新生产基地投入运行，\n公司已成为国内颇具规模及影响力的家具\n企业。公司拥有5万多平米现代化生产车\n间和园景式办公环境，员工多达千余人，\n管理团队多达百余人，设计、营销团队\n多达50余人，凭借多年扎根家具行业的\n经验和对市场了解的基础，顺应当下市\n场需求和居家环境趋势，公司2017年推\n出“YOUNZ漾驰”品牌，以当代设计美\n学概念为基础，倡导轻松、舒适、时尚\n的生活方式，秉承人体工学和空间环境\n美学相结合的设计理念，注重家居与空\n间的整体表现，为新生代80、90后年轻\n、时尚群体提供一个更佳舒适的现代居\n住空间。\"', 3.00, 1, 14, 51, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594173316, 1604393604);
