INSERT INTO `p_brand` VALUES (145, 98, 'SSSDJJYSYXGS', 2, '深圳市索顿家居艺术有限公司', 'https://oss.yiwofa.com/brand/20200709/89a4d6b48873af8fab1941276f17160a.png', 'https://oss.yiwofa.com/brand_banner/20200930/22936a270aa35586e4bb2bb3d3967fe2.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/094637e10d373259440f9a0dd947f08a.jpg,https://oss.yiwofa.com/brand_banner/20201103/62d6790d25f2672daccbf3298a32aa91.jpg,https://oss.yiwofa.com/brand_banner/20201103/0e29009bda4762d1512f3ca12a29c48d.png', '\"深圳市索顿家居艺术有限公司 是一家专业家居饰品研发，设计，生产，销售为一体的销售设计公司，致力于原创工艺品设计和开发， 成立于2011年，拥有自己的生产工厂，资深产品设计师团队和专业的营销团队。 公司展厅设在全中国最专业的软装产品市场——深圳市罗湖区艺展中心. 公司主营业务 1.产品范围 陶瓷类饰品摆件，陶瓷花器，装饰挂镜,木质漆器。多材质结合饰品摆件，挂件。（贝壳，铜饰，水晶，石 材） 2.软装工程 承接高端酒店，会所，样板房，售楼处，展厅设计等整体软装工程项目服务。\"', 3.00, 2, 105, 113, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594262434, 1604395990);
