INSERT INTO `p_brand` VALUES (155, 101, 'YMYP', 2, '优美优品', 'https://oss.yiwofa.com/brand/20200713/e9f49b690f7bb32a926039ebdff78d38.png', 'https://oss.yiwofa.com/brand_banner/20200930/9ae846577795fce433ffc615e2321fd0.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/ed881ed92671e9262c539c32bfcf39bb.jpg,https://oss.yiwofa.com/brand_banner/20201103/288c617392575f2021c9b2f176a5efe2.jpg,https://oss.yiwofa.com/brand_banner/20201103/2ff60940c1a8b0f17f1ffe3fde9b42e8.jpg', '1998年开始从事家具生产制作，至今超过有20年。之前我们一直是做出口和品牌代工。2017年创立自己的品牌—优美优品家居，根据市场的需求，我们陆续推出了轻奢意式、意式轻奢和意式简奢的常规产品。我们的工厂是在家具重镇板芙，有标准化的厂房和仓库18000平米，生产团队大约有120人左右，我们工厂有国家环保局认证颁发的国家油性排污许可证、大型设备，消防喷淋等安全生产设施，保证我们在任何情况下正常生产运营。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594606923, 1604396189);
