INSERT INTO `p_brand` VALUES (157, 104, 'TT.casa/HJKXG', 14, 'TT.casa/皇家凯旋宫', 'https://oss.yiwofa.com/brand/20200714/382e7d03c0b86f9141c5581d96c95cc9.png', 'https://oss.yiwofa.com/brand_banner/20200930/ab5d6ca0ef64ddb0d455c65d598e495f.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/ca32625743553ced08afc8aab1cc5134.jpg,https://oss.yiwofa.com/brand_banner/20201103/2ea67e75b93b8e00970d4e521a4486d8.jpg,https://oss.yiwofa.com/brand_banner/20201103/a96bc7a68f455c9a5b3944b7ddf7389f.jpg', '玉环县美林格家具有限公司创建于 2004 年，座落于“海上花园”之称的海滨城市-浙江玉环，毗邻宁波、温州两大港口城市，地理位置优越、交通便利、美林格家具是一家集“调研、创新、生产、销售、服务”为一体的专家型家，具企业，主要生产各种中、高档沙发、套房、餐厅、书房等配套的实木家具，产品远销国内外 30 多个国家和地区。公司目前拥有职工 500 多人，管理人员 80 多人，研发型技术人员 100 多人，厂房面积 30000 多平方米。公司目前拥有两大品牌：“皇家凯旋宫”与“T T·casa”', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594708248, 1604396703);
INSERT INTO `p_brand` VALUES (158, 105, 'MK', 2, '慕壳', 'https://oss.yiwofa.com/brand/20200714/284247867430616e120931cce98c0acd.png', 'https://oss.yiwofa.com/brand_banner/20200826/2f8533051bb044d9c1301b8e15c4e9e0.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/1b1df7bb25d1140d1152f3b7e1c19169.jpg,https://oss.yiwofa.com/brand_banner/20201103/c8533b27daae6e49e58113b173fed80c.png,https://oss.yiwofa.com/brand_banner/20201103/f4ed517eb5b863b8133f43ce6de28e41.png', '慕壳家具是一家集设计、生产营销为一体的综合性家具制造企业，专注于现代轻奢、现代极简等风格，旗下拥有三大系列产品。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594716169, 1604401273);
INSERT INTO `p_brand` VALUES (159, 106, 'TTYJJ', 3, '团团圆家具', 'https://oss.yiwofa.com/brand/20200715/d231577ee8e491967415dcf3197febb3.png', 'https://oss.yiwofa.com/brand_banner/20200902/9d2c1bf53b076073cad9ce265b3fff8c.jpg', 'https://oss.yiwofa.com/brand_banner/20201028/511272b430803b074352c9c1f7e84399.jpg,https://oss.yiwofa.com/brand_banner/20201028/c974b1bf680a1021c17cf78f6c063d25.jpg,https://oss.yiwofa.com/brand_banner/20201028/d97efb84fc5cf0a31afdaff3d54f41ab.jpg', '江西团团圆家具有限公司创建于2014年，是一家位于中国中部家具产业基地——南康的知名家具企业。公司致力于实木家具产品的设计、研发、生产与销售，目前主要生产不同风格的实木家具，为全球超过20万家庭提供健康、舒适、环保的家居产品。 公司目前拥有三大生产基地，占地200亩，厂房面积14万平方米，员工数1000多人，其中管理团队有150余人。 2017年公司投资5000万在南康家具产业园新增70000多平米标准厂房，采购国内最先进的生产设备和环保设备，生产环境得到显著改善，生产效率得到大幅提高。 在公司成立短短五年的时间里，获得国家级高新企业、江西省名牌产品、江西省五一劳动奖状、安全生产标准化三级企业、赣州市知名商标等荣誉称号。公司在中国实木家具之都——南康担任南康家具协会常务理事，并且参与订制了南康实木床和实木餐桌椅生产制作标准。 2019年，公司将不断丰富产品矩阵，新增德式、新中式、美式、地中海等系列产品，同时进军外贸、定制化家具和智能家居领域。我们将不断拓展业务范围，提高品牌知名度，给消费者提供环保、高品质、高性价比的家具产品，2019年实现总销售额超过10亿元的目标。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1594775252, 1603873448);
