INSERT INTO `p_brand` VALUES (165, 158, 'LGXHM', 13, '隆古轩红木', 'https://oss.yiwofa.com/brand/20200718/53f6fee64b003624066e2bae6ec1b223.png', 'https://oss.yiwofa.com/brand_banner/20200902/f648a53e813d5d2c4fecd32476747152.jpg', 'https://oss.yiwofa.com/brand_banner/20201028/1d47d402528b6b599b07c76fb18992fa.jpg,https://oss.yiwofa.com/brand_banner/20201028/dd14b303831c72b202bedb3d2f24a602.jpg,https://oss.yiwofa.com/brand_banner/20201028/562cfdbeb32982f34f35206796378cab.jpg', '\"松麟家具集团公司成立于2010年5月，是一家研发、设计、生产、销售、服务于一体，专业生产明清古典红木家具的优质企业。隆古轩是松麟家具集团公司旗下的红木家具品牌之一，专注红木家具设计制作工艺精湛，服务一流，值得依赖。本企业不但选取高档名贵的木材，而且经过科学烘干处理，再加上严谨的制作工艺，然后根据巧妙多变的榫卯结构，优美合理的精美雕饰如巧夺天工，每一件产品都集艺术性、装饰性、使用性和收藏性于一体。首创尊贵专属定制，有客厅系列、餐台系列、茶台系列、书房系列、卧室系列等，倾力打造新一代红木家具品牌，创新理念，挖掘更深的文化底蕴。 隆古轩红木工厂厂房面积占地：10000方；生产工人：200余人；营销总部面积：5000方；营销人员有80名；目前已合作经销商有3000多名，品牌加盟专卖店有108家；所有产品工艺都采用古代传统的榫卯结构技术，由从业三十年以上的知名工匠率亲传弟子打造，四道检测，保证每件器物耐用不变形。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595039467, 1614752216);
