INSERT INTO `p_brand` VALUES (173, 166, 'TSBK/KS', 7, '托斯贝卡/梵克斯', 'https://oss.yiwofa.com/brand/20200721/e547df3305edaa440bb6c19b987d9e55.png', 'https://oss.yiwofa.com/brand_banner/20200930/acd4ace90b457298bde7e2dfa3778d3c.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/5d6f957338cecffd60621982f106f687.png,https://oss.yiwofa.com/brand_banner/20201104/fd358e7e303b72c4572c174e2ee60d6b.png,https://oss.yiwofa.com/brand_banner/20201104/304c9fa491cd9f713c72811ce006df56.JPG', '深圳市永麒家具有限公司，始建于1995年，是一家集产品研发、设计、制造、营销以及家居文化研究为一体的知名企业。公司总部位于中国香港，营销总部位于深圳市中心。企业拥有占地40多亩的生产制造基地。其产品行销欧美10多年，包括美国、加拿大、欧洲、中东等国家和地区。公司的产品严格遵守欧美市场所要求的质量标准，并通过了ISO9001：2000质量体系管理认证。赢得了各国客人的广泛好评和信赖。\n\n       根据公司新的发展战略，2008年全面启动国内市场，推出“卡芭尼”美式风格系列产品，把美式风格的家居生活方式，带给国内的广大顾客。在全国建立多家“卡芭尼”系列产品专卖店。全面引进国外的先进管理模式，带给每个消费者原汁原味的美式家居生活文化体验。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595303471, 1604452556);
