INSERT INTO `p_brand` VALUES (177, 168, 'MS', 5, '铭世', 'https://oss.yiwofa.com/brand/20200722/3cb27e5bca27d9a2d391bdb85ecdc10f.png', 'https://oss.yiwofa.com/brand_banner/20200930/20167e692fa8682e1e3082b130014712.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/f7d17201cb3a1eea98b59b3fbbcdaceb.JPG,https://oss.yiwofa.com/brand_banner/20201104/f4ea6a4d477724fba416a1e03f5ba495.png,https://oss.yiwofa.com/brand_banner/20201104/65a8a742e9010cb676e4a3597b3b4fb2.png', '铭世家具成立于2019年，公司前期主要以生产研发实木套房及五金产品家具，并主要做出口业务。于2018年转型以内销为主，开发新中式系列产品和意式极简五金配套及复古定制类产品', 3.00, 1, 14, 54, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595388526, 1604453016);
INSERT INTO `p_brand` VALUES (178, 170, 'LF', 3, '理风琥珀', 'https://oss.yiwofa.com/brand/20200723/dc6e25d1984e304a62bcb82047a98e2e.png', 'https://oss.yiwofa.com/brand_banner/20200902/2294e4428891240108f8ffc757b7a3b8.jpg', 'https://oss.yiwofa.com/brand_banner/20201029/88369c32fde8b442c7ee4d8b0bbe8cb8.jpg,https://oss.yiwofa.com/brand_banner/20201029/f800807c51ec877d321c8ed1b25ed14c.jpg,https://oss.yiwofa.com/brand_banner/20201029/aefd7fea30045249ff27e150f35324d1.jpg', '2015年，理风家具创立于广东省江门市，始终坚持原创高品质的原木家居，理风家具始终坚持“不随大流，只创经典，原木本心，恒久自然”的品牌理念。“忠于原创”作为企业发展的指导方针。作为原木自然家居文化的领导者，为消费者创造前所未有的自然闲适家居风格，实现人类家居生活的至美享受！ 理风家具联合知名设计师推出两大实木品牌：《琥珀》《半调》 原木自然风格《琥珀》，以艺术手法，将结疤、裂痕运用于家具设计中，巧妙的以自然还原自然，让每一块木的价值得到大化发挥，是对大自然好的尊重。我们懂得每一块木的美，选择适合的地方，将它们浑然天成又独一无二的形色之美发挥到极致，给家居环境呈现不一样的自然气息', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595475987, 1605943238);
INSERT INTO `p_brand` VALUES (179, 171, 'HLDS', 2, '鸿立灯饰', 'https://oss.yiwofa.com/brand/20200723/df6cc9d4d1e05bc34512903dc82e9586.png', 'https://oss.yiwofa.com/brand_banner/20200930/a02e17adf6b054dc6c917dfed503c58e.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/6ef65aa0348fea8370f1625e1e2693bc.png,https://oss.yiwofa.com/brand_banner/20201104/27859a34604c55d2578e881f21aa40a5.jpg,https://oss.yiwofa.com/brand_banner/20201104/3b9f617f3d1aa3e092b48c3cd26644b1.jpg', '鸿立灯饰是一家专业生产全铜灯具的工厂', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595492828, 1604453717);
