INSERT INTO `p_brand` VALUES (181, 157, 'JK', 1, '捷卡', 'https://oss.yiwofa.com/brand/20200725/b77750cf257fe0ef36cd5f89e8a0b17e.png', 'https://oss.yiwofa.com/brand_banner/20200826/7d3d205f6639be6cba9f0f01eb18279f.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/d4db7b55f89a40b8de5dffba58eb786d.jpg,https://oss.yiwofa.com/brand_banner/20201103/c0d9a0c499a069874f90c085cde05b96.jpg,https://oss.yiwofa.com/brand_banner/20201103/4ab55f709bdb0914bdd30d80ba4b8402.jpg', '捷卡家具是一家专业致力于人类深度睡眠研究的企业，集设计，研发，生产，销售，服务及新型管理方式一体化大型公司。公司引进了国际一流设备，先进的生产技术和管理方式使企业处以家具生产行业领先地位，运用科学的人才培养和激励机制，聚集了一批高水平的专业技术人才和高素质管理人才，严格按照质量管理体系生产保证产品的优良品质，每一款产品的材质均通过严格的筛选，首款产品工艺经过反复的修改，由业务团队一致评审通过才量产，每一款产品必须试装安装，经由检验部检验合格才会打包入库。\n人文篇\n捷卡家具始终秉承以人为本，持续创新，质量第一，服务至上，共赢的发展理念。以做精品家具，创百年捷卡为企业使命！在用人方面采用品德优先，能力适度的用人策略。\n设计篇\n优秀的设计必定来源于对生活的感悟，对文化的理解，对人性的研究，只有不断去研究消费者的生活方式，行为方式，居家环境，文化思想和消费诉求，才能设计出被市场认可和喜爱的家居品牌。捷卡家具创立之初就与Bouroullec兄弟设计师达成了战略合作伙伴关系，捷卡家具团队由一群年轻的80/90家具人创立，思想活跃，嗅觉灵敏，去伪存真，浪漫而不失稳重', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595642029, 1604388609);
INSERT INTO `p_brand` VALUES (182, 173, 'ODLDS', 12, '欧蒂利灯饰', 'https://oss.yiwofa.com/brand/20200725/4c73350a9d073b04cf5645720af88be2.png', 'https://oss.yiwofa.com/brand_banner/20200902/a0386a51e3d240949c1dae540a258d18.png', 'https://oss.yiwofa.com/brand_banner/20201029/abcb5a457ffe332b8e3c33497cefa667.jpg,https://oss.yiwofa.com/brand_banner/20201029/5a637a9dd6634c0b56ddd56acc75b1d0.jpg,https://oss.yiwofa.com/brand_banner/20201029/ed9c211e57f328718cb81a396038c86b.jpg', '欧帝利灯饰实业有限公司座落于中国灯都中山古镇曹三创业园华盛东路8号，是一家专业生产高中档豪华欧式玉石蜡烛水晶灯、全铜灯的大型现代化企业，自公司成立以来，坚持“以质量求生存，服务求发展”的经营理念，赢得广大新老客户的一致好评与依赖！ 欧帝利企业注重诚信经营、双赢互利，顾客至上； 欧帝利人还在不断的努力、不断地创新；公司事业蒸蒸日上， 发展迅猛，力争将欧帝利灯饰打造成中国知名灯饰品牌企业， 十年内成为国际知名灯饰企业。让欧帝利人以人为本的服务精神， 感动于每一位新老顾客。也希望各位新朋老友一如既往地支持欧帝利、 互惠互利，携手合作，共创您我辉煌明天！', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595662497, 1606123025);
INSERT INTO `p_brand` VALUES (183, 174, 'SHLZ', 7, '生活例子', 'https://oss.yiwofa.com/brand/20200727/3a025390a7c9f1eee180f7eafaf9679f.png', 'https://oss.yiwofa.com/brand_banner/20201022/005332ee7e555c3b5798e2ae1b41edd0.jpg', 'https://oss.yiwofa.com/brand_banner/20201022/547bfb723d556c2d13933dc333f50888.png,https://oss.yiwofa.com/brand_banner/20201022/24b02ef6f3c5dd9d9895630decb8fa6d.png,https://oss.yiwofa.com/brand_banner/20201022/6875d7653f3a3193fe7a2f25ba6a3ab7.png', '生活例子工厂位于四川省成都市沙渠工业园占地面积约5万㎡，生活例子是集研发，制造为一体以活动家具为主， 逐步导入餐具、床品等日常生活用品。打造一系列简约、温馨而实用的产品， 满足休闲、娱乐、社交、运动、工作、学习等需求；为生活提供各种各样的参考、 示范、灵感与可能性 从而成就每个人心中理想生活方式', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595812330, 1603350320);
