INSERT INTO `p_brand` VALUES (188, 175, 'LBLJJ', 12, '伦勃朗家居', 'https://oss.yiwofa.com/brand/20200729/f4f4f2806d112d1259592421d525cdb1.png', 'https://oss.yiwofa.com/brand_banner/20200902/ddaff3e63ac28fd60b4e1db19bbabc1b.jpg', 'https://oss.yiwofa.com/brand_banner/20201029/7a60a068ff5fadac7c1dbd53c43bf4ab.jpg,https://oss.yiwofa.com/brand_banner/20201029/d52046d4918fd8211d3b2ac2cab48e18.jpg,https://oss.yiwofa.com/brand_banner/20201029/8751b5d46c73f7084ec7ebe376a2bd08.jpg', '早在17世纪，欧洲天才画家、世界级艺术大师伦勃朗以登峰造极的艺术才华给人类留下了600多幅油画、1500多幅素描等一批价值连城的宝贵文化遗产。21世纪的今天，以专业制造24K镀金家居系列见长的伦勃朗家居传承数百年欧陆家居文化将古典家居艺术极致演绎。以创新的理念与精湛的工艺向世人展示了完美古典欧式家居，沿袭皇家风范，彰显高贵品质！ 成立于1994年的佛山市顺德区伦勃朗家居有限公司，是一家专业生产电镀24K金金属家具、装饰品的家具制造企业，产品以意大利、西班牙等欧式设计风格为主，拥有家具系列、钟表系列、灯具系列、饰品系列等四大系列16大类产品，配套能力强，构成欧式整体家居概念。产品选材精良，镀金件及镀银件主要采用优质铜材，小量不锈钢，经久耐用，色泽亮丽，永不生锈，辅助材料如布料、石材等主要采用进口材料。 领跑者，领先。伦勃朗家居不仅是电镀24K金金属家具的先行者，通过数百年欧陆家居文化精髓与十多年家具制造经验的积淀，造就了一支专业出色的制造团队， 成为伦勃朗领跑金属家具领域并持续壮大的生命力。同时，公司将“诚信求发展，品质树品牌”作为企业核心理念，重视工艺流程及质量监控，坚持工艺流程严格按', 3.00, 1, 14, 51, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595988372, 1606102584);
INSERT INTO `p_brand` VALUES (189, 176, 'Z  YPYJ', 12, '俪作  壹品艺家', 'https://oss.yiwofa.com/brand/20200729/c38ef8e0c8aece4a999ee48e9e71a38e.png', 'https://oss.yiwofa.com/brand_banner/20200930/a1dbb1972973083fa47a37ca723f7e5d.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/11f1856bd796d8eb184a5d1d3fc49088.jpg,https://oss.yiwofa.com/brand_banner/20201030/ac28164cf47d2977ae632af2deaae185.jpg,https://oss.yiwofa.com/brand_banner/20201030/a00b456d61622331a83f470ce3053882.jpg', '\"俪作家居创立于1988年，专业致力于为客户创造有艺术气质的家，从事中高端整体家居的研发、生产和销售。 俪作家居以“成为受人尊重的百年企业”为愿景，在践行“创造价值、厚德感恩、互信共赢”核心价值观的过程中，由中国迅速扩张至全球，旗舰店遍布北京、上海、广州、深圳等国内一二三线城市，以及加拿大、澳大利亚、俄罗斯、迪拜、阿联酋、沙特等国家和地区。 作为当代美学家居运营商，俪作有着精耕中高端家居市场的品牌战略规划，旗下拥有“壹品艺家”、“俪作”、等多个品牌，构成覆盖家居品类全风格的品牌矩阵。 俪作贝家居自成立三十年来忠于初心，始终专注于中高端家居的研发与制造，致力于为追求高品质生活的人们提供优质的产品与服务，打造健康环保，富有艺术气质的生活方式，让全球更多的家庭享受有爱、有品质的生活。 \"', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1595988448, 1606011982);
INSERT INTO `p_brand` VALUES (190, 1, 'PE', 4, '品二', 'https://oss.yiwofa.com/brand/20200729/cc7bc860bbaf5f5081bab0f914cd6d46.jpg', 'https://oss.yiwofa.com/brand_banner/20200821/cad6ab1f55d9e55981de437ccd3e8f42.jpg', '', '这是品牌的介绍', 2.00, 1, 13, 39, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 0, '', 1596022632, 1602311359);
INSERT INTO `p_brand` VALUES (191, 178, 'YHX', 2, '永豪轩', 'https://oss.yiwofa.com/brand/20200731/4917153a9a24ca9bc7d30c2f780eae76.jpg', 'https://oss.yiwofa.com/brand_banner/20200902/de205cff5ab348ecb631ec80bf9e90e5.jpg', 'https://oss.yiwofa.com/brand_banner/20201029/fef2006db9030dd8fb298acd03c27d19.jpg,https://oss.yiwofa.com/brand_banner/20201029/16db4968eb4a3677bce50e74f3217799.jpg,https://oss.yiwofa.com/brand_banner/20201029/9862f87fec07dac09e2994dd9cac820a.jpg', '佛山永豪轩家具有限公司于1985年建厂，至今已有20多年的发展历程，是中国家具协会理事单位、广东省家具协会副会长单位、乐从家具协会副会长单位、顺德职业技术学院“家具制造与设计”专业委员会委员单位、顺德工商联合会执委委员。 永豪轩家具有限公司是一家集产品研发、生产、销售于一体的板式、实木大型家具企业。公司通过ISO 9001质量体系认证，坚持：“质量为先 ，信誉为重；管理为本，服务为诚”的原则。公司拥有高标准的厂房，成功引进国际顶尖生产设备及国际工业制造技术，并拥有一套完整的手工工艺标准，集中了一大批手工精湛的技师。运用的材料均达到国际环保标准，部分采用进口原材料，并顺利通过国家技监所《绿色环保甲醛释放量达标合格》的检验；公司高度重视产品开发，大部分产品已申请国家外观设计专利，连续多年，在大型家具交易会上获得产品外观设计大奖。产品远销欧美、中东、东南亚等国家，在国内的北京、上海、天津、西安、沈阳、广州等大中城市均有加盟商，是广东家具界知名企业之一。 文化 --经过20多年的发展历程，是中国家具协会会员单位、广东省家具协会副会长单位、乐从家具协会副会长单位、市职业学院“家具制造与设计”专业', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596182787, 1603960747);
INSERT INTO `p_brand` VALUES (192, 179, 'DW', 14, '戴维', 'https://oss.yiwofa.com/brand/20200801/7ce71f2e19912fe5f84cf66746835224.png', 'https://oss.yiwofa.com/brand_banner/20200826/93b6ddf81c5169ab2f509f25e232705b.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/797434d6b421cdaa711d5f90fc45e7cd.jpg,https://oss.yiwofa.com/brand_banner/20201030/44ee1b11581576441319e26cde67da82.jpg,https://oss.yiwofa.com/brand_banner/20201030/ccd19d6e671fdc04c88e843c71872784.jpg', '专注古典和现代欧美全实木', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596249327, 1604050189);
INSERT INTO `p_brand` VALUES (193, 180, 'YZAZERA', 2, '雅尊AZERA', 'https://oss.yiwofa.com/brand/20200803/59890eaea663cac5c5a2696651dfc4c3.png', 'https://oss.yiwofa.com/brand_banner/20200902/0803e0833238e4a846b9838d181d4bd9.jpg', 'https://oss.yiwofa.com/brand_banner/20201114/1a47b3e383641a225f6427954b17fd9a.jpg,https://oss.yiwofa.com/brand_banner/20201114/2b1d84edc24d88ef120ac3d5285d662c.jpg,https://oss.yiwofa.com/brand_banner/20201114/8ad92ca11aa8242d9b28c51715330247.jpg', '东莞市钜元家居有限公司成立于2002年，属(广东尚美智能家居有限公司)旗下子公司。 是一家专业家居软装饰品研发、设计、生产、销售于一体的实业公司。 产品风格北欧、新中式、轻奢现代、卡通、欧式五大系列软体装饰品。 钜元旗下品牌《AZERA雅尊》与《艺心艺意》 属国内家居饰品知名品牌企业，在京东、唯品会、天猫等平台销售，在业界享有极高的盛誉和影响力 2013年正式入驻天猫商城，我们有能力将最好家居软装，最大化满足国内消费者的需求。 公司创始人万涛先生，深耕家居工艺装饰领域二十年，对材质、设计、工艺等都有其独到的见解与品味。 公司将忆独特的中国家居风尚点缀出绚丽多资、质感强烈、表现细腻佳品，为您装点艺术空间，共享品质生活。 我们致力于“美化生活空间, 传承艺术典范”的品牌理念，秉承“创新品质生活，成就客户价值”的经营理念，践行科技、环保、时尚的现代家居理念，打造“中国软装行业小而美的知名企业品牌”', 3.00, 3, 133, 150, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596418822, 1605327020);
INSERT INTO `p_brand` VALUES (194, 182, 'JYMT', 5, '静悦明檀', 'https://oss.yiwofa.com/brand/20200803/6bcf87c3eed0528ed41aa55ccf87acc9.png', 'https://oss.yiwofa.com/brand_banner/20200826/8ea04d2c3f3d1f6318ee8c7d11e36544.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/9b18b2ad8f5ba03c4ebaf269bffbe81e.png,https://oss.yiwofa.com/brand_banner/20201030/f506011dbf013d04990992aebf96bf91.png,https://oss.yiwofa.com/brand_banner/20201030/99cf9943c744e50b51a03d374933dceb.png', '\"佛山市明瑞家具有限公司创建于2003年，员工现有近两百人，年产量达五千万以上，是一家集研发、生产、销售于一体的大型家具企业。公司专注现代中式实木家具，并一直保持着“用良材、造精品、创国际家具领航品牌”的企业经营理念，坚持以市场为先导、以品质求生存、以创新求发展、以管理求效益、以诚实求信赖、以满足客户需求为已任。明瑞“森濠轩”家具品牌现共有三大系列产品：斯柏瑞板木系列、北欧臻品全实木系列、静悦明檀全实木系列，专卖店80多家。经过多年发展，公司先后获得“设计创新标杆企业”、“广东省十大实木家具品牌”、“消费者信得过产品”、“中国优秀绿色环保产品”、“中国名优产品”等荣誉称号，得到了行业及广大消费者的认可。\n\"', 3.00, 1, 12, 36, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596436292, 1604050404);
INSERT INTO `p_brand` VALUES (195, 183, 'ADK', 8, '爱多酷', 'https://oss.yiwofa.com/brand/20200804/258c4ca770d08d00f4a365db50a03719.png', 'https://oss.yiwofa.com/brand_banner/20200902/ad7282ff2b0223c3040ecd78aec5b627.png', 'https://oss.yiwofa.com/brand_banner/20201114/6046da38bad5455d1c23c313a77f02e8.jpg,https://oss.yiwofa.com/brand_banner/20201114/68ef92a62e579433bb45d5904a806724.jpg,https://oss.yiwofa.com/brand_banner/20201114/8c10d26348798c771135c51904b663fd.jpg', '盛皇家具有限公司是一家集研发、生产、销售与服务于一体的大型民用家具现代化生产企业。公司拥有行业一流的专业设计人员，技术精湛的技术人员及先进的管理团队，以服务社会，发展自我为宗旨，推进中国家具的发展和创建世界家具品牌为使命。', 3.00, 1, 16, 64, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596505888, 1605325302);
INSERT INTO `p_brand` VALUES (196, 184, 'QJ', 2, '巧匠', 'https://oss.yiwofa.com/brand/20200804/23699f180e3bf30b976bcf03b65b4013.png', 'https://oss.yiwofa.com/brand_banner/20200930/ce5e0be5191a831a7d5b6be35a455688.jpg', 'https://oss.yiwofa.com/brand_banner/20201126/405b04e4e40c7320562e66d9ee68c0e1.jpg,https://oss.yiwofa.com/brand_banner/20201126/5020229b2043186b387ebd586e61b3e7.jpg,https://oss.yiwofa.com/brand_banner/20201126/a4d8a2fccd223fbf426c2ea2132edda4.jpg', '设计开发及生产新中、轻奢风格的摆件、花器、托盘等产品的一家工厂', 3.00, 3, 135, 158, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596506462, 1606386561);
INSERT INTO `p_brand` VALUES (197, 185, 'DSL', 1, '帝思利', 'https://oss.yiwofa.com/brand/20200805/b1206015779a2ccaa4d571f1e1a19b1b.png', 'https://oss.yiwofa.com/brand_banner/20200930/e4e30881d2a3e2518a627d0c28fa0bf6.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/c9e670b265a9bcf042cee22134db4611.jpg,https://oss.yiwofa.com/brand_banner/20201030/65a36a40de5c6cf351a6513df33b3080.jpg,https://oss.yiwofa.com/brand_banner/20201030/a2148a1b08c4328f8622356785aefdcd.jpg', '\"佛山市顺德区睿辰家具坐落于世界家具制造重镇——佛山市龙江镇，经过高速稳步的发展，公司经营规模年年壮大，现有厂房占地面积到8000平方米，有独立办公大楼占地面积2000平方米。在顺德国际会展中心馆旁边设有展厅1000平方米。集设计、研发、生产、销售服务于一体的大型综合企业，产品以温馨时尚的绿色环保健康的床垫、软体床、沙发为主。公司执行ISO9001管理体系标准，获得由国内国际10多项行业荣誉证书，现在员工100多人， 经过科学的管理方法，高素质的设计队伍，完善的售后服务，不断的发展壮大，在现代日益激烈的家具市场，我们不断革新严格把好质量关，从选材到生产环节，时刻都做到精益求精，我们还掌握家具款式变化的动向，对产品的设计款式不断革新，充分杨显现代精神意念，超前时尚，我司的产品受到广大客户的认可和信赖，在国内已拥有50多家专卖店及酒店床垫工程，我们凭着坚韧不拔的创新精神，永远以最完美的品质接受您的检阅，我们全体同仁将以公司全员之力为市场创造美好的明天。', 3.00, 10, 239, 250, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596593741, 1604051811);
INSERT INTO `p_brand` VALUES (198, 186, 'PFS', 3, '普菲斯', 'https://oss.yiwofa.com/brand/20200805/b1acaa6d331e10db35adf3230a18699a.png', 'https://oss.yiwofa.com/brand_banner/20200826/57a8d16b786104710ba160fc27d3b4b3.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/65ea3e89eec9c24db7fba0024c77ac34.jpg,https://oss.yiwofa.com/brand_banner/20201030/ab8acf7cf9aee9901588d1f413a0b04c.jpg,https://oss.yiwofa.com/brand_banner/20201030/2f1d814418a8a45463b3d4bc527ac547.jpg', '\"创明公司创建于1997年，起初以经营打款皮加布为主。当时适逢国家经济体制改革，具备经济腾飞的良好土壤，在这样的大好环境中，公司以其团结、务实、创新、发展的企业精神在竞争中逐渐发展壮大，迄今为止，已发展成为拥有一百多名员工，占地面积逾4万平方米的集团式公司。\n创明公司拥有符合国际水准和规模的家具厂，有自己的布艺沙发厂、功能沙发厂，还有配套家具的设计工作室，他们担负创明公司的产品款式、专卖店展场等各个关键领域的设计工作。所以，创明公司能用自己的原创风格来设计、生产我们的产品。\"', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596609673, 1606380884);
INSERT INTO `p_brand` VALUES (199, 188, 'RJO', 3, '瑞吉欧', 'https://oss.yiwofa.com/brand/20200805/5ad09a5c94c1f9a401a7918d5ec0015a.png', 'https://oss.yiwofa.com/brand_banner/20200903/1f672ccfdd5a1977dea8b0855581efa9.jpg', 'https://oss.yiwofa.com/brand_banner/20201113/30d3a702cf1259c9dee9234adde4d2cd.png,https://oss.yiwofa.com/brand_banner/20201113/29080d35e72df1264ce544527d52e1e0.png,https://oss.yiwofa.com/brand_banner/20201113/0f68dbdc2536509fc049875c2c08f3ba.png', '\"1999 年创始于马来西亚首都 – 吉隆坡 2011 年成立佛山市瑞吉欧家具贸易有限公司（开始进口家具至全中国批发销售） 2018 年成立广东瑞吉欧家具有限公司 （马来西亚瑞吉欧中国分公司） 致力于马来西亚橡胶木家具的研发、设计、生产及销售。 每年坚持研发 100 件以上的新产品，坚持品牌责任与态度。 卧室、客厅、餐厅、书房及酒吧等空间，目前共累计单品 616 件，33 个完整套系产品。 专注于空间设计，实体店、酒店民宿、工程配置等方案，满足不同层次、不同家装风格的需求 80、90 后主流消费群体，60-80m2 中小户型。 马来西亚生产基地占地面积约三万平方米，配备点对点钻孔机、自动化快速切割机、电脑数值控制工具机及无尘喷漆等大型设备。 拥有两万平方米的完整流水线作业，专业喷涂厂房及三家白胚加工厂。 中国、欧洲、日本、东南亚等多个国家及地区。 马来西亚工厂：生产人员达 450 人，专业设计团队 35 人 / 中国分公司：办公室、仓库合计 70 人。 1. 大仓储现货销售，仓库总面积达 12,000 m2 ，可同时收纳 210 个集装箱。 2. 马来西亚生产工艺，产品方便拆卸、组装，', 2.00, 1, 14, 47, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, '', 1596620121, 1626501718);
INSERT INTO `p_brand` VALUES (200, 189, 'YT', 5, '云檀', 'https://oss.yiwofa.com/brand/20200806/e62042b6b67c63c3349d88e5fbeea75b.png', 'https://oss.yiwofa.com/brand_banner/20200903/78d1bafbec1417782ec1b23d8ed12351.jpg', 'https://oss.yiwofa.com/brand_banner/20201022/0a71440d202a53c4345a1497d122c674.jpg,https://oss.yiwofa.com/brand_banner/20201022/f5c7f1a2fd82d27f010a25eacbf64b73.jpg,https://oss.yiwofa.com/brand_banner/20201022/e5c9b208e1d740d0f74c1ffb5ec32d35.jpg', '现代轻奢新中式\n经营范围：家具\n旗下品牌：云檀', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596679026, 1603358023);
INSERT INTO `p_brand` VALUES (201, 190, 'JD', 1, '匠度', 'https://oss.yiwofa.com/brand/20200806/8e0f5014972658bd0c344d1a1d7c11cc.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/8ad7d3038cdc3e903619902eb3991202.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/ff8e049587ebd89ef87634b720c677fc.jpg,https://oss.yiwofa.com/brand_banner/20201030/bdb302215f929fa0b535493dee033d51.jpg,https://oss.yiwofa.com/brand_banner/20201030/5ddf6ee1cf8b40958f355ca03886c7c6.jpg', '佛山市万匠家具有限公司于2000年5月成立，位于珠江三角洲，中国最大的家具生产基地---顺德龙江，是一家集设计、开发、生产、销售为一体的主打意式现代风家具生产企业，公司拥有雄厚的资金、现代化标准厂房、先进的设备、优秀的人才、科学的管理。', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596681987, 1604052494);
