INSERT INTO `p_brand` VALUES (204, 194, 'ZYZH', 2, '知遇知赫', 'https://oss.yiwofa.com/brand/20200807/53c6001c5aeb068bdfdf59b46c3a80ed.png', 'https://oss.yiwofa.com/brand_banner/20200903/ddc9cca1725fbfe8fc0a9cf693075b62.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/f80a59846d380cdbcbd014165addea0a.png,https://oss.yiwofa.com/brand_banner/20201027/684121cb908efa9d0fb90427bb0201ce.jpg,https://oss.yiwofa.com/brand_banner/20201027/6035a1e92354ed6daa59c22ecf945e3b.jpg', '深圳市域知赫贸易有限公司集研发，设计，生产，销售，服务为一体的原创家居家纺公司，正式成立于2010年，其经营品牌有“布莉丝”“知遇.知赫”，十年来主要从事酒店，会所，样板房，家具展示厅等的软装配套设计及服务', 3.00, 7, 232, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596782480, 1603765414);
INSERT INTO `p_brand` VALUES (205, 198, 'HMJ', 3, '鑫豪美居', 'https://oss.yiwofa.com/brand/20200807/2daa3f9ca702bed3d88cb50ef6fc495c.png', 'https://oss.yiwofa.com/brand_banner/20200826/5e6f0f02bdd7601728ae46404667853a.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/b29672186c6ab049feed81db7b84de19.jpg,https://oss.yiwofa.com/brand_banner/20201031/1030df87237d36bbf2b591ae2e1a1816.jpg,https://oss.yiwofa.com/brand_banner/20201031/620798d378d362f5b031e4bc1e8412ac.jpg', '公司主要是自产自销北欧实木套房家具，旗下有3个系列：北依美舍、北欧林森、品韵轻奢', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596792383, 1604141316);
INSERT INTO `p_brand` VALUES (206, 197, 'BXJJ', 3, '不下家居', 'https://oss.yiwofa.com/brand/20200807/a5069bb9f788b688a46ab8391b93fb04.png', 'https://oss.yiwofa.com/brand_banner/20200903/29f0baec4f26a0d3267e7f99540ca50f.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/61423109f70c62c3be61fac7841c624d.jpg,https://oss.yiwofa.com/brand_banner/20201027/c019b97d8206244d9b3df4a3de28eb06.jpg,https://oss.yiwofa.com/brand_banner/20201027/b1420227cee9f73552b5af52ab74d22e.jpg', '赣州尚好居家具有限公司成立于2017年，是集现在代丹麦北欧风格家具设计，制造，销售，安装，售后服务为一体的股份制企业。主营当前北欧流行的现在纯实木家具。随着我国经济水平的不断向前发展，人们对家居居住环境越来越高。传统家具在款式和环何性能上越来越不适应现代人的居住要求。我们反对落后家具理念而倡导现代健康环保，时尚的家具消费理念。 公司的北欧家具在地区流行多年，基于健康环保及科学人性化设计师当前家具用品的设计主流。本企业拥有世界先进的数控生产设备。专业的80.90年轻设计团队。大批经验丰富，技术精湛的管理骨干和技术人员，以给孩子一个健康环保，舒适安全，温馨时尚的家园为企业的服务理念。我们的产品没有过多元素的装饰，致力于为您营造现代简约、充满温情、完全放松的生活方式。 材料采用天然生长北美白蜡木，使用榫卯结构，经绿色环保型木蜡油作表面处理，实木纹理完美呈现，是您高品位的最好体现我们提供的产品在外观设计，使用寿命，环保指标等全部按照国际标准进行打造', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596792538, 1605254597);
INSERT INTO `p_brand` VALUES (207, 199, 'CDF', 5, '茶道夫', 'https://oss.yiwofa.com/brand/20200808/f7dd5ee8d2cddcdde556d95beb05b337.png', 'https://oss.yiwofa.com/brand_banner/20200826/6b84ab50e679c7a8d0546a2c8c6f88d5.jpg', 'https://oss.yiwofa.com/brand_banner/20201031/9ef45b995a5f8628b7a304c051dd68e8.jpg,https://oss.yiwofa.com/brand_banner/20201031/372770df576e1ee62aef69ca71062084.jpg,https://oss.yiwofa.com/brand_banner/20201031/cf730148f41d5d011deff484b7e4fc95.jpg', '棹美轩家具有限公司创立于2008年，位于广东省佛山市家具重镇乐从，拥有近4万平米的生产基地，公司集设计、开发、生产和销售于一体的多元化家具企业。主要经营实木家具民用系列产品。\n\n棹美轩家具利用现代技术之精华，采用先进、专业的实木创作工艺，选用实木环保材料。同时凭借多年雄厚的家具技术力量，专业的开发技术人才和先进的生产设备，在不断运用高新科技提升产品质量、功能的同时，更注重产品的设计风格、款式及品牌的有个性。\n旗下“卓木韵”(檀舍)新中式系列非洲进口黄檀木，木中\"\"贵族\"\"是难能宝贵的珍惜木材之一，质地致密，木质坚硬，文理优美。100年的成材期，承重性好，抗压性强，经久耐用。\n\n旗下\"\"荷塘木语\"\"品牌目前两大系列\"\"荷塘木语1代\"\"纯实木和\"\"荷塘木语2代\"\"北欧现代时尚纯实木家具，产品涵盖卧房、书房、客厅、餐厅等。具有良好的市场销售发展前景；同时远销中东、澳洲、日本、欧美等多个国家和地区。\n\n旗下茶文化家具品牌\"\"茶道夫\"\"乌金系列和\"\"茶为媒\"\"江湖系列是茶文化家具中的品牌。\"', 3.00, 1, 17, 75, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596871995, 1604141623);
INSERT INTO `p_brand` VALUES (208, 200, 'WDBO', 3, '唯的北欧', 'https://oss.yiwofa.com/brand/20200808/31038899ddb6f31e023ee89e6da0b962.png', 'https://oss.yiwofa.com/brand_banner/20200903/f67b03bde2856ed25ab043a095504908.jpg', 'https://oss.yiwofa.com/brand_banner/20201113/d29176de9fdd1a9dd9af8e9d17393200.png,https://oss.yiwofa.com/brand_banner/20201113/75c8bf6cd5e0b9f7c59147593f2ac820.png,https://oss.yiwofa.com/brand_banner/20201113/e7ff8f066b5f1eb79ed3bc02116b11e5.png', '公司是一家集研发，生产，销售和服务为一体的中型家具企业', 3.00, 1, 14, 54, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1596872732, 1605252818);
INSERT INTO `p_brand` VALUES (209, 201, 'AB HOME', 12, 'AB HOME', 'https://oss.yiwofa.com/brand/20200810/6d47622eba63cf3210b162860c9ef36a.png', 'https://oss.yiwofa.com/brand_banner/20200930/19ca444f22c608558ca612a39d99ea49.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/da6ae1266b88ec38dd2c5d05979b8686.jpg,https://oss.yiwofa.com/brand_banner/20201102/04203ecb969d41d59f9e49e15bea7392.jpg,https://oss.yiwofa.com/brand_banner/20201102/e1cb8cf8aa403eecdade25269eee7472.jpg', '\"多元化家居品牌，家居饰品上游供应商。1993年创立于美国，总部设 在洛杉矶。在亚特兰大、达拉斯、拉斯维加斯、高点、广州、深圳等地设有展厅。产 品设计团队成员主要来自欧美国家，每年推出近1500款新品，二十多年以来深 A&amp;amp;amp;B Home受世界各地的设计师、大连锁超市及高端家居买手喜爱。 2002年A&amp;amp;amp;B Home携手中国Evergreen Decor在上海、厦门、广州共同开发 中国市场，其中位于广州的中国旗舰展厅，拥有1000平方米的场地，距离琶 洲展馆仅一步之遥。在厦门，本公司为服务中国以及全球的客户，设有20000 平方米的中国区仓库。仓库内存有价值八千万以上的货物，这些货物经过多道 检验，合格后整装待发。 独特的设计是本公司产品的亮点。公司的产品研发部门与国际知名设计师合 作，每半年推出1000+潮流且经典的新品，拥有超过5000个SKU的产品，种 类齐全，风格多样，涉及家具、灯具、墙挂、餐具、软装配饰等。 在未来的道路上，我们希望能遇到更多志同道合之士一起去耕耘家居行业之 田，A&amp;amp;amp;B Home会一往如前的坚守理念，诚心服务我们的客户。我们深知， 您的发展，才是我们的立足之本。\"', 3.00, 3, 136, 161, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597024396, 1606373556);
INSERT INTO `p_brand` VALUES (210, 203, 'YLS', 1, '雅蕾斯', 'https://oss.yiwofa.com/brand/20200812/78a0096e2809415ee81f25da5e17aed3.png', 'https://oss.yiwofa.com/brand_banner/20200826/aa2ba0503ccfc81c4cd28f8f7e2de449.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/f5d2421260b10e0e6aee4d42f1d8f411.jpg,https://oss.yiwofa.com/brand_banner/20201102/a9a1a46b0481306ff92dca114c6f3921.jpg,https://oss.yiwofa.com/brand_banner/20201102/4fc477d46f3d06d615ef98435c5b4d5b.jpg', '佛山市大瀛家具有限公司成立于2008年，经十余年的发展，现今已成为一家集软床、床垫、沙发及其配套产品研发、生产、销售、服务为一体的综合性企业。公司不但拥有美国雅丽斯集团(Albea ir is group)授权的\"雅蕾斯\"(Anise)中国独家代理权,而且现拥有“塞尚・风情”、“大瀛”、“珊瑚岛”自有品牌。主打“Anise”品牌在美国始创于1982年，现已有近四十年的文化历史，凭着文化沉淀和日臻完善，旗下拥有：雅蕾斯•皇后系列，雅蕾斯•皇冠系列，雅蕾斯•皇马系列等。我们秉承“大瀛家具只做良心产品，放心产品”的企业宗旨，坚持“让客户用有品质的家具，过有品位的生活”的服务理念，致力于为中国家庭提供舒适、环保、高性价比的家居一站式解决方案。我们专业开发团队，能根据现代市场需求开发出时尚、温馨、现代、高档次新品，并运用先进的生产管理模式和严格的品质管理体系，整合世界先进科学技术，融中西家居文化精粹于一体，总是以其独特的创意，赋予拥有者出众的享受，备受世界同行赞誉。', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597196683, 1604283366);
INSERT INTO `p_brand` VALUES (211, 204, 'ZHBG', 1, '中浩办公', 'https://oss.yiwofa.com/brand/20200812/452e70ae21010515490e99f029c8c17c.png', 'https://oss.yiwofa.com/brand_banner/20200903/c66b4749b35b9bd21f5b88343e6ad4df.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/3697d5e9b2540156a676372f481327bb.jpg,https://oss.yiwofa.com/brand_banner/20201027/0faad348ae42b1820baf0ee96aa4895e.png,https://oss.yiwofa.com/brand_banner/20201027/d79f60d29375a22f3bffac279b5aacce.png', '中浩传统办公软体系列/仁者居开元实木新中式系列/椅带一路北欧办公系列', 3.00, 430, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597197600, 1603771111);
INSERT INTO `p_brand` VALUES (212, 205, 'MLZM', 2, '迈朗照明', 'https://oss.yiwofa.com/brand/20200812/80f92c18efe368a5612d5828ea48fb6f.png', 'https://oss.yiwofa.com/brand_banner/20200930/ffa5ebfbdf7d83bd3fe6ae79d483ea2e.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/0aaa6df24dd11a72009808cfb51c92c5.jpg,https://oss.yiwofa.com/brand_banner/20201102/59f22667dfb20d542a955b51a88bb1d1.jpg,https://oss.yiwofa.com/brand_banner/20201102/5b5d4b107bcf27db52f876333f6c34e8.jpg', '山市迈朗照明有限公司，位于中国灯都—中山古镇，是集研发、制造与销售于一体的综合性照明企业。中山市迈朗照明有限公司专注全球酒店会所工程装饰灯饰灯具照明方案解决，公司荣获酒店工程灯具优质供应商，地产项目优质合作伙伴（宝能集团、保集集团、通和置业、恒大、中旭置业、绿地长期合作战略伙伴），全国软装饰公司优质合作伙伴（广东星艺、华贝软装、七号公馆、欧申纳斯、黎源建筑软装、星宏建筑装饰长期合作伙伴），欧式水晶灯专业制造商，现代时尚灯具开发商。公司产品涵盖工程照明、家居照明、电工、光源等；专注生产大型水晶灯，欧式全铜云石灯，中式羊皮灯；吊灯，吸顶灯，壁灯，落地灯系列等。企业拥有雄厚的技术力量，强大的研发人员及高素质品质管理队伍；完善的企业 管理体系；先进的检测仪器和生产设备；并已通过：IS09001国际管理体系认证和节能标识，UL，cUL，SAA，CCC，CE等国内外权威产品质量认证。产品畅销国内市场，还远销欧洲、南美洲 、北美洲、澳洲、东南亚及中东等地区。中山市迈朗照明有限公司致力于打造酒店装饰灯具第一品牌，现代家居照明第一品牌，公司秉承时尚照明，绿色照明，低碳生活，节能照明的经营理念，缔造出更自', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597202634, 1604287085);
INSERT INTO `p_brand` VALUES (213, 206, 'DWJ', 8, '榕瀚大玩家', 'https://oss.yiwofa.com/brand/20200812/61a5b4e619d726aa40e5388062c4c88d.png', 'https://oss.yiwofa.com/brand_banner/20200903/855903478bbb1edb60d7a176745d0067.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/8e48ae3ef2d6eab86ad4a2b2e4ba5073.png,https://oss.yiwofa.com/brand_banner/20201027/3054370422919489123d9b6bbb23b738.png,https://oss.yiwofa.com/brand_banner/20201027/85a881008b034def4dad6ec4923f5b98.png', '\"佛山市榕翰家具有限公司是榕大家具公司旗下又一新品牌子公司. 公司现有厂房面积20000平方米，拥有现代化的标准车间。先进的 生产设备以及一批专业技术开发人员，形成了科研、设计、生产、 销售、售后服务一体化的完整体系，是一家具备了相当的生产规模 和较强经济实力的企业。 公司不断扩大生产规模，推进技术创新，积极采用国内外先进技术 装备，生产条件日臻完善。引进了世界一流的数控3D环保吸塑机、 电脑雕刻机、电脑锯、全自动封边机等各种数控加工设备。完善 严格的治理体系和一流的专业团队，成为榕翰家具优异品质和健康 环保的有力保证。 公司将以《大玩家》为主导品牌，服务市场立志于打造国内外知名 品牌。《大玩家》秉承现代青少年是个彰显个性的时代，以玩是一 种坚持，玩是一种极致，是源于对事物本质最真诚的态度，用发烧 级的热爱，追寻现代青少年家居的真谛，玩出健康，玩出情怀，玩 出风格，玩出个性，玩出传奇。 “感恩做人，敬业做事”是公司的唯一宗旨 \"', 3.00, 1, 16, 64, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597203359, 1603768947);
INSERT INTO `p_brand` VALUES (214, 207, 'ZFJJ', 1, '佐菲家具', 'https://oss.yiwofa.com/brand/20200813/1f4f5e5f95b0930dd46591e0e68146f9.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/9001027fa38262aed832a878b7f55268.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/1ac197e2125e3416616ac55d864b70b5.jpg,https://oss.yiwofa.com/brand_banner/20201102/4a6730df0accc643d79e38942b0c9ab1.jpg,https://oss.yiwofa.com/brand_banner/20201102/90c7f328fe9b3673d43ffe8cb465fd98.jpg', '业生产休闲椅及休闲铁艺沙发', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597286935, 1604284890);
INSERT INTO `p_brand` VALUES (215, 208, 'Y', 2, '羽馨', 'https://oss.yiwofa.com/brand/20200814/232fac2f4aec252d473584f3a71199e7.png', 'https://oss.yiwofa.com/brand_banner/20200903/c33af6d559cd64e4b30132e40f7cd904.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/7a9e3fe8d273bfb8492c88ebdc872e73.png,https://oss.yiwofa.com/brand_banner/20201027/caf44f255f5eda55cb7818e48260500f.png,https://oss.yiwofa.com/brand_banner/20201027/3c3be1c35d0aeac792482bf3d91a1140.png', '中山市横栏镇羽馨灯饰厂位于中国广东省中山市古镇，中山市横栏镇羽馨灯饰厂是一家蕾丝布艺台灯、水晶灯、吸顶灯、吊灯、壁灯、落地灯等产品的经销批发的私营独资企业。中山市横栏镇羽馨灯饰厂经营的蕾丝布艺台灯、水晶灯、吸顶灯、吊灯、壁灯、落地灯出售消费者市场。中山市横栏镇羽馨灯饰厂的产品在消费者当中享有较高的地位，公司与多家零售商和代理商建立了长期稳定的合作关系。中山市横栏镇羽馨灯饰厂经销的蕾丝布艺台灯、水晶灯、吸顶灯、吊灯、壁灯、落地灯品种齐全、价格合理。中山市横栏镇羽馨灯饰厂实力雄厚，重信用、守合同、保证产品质量，以多品种经营特色和薄利多销的原则，赢得了广大客户的信任。', 3.00, 2, 105, 110, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597368780, 1603771809);
INSERT INTO `p_brand` VALUES (217, 209, 'ASK', 8, '澳思康', 'https://oss.yiwofa.com/brand/20200814/f9b6240d43f9173fe352c5e4692b108f.png', 'https://oss.yiwofa.com/brand_banner/20200826/b2cbdd33cab7779693add9ea0ebc790c.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/97a97daea51dcd675fcc7f34391fb1d9.jpg,https://oss.yiwofa.com/brand_banner/20201102/ef4077c6b976d037d1a62571e397985b.jpg,https://oss.yiwofa.com/brand_banner/20201102/0bc2f809ffd08016bdfa983a88a56c33.jpg', '澳玛家具有限公司位于中国家具制造重镇——广东省佛山市顺德区龙江镇。公司是一家集设计、研发、生产、销售和服务为一体的现代化家具制造企业。公司旗下品牌有:“鑫林玛”木纹铝金合框架,独一无二新型材料产品,防潮防水防爆裂。独特的乌金木色颜色,彰显产品的高档气质。“澳思康”整体家居,定制风格家具,三种颜色可选(金属拉丝银白色、橄榄色、樱桃色),选择多样化,自由搭配风范,边角柜、加顶柜随意搭配,衣柜门板多种门板,玻璃门板,立体感板材门板,百叶门板,应有尽有。“我的地盘,我做主”,尽显个性家居!公司板材有高密度板、生态板(实木多层板)。质量保证,用心服务是我们的宗旨!公司自创立之初起,一直关注于国内外家具市场发展趋势,在多年与国际家具业接轨及同步发展过程中,积累了丰富的家具研发与制造经验。公司严格执行iso9001-2008国际质量标准运作体系,引进全自动数控设备群和世界上最先进的生产加工工艺,确保及时供货和产品品质,公司极力倡导绿色环保的生活理念,以全力打造高级环保产品为已任,尽力塑造“简约而不简单,厚重而不笨重,时尚而不张扬,高档而不夸张”的家居文化。款式极为丰富、受众面广、性价比高,', 3.00, 1, 14, 58, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597370754, 1604287264);
