INSERT INTO `p_brand` VALUES (220, 211, 'Lazy home', 1, 'Lazy home', 'https://oss.yiwofa.com/brand/20200815/76f284f1b1ab6abe1d71dcbb9eed308f.png', 'https://oss.yiwofa.com/brand_banner/20200826/da3627d81af1331622bef2ddbba9a0ab.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/022bf3c7d45ae5c885335f6f024aba5c.jpg,https://oss.yiwofa.com/brand_banner/20201102/2bd4942bd5e0573820b2c7fc58447e98.jpg,https://oss.yiwofa.com/brand_banner/20201102/b781f7d6ac9c24a6ed3c9bb2fb10f4bc.jpg', '\"LAZY HOME（慵懒家居）是一个倍受 85 后新中产喜爱的家居品牌，专注于产品研发设计与 生产销售，\n产品系列涵盖客厅、卧室、餐厅、书房等 4 大空间，以至简至美的设计风格诠释 现代审美和幸福生活方式，\n倡导以舒适慵懒的家居平衡工作与生活，提升人们的幸福感，并 将这种初心倾注到每一个产品中，\n为消费者全面提供高品质全案软装一体化服务。\"', 3.00, 1, 12, 26, 0, 1, 0, 1, 100, 103, 0, 0.012, 1, 1, 1, '', 1597458156, 1614765215);
INSERT INTO `p_brand` VALUES (221, 212, 'PMXM', 3, '泡沫小敏', 'https://oss.yiwofa.com/brand/20200817/fe19c05d67160ca868569a98926872f0.png', 'https://oss.yiwofa.com/brand_banner/20200903/ac87cfd30b79d9e4c9a4bf2c41162f1d.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/8ad9c50b7c7957832b38fbeeebe7a870.png,https://oss.yiwofa.com/brand_banner/20201027/6bbde5daf27aff2bef93b80501a790d4.png,https://oss.yiwofa.com/brand_banner/20201027/ec31a5f1c5d07813ad11363d9d3bf9e6.png', '\" 台州市泡沫小敏家具有限公司成立于2013年，旗下泡沫小敏定位为现代实木家具品牌。是一家集研发、生产、销售于一体的专业实木企业。凭借独特的设计，过硬的品质，受到国内外客户的广泛赞。 \"', 3.00, 1, 13, 41, 0, 1, 0, 1, 100, 1000, 0, 0.050, 1, 1, 1, '', 1597656038, 1603782996);
INSERT INTO `p_brand` VALUES (222, 214, 'SL', 1, '世霖', 'https://oss.yiwofa.com/brand/20200818/bc23eb5fe2516b066709b3270f7f3b72.png', 'https://oss.yiwofa.com/brand_banner/20200930/242f84f110fd06764da154e32e883495.jpg', 'https://oss.yiwofa.com/brand_banner/20201102/3a542d8cdd1cc3a11b9b6f08f8b509ea.jpg,https://oss.yiwofa.com/brand_banner/20201102/d754d7cd88f46507860b59b5f901bda0.jpg,https://oss.yiwofa.com/brand_banner/20201102/903a2bc6ac104bb31dd88e1172a37127.jpg', '\"公司成立于2007年，于2015年建厂，\n工厂现有员工 30人左右，厂房面积4000平方米\"', 3.00, 430, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597717853, 1604304982);
INSERT INTO `p_brand` VALUES (223, 215, 'camino', 4, 'camino', 'https://oss.yiwofa.com/brand/20200819/f35f175496775d79294acce96931602f.png', 'https://oss.yiwofa.com/brand_banner/20200826/86b2a882ebc77ce26ebc75e04e97fb2e.png', 'https://oss.yiwofa.com/brand_banner/20201103/8a81c4cabd8e789f5644b3812f3e1ff5.jpg,https://oss.yiwofa.com/brand_banner/20201103/ff5bee93e31b15378baf39fbd1357511.png,https://oss.yiwofa.com/brand_banner/20201103/78b5548f724af390aec5893eba8857b4.png', 'camino是西班牙文中“路”的意思。生于这个世代的我们，时常在城市与城市间\n往返，国度与国度间奔波，在实践梦想的路上，时停时走。体验跨国度万种风\n情的同时，难免会思乡念家，路途中仍渴望一丝归属。 \ncamino因此诞生，为了“城市旅居者”而创立的品牌，让我们在持续的迁移中，\n也能享得片刻认同的歇息，支持着我们的心在旅途中依然勇敢前进。\"', 3.00, 3, 138, 169, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597802743, 1604385159);
INSERT INTO `p_brand` VALUES (224, 216, 'LJDT', 1, '丽家地毯', 'https://oss.yiwofa.com/brand/20200820/33c114a55870d74e9a56df55904a843f.png', 'https://oss.yiwofa.com/brand_banner/20200826/559fac0944fd0822e13b7fa05933debd.jpg', '', '宁波丽华家居用品有限公司，创建于1996年，是一家专业从事以家用、商用地毯的研发、设计销售为一体的新型家居用品企业。公司自有集办公、仓储、物流的\n\n综合性办公基地，位于鄞州区茅山工业园区，东傍甬台温高速公路，西依宁波机场，交通便利，风景优美。公司以宁波为中心，下设上海、苏州等分公司。批发\n\n   零售销售网络覆盖整个华东地区，辐射全国，已成为宁波地区乃至整个华东地区地毯行业发展的标杆。    经过20年的高速发展，我们已经发展成为集研发，生产，\n\n国内外贸易，品牌运营，电子商务一体化的专业化、集团化地毯企业。    今天的LYKA加速了国际化融合和互联网融合，我们的设计来自于全球优秀的设计师，我\n\n们的产品出口欧美的同时，也越来越国际化，除了我们自己生产的产品，LYKA的产品也来自于德国、美国、土耳其、伊朗等国家，目前丽家已成为全球家用地毯\n\n 产量最大的土耳其Merinos公司的中国区总代理，丽家将会把更多国际先进的地毯技术和产品带入中国。我们的境外商品将直达零售客户，而同时，我们也将在国\n\n               内实施免费和收费的专业清洗服务。\"', 3.00, 4, 215, 0, 0, 1, 0, 1, 100, 70, 0, 0.012, 1, 1, 1, '', 1597888964, 1614761539);
