INSERT INTO `p_brand` VALUES (226, 218, 'MFD', 7, '美芬达', 'https://oss.yiwofa.com/brand/20200821/018834a853d118488a5bcb138b00da4b.png', 'https://oss.yiwofa.com/brand_banner/20200821/5b82b6428c6972fccbc51c6420fc380b.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/006d412d177af6081f3c16fd0091015d.png,https://oss.yiwofa.com/brand_banner/20201027/c49e3c4593514487743324029aea6db5.png,https://oss.yiwofa.com/brand_banner/20201027/a18bb378f28953ff3d716993f799a092.png', '深圳市富家美佳家具有限公司创立于1999年，现拥有5万多平方米现代化的标准厂房，富家美佳有限公司是深圳家具协会会员企业，率先在国内同行业中通过ISO900国际质量体系认证。旗下的“和美”“美芬达”“新贵时代”三大品牌在家具行业声名显赫，被众多消费者所喜爱和选择，更是得到了行业内的一致好评。产品不仅畅销全国，还大量出口到美、澳及欧洲大陆等世界各地。先进的生产体系、完美的销售网络、超前的营销理念，诚挚的配套服务是富家美佳家具奉献给广大消费者的信心保证。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1597998952, 1603785979);
