INSERT INTO `p_brand` VALUES (228, 219, 'WEISWS', 5, 'WEIS唯诗', 'https://oss.yiwofa.com/brand/20200824/ff08be1399a226c8eb13e86e150fab6e.png', 'https://oss.yiwofa.com/brand_banner/20200826/73868590deff4858084c7dd661fd77bb.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/cc1b45f1884b3ff1a452e77fe8b709b5.png,https://oss.yiwofa.com/brand_banner/20201103/27c2335f001c5a3c37642cd50b86abb2.png,https://oss.yiwofa.com/brand_banner/20201103/d65098a51d64e312853c15edf4ffb5c0.png', '专注文化创意生活用品及礼品的设计和开发，提供从创意概念，成本控制，加工生产到包装成品的全域整合设计服务，对接博物馆，文化机构，地产，保险金融，IT等领域的创意产品和礼品需求，至今获得了德国红点概念奖，IF概念奖，台湾金点奖等多项设计大奖。', 3.00, 3, 133, 152, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598231945, 1604387327);
INSERT INTO `p_brand` VALUES (229, 220, 'MXS', 1, '梦相随', 'https://oss.yiwofa.com/brand/20200824/a04da6a2b7ddec91ee20badf26d05a3c.png', 'https://oss.yiwofa.com/brand_banner/20200826/03616b044eb8cd270efee8c55105abc8.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/b8400ac06cd732af6241e322f62e1817.jpg,https://oss.yiwofa.com/brand_banner/20201103/9ce55f9711eba4cb14211cdf2eb0db40.jpg,https://oss.yiwofa.com/brand_banner/20201103/50a4434b0e123132fdfadb65da33a9b6.png', ' 佛山市度凡家具有限公司是一家具备研发设计、生产制造、营销服务于一体的大型家具公司，生产基地位于佛山市南海区沙龙路工业园区，公司拥有专业的标准厂房，严谨的生产体系。公司定位于：致力于打造功能型睡眠家具。     度凡家具实业有限公司具备的优势：专业的研发人员，高素质的管理团队以及强大的营销队伍。稳定的核心团队，为公司的产品研发、品质管控、供应链体系打造及 营销服务输出等核心环节提供了优质的保障，为企业的可持续发展奠定了稳固的基础。企业创立之初，我们就确立公司的使命：“与有中国梦的人一起实干兴邦”。我们致力于提升中国人的睡眠质量而努力践行，为提升国人的生活品质而奋斗不息。', 3.00, 10, 240, 253, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598253259, 1604387530);
INSERT INTO `p_brand` VALUES (230, 221, 'SSBJYSWHYXGS', 2, '深圳市铂晶艺术文化有限公司', 'https://oss.yiwofa.com/brand/20200824/9afd4ab497a5aedee34f0005249e7b25.png', 'https://oss.yiwofa.com/brand_banner/20200824/655d687e85bc8b5c9c6f7632e6ad52d5.png', 'https://oss.yiwofa.com/brand_banner/20201027/4670dd7ff9b61efacf3e98b26069cf5a.png,https://oss.yiwofa.com/brand_banner/20201027/d484bbc9e5d7c06b4875b8e7ac6787f3.png,https://oss.yiwofa.com/brand_banner/20201027/ec8f58937347dc0d9f8b40375e52539e.png', '深圳市铂晶艺术文化有限公司集材料研发，设计，生产制作一体，由艺术雕塑、艺术家具和艺术灯具为主，一直坚持原创艺术道路。', 3.00, 3, 133, 149, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598258369, 1603786956);
