INSERT INTO `p_brand` VALUES (232, 223, 'HY', 7, '嘿哟', 'https://oss.yiwofa.com/brand/20200825/828f86693543f5468d442b4ba81ed6c6.png', 'https://oss.yiwofa.com/brand_banner/20200826/c87591eab863df9919e89dba0176c4de.jpg', 'https://oss.yiwofa.com/brand_banner/20201103/48f8958153996390d1f683544e0d80de.jpg,https://oss.yiwofa.com/brand_banner/20201103/656a6c8b6950c29a2dd44b6ed7586c5f.jpg,https://oss.yiwofa.com/brand_banner/20201103/8bb7a584d694d88db7df4570e2c81c38.jpg', '\"HYM由台湾创意团队担任品牌策划、设计与研发，\n以精良的思维打造时尚、年轻的黑胶文化品牌，\n并与环球音乐等国际一线唱片公司合作， 独家发行艺人黑胶专辑。\nHYM首款产品Seed融合了播放器与音响，\n一体式的设计能提供近乎原音重现的高保真输出，\n打破传统黑胶唱机庞大的配套设备, 降低空间与知识门槛，\n并结合蓝牙、语音等多元的应用模式，\n设计出更符合现代人生活的一款黑胶智能音响。\"', 3.00, 11, 245, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598342502, 1604388071);
