INSERT INTO `p_brand` VALUES (236, 230, 'HWSJ', 5, '华文世家', 'https://oss.yiwofa.com/brand/20200828/6384de25d70ed8768fc942f6227cda48.png', 'https://oss.yiwofa.com/brand_banner/20200828/a1f3f9bc76758fb8b28a75bc23623352.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/1d132d99f71910bb6f3a72f7f9e5ac88.png,https://oss.yiwofa.com/brand_banner/20201027/7af818df4d3741bbbbe48e703da0710a.png,https://oss.yiwofa.com/brand_banner/20201027/580636409a1ffc4ac2c879d8eb8a4783.png', '深圳华文世家有限公司创立于2014年,座落在中国中部家具产业基地一江西省赣州市南康区本公司是一家从事家具销售的电子商务公司,深产品和服务之重要,对待产品的品质和服务近乎严苛,且知行合。公司秉承合作共赢,诚信至上”的理念服务于广大消费者,公司实施蓝海战略,密切跟踪主流社会的家居文化观念和市场需求的演变，为广大消费者精心构造舒适、自然、典雅、时尚的高品位生活。目前公司这个处在高速发展的过程当中。旗下品牌“华文世家”，在天猫，淘宝，京东，拼多多均拥有自营店铺。在互联网市场红利日渐消减的大环境下，电商行业的整体增速放缓。为了谋求新的增长来源，作为实木家具电商的华文世家，大力倡行全渠道发展战略，从线上走到线下，积极探索线下渠道布局。在3年内铺设500家新零售门店的计划，将覆盖全国大中小型城市，下沉三四五线城市，实现2020--2022年三年内500家线下门店目标，让华文世家走进千家万户。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598578872, 1603790258);
INSERT INTO `p_brand` VALUES (237, 231, 'YJ', 1, '遇见', 'https://oss.yiwofa.com/brand/20200828/372290ebed0caa289cddfbdf1ff1b581.png', 'https://oss.yiwofa.com/brand_banner/20200828/9cf42447b327255498b4ecd06b79d860.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/bd190d2459da26126ade96e24ebef2ad.jpg,https://oss.yiwofa.com/brand_banner/20201104/7326c86fbe6254128c7808c559417141.jpg,https://oss.yiwofa.com/brand_banner/20201104/33516695857700598d40937c470bed88.png', '\"琢金家具于2005年成立，坐落在全国最大的家具生产基地—广东佛山。主要引进德国，意大利等国先进生产设备，是一家集产品研发，生产，销售集一体现代化实木家具公司。 \n        有专业而庞大的设计团队，确保产品的原创能力，产品多出口欧美及一些新兴发展国家，荣获甚多好评。几年来，琢金企业组建起了顾问式的营销团队，从专卖店选址到后期经营\"', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598595721, 1604459921);
INSERT INTO `p_brand` VALUES (238, 226, 'ZSSMGZM', 2, '中山市米高照明', 'https://oss.yiwofa.com/brand/20210415/e6744b86f94e3e2bed8ae259f1713537.png', 'https://oss.yiwofa.com/brand_banner/20210416/c3cf949df0e5e6f2f11c0ba6a309ab32.png', 'https://oss.yiwofa.com/brand_banner/20210416/5a4cd323d8d6b95c0df9c356728e89cf.png,https://oss.yiwofa.com/brand_banner/20210416/98cb8156719f80a3ae9272907ea05f78.png,https://oss.yiwofa.com/brand_banner/20210416/58220d227456e57126b13fa6286cdf3f.png', '米高照明专业专注于灯饰研发设计不断创新\n\n以时尚家居潮流为主题核心\n\n匠造浑然天成的独特气质的精品\n\n稳重的中式，奢华的欧式，复古的美式，端庄的法式，前卫的现代轻奢\n\n成为全球设计师以及各大开发商的首选品牌', 3.00, 2, 107, 126, 0, 1, 0, 1, 100, 1000, 0, 0.030, 1, 1, 1, '', 1598671225, 1618646200);
INSERT INTO `p_brand` VALUES (239, 234, 'TPZ', 3, '同频者', 'https://oss.yiwofa.com/brand/20200831/d601963174de84a9343b863d3fb3aed4.png', 'https://oss.yiwofa.com/brand_banner/20200831/f6062b57bde74f47332496d2d283716f.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/9bd25e0350852e50dee72423c426493b.png,https://oss.yiwofa.com/brand_banner/20201027/4957ce46dab8284c234d8b9d94e3e0e1.png,https://oss.yiwofa.com/brand_banner/20201027/f814e6be2594b399ed3270f97e4d4ec9.png', '同频者是由有着相同底线设计师和工厂联创的家具供应链。通过设计师对产品独特的嗅觉，找出大众经典差异化的款式，联合更专业更有底线的同频工厂，用更好的材料更好的工艺和品控，让消费者用更低的价格照样可以享受更好的品质；真正从制造工厂源头整合供应链，控制生产成本，确保产品超高性价比。此外，我们提供仓储、一件代发，品牌贴牌、无忧售后等客服服务体系，降低客户成本，提升合作体验。TPZ倡导“共创产品，共享资源，共守底线”的全新品牌基因，逐步布局极简全品类家具，在将来为合作伙伴提供一站式全品类供应链服务。', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598836810, 1603791524);
INSERT INTO `p_brand` VALUES (240, 235, 'THJJ', 14, '天环家具', 'https://oss.yiwofa.com/brand/20200831/50e4bed9287235d8b12e092fb2f9ef2f.png', 'https://oss.yiwofa.com/brand_banner/20200831/0699b9ba2ff4e10d70c03000cd447c2c.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/54b9a0cb708e8d15cbd84e9483f617d1.png,https://oss.yiwofa.com/brand_banner/20201027/9753d4915e74a35b9a50d1fe55e9644f.png,https://oss.yiwofa.com/brand_banner/20201027/650a86eb9dbe7dc4009845aa8f021f7d.png', '来图生产，实木，五金，大理石，各种材质结合生产而成的轻奢风的家具', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598844526, 1603791987);
