INSERT INTO `p_brand` VALUES (242, 237, 'YW', 3, '永伟', 'https://oss.yiwofa.com/brand/20200831/f58d1a033c53943919119df50c452fc3.png', 'https://oss.yiwofa.com/brand_banner/20200831/3ba69b35fe0b32f8fbcb4da462e9b0b0.jpg', '', '我厂是一家集高中档实木家具设计、生产与销售的综合型企业。本公司有专门的设计师和优秀的管理人员，为广大消费者提供随心所欲的优质家具。\n     主要经营各种高中档家具。产品销往全国各地，每件产品的生产都以人体工程学为生产理念，精心制作，给人们创造一些最舒适、最温馨的生活环境。\n    本公司坚持走品牌化、规模化的道路，致力于科学的管理体制，畅通管理渠道和高素质的人才队伍建设。\n    本公司一直坚持\"以客户需求为向导，以产品质量我生命力，靠高品质个一流的服务获得客户的一致认可”为理念，竭诚为广大消费者服务', 3.00, 1, 12, 34, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598862260, 1598862260);
INSERT INTO `p_brand` VALUES (243, 238, 'YXZSJJ', 5, '箐院新中式家具', 'https://oss.yiwofa.com/brand/20200831/e10fcf62475412a38e176f4d4ea65ef1.png', 'https://oss.yiwofa.com/brand_banner/20200831/2b54a34cfe1df3941ce4f27d2a53141c.jpg', 'https://oss.yiwofa.com/brand_banner/20201027/1e7b5f0f5216b70fa1854ce8a5d5c8eb.png,https://oss.yiwofa.com/brand_banner/20201027/473966dcd7163b18f4a43375f7ccb513.jpg,https://oss.yiwofa.com/brand_banner/20201027/ac30379bf921405e814ad1eb36258a6e.jpg', '佛山海煜家具有限公司是一家集设计、制造、销售为一体的时尚红木家具企业，于2013年推出“文青”品牌。于2015年公司相继推出“工匠坊箐院”品牌。目前公司拥有先进的生产设备与完善的管理体系在生产的第一个一环节都力求做到尽山尽美，保证为消费者提供高标准、高质量的新品。工匠坊家具继承明明式家具营造技法，榫卯结构承袭古制。在温厚的手工传统中，每一道工序、每一个细节都分外讲究，力求打造现代新中式经典。工匠坊产口尊循“原生材料、原生色、适度设计、精湛工艺四大设计策略。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598868317, 1603792748);
