INSERT INTO `p_brand` VALUES (246, 239, 'ZSX', 2, '钻石星', 'https://oss.yiwofa.com/brand/20200901/13f5ff1302ba8ca06f5f6ae0cdc81dfd.png', 'https://oss.yiwofa.com/brand_banner/20200901/dc22b94d2c411e25fabb3c7c68059c37.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/e9fc4db8219f11483df64aaef4228990.png,https://oss.yiwofa.com/brand_banner/20201104/17218522c408364836e7b20e4a3bdea7.png,https://oss.yiwofa.com/brand_banner/20201104/e7da2d44540a243fe2b5bc388057bf0c.png', '钻石星（广州）家居饰品有限公司 经销批发的玻璃饰品、畅销消费者市场，在消费者当中享有较高的地位，公司与多家零售商和代理商建立了长期稳定的合作关系。钻石星（广州）家居饰品有限公司经销的玻璃饰品、品种齐全、价格合理。钻石星（广州）家居饰品有限公司实力雄厚，重信用、守合同、保证产品质量，以多品种经营特色和薄利多销的原则，赢得了广大客户的信任。', 3.00, 3, 141, 183, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1598944032, 1604458125);
