INSERT INTO `p_brand` VALUES (251, 242, 'MSA', 2, 'MSA', 'https://oss.yiwofa.com/brand/20200902/1dd970eba636e95680d3f361febe5b0f.png', 'https://oss.yiwofa.com/brand_banner/20200902/3d07ba84710fa484c1015d0efb59b16a.jpg', '', 'MSA——是欧洲进口岩板的专业供应商，进口商。是西班牙INALCO，TECHLAM,coverlam,ARGENTA岩板在中国区的授权市场运营商。中国库存面积30000 ㎡，有专业岩板加工厂，为更多的橱柜/卫浴/定制/家具/装饰企业提供产品和服务。并带有专业岩板施工团队，根据每个项目施工环境，为客户选取最合适的施工方式。', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 0, '', 1599031285, 1609146120);
INSERT INTO `p_brand` VALUES (252, 243, 'AMJ', 3, '安琦美居', 'https://oss.yiwofa.com/brand/20200903/f5d90395dc2e2e68263432cd1e5bbe7d.png', 'https://oss.yiwofa.com/brand_banner/20200903/51dc626b3e61d4cf591e96164a6b8d46.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/547a3d3faac4cd1c77b7264499541a2c.jpg,https://oss.yiwofa.com/brand_banner/20201104/4e580b06b5f1d6a3bcec2f35df60a500.jpg,https://oss.yiwofa.com/brand_banner/20201104/531003bb14134042724619f3dcf52a9a.jpg', '\"佛山市安琦美居家具有限公司是一家集设计、生产和销售于一体的多元化实体企业品牌。\n安琦美居组织机构健全，管理科学先进，机械设备齐全，技术力量雄厚。公司自成立以来，秉承“家文化”的主要元素精神，“家文化”无论是在内涵还是在外延上，都应该是“LOVE文化”，也就是“爱的文化”。外延上，爱自己的团队、爱自己的客户是“家文化”的外在表现。安琦美居注重：禅、和、美、孝、感恩儒家文化，使每个员工倾注心血融入感恩之心，精心打造每一个细节，更让员工像家庭成员一样相处的和睦和谐，发挥更大的团队力量。这事始终坚持关爱员工，凝聚人心，共同投身企业发展的结果，也是注重科学管理，充分实践“以人为本”的核心理念。\"', 3.00, 1, 13, 38, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599099963, 1606353984);
INSERT INTO `p_brand` VALUES (253, 244, 'MLM', 5, '美拉美', 'https://oss.yiwofa.com/brand/20200903/b3f652ebe4b064368ec8b2e66ba5e28e.png', 'https://oss.yiwofa.com/brand_banner/20200903/230c00a2eb2a2bcf59a0f2624fde2baa.png', 'https://oss.yiwofa.com/brand_banner/20201024/3a22b49ce73525864983509a797a8fca.jpg,https://oss.yiwofa.com/brand_banner/20201024/951c269cd4dd58da0b6dc969d37e07b2.jpg,https://oss.yiwofa.com/brand_banner/20201024/6347c57baeae289cedc906cf3bbdd819.jpg', '\"英隆家具家具厂创办于2012年，工厂位于南海西樵显岗工业区，为榕大家具集团旗下第六分厂。是一家专业从事板木家具设计、产品研发、生产、销售为一体的中型家具企业。公司拥有先进的木工机械设备；大批经验丰富、技术精湛的技术人才及管理骨干；拥有的严谨的生产管理制度、品质保证体系和完善的售后服务。\n2013年，英隆家具成功推出“名爵士”虎斑木颜色现代板木系列，产品简洁明快、款式丰富，受众广泛；尤其注重产品的安全性，环保性。产品自推出以来，过硬的产品质量，合理的产品价格，快捷的售后服务，迅速赢得了市场的认可和消费者的喜爱；我们坚持“专注、专业、专一”的开发生产理念，专注单一品牌系列的开发与完善，努力将每一件产品做到极致。名爵士欢迎您的加盟！\"', 3.00, 1, 18, 76, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599110782, 1603536234);
INSERT INTO `p_brand` VALUES (254, 245, 'JNSYM、', 1, '佳尼随易眠、', 'https://oss.yiwofa.com/brand/20200904/fefd9208fe602ff96d739bd802c025e9.png', 'https://oss.yiwofa.com/brand_banner/20200904/cbf8163da2c7daba1553905646e2103c.png', 'https://oss.yiwofa.com/brand_banner/20201026/c26360f52a32f6a972b6a28449a9aa3b.png,https://oss.yiwofa.com/brand_banner/20201026/74b4b0e758e7f84794d202d6c84ff80c.png,https://oss.yiwofa.com/brand_banner/20201026/2387f93e59e2622574314ce98b1e8b91.png', '公司成立于1986年，前身是汕头锦记家具有限公司，至今已有33年，在卧室系列领域中以少有的实力派而被同行著称；2000年，为靠近产业优势地带，公司将主力转移到佛山，并更名为佳尼家具；2009年，公司更名为：广东雅兰皇庭家具有限公司，自行买地，自建厂房，全面提速国内市场的发展；2014年，公司再斥巨资，新建现代化、智能化环保厂房，并于2014年8月投产使用；2014年，为配合公司全面战略提升，更名为“佛山市佳尼家具科技有限公司”。\n公司拥有一座占地面积30多亩的花园式工业园，包括30000多平方的现代化厂房，8000多平方的产品展厅，6000多平方的现代化办公大楼，以及宿舍、食堂、运动娱乐等生活设施\n自2013——2019年，佳尼荣获的重要奖项：\n   ◆“中国家具行业年度优秀企业”\n   ◆“中国泛家居发展企业500强”\n   ◆“中国家具行业年度最具竞争力品牌”\n   ◆“中国家具行业年度最受消费者欢迎十佳床垫家具品牌”\n   ◆“CCTV联合展播诚信品牌”\n   ◆“《软体家具床垫有害物质限量等级细分》团体标准起草单位”\n   ◆“2018 中国家居品牌领袖峰会传媒大奖——金匠奖”', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599185203, 1603677445);
INSERT INTO `p_brand` VALUES (255, 246, 'S', 1, '拾梵', 'https://oss.yiwofa.com/brand/20200904/9fd0ccd7200c7363ea11a8befbd85e7b.png', 'https://oss.yiwofa.com/brand_banner/20200904/97f1cfe9761f4e52d90d2dcec4d3c035.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/8b290e5abd1afe020a641a290ce87746.jpg,https://oss.yiwofa.com/brand_banner/20201104/84a00f5d054d57f8031e8aa561210a42.jpg,https://oss.yiwofa.com/brand_banner/20201104/13805222b85919bad01afe6866c2a23e.png', '西米图客厅家具位于全国最大的家具生产基地——广东省顺德区乐从镇。公司是集硏发,生产,销售,服务于一体的企业。\n \n公司吸取了各国顶级家具设计技术,并通过专业的人体工程学,时尚文化的研究,加上对产品结构和原材料的准确定位和精湛的制作要求,产品无论在美学上,实用性上及家具文化上都是尽致尽美的完美结合,深得国内外客户的信任与好评。\n \n产品从设计,用料到生产的整套工艺始终追求艺术与时尚,自然与环保，简洁与舒适的完美结合,并以卓越的品质,新颖的款式和实惠的价格畅销全国各地并远销东南亚,中东及欧美地区,深受广大客户和消费者的一致好评。\n \n我们本着“以人才为根本,以市场为导向,以科技为动力,以品质为生命,”的经营理念,全力打造优良的品牌形象,志在为客户提供最优质的产品和最满意的售后服务。', 3.00, 1, 12, 25, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599200860, 1604460350);
INSERT INTO `p_brand` VALUES (256, 247, 'DH', 2, '得辉', 'https://oss.yiwofa.com/brand/20200904/e0c94b3d6432f4c569a3348e18f6521d.png', 'https://oss.yiwofa.com/brand_banner/20200905/ee0e43f656296f6a2487af88679d9586.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/b3a1ee9d1e19d4c5b7ae9f5235aecb45.jpg,https://oss.yiwofa.com/brand_banner/20201026/62c66cf0a13f1f5b017a1c40ac217b92.jpg,https://oss.yiwofa.com/brand_banner/20201026/9f434c157fff51bc941860d323a4fbcc.jpg', '佛山市得辉美居家具有限公司位于全国最大的家具生产基地-广东佛山-龙江镇.公司集研发生产-销售 服务一体的企业.得辉美居家具有限公司研发生产销售现代整体家居.旗下品牌米兰朵 得辉 专注研发销售软体家居沙发 软床等.其品牌大部分为独家设计研发生产.无论在款式还是手工上的深受赞扬与肯定', 3.00, 1, 12, 30, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599205189, 1605234443);
