INSERT INTO `p_brand` VALUES (261, 251, 'HSJJ', 1, '韩舍家居', 'https://oss.yiwofa.com/brand/20200908/69b9c4761cfe4fb66d00ae1396b98372.png', 'https://oss.yiwofa.com/brand_banner/20200908/4ba618baeed266cbc16bdf9f5311d016.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/9805680ba9ace6c1a549d0dd1f83d86a.jpg,https://oss.yiwofa.com/brand_banner/20201026/effe70b412bffaf6a9528820a5a8160d.png,https://oss.yiwofa.com/brand_banner/20201026/91e177163c0f4436d4853d010f39809c.png', '\"韩舍家居是通过极简一些经典款式，糅合部分轻奢的一些元素，主要是金属部分（颜色为玫瑰金和灰色汽车漆），木制部分为炭烧色，黑灰色拉丝（白橡），小部分胡桃木（未来以原创为主），做出东方人自己的生活方式，主题为意式东方！\n在单椅部分为全皮，半皮，超纤三种材料，迎合市场的样板间，工程项目，不仅把品质做上去，把高性价比也做出来。\n意式东方主要两厅为主，沙发椅子是主力 产品\n\"', 3.00, 1, 13, 38, 44, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599547332, 1603693521);
