INSERT INTO `p_brand` VALUES (264, 256, 'BYSP', 5, '柏艺尚品', 'https://oss.yiwofa.com/brand/20200909/b44407e2ff4726ce3454b0ed9433ba6a.png', 'https://oss.yiwofa.com/brand_banner/20200909/2c93b10e081dc9184525b0851752471b.png', '', '柏艺尚品是东莞市金莎家居旗下品牌，主要生产仿真花，新中式饰品，家居饰品', 1.00, 6, 227, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599624363, 1599624363);
INSERT INTO `p_brand` VALUES (265, 257, 'SKQJJ', 7, '斯科奇家居', 'https://oss.yiwofa.com/brand/20200909/6ef42752562c85748030728e3103b0ae.png', 'https://oss.yiwofa.com/brand_banner/20200909/1994dc73e6c45b71841e99c2c9be67f0.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/d6a40fc892cb0c3ed11e5c99c7587ea1.jpg,https://oss.yiwofa.com/brand_banner/20201104/c8908297ef5a0981a35dfc48f65745c5.jpg,https://oss.yiwofa.com/brand_banner/20201104/d1dce79a35ee0fbd0afb63eb5d568cf7.jpg', '\"东莞市斯科奇家居有限公司位于中国家具制造名镇--东莞•厚街.\n专业致力于欧美式家具的客厅、餐厅、卧室、书房及酒店工程等系列民用及商用家具产品的研发与制造.我们始终贯彻以产品质量为企业发展基石的理念，依托广东家具产业集群化优势，努力整合和优化公司内外部资源，不断丰富公司产品线。竭力打造外观精美，性价比更高的欧美式家具，不断增强产品的多样化和实用性。\"', 3.00, 1, 18, 76, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599635810, 1605150170);
INSERT INTO `p_brand` VALUES (266, 258, 'SJ', 2, '奢简', 'https://oss.yiwofa.com/brand/20200909/fcfb3d4159d3e58ac23ce5ba333699da.png', 'https://oss.yiwofa.com/brand_banner/20200909/196fb9121a07f515fea8dcfe2acd17d1.png', 'https://oss.yiwofa.com/brand_banner/20201024/64e727182e85f01ec7f27f4cf083e45e.png,https://oss.yiwofa.com/brand_banner/20201024/b011fbecfb71ab2001060b6b1313e56b.png,https://oss.yiwofa.com/brand_banner/20201024/efe1a5b3c2e83fac9693be50a13c4f88.png', '公司简介：中山市奢加简照明灯饰制造有限公司始创于1998年，至今23年的品牌。是一家集研发、生产、销售于一体的灯饰企业。公司跻身于高端灯饰领域，自创办以来，坚持 以品质、创新取胜，以市场需求为向导，得到世界各地的消费者的认可和赞誉。旗下共有 奢简、兴唐风 奢简订制  4大品牌公司相继通过中国强制性产品3C认证、CE、ISO等欧盟国家的多个认证，过硬的品质使产品远销欧美多个国家、遍及全中国。公司团队将以诚 信、创新、务实来推动企业的健康发展。励精图治，创灯饰百年品牌。产品从设计研发到模具雕刻，每道生产程序均有严格的质量把关，已经建立ISO9001：2008国际质量管理体系，并遵循ROHS环保指令，使“奢 简”全铜灯在行业建立了良好的口碑，并通过CCC.CE,UL,CUL,SASO，等权威机构认证。', 3.00, 2, 105, 111, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599643636, 1603535321);
