INSERT INTO `p_brand` VALUES (270, 265, 'YJJ', 1, '芊艺家居', 'https://oss.yiwofa.com/brand/20200911/b71ebd56cee40ecd16858f9dc6816af6.png', 'https://oss.yiwofa.com/brand_banner/20200911/4ae3b6c2245cab47cec4943978766781.png', 'https://oss.yiwofa.com/brand_banner/20201026/89c3d2a0b2938c1934a1b7dce4ddf3a0.jpg,https://oss.yiwofa.com/brand_banner/20201026/188adb187fbbc9b744a02c4a13c35e98.jpg,https://oss.yiwofa.com/brand_banner/20201026/cd38fa494c7aa009238657f6a924d3f1.jpg', '\"芊艺家居是一家客餐厅配套的服务商，芊艺家居定位于“现代简约”的专业化家具企业。产品以绿色环保，健康自然为核心竞争力，致力服务于国内中高端家居市场。公司旗下拥有“现代”“极简”风格的系列产品。我们将不忘初心，继续前行，为市场源源不断提供优质、\n有品位的家居精品，帮助经销商持续盈利，为成为消费者信赖的知名品牌而更加努力！\n\"', 3.00, 1, 12, 30, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599790549, 1605168510);
INSERT INTO `p_brand` VALUES (271, 266, 'TOUCH LIGHT.TC', 2, 'TOUCH LIGHT.泰昌', 'https://oss.yiwofa.com/brand/20200911/31b3e712c5ff5f7a1907bbf23a02914a.png', 'https://oss.yiwofa.com/brand_banner/20200911/65b5be9f5698ba3a5e6951d2f72ae4fb.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/983f57681dba9a40f9096d43e0803429.jpg,https://oss.yiwofa.com/brand_banner/20201104/7f02eb581aab4600578e8517288b567b.jpg,https://oss.yiwofa.com/brand_banner/20201104/43c975ebc2c1a36252eb103928dff513.jpg', '\"中山市泰昌照明有限公司是一家1995年成立的老牌家居照明公司。总部位于灯都古镇。\n\n泰昌照明旗下有三个品牌。分别是：泰昌阳光、诺汀斯及爱玛斯。泰昌阳光以出品现代灯饰为业。诺汀斯专营美式全铜简约灯。爱玛斯主打欧洲进口品牌铜灯。\"', 3.00, 2, 105, 114, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599808175, 1605089998);
INSERT INTO `p_brand` VALUES (272, 267, 'SJGG', 12, '世纪公馆', 'https://oss.yiwofa.com/brand/20200912/7ce016ca65bb13d56a1ad5e54c73d460.png', 'https://oss.yiwofa.com/brand_banner/20200912/11d97c299cf07ab35ec4d7dbe2ec13eb.png', 'https://oss.yiwofa.com/brand_banner/20201022/37b6b557bac3a6342d4e58ca7dbb41dd.jpg,https://oss.yiwofa.com/brand_banner/20201022/c98ecf4fc360936ec8369206b0f19d49.jpg,https://oss.yiwofa.com/brand_banner/20201022/a293dafdf5d67b01d82db4840dbcb696.jpg', '世纪公馆系列产品研发之初，就是秉承现代，时尚，简约，美感，高颜值，满足当代年轻人一切个性追求为设计理念来定位的，所以我们品牌是集当下流行的极简，新中式，北欧，轻奢风格元素为一体的时尚简约现代实木套房家具。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1599880533, 1614752307);
