INSERT INTO `p_brand` VALUES (279, 272, 'PYJJ', 1, '品粤家居', 'https://oss.yiwofa.com/brand/20200916/1154d4c65558aa5fbb60b1b4cbcdf1d1.png', 'https://oss.yiwofa.com/brand_banner/20200916/30d80a6e4fcfafd874be7b2c1eedf9f7.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/c7b458a41c7d8758cbaed1fdc779a825.png,https://oss.yiwofa.com/brand_banner/20201104/774b223b23b619f32dfa19664b1239db.jpg,https://oss.yiwofa.com/brand_banner/20201104/b764ff4452c23ad29be132e1d0e7e91e.png', '承继着广州雅美家具制造厂坚毅的基础，精心设计尊贵时尚欧式风格客厅系列产品。', 3.00, 1, 14, 47, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1600220310, 1604461373);
INSERT INTO `p_brand` VALUES (281, 274, 'SDAZ', 1, '斯帝阿姿', 'https://oss.yiwofa.com/brand/20200916/78c260821fbe2166cf5f5a7f1753a222.png', 'https://oss.yiwofa.com/brand_banner/20200916/091d3f057ec48d2237c81481a87d9686.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/59abdf49a7f41ddcea1fbf669e3c333a.png,https://oss.yiwofa.com/brand_banner/20201026/cfc838b0f176a355ba5c536e7c3c14ce.png,https://oss.yiwofa.com/brand_banner/20201026/e750aa66e95959cbd9a5e19f613aca11.png', '1.企业定位： 把握世界流行时尚，参考服装、饰品、汽车，名表等奢侈品调整和研发最时尚，最前卫的艺术家居，致 力于快时尚整体家居研发及销售，争做全球时尚、前卫的艺术家居精品研发及销售商！ 2.设计师语录： 艺术，没有定义，只有颠覆！时尚，没有妥协，只有彻底! Steelarts,一个因纯粹艺术及个性而诞生的时尚家居品牌，不是出身名门，不是伪进口家居，不是原 版的意大利风格，而只是遵循我们对时尚的定义，遵循我们对世界艺术的的理解，这其中不仅仅是像某 些自诩为艺术家的屌丝们认可及推崇的意大利家居艺术，因为我们认为这太浅薄，这只是对艺术的践踏 和肤浅！我们会用心的去学习研究世界上所有的优秀的艺术，包括大师的，当然也包括民间的及无的． 我们不需要所有人都认可和欣赏我们的产品，因为我们不屑妥协于世俗的眼光，因为我们只与知己者 共舞！那么，哪些人是我们的知己者呢？我们认为我们的知己必须受过良好的教育，对生活及情调有较 高追求，时尚但不随众，现代但不泛滥，对生活有深层次的感悟，对艺术有独到的理解，有较好的经济 基础，担责任，富爱心，懂回报社会的精英时尚人士！ 斯帝阿姿个性家居，仅为全球时尚人士！', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 88, 0, 0.012, 1, 1, 1, '', 1600247298, 1614763778);
