INSERT INTO `p_brand` VALUES (285, 277, 'FJJ', 2, '瀚凡家具', 'https://oss.yiwofa.com/brand/20200921/0e670585cb3b7ddc2fe5ca3adb78a2de.png', 'https://oss.yiwofa.com/brand_banner/20200921/5f36a057b38db737c675c62f1ba67daa.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/6867b8371bcb4cf03e2e8072a9a0eccb.jpg,https://oss.yiwofa.com/brand_banner/20201104/409bbca8632154d95cfbbb31f41301b0.jpg,https://oss.yiwofa.com/brand_banner/20201110/ca825522a8eb2a2f207e6d468e7f2f2e.jpg', '“设计为先，工艺创先，品质优先，服务至上”是瀚凡家具品牌家居的宗旨，在品牌经营过程中，开发设计产品超过100件单品，并持续不断增加。瀚凡全体同仁将不断努力，将品牌推向全球高端家居领域，立足于世界！', 3.00, 1, 18, 260, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1600658536, 1605005153);
