INSERT INTO `p_brand` VALUES (287, 279, 'MZX', 1, '梦之欣', 'https://oss.yiwofa.com/brand/20200923/29106226d8ed62a564eeade9f1c4deda.png', 'https://oss.yiwofa.com/brand_banner/20200923/c611769aae845757d2dacc01b86ef3d0.jpg', 'https://oss.yiwofa.com/brand_banner/20201104/e7b2c03a7a2b7a36fd9c6fdaf198b68c.jpg,https://oss.yiwofa.com/brand_banner/20201104/39d41fe40b2e045d80ddada9f8cbf2fc.jpg,https://oss.yiwofa.com/brand_banner/20201104/d092586a8d65ca67ab85c55e80ce235b.jpg', '榕大家具集团，2004年成立于广东省广州市，成立之初主营办公家具的研发，制造销售，凭借良好的信誉及质量，成立当年就成为广州政府定点办公家具采购单位，亚运会合作单位。2009年公司决定在“中国家具商贸之都”广东省佛山市顺德区成立佛山乐雅居家具实业有限公司，2010年成立森之富工艺有限公司，2011年成立凯蒂莱家具有限公司，2012年成立欧宝莱有限公司等，公司凭借丰厚的市场营销经验，聚天下有志之士，共聚榕大同谋发展榕大梦之欣科技睡眠科技有限公司。', 3.00, 10, 239, 0, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1600829414, 1604472571);
