INSERT INTO `p_brand` VALUES (289, 281, 'YNDT', 3, '雅宁地毯', 'https://oss.yiwofa.com/brand/20200924/a0b5c05e895fe8d2aef336e216163087.png', 'https://oss.yiwofa.com/brand_banner/20200924/acc86a24b3cbfa83f250c9e770fefffe.jpg', 'https://oss.yiwofa.com/brand_banner/20201112/094ea44eb68192a99ae25cd6fe29549b.jpg,https://oss.yiwofa.com/brand_banner/20201112/1614d1e7aec2d681893f2531e2118a63.jpg,https://oss.yiwofa.com/brand_banner/20201112/59f9a8759f117f17bfc0f7858839e622.jpg', '天津雅宁地毯有限公司办公室地址位于环渤海地区经济中心天津，天津 天津市武清区大黄堡镇后蒲棒村综合大楼505-7（集中办公区），于2015年06月09日在天津市武清区市场和质量监督管理局注册成立，注册资本为300万人民币，在公司发展壮大的5年里，我们始终为客户提供好的产品和技术支持、健全的售后服务，我公司主要经营地毯、挂毯制造、加工、销售，针纺织品、工艺品、建筑材料、日用品、服装销售。（依法须经批准的项目，经相关部门批准后方可开展经营活动），我们有好的产品和专业的销售和技术团队，我公司属于天津地毯公司行业，如果您对我公司的产品服务有兴趣，期待您在线留言或者来电咨询', 3.00, 4, 215, 0, 0, 1, 0, 1, 100, 61, 0, 0.012, 1, 1, 1, '', 1600913943, 1614761248);
INSERT INTO `p_brand` VALUES (290, 282, 'FFSJ', 14, '法菲世家', 'https://oss.yiwofa.com/brand/20200924/3234eb207dc1cf04f1228eead3f12073.png', 'https://oss.yiwofa.com/brand_banner/20200924/51f1cbf4a5d2e550ed9f8a3170ec8c9a.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/4811d302244e126c9f12ad29675df4a2.jpg,https://oss.yiwofa.com/brand_banner/20201026/c190d2e02254cd27656da4a4ddd76252.jpg,https://oss.yiwofa.com/brand_banner/20201026/c5da8874459cb8baf17c86606216cd7c.jpg', '“拉风”取时尚、前卫、 出色之意 。寓意拉风人倡导时尚，终走在时代的前沿， 引领家居流行风尚。佛山市拉风家具有限公司，坐落于中国家具产业链最成熟的地段顺德镇 地理位置优越，环境优美 ，公司成立于2010年 多年来我们埋头苦干 员工200多人的集研发，生产， 销售为一体的“高，精，尖”企业。公司两大品牌“法菲世家”新古典系列家具以及法式轻奢系列家具“LOFOOON”深入挖掘顾客需求，不断调整市场策略， 产品不仅深受国内消费者的热爱 也深受到越来越多的国际客户的青睐。', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1600938685, 1603702786);
INSERT INTO `p_brand` VALUES (292, 286, 'AET', 7, '阿尔特', 'https://oss.yiwofa.com/brand/20200926/255a35578e19830640668f35e8c39cd8.png', 'https://oss.yiwofa.com/brand_banner/20200926/03503f59d900e8f81adcfc3bcf65f494.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/f249d50d8ff55a53d220f228575ba684.jpg,https://oss.yiwofa.com/brand_banner/20201026/798982eb0cce11d9dbb361bbe137f515.jpg,https://oss.yiwofa.com/brand_banner/20201026/244a5506fe3b2b7692827403e3c0e063.jpg', '中山市横栏镇阿尔特灯饰厂，成立于2003年，坐落在中山市横栏镇，毗邻有\"中国灯饰之都\"之称的中山古镇，地理位置优越，交通便捷，是一家专业生产田园风格铁艺水晶灯、铁艺花草灯的厂家，具有专业的设计水准，精湛的生产技术，规范的生产管理，灯饰产品汇聚欧美风格，集艺术观赏、装饰效果为一体，具有高贵、典雅、雍容、华贵之品', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601086287, 1603703939);
INSERT INTO `p_brand` VALUES (293, 287, 'MLD', 1, '莫兰迪', 'https://oss.yiwofa.com/brand/20200926/39c697b489cf734dbca57d7a6c0e023d.jpg', 'https://oss.yiwofa.com/brand_banner/20200926/215134c20d3c86925eb2586a1e11c2a0.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/984a1727ee2822d47e80167d579c56fd.jpg,https://oss.yiwofa.com/brand_banner/20201026/1f7ddf288d20738f7dda56d807c01515.png,https://oss.yiwofa.com/brand_banner/20201026/0d3026a60380503d934f34aa1f0eae8f.png', '达米（柏亨）家具位于中国家具之都广东佛山龙江，达米（柏亨）家具经历了民用家具行业的严峻洗礼，至今成长为【柏亨】家具品牌美誉全国。达米家具集研发、设计、制造、营销为一体的大型专业化民用家具企业。拥有生产基地45000平方的专业现代化厂房，依托顺德家具之都高地，打造国内外知名品牌为使命 。步入高速成长期的达米家具品牌旗下5大系列：＜＜卡美尔＞＞全实木现代简美系列＜＜木韵佳檀＞＞新中式系列，＜＜御尚＞＞北欧系列，＜＜莫兰迪＞＞现代极简系列，＜＜科思＞＞全实木进口北欧系列。布局更高层次的行业竞争，将全面整合优势资源，继续创新产品服务市场与品质为核心竞争力。在提升产品优势的前提下，深化营销格局，提高服务质量，提供更加快捷、周到、精准、细致的服务。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601111029, 1604992790);
INSERT INTO `p_brand` VALUES (294, 287, 'BHJJ', 3, '柏亨家具', 'https://oss.yiwofa.com/brand/20200926/23dcb673480f1a737a8e4cd6f4f66afb.jpg', 'https://oss.yiwofa.com/brand_banner/20200926/c35b8f574067bbdf748b6ce194108bdc.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/138942e00bfa22138507e626d8a4186a.jpg,https://oss.yiwofa.com/brand_banner/20201026/82a6006f867eb315e0d983211fec80ab.png,https://oss.yiwofa.com/brand_banner/20201026/65b13c31b1eae0a0ac0709809861b336.png', '达米（柏亨）家具位于中国家具之都广东佛山龙江，达米（柏亨）家具经历了民用家具行业的严峻洗礼，至今成长为【柏亨】家具品牌美誉全国。达米家具集研发、设计、制造、营销为一体的大型专业化民用家具企业。拥有生产基地45000平方的专业现代化厂房，依托顺德家具之都高地，打造国内外知名品牌为使命 。步入高速成长期的达米家具品牌旗下5大系列：＜＜卡美尔＞＞全实木现代简美系列＜＜木韵佳檀＞＞新中式系列，＜＜御尚＞＞北欧系列，＜＜莫兰迪＞＞现代极简系列，＜＜科思＞＞全实木进口北欧系列。布局更高层次的行业竞争，将全面整合优势资源，继续创新产品服务市场与品质为核心竞争力。在提升产品优势的前提下，深化营销格局，提高服务质量，提供更加快捷、周到、精准、细致的服务。', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601111072, 1603706849);
INSERT INTO `p_brand` VALUES (295, 288, 'TWJJ', 1, '拓唯家居', 'https://oss.yiwofa.com/brand/20200926/25866f6279a66ec369a429110a9994be.png', 'https://oss.yiwofa.com/brand_banner/20200926/210d6c298bc788e8ffafa43d246cf300.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/930c10d836a8b4dc5da5041977dec952.png,https://oss.yiwofa.com/brand_banner/20201026/c55d9cd96134b1b6beb3432669e2f289.png,https://oss.yiwofa.com/brand_banner/20201026/67ade677f1a6510e4c42a6df21f21346.png', '\"拓唯家具，隶属于佛山市南海金贤华家具实业有限公司，创办于1997年，坐落于广东佛山市南海区九江镇沙头石江江尾社，是一家集研发，生产，销售和服务为一体的中型家具企业。\n\"', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601112110, 1614752286);
INSERT INTO `p_brand` VALUES (296, 285, 'FLMTGBJJ', 1, '菲丽蒙特国宝家具', 'https://oss.yiwofa.com/brand/20200929/9d8d43abac37d3e95f65116551b46427.png', 'https://oss.yiwofa.com/brand_banner/20200929/792c2348a2cea5fa0ea877dfc967c7fd.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/aa6992ed6ee800062a7e7f8b80069eaf.jpg,https://oss.yiwofa.com/brand_banner/20201030/c3528a60cc2c79db29e93bfd17e3e99b.jpg,https://oss.yiwofa.com/brand_banner/20201030/c71804d72584a4a42fc75531db44c45e.jpg', '\"\n　　 国宝家具是专业从事家具生产、加工、设计、服务于一体的家具企业，从1983年建立至今已38年，主要生产床垫、沙发、软床、枕头。公司位于广东家具重镇佛山市顺德区龙江镇。企业以科学管理为核心，组织了一批高素质，责任心强的生产队伍，本着专业化的生产经验生产出各种风格的品牌家具，畅销国内外市场！\n　   企业以质量为核心，严把质量关；以诚信为本，为广大客户生产出一系列以国宝品牌为代表的健康放心产品！\n　　“优质的产品、创新的理念、专业化的生产骨干、务实的工作态度及完善的售后服务!”是本企业永远坚持的宗旨！\n   在未来的日子里，我们将继续精益求精，不断改良生产技术，提高产品质量和服务水平，争取让每一位顾客对我们的产品更为称心如意！\n树立品牌，拓展市场！我们诚邀家具行业热爱者，勇于创业的佼佼者加盟，共同成长，共同发展共同分享国宝家具的成长和品牌价值!\"', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601360888, 1604046222);
INSERT INTO `p_brand` VALUES (297, 295, 'BHJJ', 5, '博和家具', 'https://oss.yiwofa.com/brand/20200930/75deea5bf9c46d84c22994d7b98b1f2f.png', 'https://oss.yiwofa.com/brand_banner/20200930/38716f8bc1cac9f8db43367b89346bda.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/36d06cf0a58d6c7c8f0bb56c801675a3.jpg,https://oss.yiwofa.com/brand_banner/20201030/1262a342f53576520cadc7f234d55e2d.jpg,https://oss.yiwofa.com/brand_banner/20201030/9e36b81bf70dff48d907c7bd9b2b693e.jpg', '苏州汉缔森家具有限公司是一家专业生产及销售实木家具 15 年的老品牌，目前旗下拥有博森胡桃木中式和博禾新中式系列产品，一直专注于实木家具的生产与研发以及销售。总部在苏州常熟，随着公司业务不断扩大，于 2015 年在江西玉山国家家具产业园开设第二生产及销售基地，2017 年拥有自己的框距和软包工厂，拥有一体化生产体系。现拥有 15000 多平方现代化厂房，环评达标无忧，引进先进的生产设备，生产工艺技术已具备国际先进水平，适应多品种高品质快速供货服务需求', 3.00, 1, 12, 31, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601431370, 1604046560);
INSERT INTO `p_brand` VALUES (298, 296, 'YM', 2, '尤目', 'https://oss.yiwofa.com/brand/20200930/b7207ab0c812eee45b2958e5b126c83a.png', 'https://oss.yiwofa.com/brand_banner/20200930/9be8438c94d61d9d22c43e4ac7875e7c.png', 'https://oss.yiwofa.com/brand_banner/20201023/4cf25cb61dddd6202865188f3a0e3fef.png,https://oss.yiwofa.com/brand_banner/20201023/e91cfcd8b93cb22c22a974dd81ddce5c.png,https://oss.yiwofa.com/brand_banner/20201023/9b6b12d0c3d8f3cc4a60a37c46e78c87.png', 'yumoor尤目品牌源起\n公元1140年 法国苏遮统长发明了影给麦读，彩给坡境营遗的高照望皇而又意幻神税的效果。立即得到皇室的认可。珐琅彩 玻璃胎画珐琅工艺', 3.00, 2, 105, 108, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1601457171, 1603444418);
INSERT INTO `p_brand` VALUES (299, 299, 'BDGJ', 8, '贝登公爵', 'https://oss.yiwofa.com/brand/20201009/95fb7cffe0563304bb02126dfd0b56ad.png', 'https://oss.yiwofa.com/brand_banner/20201009/220937da0913637780e1b8ee2f7d299a.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/db20d50efa7a0e77f44e0471b25993b1.jpg,https://oss.yiwofa.com/brand_banner/20201030/cb0dba431300a36083c705198c84c18c.jpg,https://oss.yiwofa.com/brand_banner/20201030/30b61f5df6970080dd9617282a2f9c2f.png', 'BUKE OF BEDEN 贝登公爵隶属英国百年奢侈品牌 Craftsman workshop(工匠坊)授权中国唯一生产与销售的集团公司，英国 Craftsman workshop(工匠坊)于 100 多年前创立。早期为皇室 生产木制工艺品为主，之后开始涉及民用家居，到上个世纪八 十年代，专业研发设计和生产儿童家具。是目前英国家居奢侈 品知名品牌。', 3.00, 1, 16, 64, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602209247, 1604046795);
INSERT INTO `p_brand` VALUES (300, 300, 'YSJJ', 1, '与上家居', 'https://oss.yiwofa.com/brand/20201009/7a02b0ac768ab5437e00de95c61dc79d.png', 'https://oss.yiwofa.com/brand_banner/20201009/0e86d8c431f8db86aca20853696078bb.png', 'https://oss.yiwofa.com/brand_banner/20201023/9892f095e56f87b87acc37ad26435648.jpg,https://oss.yiwofa.com/brand_banner/20201023/b9c82f6315ee0902e75d0acbfad30c53.jpg,https://oss.yiwofa.com/brand_banner/20201023/1be3ad070318496a45ae178440fac272.jpg', '广东佛山思品美学家具有限责任公司，旗下与上整体家居，以研发、生产、销售、终端营运为基础，一家集软体家具结合整体软装，为一体的现代化家具企业，公司成立于2011年。与上家居产品涵盖了沙发、软床、床垫、五金配套产品等全系列的家居用品。公司分别成立：佛山龙江工业园与上家居软体事业部，佛山思品美学馆、佛山高明五金配套木制品事业部。专注现代简约、时尚精致的家居风格；坚持自主创新，开放合作；坚持绿色环保，适材适料；以国际最新、最先进的家具制造工艺，为全球客商提供顶级家居产品与服务；并致力于未来家居生活品质持续提升的同时，全力探索、创新与实践家居企业未来发展的新思路与新模式。', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602209991, 1603442510);
INSERT INTO `p_brand` VALUES (301, 301, 'SKT（SKATER)', 2, '斯卡特（SKATER)', 'https://oss.yiwofa.com/brand/20201009/0428c7b057e2630637cb2bc000d8ed4a.png', 'https://oss.yiwofa.com/brand_banner/20201009/e4b1813d6ed1f5261f8e5b846f58d5ea.jpg', 'https://oss.yiwofa.com/brand_banner/20201026/07aa8855fcdd7457046eead42292f2b6.png,https://oss.yiwofa.com/brand_banner/20201026/39f6f9179483005d0beb554b7aa25772.jpg,https://oss.yiwofa.com/brand_banner/20201026/3079c7d5c4b02dd620d1bdc62199f4b3.png', '佛山市顺德区龙江镇绅迎轩家具厂办公室地址位于中国近代明清的天下四聚之一佛山，佛山 佛山市顺德区龙江镇世埠长路工业大道4号，于2010年07月02日在佛山市顺德区市场监督管理局注册成立，在工厂发展壮大的10年里，我们始终为客户提供好的产品和技术支持、健全的售后服务，我工厂主要经营加工、产销：家具。(依法须经批准的项目，经相关部门批准后方可开展经营活动)〓，我们有好的产品和专业的销售和技术团队，我工厂属于佛山家具店黄页行业，如果您对我工厂的产品服务有兴趣，期待您在线留言或者来电咨询', 3.00, 1, 14, 48, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602227202, 1603709896);
