INSERT INTO `p_brand` VALUES (312, 306, 'YZM', 1, '雅挚美', 'https://oss.yiwofa.com/brand/20201011/e7d753694c632e5aa82570368b1b6443.png', 'https://oss.yiwofa.com/brand_banner/20201011/05d8d166d0bd86083f9a9a20b3bf9582.png', 'https://oss.yiwofa.com/brand_banner/20201030/61e03b9819f8c6d856ade84cb12d992d.jpg,https://oss.yiwofa.com/brand_banner/20201030/6a4e94accfec8c2073503e3ca0aa580c.jpg,https://oss.yiwofa.com/brand_banner/20201030/22945f6f9219e5afa369f7127a40e228.jpg', '雅挚美---ARTSYMEN，专注于创造美好生活的家居品牌！佛山市崇雅家具有限公司，始建于1997年，前身是佛山市顺德区雅舍家具有限公司。于2013年正式落户于佛山市高明区，占地100多亩，首期现代化标准厂房建筑面积达60000㎡，总投资超1亿元，已发展成为集研发、设计、制造、销售、服务于一体的家具企业，主营金属玻璃、实木、板式、软体等民用、商用家具产品。今天的崇雅，以“创造美好生活的家居”为使命，致力打造“雅挚美”知名品牌，用质量和服务占领市场。秉承“拼搏实干、诚实经营”的企业精神，崇雅家具将继续夯实基础，完善企业管理机制，强化企业竞争力，实现企业的跨越式发展！', 3.00, 1, 13, 38, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602397013, 1604048357);
INSERT INTO `p_brand` VALUES (314, 307, 'HY', 1, '亨友', 'https://oss.yiwofa.com/brand/20201011/33d0c171646603943af95fb48f28a645.png', 'https://oss.yiwofa.com/brand_banner/20201011/9766896477067d23da76d5516436ed8a.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/b82768fd2c8853f48216176ef95ca3fe.jpg,https://oss.yiwofa.com/brand_banner/20201030/dc04c9449850b9acae887635af4d3aee.jpg,https://oss.yiwofa.com/brand_banner/20201030/0415265f7c75a17452074f129d9dd0b8.jpg', '亨友家具有限公司成立于广东佛山顺德龙江镇，是一家集开发生产销售服务体验为一体的家具企业，主要生产各茶几电视柜餐桌椅等现代家居产品。', 3.00, 1, 16, 66, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602404711, 1604048911);
INSERT INTO `p_brand` VALUES (315, 308, 'FKS', 1, '弗克斯', 'https://oss.yiwofa.com/brand/20201012/1c7756885d5d06cb21a07477bb4964c4.png', 'https://oss.yiwofa.com/brand_banner/20201012/20acffcfaddc4244344642520bc33387.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/e951129fb854caeafcb3c8d346f8741a.jpg,https://oss.yiwofa.com/brand_banner/20201030/6acfde54285268b58b08c3b727f4fd81.jpg,https://oss.yiwofa.com/brand_banner/20201030/1b9439b84fd8b63f55c918d6821973d9.jpg', '佛山市顺德区博斯家具有限公司（原博斯家具制造厂）成立于2006年，位于中国家具制造重镇顺德龙江镇，是一家专业研发和生产真皮沙发、茶几、电视柜、餐桌椅、软床等现代休闲家具的厂家，旗下品牌“弗克斯”。\n弗克斯占地面积10000平方米，员工将近200人，早年专注出口欧美市场，2010年开始出口转内销，凭借多年在欧美出口市场中积累的过硬的生产品质管理能力和成本控制能力，经过3年的艰苦探索，公司于2013年成功转型，现集中精力布局国内2-3线城市，力争用10年时间，将“弗克斯”打造成中国现代休闲家具领导品牌！', 3.00, 1, 12, 27, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602467590, 1604048624);
INSERT INTO `p_brand` VALUES (316, 309, 'HSTB', 12, '赫斯特堡', 'https://oss.yiwofa.com/brand/20201012/3d007849df56a231fbb346dd45ee75af.png', 'https://oss.yiwofa.com/brand_banner/20201012/0268829615f7fddf2f8099adccfeceb5.jpg', 'https://oss.yiwofa.com/brand_banner/20201030/b26ecd8f8317e002b2827e98d1b46335.jpg,https://oss.yiwofa.com/brand_banner/20201030/c42b36166c00f1e7c3381825aa24b12c.jpg,https://oss.yiwofa.com/brand_banner/20201030/7a711d74cc2093501d00c0b93e6006ba.jpg', '深圳华美居家具有限公司创立于1992年，是顶级专注古典实木家具制造商之一，公司拥有近40万平方米的工业园区并投资拥有6亿人民币(1亿美元)设施建设，以德国进口600多套豪迈现代化生产设备，年产量超过十亿人民币(2亿美元)，并且是行内第一家通过CQC绿色环保”ISO9001质量认证”。公司产品远销美国，欧洲，加拿大，俄罗斯，韩国和中东等的个国家。', 3.00, 1, 17, 72, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602485953, 1604049192);
