INSERT INTO `p_brand` VALUES (321, 311, 'HDJJ', 3, '华戴家具', 'https://oss.yiwofa.com/brand/20201013/c00dac713a45f125b9b605272fdf76e1.png', 'https://oss.yiwofa.com/brand_banner/20201013/6b3cc9f47c6b0d5e3a4adc9debbdeb65.jpg', 'https://oss.yiwofa.com/brand_banner/20201107/b6feb6e312e39a8b3bc84aa970db74d3.jpg,https://oss.yiwofa.com/brand_banner/20201107/3034ef3fce2782721c8555e0513e8156.jpg,https://oss.yiwofa.com/brand_banner/20201107/8fe016c4bad96ac3a1a85a9b0a8ec036.jpg', '佛山市华戴家具用品有限公司主要以实木套房家具研发、生产、销售、服务为一体的现代化大型家具生产企业;自有知名品牌\"华戴北欧\"全实木系列已在国内建立覆盖6万多个销售服务客户群体;公司现有职员达300多人,其中销售业务团队80余人.工厂占地面积3万多平方,两大仓库每月库存不低于1500万,年销售额高达上亿元;我司自研发团队成立以来,独家自主研发外观专利产品60余项,为满足现代消费者制造出不同层次的北欧个性化需求产品;我们坚持以人体功能学、力学、美学为原理的家居环境概念巧妙融合为一体,获得广大实力派经销商及国内外客户的一致认可;我们秉承\"以客户为本、以市场为根\"的经营发展为核心理念;产品重点打造功能与舒适为为导向的高端产品，融入中西方文化相结合，演绎北欧简约时尚潮流，引领北欧家居文化风向标；欢迎工程装饰渠道，房地产开发渠道，公寓配套工程单位洽谈采购本厂产品，华戴家具更舒适的高端家具。', 3.00, 1, 18, 76, 0, 1, 0, 1, 100, 1000, 0, 0.012, 1, 1, 1, '', 1602561849, 1604744304);
