INSERT INTO `p_brand` VALUES (900, 416, 'AWL', 17, '阿瓦隆', 'https://oss.yiwofa.com/brand/20201207/7b34c052b24cc52a49f305f0d9c50311.png', 'https://oss.yiwofa.com/brand_banner/20201207/5b17b5e0a3400e9141b09dc539e57094.jpg', 'https://oss.yiwofa.com/brand_banner/20201207/7ffad5bddb0d11ba3a35147bc3867265.jpg,https://oss.yiwofa.com/brand_banner/20201207/885931788a0ba8fb2f3a781083f68d5f.jpg,https://oss.yiwofa.com/brand_banner/20201207/2a0622a4a5205c848193608ecc55f377.jpg', '阿瓦隆家具品牌的拼布系列产品款式新颖，用材考究，深受广大品味人士的青昧与喜爱，产品远销欧洲，东亚，东南亚，美洲，澳大利亚，中东，台湾，香港等多个地区。\n是一家集生产、 开发、销售于一体的专业中西餐厅，酒店配套订制家具的生产厂家。 企业一直以来以专注于生产中西餐厅、酒店、宴会、KTV、及金属类家具等配套产品，主要有餐厅卡座、宴会桌椅、实木椅、皮餐椅、吧椅、吧 台，及各类餐厅，产品适用于各类酒店宴会厅、会议室、欧式沙发中西餐厅及各类餐饮娱乐场所。\n佛山阿瓦隆家具厂拥有一支经验丰富、技术过硬的生产管理团队，有着先进的生产设备和完善的生产工艺流程，这为企业提供了可靠的技术、管理、质量与服 务保障。凡在阿瓦隆购买产品的客户都可以随心而定，我们的家具都以客户订制而做，欢迎国内外客户来定，工程单更为优惠，一起来感受阿瓦隆订制的贴心与周到的服务。\n“放心的质量、贴心的服务，只为有要求的您”', 3.00, 1, 12, 29, 0, 1, 0, 1, 100, 4, 0, 0.010, 1, 1, 1, 'https://awalong.1688.com', 1606901750, 1612258513);
