INSERT INTO `p_brand` VALUES (1077, 423, 'UMESJIA', 17, 'UMESJIA', 'https://oss.yiwofa.com/brand/20201209/b5729bbd3c568f9ff106fb4aed3dcd63.png', 'https://oss.yiwofa.com/brand_banner/20201209/29e987f75447a3984d239030e3befd72.png', 'https://oss.yiwofa.com/brand_banner/20201209/bc195f095fb8cc8adf9a9f9d69cf1c50.png,https://oss.yiwofa.com/brand_banner/20201209/4f8c0bc89118cd70f9193bad3c192091.png,https://oss.yiwofa.com/brand_banner/20201209/d4adefb129608d44d4ab809be62f7cf7.jpg', '优美世家（UMESJIA)家具成立于2015年，是专业设计开发生产为一体的拼布系列和北欧休闲定制家具厂家，工厂坐落在全国家具重镇顺德龙江镇。我们一直致力于向全球客户提供高品质的家具产品和定制服务，所有产品从设计，生产，包装到出货的每一个细节都进行严格的把控。只为优质产品和热情的服务，使我们的品质能够达到国际标准！\n家具已经进入定制时代！高定位、高品质及优服务使我们的产品畅销海外各地。至今，我们的拼布系列产品已远销到英国，荷兰，德国，意大利，比利时，美国，澳大利亚，阿联酋迪拜，南非，东南亚以及祖国香港，台湾等等40多个国家和地区。我们始终相信，品质才能赢得市场。\n我们不断努力开发新产品，完善配套服务，提高自身竞争力水平。为大家提供更好更优质的服务！公司立身之本：品质第一，服务至上，诚信经营！同时可以定制工程单，咖啡厅餐厅酒吧等等。\n欢迎定制！欢迎合作！', 3.00, 1, 13, 38, 44, 1, 0, 1, 100, 5, 0, 0.010, 1, 1, 1, 'https://umesjia9102.1688.com', 1607299882, 1612258595);
INSERT INTO `p_brand` VALUES (1081, 425, 'SL', 3, '森邻', 'https://oss.yiwofa.com/brand/20201210/91a49a2bf00ed4fa99cdc17136740d25.png', 'https://oss.yiwofa.com/brand_banner/20201210/e442ae90ee90cd4d4e87286c5c0146e6.jpg', 'https://oss.yiwofa.com/brand_banner/20201210/e4a12697f9d59794b6eed244f6c39195.jpg,https://oss.yiwofa.com/brand_banner/20201210/7e007fc3314d31248731344c1e68fd5c.png,https://oss.yiwofa.com/brand_banner/20201210/fd9a5761ad6c2ba36d1d3c10265ef9df.png', '揭阳市榕城区森邻家具有限公司经营部注册于中国最具活力的广东特区，生产基地位于浙江台洲经济圈，拥有优良的原材料和物流资源。 公司拥有傢俱模具开发、注塑成型、傢俱架体焊接、流水线装配及高效仓储、电商线下运营体系。 简欧傢俱是桌椅为设计、研发、加工和销售为一体的专业傢俱公司，产品涵盖办公电脑椅、室内外休闲椅、餐厅桌椅等时尚宅配佳品。产品的时尚、环保、价格优势 为我们带来了韩国、日本 荷兰、新西兰及东南亚、北欧、中东和北美地区的外贸客户。 公司秉承质优、环保、价优及完善的售后服务，将继续开拓市场，与各界客户保持良好的合作关系，不断开发推出新品和完善产品的服务体系，为您提供性价比更高的时尚产品！ 携手合作！助力您事业的成功！', 3.00, 1, 13, 38, 40, 1, 0, 1, 100, 65, 0, 0.010, 1, 1, 1, 'https://shop06p6207q02420.1688.com', 1607299882, 1614761424);
