INSERT INTO `p_brand` VALUES (1098, 429, 'XRMJJ', 1, '旭日美家具', 'https://oss.yiwofa.com/brand/20201211/fbac11fd93db1f29174f6a7f8b1c91a3.png', 'https://oss.yiwofa.com/brand_banner/20201211/00f7b49b57430ec06f8fc747931aadf5.png', 'https://oss.yiwofa.com/brand_banner/20201211/8386078734d03a6df2583c255ab6c604.png,https://oss.yiwofa.com/brand_banner/20201211/00f7b49b57430ec06f8fc747931aadf5.png,https://oss.yiwofa.com/brand_banner/20201211/5a3b992db3a36fa656660520e6872cc4.png', '深圳市宝安区西乡旭日美家具厂是餐桌、椅子、床、床头柜、沙发、茶几、电视柜、边柜、自主生产、主营北欧风格等产品专业生产加工的公司，拥有完整、科学的质量管理体系。深圳市宝安区西乡旭日美家具厂的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈', 3.00, 1, 17, 72, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://shop33167g0115j64.1688.com', 1607299882, 1607664794);
