INSERT INTO `p_brand` VALUES (1655, 540, 'J', 1, '歆皓爵', 'https://oss.yiwofa.com/brand/20201222/33504924d907c047477f2b56d370404f.png', 'https://oss.yiwofa.com/brand_banner/20201222/7c7f033c2516fd64ae162a4f7f9bdc6d.png', 'https://oss.yiwofa.com/brand_banner/20210225/1d465c504fad0b65d1bbeeb4d8eea111.png,https://oss.yiwofa.com/brand_banner/20210225/5860b734fddabf7e41945f6cb72c8874.png,https://oss.yiwofa.com/brand_banner/20210225/872e8b9d25cb62c0d7848306fc6ef836.png', '我们的名古坊整体家居概念在欧美地区流行多年，基健康环保及科学人性化设计理念是当前世界家居用品的设计潮流。在上海广州和深圳等一线城市地区受到相当部分家居消费者的欢迎并大面积流行。其倡导的生活方式是对传统家具的绝对挑战。使用的全套高管理生产流水线和高档板材、高级五金件组全皆是一和高品质生活象征。其产品在外观设计、使用寿命、环保指标等全部按照国际标准打造。\n\n我们名古坊家具有限公司是集现代新型家具设计、制造、销售、安装、售后服务为一体的企业。主营当前欧美流行的现代主流沙发与配套家具。随着我国经济水平的不断向前发展，人们对家居居住环境的要求越来越高。传统家具在款式和环保性能上越来越不适应现代人的居住要求。我们的整体家居设计观念反对落后家居观念而倡导现代健康环保，时尚、潮流的家居消费理念。公司拥有5000平米家具制造厂和高端精品家具设计工作室。针对高端家居市场提供高品位沙发与配套家具。系列家具专业提供私人化家具订制，将家具设计纳入室内装修设计过程。可充分利用房屋空间进行外型及功能设计。产品以高级金属框架和高档板材搭配组合，安装拆卸快捷方便，并全部在工厂完成加工生产，有效避免传统家具现场制作产生', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 109, 0, 0.010, 1, 1, 1, 'https://migufang.1688.com', 1607906152, 1614765412);
