INSERT INTO `p_brand` VALUES (4036, 678, 'JY', 1, '家逸', 'https://oss.yiwofa.com/brand/20201224/f92b3519dce25eff4eb2b91752bebff3.png', 'https://oss.yiwofa.com/brand_banner/20201224/658aece1c648adfb18494367c33ac14f.jpg', 'https://oss.yiwofa.com/brand_banner/20201224/b15244f35ef090e979c8a9e3c3369adc.jpg,https://oss.yiwofa.com/brand_banner/20201224/689e6e032b17645b75c261dabd87f9fa.png,https://oss.yiwofa.com/brand_banner/20201224/1f3fdaa1975b31ec548fa593ca106cbb.png', '山东睿帆工艺品有限公司成立于2007年，是一家专业生产木制品，柳制品，草制品的企业，工厂位于中国“牡丹之乡”山东省菏泽市，中国林产品加工基地，山东省曹县工业园区。\n我公司主要生产鞋柜、换鞋凳、床头柜、梳妆台、化妆柜、衣帽架、餐边柜、餐桌椅、电视柜、休闲懒人沙发、置物架搁板装饰收纳等小家具产品，配套加工草柳编工艺的收纳篮储物筐等，产品品类繁多，款式新颖、时尚，以日韩风格为主。\n公司拥有厂房、仓库面积5万多平方米，300多个工人，30多台套机器设备，20余人的销售团队和一个产品研发部门，我们追求美化、健康、环保相结合的可持续发展的战略理念，大力发展绿色小家具产品。\n我们生产的小家具产品在全省销量第一，在全国销售市场中，也占据领先地位。我公司的全部产品出口至英国，美国，法国，德国，澳大利亚，日本等120多个国家和地区。我公司以其产品新颖的款式，精湛的工艺及完美的品质赢得了众多海内外客商的赞誉。\n我公司是重合同，守信用企业，始终以服务于客户为宗旨，以质量求生存，以效率求发展。真诚的欢迎国内外各界人士来司考察，交流，互惠互利，共谋发展', 3.00, 1, 15, 397, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://sdrfgyp.1688.com', 1608711794, 1608740677);
