INSERT INTO `p_brand` VALUES (4192, 681, 'SBZ', 1, '十八纸', 'https://oss.yiwofa.com/brand/20201223/7c9150ba9a249cc9d4809a07b90055cd.png', 'https://oss.yiwofa.com/brand_banner/20201223/dd255d9d6b52b85f1c9f3fd5105c9c53.png', 'https://oss.yiwofa.com/brand_banner/20201223/d78713f1a370cb75c117435dffce1796.png,https://oss.yiwofa.com/brand_banner/20201223/28b79416eea36543e6174fe527c9a2b7.png,https://oss.yiwofa.com/brand_banner/20201223/ca84852745e7c2a5a588aaa6d8994564.png', '公司介绍：\n十八纸，致力于探寻纸艺的无限可能，十余年匠心执着与探索，荣获德国iF设计大奖、德国红点奖、上海创博会金奖等数十项荣誉，持有欧盟、日本、美国、中国等国内外50多项专利，出口法国、意大利、德国、英国、日本等30多个国家。\n\n设计理念：\n采用特制牛皮纸黏合成蜂巢结构，创作出时尚环保、便携可折叠的风琴式纸家具，每一款产品都力争突破传统，期望给小伙伴们带去未曾有过的趣味体验、时尚美颜、便捷生活\n\n公司荣誉和历程：\n2008年—获北京青年创意周“最具创意奖”、“最佳人气奖”\n2009年—获国家实用新型专利一项和外观专利三项\n2010年—创业失败，南下深圳\n2013年—卷纸重来，二次创业，成立公司，注册“十八纸”商标\n2014年—登陆《交换空间》、《快乐大本营》、《生活面对面》等节目\n2015年—成为《淘宝十二周年庆》全球视频推广六组合作伙伴之一、获北京798创客创意之星作品大赛“优秀之星”\n2016年—获2016德国IF设计大奖/2016德国红点奖、两项PCT国际专利 \n携手中国国家博物馆推出国画艺术纸凳，获邀参加北京文博会/摩登上海设计展等\n2017年一获上海创博会金奖/获2017', 3.00, 430, 0, 0, 0, 1, 0, 1, 100, 89, 0, 0.010, 1, 1, 1, 'https://shibazhi2014.1688.com', 1608713965, 1614763796);
