INSERT INTO `p_brand` VALUES (5507, 693, 'HY', 1, '汇宜', 'https://oss.yiwofa.com/brand/20201225/68e87b30a02864223bbe88c5a9b90884.png', 'https://oss.yiwofa.com/brand_banner/20201225/d3c4858c3927b3e992610b70df9effd8.jpg', 'https://oss.yiwofa.com/brand_banner/20201225/80d6fcae350619da77bf8bb36e0dd0b9.jpg,https://oss.yiwofa.com/brand_banner/20201225/467dc1368e1498eef44ff0c525db47f3.jpg,https://oss.yiwofa.com/brand_banner/20201225/d3c4858c3927b3e992610b70df9effd8.jpg', '佛山市汇宜家具厂位于广东省佛山市乐从镇，专注于五金和岩板家具研发设计、生产销售、技术服务、营销策划、管理咨询。公司提出”环保可持续新型材料的理念“，扩大了五金和岩板的应用范围，依托成熟的制造工艺，把资金和精力投放到产品个性化设计和创新上，从而提升岩板家具的产品附加值，实现“五金定制，岩板集成”的大家具品牌理念。让岩板家具可持续发展、循环利用，为国家节能与环保贡献一份力量。 公司引进国外先进的表面处理设备，使材料具有木材天然的纹理和质感，色彩丰富、选择多样。严格把控每一道工序的检测并重视为客户服务，方案创意设计和后期工艺制作，完善售后服务力求客户的满意度，让顾客拥有健康、高端、温馨的居家生活环境，产品专业生产加工的公司，拥有完整、科学的质量管理体系。佛山市顺德区汇宜家具厂的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://shop2v0248t096123.1688.com', 1608770546, 1608891003);
