INSERT INTO `p_brand` VALUES (17851, 768, 'MSFN', 17, '玛斯菲诺', 'https://oss.yiwofa.com/brand/20201225/e5007e63d00f364867bac06273f54f77.png', 'https://oss.yiwofa.com/brand/20201225/ff857d9cb2e0183cfa342b7c276a7514.png', 'https://oss.yiwofa.com/brand/20201225/3c1b6dcd618a16c0262baa025423dd08.png,https://oss.yiwofa.com/brand/20201225/4bfc26cefb1162bb10c118f4a5c6f897.png', '深圳市玛斯家具有限公司的成立是定位于定制高端配套工程家具的品牌企业，主要以创新，个性，创意风格为理念，专业生产样板房家具、售楼处家具、会所、别墅豪宅、酒店、KTV夜总会、高档酒吧餐厅等多种风格配套工程家具。工厂在2002年就开始从事定制配套工程家具，已经有十一年，工厂座落在交通便利，全国家具生产基地—深圳龙岗区。工厂拥有七千多平米的厂房，员工150多人，拥有一批先进的进口生产设备及成熟的家具生产技术和一批高素质的专业设计人员，能很好的与甲方设计师沟通，充分领会其设计理念，将其设计意图完整地在家具上体现出来，在家私的比例、颜色、形状细节上，准确地体现图纸的要求；另外还有一批手艺精湛，工作负责的样板师傅，他们有很强的识图能力，很细致的手工，能真实地还原图纸的每一个细节予其家私作品之中。 \n以下是部分我公司作品： 惠州中信地产水岸城售楼处及样板房 福建省福清宏彬豪华车行 诸暨浦阳江一号样板房 禧园工程案例样板房 南京东方熙龙山院样板房 龙城一品样板房 福田水木澜山样板房 罗湖峰度天下售楼处及样板房 蛇口洛德假日花园样板房 罗湖花半里别馆样板房 西丽花半里样板房 蛇口泛海拉菲售楼处及样板房', 3.00, 1, 16, 404, 0, 1, 0, 1, 100, 10, 0, 0.010, 1, 1, 1, 'https://shop1369414591333.1688.com', 1608785520, 1612258930);
