INSERT INTO `p_brand` VALUES (30447, 866, 'CFS', 1, '驰凡诗', 'https://oss.yiwofa.com/brand_banner/20210105/d5fa0652523fe32608f04560ef00acf1.png', 'https://oss.yiwofa.com/brand/20210105/8bc52b29dbaf2317d7594eaf166b4f9d.png', 'https://oss.yiwofa.com/brand/20210105/b8395f062740222563f3978116e199b9.png,https://oss.yiwofa.com/brand/20210105/4b24b93c0bfad81e61afd5eb236191d9.png,https://oss.yiwofa.com/brand/20210105/164aacd7bccc7f60b7c88a232a534758.png', '福州一心家居工艺品有限公司位于福建省最大的工艺品生产地福州闽侯县，闽侯县工艺品多出口欧美市场，因为其优良的做工，一直被线下零售店以及线上网店所青睐，故而很多工厂将工艺品的销售搬到网络上，走量一直很大。\n福州一心家居工艺品有限公司现有厂房面积1千多平方米，专业技术人员20人以上，其中从事多年工艺品制作的老师傅占百分之七十以上，是挂钟、挂饰等工艺品的专业生产加工的公司，首先公司拥有自己的生产工厂以及长期合作的原材料供应商，省去中间价格，故而产品价格优惠，其次公司拥有一大批经验丰富的的专业人才，集设计与制作完整于一体，最后公司拥有完整、科学的质量管理体系。公司定期组织设计和技术人员会议，针对产品质量以及产品款式的问题开会研究，所以对国内外的工艺品市场了如指掌，也在根本上降低产品成本，因此公司生产的产品因为价格合适，款式超前，一直受到海内外客户的认可，公司的诚信、实力和产品质量获得业界的。因为公司有自己的工厂，所以承接大单，且量大从优，欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 3, 148, 212, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://shop1483635102181.1688.com', 1609405637, 1609834796);
