INSERT INTO `p_brand` VALUES (31759, 871, 'KDMLJJ', 2, '凯德美里家居', 'https://oss.yiwofa.com/brand_banner/20210105/0f27636fee5853fdeca945cc1bc6aab5.png', 'https://oss.yiwofa.com/brand_banner/20210105/1c0729a2e46115883a4ab44450096797.png', 'https://oss.yiwofa.com/brand_banner/20210105/aed9620f48595685ed5ba0746f09ed2a.png,https://oss.yiwofa.com/brand_banner/20210105/3197c8191e02865270b180a12737172d.png,https://oss.yiwofa.com/brand_banner/20210105/8a552810bfdfa263dad558514aa5b06c.png', '凯德美里家居（KEDMERI）专注于现代轻奢家居饰品的设计，生产，销售和陈列。用心打造每一个细节，独具匠心打造出别致造型，给你不一样的艺术感。\n我们拥有一支具备国际视野的设计团队，穿梭于各大家居展会，收集最新潮流趋势，使得产品的开发保持着快速的更新，并且始终走在潮流的前沿。\n身处在行业的朝阳时代，我们凯德美里将遵循着：“品质”、“多赢”、“创新”、“进取”的核心价值观。营造国际化的家居文化气氛，为传播品牌文化，造就美好的艺术生活空间而不断地努力。', 3.00, 3, 139, 171, 0, 1, 0, 1, 100, 4, 0, 0.010, 1, 1, 1, 'https://shop0j54215640207.1688.com', 1609405982, 1614759270);
