INSERT INTO `p_brand` VALUES (33914, 884, 'XTHD', 17, '西苔花岛', 'https://oss.yiwofa.com/brand/20210413/ae48c906ed469d981521bdffce13ef6f.png', 'https://oss.yiwofa.com/brand_banner/20210413/7df037e6f260f328e66561a0a9281536.png', 'https://oss.yiwofa.com/brand_banner/20210413/29adc104988a4940399cce42ecd14492.png,https://oss.yiwofa.com/brand_banner/20210413/c3c4a46baa3c7d44304a0e79bebf0ad2.png,https://oss.yiwofa.com/brand_banner/20210413/412920abbee7e31df8f6cd56a3d1f131.png', '西苔岛，古希腊神话中爱神维纳斯的诞生之地，更是爱与诗意的源头。西苔CANDLE——一个始于2018年的年轻品牌，致力于将希腊神话中的爱与美好融入现代生活，追“烛”	花艺与香气的完美邂逅。 \n品牌立足于十余年专注花艺礼品的行业经验，将花艺设计与香薰蜡烛相结合，开创花艺香薰蜡烛这一崭新的产品体系。公司拥有强大的设计团队、高效的生产线以及强大的仓储物流能力，同时，可结合C端客户需求配套一系列宣发文案及场景化的产品图片，坚持围绕客户需求持续创新，为推动花艺礼品行业的发展不懈努力。', 3.00, 3, 138, 169, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://shop2472823371t95.1688.com', 1609723906, 1618300412);
