INSERT INTO `p_brand` VALUES (37897, 919, 'JX', 1, '吉喜', 'https://oss.yiwofa.com/brand/20210125/eaaf9929e3d6ee75aff075b8c616c522.png', 'https://oss.yiwofa.com/brand/20210125/3e2a69046b4b4a145b8363e176a2bb6b.png', 'https://oss.yiwofa.com/brand/20210125/3e2a69046b4b4a145b8363e176a2bb6b.png,https://oss.yiwofa.com/brand/20210125/233531c4756fb23d7fb8129286c15399.png', '中山市吉喜灯饰有限公司是一家集产品品种多元化，管理体制现代化，销售网络国际化，生产分工专业的大型工程照明灯饰生产企业，工厂座落于中国灯饰之都广东省中山市古镇镇，占地5000多平米，产品齐全，技术力量雄厚，工艺设备先进，与时俱进，超越常规理念，发展绿色照明，产品畅销国内外，每年都能推出最新最美的精品灯具，供客户选用。 公司产品线集高端家居照明、酒店工程照明、商业亮化照明产品于一体，打造了全面而精致的产品集群，致力打造全球酒店工程顶级制造商。公司产品涵盖水晶灯、LED水晶灯、客房灯、云石灯、全铜灯、欧式古典灯、羊皮灯、布艺灯、欧式蜡烛灯及各类工程非标灯饰。 公司由于受到社会各界的大力支持，生产照明产品已形成多系列品种的生产规模，“吉客”产品在德国，美国，英国，法国，西班牙，意大利，荷兰，瑞典等2 0多个国家已享有盛誉，并已通过IS09001质量体系认证和欧盟C E认证及CCC', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://jixidengju.1688.com', 1609754382, 1611577203);
INSERT INTO `p_brand` VALUES (37947, 920, 'RY', 1, '荣灏洋', 'https://oss.yiwofa.com/brand_banner/20210226/679f3bb7dbb53e2632fe869eba773b86.png', 'https://oss.yiwofa.com/brand/20210125/733d9942932b13ca4d31d31ba1d958c9.png', 'https://oss.yiwofa.com/brand/20210125/301ef968867910b3bbf3928d6bf6dea6.png,https://oss.yiwofa.com/brand/20210125/2fb4ca1f56577c6744b7348d10835ea7.png,https://oss.yiwofa.com/brand/20210125/4aa5de9808545c8638c238ac7ba47076.png', '深圳市荣灏洋科技有限公司是一家集产品研发、设计、制造、销售于一体的灯饰照明企业，公司总部在深圳，研发与生产工厂位于灯饰之都--中山，坐拥得天独厚的地理位置和便捷的交通环境。\n公司自创建以来，凭借优质的产品品质、创意的设计理念、卓越的服务精神，赢得了广大经销商和消费者的认可和喜爱，产品不仅热销售于国内，还出口于海外东南亚以及中东各地，始终专注于LED家居照明，主营产品有吸顶灯、家庭客厅吊灯、餐厅灯，镜前灯、壁灯、台灯、等各种家居照明产品以及工程照明产品等各种灯饰光源配件，为消费者提供多元化、全方位的家居照明解决方案。\n公司一直秉承着‘诚信经营，客户至上，品质至上，服务好每一位客户’的宗旨，以确认，确认，再确认’的工作理念，产品坚持以科技为依托，以低碳、节能、环保为重点，以设计为灵魂，不仅注重产品与技术的创新，以标准化的生产来融合世界照明艺术的大潮流，致力于打造现代化的温馨、优质的家居照明。\n公司多年来我们一向注重技术人才的培养。凭借优良的技术和良好的信誉，使之我们的团队不断的成长壮大。我们的灯饰产品主要应用于以下场所：家庭、酒店、宾馆、会所、酒吧、夜总会，室内室外等场所。', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://szronghaoyang.1688.com', 1609754395, 1614326589);
