INSERT INTO `p_brand` VALUES (38350, 924, 'HGDS', 1, '慧谷灯饰', 'https://oss.yiwofa.com/brand/20210107/12286a80545bbe6ba5e65d3b28ead6a4.png', 'https://oss.yiwofa.com/brand_banner/20210107/f8d0278067d0766e11c2ef9feec92898.jpg', 'https://oss.yiwofa.com/brand_banner/20210107/2dd932780e81f74c52d0c90854b53690.png,https://oss.yiwofa.com/brand_banner/20210107/4385feb6bad7da27de29ad0d27b1244b.jpg,https://oss.yiwofa.com/brand_banner/20210107/276721e2166135d705a416a139473101.jpg', '　　中山市慧谷电子科技有限公司成立于2009年，座落于素有中国灯饰之都美称的中山市古镇，是一家集生产、研发、销售于一体的大型专业照明企业，在行业市场上一直处于发展的领先地位。公司在专业化与全面化并进的轨道上稳健发展，目前公司拥有一支专业的研发团队，完善的生产管理体系。拥有\n铝型材生产车间，组装车间，老化车间等，企业员工200多人，公司多年来一直坚持以“诚信经营，客户满意”为经营理念，以高品质的产品低廉的价格来赢得客户与用户信赖，力求真材实料工艺精益求精；公司始终坚持用户的利益高于一切，坚持产品价值的最大化，为用户设计符合市场发展趋势和时代潮流的产品；致力于打造一个高性价比家居照明名牌，服务客户和回报社会。\n　　目前公司的产品主要系列有：工业风吊灯系列、吸顶灯系列、铝材压克力灯系列、厨卫灯系列、节能灯系列等，销售网络遍布全国各地。多年来，公司始终秉承以开拓全国市场为目标，让中国的百姓都能用上质优价廉的灯具产品，同时，通过丰富的产品系列、优质的服务、完善的售后体系，赢得公众的信赖。\n　　中山市慧谷电子科技有限公司将以崭新的形象，带领全体员工奋发图强，积极拓展新兴市场，实现新飞跃！同时，也', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 117, 0, 0.010, 1, 1, 1, 'https://huigu8.1688.com', 1609754536, 1614765601);
