INSERT INTO `p_brand` VALUES (38501, 926, 'GMDS', 11, '光美灯饰', 'https://oss.yiwofa.com/brand_banner/20210226/635ba358d0b51d9b0e607d131544165f.png', 'https://oss.yiwofa.com/brand_banner/20210107/afb3c2e1f9ba03036f1b70c15b6599bc.jpg', 'https://oss.yiwofa.com/brand_banner/20210107/fae6ad68ac8a0253694a95dd19dd0f8e.png,https://oss.yiwofa.com/brand_banner/20210107/8bc6d30ecc1a3613a77133c4d615c80a.png,https://oss.yiwofa.com/brand_banner/20210107/b58cf36e0717f2c540910a0581a509d7.png', '中山市光美灯饰有限公司， 成立于2015年。公司位于中国最大的灯饰生产基地---中山古镇。\n公司拥有专业的设计开发团队，优秀的销售团队和管理团队，售后服务部门，以及勤劳的生产员工。专业生产、承接、设计、安装：星级酒店、高档会所、豪华别墅、KTV、办公楼等室内照明灯具工程.产品相继通过ISO9001质量体系认证、中国强制产品认证（CCC）、“CE”等权威机构的认证。在2016年的灯都照明质量评选中，荣获“灯都照明行业质量50强”。\n光美灯饰自创立以来，产品一直自产自销，秉承坚持走高品质路线。一直秉承以人为本，尊重客户，追求卓越，以德治厂的领导方针。产品质量精致上乘，工艺精美。在灯饰同行中，光美灯饰产品略高一筹，极具特色。在业界有极好的口碑，倍受资深建筑设计师和观众的喜爱。\n愿我们的新老客户，四海朋友，一如既往地支持我们，互惠互利，携手合作，共创光美灯饰辉煌明天！期待与您的合作! 共创双赢!', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://zsgmds.1688.com', 1609755011, 1614323664);
