INSERT INTO `p_brand` VALUES (39308, 930, 'RN', 1, '瑞霓', 'https://oss.yiwofa.com/brand/20210106/bd748b11947c3c77975b5b4105ab09ba.png', 'https://oss.yiwofa.com/brand_banner/20210106/3e3ee1ef165c3d1ec68245d6fb9ee3b8.png', 'https://oss.yiwofa.com/brand_banner/20210106/91bc6bcb113795437960a4f532d7567f.jpg,https://oss.yiwofa.com/brand_banner/20210106/3ba1f9fbdc3e1694926217c00a1fcc9a.jpg,https://oss.yiwofa.com/brand_banner/20210106/c73cbe5cc3a8ac204d36a44c8bef2091.jpg', '中山市德钰科技有限公司（前身是中山瑞霓光电科技有限公司）2014年09月, 成立于中国灯都----广东省中山市古镇，公司现有员工100多人。专业致力于设计师灯饰的设计、制造和销售，服务于一体的新型照明设备企业，专业提供照明系统的解决方案和服务。\n公司经营以下 “瑞霓” 系列产品：\n1),吊灯系列: \n2),落地灯、台灯系列;\n3),LED灯系列:LED筒灯, LED吸顶灯,ED壁灯,LED点光源,LED球泡灯等; \n我司产品的照度、均匀度、安全、防水、防尘等各项指标完全达到国家相关标准；公司产品通过了CCC、CE、ROHS权威机构的认证。 \n公司每一款产品都是将专业设计理念与先进的照明技术融为一体, 是室内装饰照明、商业照明、室内家居照明的理想选择。', 3.00, 2, 539, 0, 0, 1, 0, 1, 100, 127, 0, 0.010, 1, 1, 1, 'https://ruinee.1688.com', 1609755622, 1614765845);
INSERT INTO `p_brand` VALUES (39359, 931, 'HZM', 1, '华之美', 'https://oss.yiwofa.com/brand/20210125/2c9ef63fc9fc103fae3d23254fa7053e.png', 'https://oss.yiwofa.com/brand/20210125/a2c83c1056143ea466027a976f9d9fd8.png', 'https://oss.yiwofa.com/brand/20210125/772a91038c321e87589cbb625d11d507.png,https://oss.yiwofa.com/brand/20210125/fc8902eccd33605953bf72b710fb2c3b.png', '公司简介：\n       深圳华之美照明电器厂位临于国际上著名的灯饰生产基地、深圳市宝安区&amp;mdash;松岗，公司规模以室内的灯饰产品开发设计、成品生产和加工的模式，集研发、生产、销售为一体的多元企业.包括室内家居灯饰照明/商业照明以及其他集成照明解决方案，主要产品有吸顶灯、吊灯、台灯、墙壁灯、LED光源配套.业务包括批发、零售、网商供货、贴牌生产、外贸出口、工程定制等.价格合理，品质优良，售后完善立足于灯饰市场 。本公司具备灯饰行业以专业化方面的人才精英为基础，以市场导向为目标，以严格品质控制手段的方针，并拥有先进的企业管理方式和生产设备,以质量、价位、服务 为中心，满足广大客户的需求和获得客户的最高评价。企业精神：不断创新、以人为本、追求完美奉献精神：以奉献为乐团队精神：以团队为荣服务精神：以服务取胜专业精神：以专业为本核心价值观：&amp;#39;用智慧创造价值&amp;#39;。我们珍视每个人的专长，具备不断创新意识，你们今天的意见，就是我们明天的进步！深圳市宝安区松岗华之美灯饰照明电器厂的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 90, 0, 0.010, 1, 1, 1, 'https://qq79864347.1688.com', 1609755740, 1611574106);
