INSERT INTO `p_brand` VALUES (40859, 949, 'GYTJ', 6, '归园田居', 'https://oss.yiwofa.com/brand/20210125/4061c46d1d9b518c770600daefc13aad.png', 'https://oss.yiwofa.com/brand_banner/20210125/ac2dffe56177bf7a6ba0463a3d298a66.png', 'https://oss.yiwofa.com/brand_banner/20210226/cbe65d27a9b825535ea698127afc5a73.png,https://oss.yiwofa.com/brand_banner/20210226/5bcf8e5099fbc9d02affb7e4260cd6b6.png,https://oss.yiwofa.com/brand_banner/20210226/b7197669b79ba68305b86d26db34f58e.png', '安吉亚斐灯具厂位于自然风光优美,有&amp;amp;ldquo;中国竹乡&amp;amp;rdquo;之称的浙江省湖州市安吉县，坐落于安吉县梅溪镇月亮山工业园。\n亚斐专业致力于竹木传统产品的研究、开发、生产和销售。立足当地丰富的竹资源，我们不断大做&amp;amp;ldquo;竹&amp;amp;rdquo;字文章，专注竹艺灯饰10年，拥有&amp;amp;ldquo;归园田居&amp;amp;rdquo;、&amp;amp;ldquo;诠竹&amp;amp;rdquo;、&amp;amp;ldquo;竹艺&amp;amp;rdquo;等品牌，覆盖6大类近千款产品，拥有多项国家专利。产品荣获第5届、第6届国际森林产品博览会金奖，第2届国际竹生活跨界创意设计大赛金奖，产品远销欧美、中东、东南亚等多个国家及地区。     \n   安吉亚斐灯具厂秉承&amp;amp;ldquo;感受低碳生活，倡导绿色环保&amp;amp;rdquo;的理念，坚持技术及设计创新，将国际化设计理念融入传统的材料及成品加工和工艺控制，营造一种简洁高雅而时尚的艺术生活氛围。\n   工厂不断与国内外知名设计师合作，创造出视觉鲜明而不失典雅的产品。广泛适用于：时尚专卖场所、休闲餐饮、茶馆、咖啡地带、临时休闲区、时尚工作室、SPA健康保健、休闲疗养中心、住宅类家庭等等。\n   亚斐灯具，重视传统竹编工艺，把握', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ajyfdj.1688.com', 1610528778, 1614354905);
INSERT INTO `p_brand` VALUES (40909, 950, 'SNSDS', 1, '索纳斯灯饰', 'https://oss.yiwofa.com/brand_banner/20210130/f18d6d13b8ff48fa55654e9be7f44973.png', 'https://oss.yiwofa.com/brand_banner/20210125/aff6c74391d4d62b9d6d216aa580ffe4.jpg', 'https://oss.yiwofa.com/brand_banner/20210125/9c5390f719baa6c36023ba232b21dc50.png,https://oss.yiwofa.com/brand_banner/20210125/73a75e3239e77754d286e455ef6ecf0e.png,https://oss.yiwofa.com/brand_banner/20210125/3b629692678cdf5cc858cedc1f8a0985.jpg', '公司介绍\n本公司是专业生产各类民用商用灯饰企业，生产基地位于&amp;amp;amp;ldquo;中国灯都&amp;amp;amp;rdquo;中山市横栏工业区。多年来，索纳斯灯饰一直坚持&amp;amp;amp;ldquo;物美价廉，保障供应&amp;amp;amp;rdquo;为企业的成功之路。\n索纳斯灯饰的四大优势：\n1、	产品造型优势：款式多，款式更新快。\n2、	产品价格优势：（1）工厂位于中山古镇生产之都，有多年的生产经验。（2）工厂在阿里巴巴网上直销产品，无需分担门市租金费用，因而产品得到更大的优惠价格，工厂直接供货，在不影响品质的前提下，确保产品有价格优势。\n3、	产品质量优势：工厂有五金车间，大部分五金也由本厂自行生产，确保产品质量。\n4、	货源优势：工厂备有大量库存，确保及时供货。', 3.00, 2, 545, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop2i92908777527.1688.com', 1610530468, 1611998979);
INSERT INTO `p_brand` VALUES (40959, 951, 'YH', 1, '源卉', 'https://oss.yiwofa.com/brand/20210125/16661d7420512213d5a95825d50c1669.png', 'https://oss.yiwofa.com/brand_banner/20210125/3e4fd79f0f1511e3d92d7dc9d5b95fcc.png', 'https://oss.yiwofa.com/brand_banner/20210125/33c87a463d340616e5093a2bd2962b6d.png,https://oss.yiwofa.com/brand_banner/20210125/b8f5aaca9d4088c0a4776700f962145e.png,https://oss.yiwofa.com/brand_banner/20210125/58a7375e9512ffb6584154295090f077.png', '中山源素科技有限公司位于亚洲灯都-古镇，我们是一家集于设计，生产，销售为一体的生产厂家。主要生产销售轻奢风 港式水晶，后现代，新中式风格灯具。', 3.00, 2, 113, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop022125q945812.1688.com', 1610530664, 1611559418);
