INSERT INTO `p_brand` VALUES (41560, 964, 'HGY', 5, '辉烨工艺', 'https://oss.yiwofa.com/brand_banner/20210116/50940c08b70fed276661a10d768a9820.png', 'https://oss.yiwofa.com/brand/20210116/3c74b2816fafc926978e5d7383a6bd69.png', 'https://oss.yiwofa.com/brand/20210116/e3a9e41efaddfaa0722c2bfb8a0ed3fa.png,https://oss.yiwofa.com/brand/20210116/41b82ec02daff594e1124a36a4f718bd.png,https://oss.yiwofa.com/brand/20210116/1221f89b54c6f0301d0f5583d6aaa05d.png', '二十二年专业，只为品质保证 金华市辉烨工艺品有限公司， 创建于2003年,坐落于亚洲最大的小商品批发市场之称的国际都市——义乌市。 自创办以来经多年不断地发展壮大,现已拥有策划,创新.设计.生产.销售为一体的高水平队伍.产品远销欧美,东南亚等国家.深受客户的青睐. 主要生产木质创意家居产品.以圆形画框为主，各类装饰画框。可定制巨型画框。满足不同客户个性化的要求！公司经营理念：创新带发展，质量求生存，管理促效益，诚信引客户。本公司秉承“顾客至上，锐意进取”的经营理念，坚持“客户第一”的原则，为广大客户提供优质的服务。欢迎广大客户惠顾！辉烨工艺以雄厚的实力，合理的价格，优良的服务与多家企业建立了长期的合作关系。辉烨工艺热诚欢迎各界朋友光临。', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shuangqigongyi.1688.com', 1610591306, 1610801040);
