INSERT INTO `p_brand` VALUES (41660, 967, 'HB', 3, '画堡', 'https://oss.yiwofa.com/brand/20210116/2f9f5c685d47ffee73ca7d7a5af562a3.png', 'https://oss.yiwofa.com/brand/20210116/ea4311012f244f098f5cb61136e94450.png', 'https://oss.yiwofa.com/brand/20210116/50e8f307290434f80e5fc60c85bfba22.png,https://oss.yiwofa.com/brand/20210116/90c86647ec62a24109bb83f9cbfb7cd7.png,https://oss.yiwofa.com/brand/20210116/71ca1a3af754b140b437462eff62a69d.png', '义乌市画堡相框厂， 是专业画类产品开发、生产、销售于一体的实体企业。致力于画类产品的制作生产加工。内销外贸多个地区，受内外客户的一致好评。 我们的经营模式既解决了国内家居实体店小批量进货的难题，又满足了批量市场的步伐。 能够满足客户的多种需求和批量订购，长期承接酒店、宾馆、公寓、家装、画廊实体店、装修公司、外贸公司、 网络代销、等，画类订单。 我们将以诚信、品质、专业的准则服务每个大小客户。 欢迎顾客朋友来电来样生产加 工,我们愿与您虔诚合作', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop2208785822.1688.com', 1610592021, 1610801753);
INSERT INTO `p_brand` VALUES (41710, 968, 'LJSJ', 1, '龙匠饰家', 'https://oss.yiwofa.com/brand/20210116/28ec8186f8ac901bf41be3b9bde3303e.png', 'https://oss.yiwofa.com/brand/20210116/76011ad7f6a98b95f8cd6b0b743c0b13.png', 'https://oss.yiwofa.com/brand/20210116/636b64530eb3a74f1f62992bdbe6d18f.png,https://oss.yiwofa.com/brand/20210116/00b07431c063cdfae1fd26241c917a36.png', '北沐恩工艺品成立于2015年初，一直致力于创意家居的研发、生产和销售唯一的公司。旗下有慕白、龙匠、七佳三个品牌。目前主要从事于创意装饰画和高端实木画框相框的研发生产和销售。目前公司拥有意大利进口Valiani卡纸雕刻机3台，木工用大型四面刨机床2台，精密裁板锯3台，重型多片锯2台，切角机5台，雕刻机3台（其中包括激光雕刻机1台）、钉角机3台等等，公司致力于做最好的原创创意装饰画。 装饰画主要通过对各种镂空卡纸再配合合适的配件，来表达不出不用的意义。对每个装饰画我们都保持着原创，原创设计，原创配色，原创搭配。自有10人的设计团队，就是为了更好的保持原创的可能性，为我们原创提供了更好的有利条件。 高端实木相框画框，主要采用进口美国南方松一级材，经自有四面刨床一次成型做成纯实木高度相框画框，凸显木材纹理，是的每个纹理都是可触摸的，因为纹理的不同，每个相框都是唯一，孤品。无喷漆工艺品，食品级木蜡油', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://hebmoon.1688.com', 1610592229, 1610801986);
