INSERT INTO `p_brand` VALUES (42310, 1090, 'JLM', 3, '家立美', 'https://oss.yiwofa.com/brand/20210117/a7dcf5c02aad11783ed4422d94316693.png', 'https://oss.yiwofa.com/brand/20210117/a7b130a97106cc4fc76a66681b2c0396.png', 'https://oss.yiwofa.com/brand/20210117/95a8e9458899900a591a0c997b633e84.png,https://oss.yiwofa.com/brand/20210117/689e58d20b8d0c830629db8133531c42.png,https://oss.yiwofa.com/brand/20210117/2f97c433cdfabd23d69097ca7cddaefe.png', '本公司前身是为国外某知名商超做OEM生产10年以上的专业工厂，2019年受到国际贸易环境的影响，工厂转型内销市场。公司技术力量雄厚，研发和生产能力出众，目前拥有专业研发技术人员10人，生产工人110人，办公室文职及业务15人，生产厂房面积7750平方，员工宿舍1900平方，办公室300平方。公司的经营方针：以市场为导向，以客户为中心，以产品为基础，内抓品质，外强服务，为客户创造价值，为企业赢得未来。', 3.00, 11, 242, 192, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lsfjjyp2019416.1688.com', 1610604672, 1610868108);
