INSERT INTO `p_brand` VALUES (42510, 1094, 'YKK', 1, '意可可', 'https://oss.yiwofa.com/brand/20210117/8c70bc2c86bbdd070dbdab873301aed9.png', 'https://oss.yiwofa.com/brand/20210117/7e2d9625238b938f1ac5eb11b65a05fa.png', 'https://oss.yiwofa.com/brand/20210117/f859742a215c9c1a6e7cd1adfb3e54fe.png,https://oss.yiwofa.com/brand/20210117/066a92fc007222c1def070e4c2665d9d.png,https://oss.yiwofa.com/brand/20210117/27a57b13cc96bf7146fa7affffdb86ba.png', '聘辍贸易有限公司是一种大规模的经营日用品为主的综合性的零售商业企业， 经营的商品类别（系列）多，同时每类商品（每条商品线）的花色、品种、规格齐全（项目多），实际上是许多专业商店的综合体。一般以大、中型居多；从日用品到食品，从工业到土特产品，从低档、中档到高档品都经营，综合性强，它又是高度组织化的企业，内部分设商品部或专柜，商品部相对独立 ，可自己负责商品进货业务，控制库存，安排销售计划。1862年，法国巴黎的“好市场”是世界第一家百货公司，百年来，百货公司仍是零售商业的主要形式之一。美、日、法等国的大型百货公司，销售的商品多在25万种以上，最高的达到50万种', 3.00, 11, 242, 192, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop1443459341400.1688.com', 1610604991, 1610869413);
