INSERT INTO `p_brand` VALUES (44210, 1128, 'QDDT', 5, '圈点地毯', 'https://oss.yiwofa.com/brand/20210123/b7603c1175e6cc6a2f0e46201b709154.png', 'https://oss.yiwofa.com/brand/20210123/d5159712cf562a49041bdcd112fa1a14.png', 'https://oss.yiwofa.com/brand/20210123/3667d6a05a94010d1ee36a47d4d3fa9b.png,https://oss.yiwofa.com/brand/20210123/63e3fa144b1eee85bb326403a78a65d4.png', '圈点地毯厂，公司成立于2003年清远，厂房面积15000平方米，企业有200多人，有一支年轻、有创新能力的专业技术团队，能面对不同层次的产品要求，迅速有力的做出优质的产品。自2007年起，在广州东圃设立营销中心，在广州、上海、北京设立办事处，面向国内外进行地毯销售以及地毯工程的服务。 我们主要生产、研发手工地毯、酒店地毯、家居地毯、家用地毯、长毛地毯、宾馆地毯、展览地毯、一次性地毯、办公地毯、尼龙地毯、簇绒地毯，拥有“国源”和“圈点”两大系列品牌， 产品远销欧美、中东及俄罗斯。 近年来，我们先后同国内外的一些知名室内设计事务所进行合作。如美国WILSON室内设计事务所，新加坡WILSON室内设计事务所，香港GIL设计事务所等完成多个五星级酒店、别墅、会所等项目。', 3.00, 4, 215, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://quandian.1688.com', 1610622484, 1611373167);
INSERT INTO `p_brand` VALUES (44260, 1129, 'SDDT', 1, '盛达地毯', 'https://oss.yiwofa.com/brand_banner/20210123/823e10d3479300addc674755480ae72a.png', 'https://oss.yiwofa.com/brand_banner/20210123/2e74dbe1ec9ede5fef65fda4f9b42bee.png', 'https://oss.yiwofa.com/brand_banner/20210123/8eef57a16e0aa6370280d17b5975c6b6.png,https://oss.yiwofa.com/brand_banner/20210123/0c4d89b9e9b6bb944bd696864ec237be.png,https://oss.yiwofa.com/brand_banner/20210123/7968a954c59e9b17d254e685fa61c792.png', '天津市武清区盛达地毯厂是地毯、地垫等产品专业生产加工的公司，拥有完整、科学的质量管理体系。是一家生产手工及机织地毯的专业厂家。主要产品有：混纺及晴纶手工枪刺地毯、挂毯、块毯、满铺毯、中国结、葫芦纱、纯丝等机织毯。有中外现代抽象图案。图案美观大方，颜色绚丽多彩。可依客户的不同需求生产不同风格的产品。生产的产品远销海外、艺术品位较高，具有观赏、装饰及实用价值。我厂一贯坚持&amp;ldquo;信誉，质量至上，客户为先&amp;rdquo;的经营理念。积极推行企业管理创新、技术创新和产品创新。天津市武清区盛达地毯厂的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈', 3.00, 4, 215, 0, 0, 1, 0, 1, 100, 53, 0, 0.010, 1, 1, 1, 'https://shop1491065994233.1688.com', 1610622537, 1614761057);
