INSERT INTO `p_brand` VALUES (47911, 1294, 'JYJ', 5, '聚佑佳', 'https://oss.yiwofa.com/brand/20210204/32b5ee63f2d9a22d45a139044f93f16c.png', 'https://oss.yiwofa.com/brand_banner/20210204/9027fe2680947f4d45421a95f6c92a2d.jpg', 'https://oss.yiwofa.com/brand_banner/20210204/d15705118b714e6d504ea40c254cfae1.png,https://oss.yiwofa.com/brand_banner/20210204/3747fede80ad0277778c8c037d4775bc.png,https://oss.yiwofa.com/brand_banner/20210204/9027fe2680947f4d45421a95f6c92a2d.jpg', '佛山市聚佑佳装饰材料有限公司是一家有10年生产经验，有自主研发能力，生产面积超11000㎡的墙面装饰材料生产厂家，生产的皮雕背景墙、硬包、护墙板克服了传统装饰材料易破损、易受潮、易污脏、图案单调、档次低等问题与缺点。 \n   产品不仅具有环保、阻燃、防潮、防霉、吸声除噪、耐磨等优良的品质，而且装饰效果美观，艺术感强。产品在工装和家装市场都有广泛的应用。', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop1132524011666.1688.com', 1612061237, 1612421117);
INSERT INTO `p_brand` VALUES (47961, 1295, 'JNYSBJ', 2, '金牛艺术背景', 'https://oss.yiwofa.com/brand/20210201/3b25b2d36a5d21442530b909bae45792.png', 'https://oss.yiwofa.com/brand_banner/20210201/a036a673c5a9ea23cdc9095bb7ef6251.jpg', 'https://oss.yiwofa.com/brand_banner/20210201/71d1b8fea1fb03c3fade95c6185c247b.jpg,https://oss.yiwofa.com/brand_banner/20210201/755c11be81aa8c513383f34508ac1f00.jpg,https://oss.yiwofa.com/brand_banner/20210201/a036a673c5a9ea23cdc9095bb7ef6251.jpg', '佛山市金纺世家装饰材料有限公司企下(金牛艺术背景）是一家专业生产、设计、销售：独绣背景无缝墙布、皮革布艺整体软硬包背景、皮艺刺绣镶嵌硬包、刺绣大板硬包背景、浮雕刺绣背景制造厂家，公司拥有世界先进的生产设备和技术，因好的质量产品在业界已享有美好的声誉，产品远销欧美、中东、港澳台地区。(金牛艺术背景）产品给你营造一个温馨、和谐、喜庆的家居。\n\n(金牛艺术背景）2018年初，开始准备全新的背景墙产品，进军国内市场。投巨资从国外引进先进设备；人员方面：引进业内十几年开发经验的产品开发设计师，引进经验丰富的管理人员和专业的生产人员；开发出大批硬包背景墙、刺绣系列背景墙。\n\n(金牛艺术背景），将以：创新设计、图案新颖、质量保证、交货周期短、运输便捷、安装快捷等优势，贴心的为您服务！\n\n“演绎时尚生活，追求自然品质”是金纺世家的企业理念；\n\n“以服务求生存，以质量求发展”是金纺世家的经营方向；\n\n选择金纺世家、选择财富！(金牛艺术背景）期待与您的互助，以到达双赢的彼岸！', 3.00, 8, 349, 581, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://jnhome.1688.com', 1612061599, 1612171056);
