INSERT INTO `p_brand` VALUES (50213, 297, 'POESY', 1, 'POESY', 'https://oss.yiwofa.com/brand/20210202/49d571cf3003aa3f41f44d4663853b34.png', 'https://oss.yiwofa.com/goods/20210131/2c30d1192016489189a26bc73ccc0f53.jpg', 'https://oss.yiwofa.com/goods/20210131/2c30d1192016489189a26bc73ccc0f53.jpg', 'POESY高端家具品牌创立于2008年，其坐落于中国最大的家具生产基地--中国广东省。是集设计、研发、生产、销售为一体的家具企业，我们秉承着“设计源于生活而高于生活”的设计理念，始终相信设计在于创造，勇于创新、设计的实现，必须依托于现实。设计源于生活，细节成就品质!产品遍及中国大地和欧洲、美洲、大洋洲、非洲、亚洲等30多个国家及地区，在中国乃至全球家具行业中享有较高地位。产品以沙发为主力阵容，涵盖柜类(电视柜、茶几)、桌椅类、沙发座椅类、床类。POESY是典型的家居企业，是国际家具行业里的领域者。公司一直追求自己的设计风格，简约而庄重，前卫且经典，一直保持着对现代风尚生活得敏锐触角。现代化、量化的生产模式让它在现代生产中脱颖而出。\n       秉承“简约而不简单”的设计理念，简洁明快，色彩亮丽，轻松自然，品味超然的设计风格，使意式的现代设计艺术与国内的现代生活潮流完美的结合起来，从而营造出了新生活、新色彩、新享受的新一代高品味生活得美好形象。', 3.00, 1, 12, 23, 0, 1, 0, 1, 100, 1, 0, 0.000, 1, 2, 1, '', 1612254082, 1612258256);
