INSERT INTO `p_brand` VALUES (51113, 1413, 'MZJJ', 3, '蔓臻家居', 'https://oss.yiwofa.com/brand/20210207/e14590a6c1dac617934b0f32c7519d5b.png', 'https://oss.yiwofa.com/brand_banner/20210207/120e5c84cee3cca9781706faefecb43b.jpg', 'https://oss.yiwofa.com/brand_banner/20210207/fbc746f51a51c6eae045d7d9fb4859f1.png,https://oss.yiwofa.com/brand_banner/20210207/fc27248fca08c96577fc80c9d34d412c.png,https://oss.yiwofa.com/brand_banner/20210207/120e5c84cee3cca9781706faefecb43b.jpg', '义乌市蔓臻家居用品有限公司是一家布艺生产及研发的实力工厂。工厂成立多年，自产自销，拥有自己的产品风格路线及设计团队，产品远销海外30多个国家及地区，受到广大客户认可。本工厂拥有自己的现货仓库，海量库存，支持一件代发，同时也可以来料加工和定制。众多客户的选择与支持，成为我们不断成长的动力，我们会继续努力，把控好质量，做出更多客户喜欢的产品，服务好每一位客户。', 3.00, 7, 232, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://yiwumajor.1688.com', 1612264235, 1612690843);
