INSERT INTO `p_brand` VALUES (51663, 1424, 'CY', 1, '楚阳', 'https://oss.yiwofa.com/brand/20210215/e1bb8717f47064c07eeef0256b2c0257.png', 'https://oss.yiwofa.com/brand_banner/20210215/e77bbaaf8e5fb7859e8d1739292f283e.png', 'https://oss.yiwofa.com/brand_banner/20210215/68eb06d7a07361e7722ddedd59ed0d9c.png,https://oss.yiwofa.com/brand_banner/20210215/cf587bea1a9b5d9c5ce9995695906c55.png', '绍兴县楚阳纺织有限公司是一家充满生机和谋求发展，集生产和销售一体的公司，坚持以薄利厚质的理念立足于市场，以开发创新的方式来引领市场的流行潮流。经销批发的窗帘、转移印花、烫金畅销消费者市场，在消费者当中享有较高的地位，公司与多家零售商和代理商建立了长期稳定的合作关系。绍兴县楚阳纺织有限公司经销的窗帘、转移印花、烫金品种齐全、价格合理，公司实力雄厚，重信用、守合同、保证产品质量，以多品种经营特色和薄利多销的原则，赢得了广大客户的信任。', 3.00, 7, 230, 316, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop1385139331760.1688.com', 1612264376, 1613388948);
