INSERT INTO `p_brand` VALUES (56263, 1588, 'G', 11, '晏歌', 'https://oss.yiwofa.com/brand/20210215/d12cff8fdd96eb42f75a15df353fc54f.png', 'https://oss.yiwofa.com/brand_banner/20210215/4ab676a9a22ca3d71f63a52ab2ce023e.png', 'https://oss.yiwofa.com/brand_banner/20210215/5b714eb3e34e95794b498ba7ea05793a.png,https://oss.yiwofa.com/brand_banner/20210215/792721ebeca9439ad055c764b4d964b3.png,https://oss.yiwofa.com/brand_banner/20210215/4ab676a9a22ca3d71f63a52ab2ce023e.png', '佛山市晏歌家具有限公司坐落于国际家具城-广东省佛山市顺德区，公司秉承“以人为本、品质第一”的经营理念，以户外家具产品“专业化”为战略目标，以“创新”精神来营造晏歌；集研发、生产、销售、服务于一体。 \n\n晏歌现拥有高度熟练和敬业的生产团队。我们尝试提供独特的设计，不管是豪华的大酒店还是最小的阳台，我们都可以为您改变任何设计，为您提供真正的定制服务，真正为您提供放松和享受阳光生活的高品质家具。', 3.00, 1, 20, 87, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fsyange.1688.com', 1612964242, 1613388585);
INSERT INTO `p_brand` VALUES (56313, 1589, 'TDKJ', 3, '藤点空间', 'https://oss.yiwofa.com/brand/20210215/2857d3a2acbe4c12772fa7bcb49e2e90.png', 'https://oss.yiwofa.com/brand_banner/20210215/a0660101cfa22e78e6079173b6e4b046.jpg', 'https://oss.yiwofa.com/brand_banner/20210215/67dbbc52492b7d68c9aefc5cb3600803.jpg,https://oss.yiwofa.com/brand_banner/20210215/783834013e29b08fcb7cf8d42ac21bd9.jpg,https://oss.yiwofa.com/brand_banner/20210215/cd52bb64242644234d4e9376f7ad8666.jpg', '佛山市藤点空间户外家具有限公司是集合藤编桌椅、绳编家具、实木元素家具等产品专业生产精加工的户外家具公司，拥有完整、科学的质量管理体系。佛山市藤点空间户外家具有限公司的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、实地考察，进行指导和业务洽谈。', 3.00, 1, 20, 582, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://tengdiankongjian.1688.com', 1612964773, 1613392395);
INSERT INTO `p_brand` VALUES (56363, 1590, 'TYX', 1, '藤悦轩', 'https://oss.yiwofa.com/brand/20210215/130eb35bba7251306c0b463fa610a937.png', 'https://oss.yiwofa.com/brand_banner/20210215/6361843d952a3f465f7e7d88214f6fb9.jpg', 'https://oss.yiwofa.com/brand_banner/20210215/c363e86525a1fd58461cfa591800588d.jpg,https://oss.yiwofa.com/brand_banner/20210215/84aaa1814b67e1c7d83c4042c144df46.jpg,https://oss.yiwofa.com/brand_banner/20210215/b0c31dbb5ee0db5e80560e7d035debe9.jpg', '佛山市悦嘉藤艺有限公司（Foshan Yuejia Rattan Co. , Ltd.），位于”世界家具之都”广东佛山，地处广州、深圳、东莞三市交界地段，环境优美，交通便利，把握市场信息非常灵敏。是一家集设计、生产、销售为一体的家具企业。公司自有藤格格、TengYueXuan/藤悦轩等品牌和相关实用型专利，先后与国内多家酒店工程定制企业和跨境电商公司建立长期稳定的供应合作关系，\n公司主要生产藤编桌椅、藤艺沙发、铝合金外露沙发、餐台餐椅、秋千、吊篮吊床、躺床躺椅以及配套的防水坐垫靠枕等户外休闲家具用品。', 3.00, 1, 20, 88, 425, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fsyj18.1688.com', 1612964779, 1613398816);
INSERT INTO `p_brand` VALUES (56413, 1591, 'F', 17, '钰福', 'https://oss.yiwofa.com/brand/20210215/32963389a56c042c462b94add52bfae4.png', 'https://oss.yiwofa.com/brand_banner/20210215/a74d241deea10db355c065c65e9e5ec3.jpg', 'https://oss.yiwofa.com/brand_banner/20210215/31003f49546bfe93691bbfa4bfef7f06.jpg,https://oss.yiwofa.com/brand_banner/20210215/76130562ff15a26eb8ea2baab0c83b2d.jpg,https://oss.yiwofa.com/brand_banner/20210215/a74d241deea10db355c065c65e9e5ec3.jpg', '佛山市禅城区钰福五金塑料制品厂是藤艺家具、藤椅、吊篮、茶几等产品专业生产加工的公司，拥有完整、科学的质量管理体系。佛山市禅城区钰福五金塑料制品厂的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 1, 20, 582, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fsyfty.1688.com', 1612964784, 1613401457);
