INSERT INTO `p_brand` VALUES (56513, 1593, 'MY', 12, '铭易', 'https://oss.yiwofa.com/brand/20210216/9fe0608c518e163dab3510e24411a972.png', 'https://oss.yiwofa.com/brand_banner/20210216/616f4fb38ab4b7141fde1eaf74b96a73.png', 'https://oss.yiwofa.com/brand_banner/20210216/0968c970c0c161163a7a529e36628a24.png,https://oss.yiwofa.com/brand_banner/20210216/c6c017650922458cecb98315a669b45e.png,https://oss.yiwofa.com/brand_banner/20210216/b6f2e2eea8d08fad1d88478427b9228f.png', '佛山市铭易户外家具有限公司是一家专业研发设计、生产、销售服务及出口贸易高端户外休闲用品、高档藤制品家具及配饰的一条龙服务企业。 公司拥有优秀的设计团队和强大的生产队伍，不断创新的设计理念和原创实力，将品味、价值、艺术有机结合，采用绿色环保全新原料材质，将产品赋予了无以伦比的优雅和尊贵，40年的经历把传统工艺、艺术文化与现代休闲完美结合，编织了一个信念：我们都是编织艺术家。 “设计精品，制造精品”是我们坚持的原则，我们不是最大的，但我们在努力做到最好，我们都为梦想在努力，创造一个属于中国的高端户外家具国际品牌，为改写“中国制造”努力，将不再一味代工制造，而是打造属于自己的品牌。 我们一直在努力制造一个标准，而不是去复制历史传统，先后成功结合欧洲、日韩开发多系列多款不同风格的产品，多元化满足不同市场渠道需求。从设计理念、产品线条、原料材质、配件装饰都有了新和质的创新体验', 3.00, 1, 20, 82, 417, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://mingyitengyi.1688.com', 1612964798, 1613451795);
INSERT INTO `p_brand` VALUES (56563, 1594, 'ST', 3, '三唐', 'https://oss.yiwofa.com/brand/20210216/d6738db88ff58e6e6e1339953578f21a.png', 'https://oss.yiwofa.com/brand_banner/20210216/9cdeafe0338f54569ada0ffc5702754e.jpg', 'https://oss.yiwofa.com/brand_banner/20210216/d0685760ad181fa98b9048e0bce55bd5.jpg,https://oss.yiwofa.com/brand_banner/20210216/84b89257921fcc8e7e65a8c692636baf.jpg,https://oss.yiwofa.com/brand_banner/20210216/9cdeafe0338f54569ada0ffc5702754e.jpg', '三唐家具品牌，诞生于1998年，专业生产坐具，现在是欧美塑料椅品牌。那时的我们是一个家庭小作坊，但我们有梦想，就是让我们的客户坐的更好。 经过这么多年一步一个脚印的发展，现在的我们拥有200多名熟练工人，20多名设计，销售，管理精英。 50000平方米的现代化厂房，35台一流注塑设备，日生产能力达到10000张座椅。出口到美国，英国，德国，法国，日本，巴西，韩国，南非等38个国家和地区。2012年三唐品牌成为伦敦奥组委官方认证座椅供应商和韩国世博会官方指定座椅供应商。 同时三唐品牌取得世界第三方认证品牌瑞士SGS和法国BV的双料认证。得到了这么多，只因有您的支持和厚爱。 不忘初心，让人类【坐】的更好。三唐-从心开始。', 3.00, 430, 436, 525, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bzlhjj.1688.com', 1612964801, 1613453007);
INSERT INTO `p_brand` VALUES (56613, 1595, 'WS', 17, '悟墅', 'https://oss.yiwofa.com/brand/20210216/b12631ecc5a31c3709b968fcbe2bf8a6.png', 'https://oss.yiwofa.com/brand_banner/20210216/094a7d3194e17dd94d59300f2ec20854.png', 'https://oss.yiwofa.com/brand_banner/20210216/54b0f7b30a546cdeee2820e449fa5bcc.png,https://oss.yiwofa.com/brand_banner/20210216/416ee29e213824831b2ce7276db609d5.png,https://oss.yiwofa.com/brand_banner/20210216/6dbd7e8a704ffcfd633ea4e4cc6c850f.png', '佛山市悟墅家具有限公司是休闲户外家具、藤编桌椅等产品专业生产加工的公司，拥有完整、科学的质量管理体系。佛山市悟墅家具有限公司的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 1, 20, 582, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://wushujiaju.1688.com', 1612964807, 1613458746);
INSERT INTO `p_brand` VALUES (56663, 1596, 'QFY', 1, '沁芳园', 'https://oss.yiwofa.com/brand/20210216/62f85b0a4adc9d68d7a52a1c17caede6.png', 'https://oss.yiwofa.com/brand_banner/20210216/41f16b91b21bff5d6e74c4d6c6f0c6a7.png', 'https://oss.yiwofa.com/brand_banner/20210216/cfa3e3c36ca80192a63489a96da37fc3.png,https://oss.yiwofa.com/brand_banner/20210216/fda215840555b019c89ad0b882196254.png,https://oss.yiwofa.com/brand_banner/20210216/41f16b91b21bff5d6e74c4d6c6f0c6a7.png', '佛山市沁芳园五金制品有限公司成立于2012年，是一家专业从事户外休闲家具生产的工厂，拥有独立的产品设计、研发、生产和销售能力，公司座落于美丽富饶的珠三角工业重镇佛山市禅城区南庄镇，莅临国际家具批发大市场乐从仅8公里，公司充分发挥前店后厂的地理优势，及时掌握一线家具市场行业动态，是乐从大市场一家以五金+仿木及铝+特斯林网布为主的生产制造企业，产品成功的走向了世界50多个国家和地区。防水又防腐，亮丽又环保的PS仿木是一种国际消费趋势，是户外木质家具的理想替代品，公司有先进PS板材生产线，同时生产加工销售塑木制品。是您理想的户外家具供应合作伙伴，期待您的光临！', 3.00, 1, 20, 87, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 0, 'https://shop1357578980487.1688.com', 1612964810, 1614256013);
