INSERT INTO `p_brand` VALUES (56763, 1598, 'SS', 3, '树升', 'https://oss.yiwofa.com/brand/20210216/109e8a8708d5328187288832dbe9c960.png', 'https://oss.yiwofa.com/brand_banner/20210216/a23062bfc65c8dae4b77de921abd2beb.jpg', 'https://oss.yiwofa.com/brand_banner/20210216/ee62e1ebb7c8e6f9c5a05d2a8dbd58de.png,https://oss.yiwofa.com/brand_banner/20210216/13e5f7db42c703078451df544d66817c.png,https://oss.yiwofa.com/brand_banner/20210216/6998df8e8cd27d5f4d947f9d6cc1d22f.png', '佛山市树升家具有限公司是一家工厂贸 易一体化的公司，专业从事户外家具设计、开发、生产仿藤、金属销售为一体户外 休闲家具制品的实体企业。主要生产及销售：户外休闲家具、户外花园家具、木制 户外家具、户外编藤家具、休闲桌椅、折叠桌椅、户外休闲椅、公园休闲椅、，以 及专门提供给设计师选材的户外藤椅定制产品；以拓展户外休闲事业为导向，改善 户外休闲环境，将休闲理念带到生活的每个角落。工厂创建于2008年，工厂现拥有 厂房2万多平方米，员工200多名。位于中国**的家具制造产业基地佛山市乐从镇， 是一家藤艺家具、秋千、凉亭、太阳伞等产品的专业生产厂家，拥有完整、科学的 质量管理体系，完善、良好的售后服务体系', 3.00, 1, 20, 87, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shusheng.1688.com', 1612964827, 1613462737);
INSERT INTO `p_brand` VALUES (56813, 1599, 'SparkXB', 6, 'Spark星柏', 'https://oss.yiwofa.com/brand/20210216/137f99d13a1722c27f7143b7e9a4eaea.png', 'https://oss.yiwofa.com/brand_banner/20210216/31e4332b8e920148965ba36bda78a61d.jpg', 'https://oss.yiwofa.com/brand_banner/20210216/dbdf52c2e8db013ecef789849077d416.jpg,https://oss.yiwofa.com/brand_banner/20210216/88e7e99cc1cec046c1b9efd11c0779f9.png,https://oss.yiwofa.com/brand_banner/20210216/a6795036f8b979089babb84602ffc41e.jpg', '佛山市顺泰智能科技有限公司坐落与世界家具之都顺德，本公司公司秉承“顾客至上，质量第一，诚信为本，锐意进取”的经营理念，坚持“客户第一”的原则，致力生产研发,藤铁,铝管，仿藤等各种休闲时尚户外家具。公司自成立以来,一直以出色的研发生产工艺而跻身于世界家具企业强林之中。公司奉行质量第一、顾客至上的质量方针，拥有一流的厂房及完善的生产管理质检系统，保证了产品的质量和供应。产品远销欧美和中东等国家及地区。公司一惯注重科学管理和人才的培养，不断引进各类管理人才和技术骨干加盟，拥有技术一流的产品设计师、生产技师，先进的机械装备水平及研发力量，培养造就了一支技术精湛的研发生产队伍，可以满足客户设计、开发等要求。在经济信息全球化的今天，我们信任和尊重个人，追求卓越的成就与贡献，在经营活动中坚持诚实与正直，倡导企业文化，推行制度建设，依靠团队精神来达到我们的目标，鼓励灵活性和创造性，不断参与市场竞争。', 3.00, 1, 20, 582, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 0, 'https://sparkbenson2010.1688.com', 1612964831, 1614258384);
INSERT INTO `p_brand` VALUES (56863, 1600, 'XCGD', 17, '夕彩光电', 'https://oss.yiwofa.com/brand/20210216/c7eaeb53718dfcadbfa5d88a85be3d8a.png', 'https://oss.yiwofa.com/brand_banner/20210216/2986bd16d92c182ea75f7bc91c6224bc.png', 'https://oss.yiwofa.com/brand_banner/20210216/85e693ca3290bf454ae9d6fff8e6a09c.png,https://oss.yiwofa.com/brand_banner/20210216/b8d5971521d7d5917f4d9728f7b3e916.png,https://oss.yiwofa.com/brand_banner/20210216/41bccadea3db7dd484be0f205d465a20.png', '东莞市夕彩光电科技有限公司是研发、设计、生产、销售：光电产品，塑胶制品，橡胶制品，灯饰，灯具，模具，电子产品；货物进出口、技术进出口。(依法须经批准的项目，经相关部门批准后方可开展经营活动)。 东莞市夕彩光电科技有限公司成立于2014年，坐落于广东省东莞市高埗镇，我们对外提供ODM/OEM/OBM服务，产品涵盖：led智能灯具，led发光家具，led草坪景观灯，led装饰灯，led发光圆球，led发光立方体，led发光桌椅，led发光冰桶，led情景灯等。\n公司旗下拥有自主品牌夕彩，并通过CE/ROHS/PSE/3C/MSDS/UN38.3/产品质检报告等资质，可出口到多个国家。我们专注团队建设，专注客户需求和服务体验，用心做好产品，我们始终以客户的需求为导向，坚持以“低碳环保”为生产理念，放眼世界服务全球客户，让您买得放心用得安心。', 3.00, 1, 20, 83, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://0769xicai.1688.com', 1612964841, 1613483083);
