INSERT INTO `p_brand` VALUES (58064, 1628, 'DYXHWJJ', 3, '大印象户外家具', 'https://oss.yiwofa.com/brand/20210219/3f7b67450305bd682505eedcd64f06e4.png', 'https://oss.yiwofa.com/brand/20210219/bb95c4ff75a08ce040a05bb1d23fdabb.jpg', 'https://oss.yiwofa.com/brand_banner/20210219/4ddf9c096c93834197bb0d1fb3deb427.jpg,https://oss.yiwofa.com/brand/20210219/bb95c4ff75a08ce040a05bb1d23fdabb.jpg,https://oss.yiwofa.com/brand_banner/20210219/ff6f20e873c3a97db1c3a5b6aaf101fe.jpg', '佛山市大印象家具有限公司（Foshan big impression furniture co. LTD）位于“世界家具之都”广东佛山，处于广州、深圳、东莞三市交界地段，环境优美，交通便利，把握市场信息非常灵敏。是一家集生产与销售为一体的藤艺家具公司。主要产品有藤编桌椅、藤编沙发、餐台餐椅、秋千、吊篮、吊椅、吊床、躺床、躺椅、藤编花篮、藤编屏风、藤编养生床以及户外遮阳伞、坐垫等户外休闲家具产品及相关配套物件。 在藤艺家具越来越追求休闲化、舒适化、高档艺术化的今天，大印象家具的产品以它简洁、流畅的线条，匠心独具的设计，在藤艺家具市场拥有一席之位。 我们认真做事、精益求精；努力让每位客户在大印象得到最优质的产品和一流的服务。我们珍惜每一个合作的机会！', 3.00, 1, 20, 582, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop371743y0b2240.1688.com', 1612965092, 1613707420);
