INSERT INTO `p_brand` VALUES (58565, 1639, 'CMY', 13, '臣墨萱颜', 'https://oss.yiwofa.com/brand/20210217/ee3f477053ee7c29d1711b268bef18f9.png', 'https://oss.yiwofa.com/brand/20210217/5398648308ea83ed4b44816e81f1f5a5.png', 'https://oss.yiwofa.com/brand/20210217/59bbd5438f39a2f440dce5613b1281fa.png,https://oss.yiwofa.com/brand/20210217/be19228c8e535bf340513282dfa85243.png,https://oss.yiwofa.com/brand/20210217/4103921f0b708323847340286289a757.png', '义乌市臣墨工艺品有限公司成立于2007年，是一家以开发，生产，销售装饰画，艺术品为主的工艺品有限公司。公司坐落于浙江义乌义亭镇，现拥有员工30余人， 1500平米标准化厂房，年生产各类装饰画30万幅，相框200万个，产品设计理念超前，工艺质量精湛。近年来，公司在生产规模，经济效益，艺术创新，品牌建设上都取得了较大发展，不断引领着国内画饰行业的流行风向。', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 129, 0, 0.010, 1, 1, 1, 'https://shop4k48y34050375.1688.com', 1613113315, 1614765891);
