INSERT INTO `p_brand` VALUES (58715, 1642, 'ZN', 1, '正牛', 'https://oss.yiwofa.com/brand/20210217/c7d2a045a8680f2c4a63c961415994ee.png', 'https://oss.yiwofa.com/brand_banner/20210217/9c0fb3adf1f7acb7d9808f018a32171c.png', 'https://oss.yiwofa.com/brand_banner/20210217/994b4447506d5aea9b061f8577e4f1eb.png,https://oss.yiwofa.com/brand_banner/20210217/8c85372b2bc3263b8f1c16c17d15a059.png,https://oss.yiwofa.com/brand_banner/20210217/c861d617f509d15d1ece4707e7207042.png', '深圳市正牛家居饰品有限公司是客厅装饰画、电表箱装饰画、卧室装饰画、酒店装饰画、玄关装饰画、公司装饰画、宾馆装饰画、家居装饰画、艺术装饰画、优秀装饰画、欧美装饰画、山水装饰画、花卉装饰画、植物装饰画、批发装饰画等产品专业生产加工的公司，拥有完整、科学的质量管理体系。深圳市正牛家居饰品有限公司的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://shop1n815z0916460.1688.com', 1613113580, 1613570099);
INSERT INTO `p_brand` VALUES (58765, 1643, 'BXLP', 1, '柏轩良品', 'https://oss.yiwofa.com/brand/20210217/03212728993a526b09b34c124e1e5631.png', 'https://oss.yiwofa.com/brand/20210217/be66c65d73fd80a97104add310619280.png', 'https://oss.yiwofa.com/brand/20210217/6a436fd5a631f3c024796774420f02f3.png,https://oss.yiwofa.com/brand/20210217/1ddf23177777bf2f5186237511e215e4.png', '上海柏轩工艺品有限公司，原名上海艺睿数码科技有限公司，成立于2006年1月，注册于上海大学科技园区，是2005年上海科技创投的项目之一。\n\n现今，国内的艺术市场虽然呈现出一片繁荣，但是个性化的原创绘画艺术品却仍离普通百姓的生活很远。这并不是因为市场不需要，而是因为原创艺术品的价格还无法为国内普通消费者所接受。从现在国内市场上繁荣异常的画意摄影业就可以看出消费者对于个性化的原创艺术品有着非常强的需求。\n艺睿清楚地看到了中国艺术市场的供求矛盾，一边是对于个性化艺术服务的巨大消费需求，一边却是个性化原创绘画艺术品对于普通消费者的价格鸿沟。艺睿迫切地希望能够解决这一矛盾，想要将原创绘画艺术带进寻常百姓的生活之中。为了解决这一矛盾，在艺睿成立之前的几年中，通过大量的实践和研究，艺睿的创始人总结出一套利用计算机图形图象技术进行数字绘画的创作方法，大大提升了创作效率，从而达到了降低成本的目的。\n现在我们将传统的，自然介质的绘画艺术引入到计算机桌面上，表现出令人惊叹的艺术效果，并通过ULTRAGICLEE设备，将用计算机创作的作品直接打印在油画布上，再经过艺睿独特的肌理工艺进行处理。', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 124, 0, 0.010, 1, 1, 1, 'https://whylzs815.1688.com', 1613113714, 1614765781);
