INSERT INTO `p_brand` VALUES (60265, 1673, 'NOAH', 1, 'NOAH', 'https://oss.yiwofa.com/brand/20210218/b2bd28e2aa931d98e7c79a2bfe9fe19f.png', 'https://oss.yiwofa.com/brand/20210218/bd5192fe485101aa886f5c168e7f0280.png', 'https://oss.yiwofa.com/brand/20210218/09e7b0e4465fa1831e2d2a96739312d1.png,https://oss.yiwofa.com/brand/20210218/418eb96185c3fd014d73e9a162f2b3c5.png,https://oss.yiwofa.com/brand/20210218/e1b7a8620417db1046a2926f02930f89.png', '深圳市诺亚油画工艺有限公司位于中国经济开放前沿城市深圳市，公司自1992年成立以来，经过20余载的持续努力，已经发展成为一家专业生产油画及其相关艺术装饰品的现代企业。 公司的艺术设计与创作团队阵容强大，与国内多家美术院校的老师、以及美国和香港等国家和地区的专业设计师长期紧密合作，致力于一流油画产品的设计。公司拥有专任画师约80人，特约画师超过200人，大部分画师都受训于专业的美术学校，并具有多年的油画绘制经验。无论是在布板上作画，还是在屏风，家具上作画，我们的画师都能绘制出风格迥异、令人耳目一新的作品。我们的工艺继承了中国传统美术的精华，又融入了欧洲古典艺术的风格及欧美现代派的特点，深得国内外客户的青睐和赞誉。 诺亚自建大型油画工厂，拥有油画打样、加工、包装和检测的各种仪器设备。诺亚是深圳大芬油画村工厂化、规模化、标准化油画生产的先驱', 3.00, 5, 221, 0, 0, 1, 0, 1, 100, 71, 0, 0.010, 1, 1, 1, 'https://noahart.1688.com', 1613119010, 1614761559);
