INSERT INTO `p_brand` VALUES (60365, 1675, 'SGYC', 1, '首工艺场', 'https://oss.yiwofa.com/brand/20210216/b579237b143840e67f72808ec82ffb98.png', 'https://oss.yiwofa.com/brand/20210216/84f630b6700425c837c59cb0d44d8297.png', 'https://oss.yiwofa.com/brand/20210216/85e29a470543a9ecd3f8ce05a06e5aa7.png,https://oss.yiwofa.com/brand/20210216/ae5fc99aeafa99121327a1d58720300e.png,https://oss.yiwofa.com/brand/20210216/769a677c7dfdc470c38d6459b6d7ec19.png', '云曦艺术总部设于设计之都深圳，公司专注绘画、综合材料画、实物画、肌理画、装置艺术、雕刻艺术等画品。公司被业界认可拥有自主研发设计、生产和营销等一整套体系的挂画企业。面对国内外高端酒店、房地产样板房、商业空间等艺术品领域，提供配套产品及高端定制服务。\n公司签约高水平的画家和专业画师、油画技师数十人，另外打造了一个纯手工艺的设计制造实物画、肌理画的团队，为公司旗下的“首工艺场”品牌奠基坚实基础。\n公司的使命是“展现艺术之美，分享和传递美”，希望通过我们的“首工艺场”，努力把美好和温馨传递给更多的人和家庭。\n云曦艺术主要服务于软装设计公司、设计方案公司、家具厂、线下实体经销商代理商，特别突出的优势是定制服务，我们在深圳有自己的装裱工厂和作画工作室，样品制作团队，还有专门的设计师对接服务。结合深圳设计前沿优势，公司结合设计潮流更新挂画，成熟的新中式风格挂画，轻奢装饰画、立体肌理画、现代抽象、古典油画等都是我们优势的品种。', 3.00, 5, 218, 0, 0, 1, 0, 1, 100, 79, 0, 0.010, 1, 1, 1, 'https://shop2f192f700v389.1688.com', 1613119023, 1614761712);
