INSERT INTO `p_brand` VALUES (66265, 1795, 'GYQH', 11, '古榆情怀', 'https://oss.yiwofa.com/brand/20210219/cce1d1ef88a0fda25844970cbf5dd0cf.png', 'https://oss.yiwofa.com/brand/20210219/06abeb1c5ffa8b725d0385206796c1a5.png', 'https://oss.yiwofa.com/brand/20210219/4818aa9b8c67f20d2ae9bba337c34c15.png,https://oss.yiwofa.com/brand/20210219/1f457eff671cca04113753d01ce61f05.png,https://oss.yiwofa.com/brand/20210219/b90d9d1b279fc2b6e5db44cd62ca8037.png', '古朴年代（北京）家居有限公司是一家集产品研发生产、项目设计、市场营销、服务于一体的家具公司。公司创立于 2013年，依托自身的实木家具工厂起步，做工精湛、工艺严谨。传承文化与工匠精神，采用传统榫卯工艺与现代家具结合，扬独家之优势，集天下之精华，博采众长。公司凭借着高品质个性化的产品，良好的信誉，优质的服务，畅销全国各地，取得丰硕成果，得到市场一致认可的口碑好评。近些年，开拓国外市场，也取得了不小的成绩，我们正在走向国际化。\n经过多年积累的强大设计和生产能力，旗下三大品牌：古朴年代、古榆情怀、古朴彩漆、形成了良好的品牌效应与市场知名度。\n古朴年代在天津的家具工厂占地面积20000多平米，拥有上百名员工，其中有经验丰富的传统老工匠，有现代化的先进设备，有设计团队、运营团队。公司秉承“顾客至上，锐意进取”的经营理念，坚持“客户第一”的原则为广大客户提供优质的产品和服务。拥有完整、鲜明个性的科学管理模式，多年精心塑造的朴实而独特的企业文化。\n并且拥有线下展厅--古朴年代北京体验店，近千平米的展厅，让国内外客户亲身感受，触摸老门板家具的风化纹理，看老榆木的粗犷耐看，感受彩漆做旧家具的恬静温雅。', 3.00, 1, 13, 38, 45, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://gyqhqjd.1688.com', 1613398371, 1613743318);
