INSERT INTO `p_brand` VALUES (66479, 253, 'XHDJ', 1, '小黑灯具', 'https://oss.yiwofa.com/brand/20210303/cb32b3ca80b212fbc86871eb56f9072c.png', 'https://oss.yiwofa.com/brand_banner/20210303/c975a49d718e52199768f73e7c297c47.png', 'https://oss.yiwofa.com/brand_banner/20210303/6554cb2a0a1447c7cfee80598dfe00d7.png,https://oss.yiwofa.com/brand_banner/20210303/f5f2abb6cf917973e4d1891b1cf90373.png', '小黑灯具是设计师优选灯具品牌，集合了全球最具设计感的灯具产品。', 2.00, 2, 113, 0, 0, 1, 0, 1, 100, 1, 0, 0.000, 1, 2, 1, '', 1614759418, 1614759418);
