INSERT INTO `p_brand` VALUES (66530, 1885, 'driade', 15, 'driade', 'https://oss.yiwofa.com/brand/20210309/202103091155462811154927.png', 'https://oss.yiwofa.com/brand/20210309/202103091157066532935054.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/c485ce1f08dd75bf8d87fefab83f8c3d.png,https://oss.yiwofa.com/brand_banner/20210316/1f9cc4092005dad5093878c517fea623.png,https://oss.yiwofa.com/brand_banner/20210316/2935a1a2d9f2d6bf6b255298c6bf7725.png', '意大利有态度的室内外家具品牌driade,创办于1968年，倡导「The Art of Living」，引领生活新方式。driade品牌成立于1968年，自1968年成立之后，通过聘请风格各异的设计师与研发新功能家具，driade将自己的品牌理念表现得淋漓尽致，它鼓励创新与个性化，并推崇设计的多元。 driade秉承多元化理念的设计师们也是闻名遐迩，风格迥异。ENZO MARI、KONSTANTIN GRCIC、NANDA VIGO、PHILIPPE STARCK以及BOREK SIPEK等。开拓创新，勇往直前，driade致力于保持对设计文化的多元平衡。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://driade.1688.com', 1615273956, 1615880108);
INSERT INTO `p_brand` VALUES (66531, 1886, 'b.d barcelona design', 1, 'b.d barcelona design', 'https://oss.yiwofa.com/brand/20210309/202103091155099612719736.png', 'https://oss.yiwofa.com/brand/20210309/202103091156396833770845.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/0e8e59da0c71567b06ca6af490f45587.png,https://oss.yiwofa.com/brand_banner/20210316/5f58477bb2f6d24843c9fb97553e91a1.png,https://oss.yiwofa.com/brand_banner/20210316/e47650912e3e53fe4a91d9d253274fff.png', 'b.d barcelona design是一家享有国际声誉的西班牙设计公司，1972年由Pep Bonet, Cristian Cirici等著名建筑师及室内设计师共同建立。b.d barcelona design是一家享有国际声誉的西班牙设计公司，1972年由Pep Bonet, Cristian Cirici等著名建筑师及室内设计师共同建立。与b.d barcelona design合作的当代设计师包括Alfredo H&amp;auml;berli, Jaime Hayon, Konstantin Grcic, Ross Lovegrove等。b.d barcelona design的许多产品是从Antoni Gaud&amp;iacute; 和Salvador Dal&amp;iacute;等大师的作品中汲取灵感，打造出独特前卫的艺术家具。1989年，b.d barcelona design获得西班牙国家设计奖，1990年获得欧共体设计奖，2011年则赢得红点设计大奖&amp;ldquo;Best of the Best&amp;rdquo;的殊荣。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bdbarcelona.1688.com', 1615273956, 1615880015);
INSERT INTO `p_brand` VALUES (66532, 1887, 'LIVING DIVANI', 1, 'LIVING DIVANI', 'https://oss.yiwofa.com/brand/20210309/202103091156023400846493.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157417859298235.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/ba7de2133979a933ec6427d939c39501.png,https://oss.yiwofa.com/brand_banner/20210316/6dabd5a5344ae41f3ddc21ce3aec1f25.png,https://oss.yiwofa.com/brand_banner/20210316/e99b034f9ad7abe270456208af74285d.png', 'LIVING DIVANI以其精巧的设计闻名于世，尽善尽美、比例和谐与低调的奢华是其最显著的特征。而1988年开始与顶级设计师Piero Lissoni的合作，则奠定了LIVING DIVANI独特的极简风格特征，并延续至今。LIVING DIVANI一直致力于打造完美舒适的生活环境。设计风格方面，主打极致简约风，无繁杂的线条，无多余的缀饰，采用人体工程学设计，力求用最简单的结构实现更多的实用功能，并达到最舒适的效果。产品质量方面，LIVING DIVANI一直是高品质的代名词。LIVING DIVANI尽可能使用纯天然原材料，如自然纤维棉、麻、羊毛，真皮则出自天然畜牧场，在满足质量标准的基础上精选最优质的材料。严格把控各生产环节，从原料的切割、打磨到成品的组合、包装，每个步骤都有质检人员详细检查。对品质、细节的极致追求使得LIVING DIVANI的产品充分发挥材质的特性，给人以最舒适的享受。此外，针对不同地区的客户， LIVING DIVANI 会结合当地人的审美与需求，采用不同的原料来制作令其满意的产品。LIVING DIVANI正以其极简的风格、对细节的专注、对质量的恪守、对舒适的追求，受到广泛的关注与认同。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://livingdivani.1688.com', 1615273956, 1615879798);
INSERT INTO `p_brand` VALUES (66533, 1888, 'edra', 1, 'edra', 'https://oss.yiwofa.com/brand/20210309/202103091155473532463133.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157084285891161.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/21416afa083dbbf2b65823684c186043.png,https://oss.yiwofa.com/brand_banner/20210316/786305cb517941ae1c50547b39174908.png,https://oss.yiwofa.com/brand_banner/20210316/8aff7c20fe5e6b746bb40b48a3a5cc00.png', 'edra系列纯粹、永恒，从不受潮流的影响，它的大部分家具产品由年轻设计师首次尝试设计，首次登场即超越传统的手法，探究创意的可能性，挑战国际水平。edra是一家家族企业，1987年创建于托斯卡纳，仅用三十年的时间，就发展成意大利制造在世界上的一个重要标志。传统与创新、高科技与手工的结合，是edra的自然栖息地。事实上，在近三十年的历程中，edra始终同时采用高科技和手工制作。其高度重视艺术表现方式，营造实用家具超现实的装饰性与趣味性，堪为前卫派的代表品牌。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://edra.1688.com', 1615273956, 1615879736);
INSERT INTO `p_brand` VALUES (66534, 1889, 'bosa', 1, 'bosa', 'https://oss.yiwofa.com/brand/20210309/202103091155127826839781.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156465081335406.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/ff2b156b97757847e47948abb7da82e3.png,https://oss.yiwofa.com/brand_banner/20210316/e0d66c5ed30ded4cfbba7d2b2c51d993.png,https://oss.yiwofa.com/brand_banner/20210316/d4b1e337f225eeeca1bfc5ba025bab1b.png', '意大利bosa陶瓷是著名的陶瓷品牌，采用古老的技术制作瓷器，还会装饰以丰富的颜色和金，银，铂等贵金属意大利bosa是意大利著名的陶瓷品牌，创立于1976年，位于意大利北部威尼斯乡下的一个小镇。创始人bosa除了采用古老的技术制作瓷器外，还会装饰以丰富的颜色和金，银，铂等贵金属。他后来将企业传给了妻子和女儿。意大利bosa与许多设计师以及家具品牌建立了合作关系，包括Marco Zanuso，Patricia Urquiola，Moroso，成为意大利最有影响力的陶瓷品牌之一，目前已在50多个国家出售。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bosa.1688.com', 1615273956, 1615879164);
INSERT INTO `p_brand` VALUES (66584, 1890, 'qeeboo', 1, 'qeeboo', 'https://oss.yiwofa.com/brand/20210309/202103091156155309204287.png', 'https://oss.yiwofa.com/brand/20210309/202103091158094200832386.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/d6440840e086197d9bb442aa2a2600c0.png,https://oss.yiwofa.com/brand_banner/20210316/30312a36541d8057ad6fe946f486d78d.png,https://oss.yiwofa.com/brand_banner/20210316/a2e07cbe7a3fb15064f7e5c8de3ea833.png', 'qeeboo，这个跨时代的设计品牌，致力于易生产、易成型的塑料家具设计。qeeboo是一个跨时代的设计品牌，致力于易生产、易成型的塑料家具设计。品牌由Stefano Giovannoni（斯特凡诺&amp;middot;乔凡诺尼）创立和领导，并邀请了多位知名设计师，共同参与了包括椅子、照明和花瓶等设计。 qeeboo选择使用这些不同群体的创意，不仅因为他们是多年的知己，还因为这些设计师用心实践，在每个产品技术层面上都能诗意的展现精神风貌，提升高层次的情感价值。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://qeeboo.1688.com', 1615273968, 1615880679);
INSERT INTO `p_brand` VALUES (66585, 1891, 'Kartell', 1, 'Kartell', 'https://oss.yiwofa.com/brand/20210309/202103091155574213451552.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157322205156457.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/4c40e7c75e311b57118354c2b9f27a5b.png,https://oss.yiwofa.com/brand_banner/20210316/da2a74b79f8103d94e780937b09a3ca5.png,https://oss.yiwofa.com/brand_banner/20210316/997236225271f526098af06692e8eebc.png', '意大利Kartell的作品非常与众不同，功能多样、方便耐用、色彩明艳、神态精灵、通体透明、造型奇异,拥有独一无二的魅力，在任何场所出现都是空间中最耀眼的明星。Kartell成立于1949年，在与许多具有原创设计能力且被公众广泛接受的顶级设计师合作后，其独创的、革新的构思已变成人们熟悉的产品，多次赢得了声誉颇高的国际大奖（5次夺得&amp;ldquo;金圆规&amp;rdquo;奖），使之成为在意大利历史上和国际设计领域中最具创意的公司之一。 意大利Kartell的塑料民用家具、办公家具、工程配套家具、室内装饰品和灯饰充分体现了时尚与实用的完美结合，且独一无二，品种繁多，功能性强，价格适中。意大利Kartell本着一丝不苟的作风，追求新材料和形态的研发，给人们带来了独创的美感，使世界各地的时尚人士有机会将设计大师的作品搬回自己的家。意大利Kartell75%的产品通过遍布全球60个国家和地区的全球分销机构出口到世界各地，因而每年有上百万件产品以60000个左右航次发送货物，成为了全球塑料家具行业中的佼佼者。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://kartell.1688.com', 1615273968, 1615880840);
INSERT INTO `p_brand` VALUES (66635, 1892, 'Riva192', 6, 'Riva1920', 'https://oss.yiwofa.com/brand/20210309/202103091156168454613539.png', 'https://oss.yiwofa.com/brand/20210309/202103091158121208494879.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/35580fdf1afb8dfafc0c4a9956227a30.png,https://oss.yiwofa.com/brand_banner/20210316/3a3037fa9d0f529fc14d97539d410129.png,https://oss.yiwofa.com/brand_banner/20210316/6a3f6337b231ae4fa44c07fb66c2bc57.png', 'Riva1920家族世代从事木造相关行业，每位传人皆致力于原木家具的设计与生产，对于设计师的选择也是反复斟酌才会进行合作，无论作品出自何人，都秉持以最简约的设计，将不同树种独一无二的纹路、温润质感展现于收藏者面前。Riva1920创立于1920年，是一家以传统、文化、创意和创新为基础的生产公司，其拥有百年原木工艺历史，多年来一直对原木家具保持热情与执着。Riva1920对原木的挑选十分讲究，其品牌的一件家具，前身可能是从侏罗纪时期就封存地下的万年原木。由大自然的鬼斧神工先将其雕琢成绝无仅有的形状，再由世界知名的设计师，创作成一件独一无二的艺术品。 Riva1920的基本要求是采用高质量的原材料、对人类和环境无害的胶水，以及以天然植物油和植物蜡为基础的成品，保证了真正的天然产品。生产不顺应时代但尊重环境的家具是近100年来一直引领着拥有真正卓越品质的&amp;ldquo;意大利制造&amp;rdquo;的Riva1920的理念。', 3.00, 583, 202, 56, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://riva1920.1688.com', 1615273968, 1615881644);
INSERT INTO `p_brand` VALUES (66685, 1893, 'ClassiCon', 2, 'ClassiCon', 'https://oss.yiwofa.com/brand/20210309/202103091155194408406629.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156558022164377.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/7fa026102ae4bfa1d51746c569b091cb.png,https://oss.yiwofa.com/brand_banner/20210316/3b7fa344c651d10097644086c0bd41c8.png,https://oss.yiwofa.com/brand_banner/20210316/ec038c8a6eb13ccc9daf92f3419f6e7d.png', '德国ClassiCon家具追求原创性、功能性以及永恒的美感，风格并非最重要的设计要素，而是在于形式与功能上整体的品质。来自德国的家具品牌ClassiCon秉持着推广全世界的高品质设计为宗旨而创立，有别于短暂的时尚流行，ClassiCon追求的是永恒的美感，在它的设计中，你可以看到功能性与设计感最完美的结合。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://classicon.1688.com', 1615273968, 1615882224);
INSERT INTO `p_brand` VALUES (66735, 1894, 'Gallotti&amp;Radice', 2, 'Gallotti&amp;Radice', 'https://oss.yiwofa.com/brand/20210310/202103101019095629483759.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019058469498146.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/15301206f9c01819578b5b586bb9488f.png,https://oss.yiwofa.com/brand_banner/20210316/ee8a81f89ff1ce0e40cea18177ba974f.png,https://oss.yiwofa.com/brand_banner/20210316/e8f9f958aeb86d38f258ed16d0970faa.png', '从玻璃制造技术成熟之日开始，意大利的设计师们就开始了对玻璃的种种探索，在这波热衷“搞玻璃” 的品牌中，意大利Gallotti&amp;Radice绝对是艺术性与实用性结合最完美的。意大利Gallotti&amp;amp;Radice是由热爱玻璃艺术的两位艺术家Pierangelo Gallotti与Luigi Radic在1956年成立的，是意大利70年代早期第一个将玻璃融入家具设计的品牌。意大利Gallotti&amp;amp;Radice与著名的设计师如Luigi Massoni，Andreas Weber，Davide Pizzigoni，Maurizio Duranti，Nanda Vigo，Carla Venosta合作，虽然以玻璃为素材的家具品牌多如牛毛，但意大利Gallotti&amp;amp;Radice始终能够保持良好声誉和市场认知度的原因在于：他们只打造能够经受时间考验和磨砺的产品。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://gallottiradice.1688.com', 1615273969, 1615882707);
INSERT INTO `p_brand` VALUES (66785, 1895, 'munna', 2, 'munna', 'https://oss.yiwofa.com/brand/20210309/202103091156074265244304.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157558134275785.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/08b69aea354ece98c5a2a1a0a26d68be.png,https://oss.yiwofa.com/brand_banner/20210316/1273f629b761b39277cd34e120982d78.png,https://oss.yiwofa.com/brand_banner/20210316/2a5e14a24df598a22e5f9c5ffa43299a.png', 'MUNNA 成立于2008年，位于葡萄牙，致力于从事家具产品的生产。MUNNA 成立于2008年，位于葡萄牙，致力于从事家具产品的生产。随着人们对独特自由风格的要求日益强烈，MUNNA 努力完善创新，满足客户的严格要求。MUNNA 将传统工艺与创新技术相结合，与葡萄牙著名的专家、工程师设计师密切合作，承诺只提供最高的质量，确保开发出舒缓疲劳的创新家具。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://munna.1688.com', 1615273969, 1615882947);
INSERT INTO `p_brand` VALUES (66835, 1896, 'PORRO', 1, 'PORRO', 'https://oss.yiwofa.com/brand/20210309/202103091156149365742179.png', 'https://oss.yiwofa.com/brand/20210309/202103091158081364664810.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/ccbb3c98ed03d43896e9a41a616e8d1c.png,https://oss.yiwofa.com/brand_banner/20210316/80bc3661d1cd394ba99169fbf3f4659c.png,https://oss.yiwofa.com/brand_banner/20210316/02a12c345aa775a43481c53f5a63907d.png', 'PORRO诞生于布里安扎（BRIANZA）——意大利高品质家具的传统出产地。今天的PORRO已经将近百年的历史，PORRO衣帽间被誉为欧洲最顶级私人衣帽间。PORRO诞生于布里安扎（BRIANZA）&amp;mdash;&amp;mdash;意大利高品质家具的传统出产地。朱利奥（Giulio）和斯特凡诺（Stefano Porro）俩兄弟在1925年开办了他们第一个生产传统家具的工作室。兄弟俩致力于生产旧式家具，为米兰的新中产阶级提供原汁原味的英式和法式家具的再生版本。PORRO家族始终遵循融合历史悠久的传统手工艺与现代生产以及计算机技术的模式来致力于家具制造。 PORRO制造的70%的产品是由模块化系统组成，如现代化集装箱系统、系统书柜与配备的墙壁、存储衣柜和新的精品桅杆系统、卧室和起居室之间的连接区域，产品包括各系列的床、收纳箱、书架、椅子、桌子和配套的家居饰品。其设计广泛且耐用，包括专利设备在内的高科技细节，其多功能性满足了多种空间的全方位需求。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://porro.1688.com', 1615273970, 1615883284);
INSERT INTO `p_brand` VALUES (66836, 1897, 'MERIDIANI', 1, 'MERIDIANI', 'https://oss.yiwofa.com/brand/20210309/202103091156056742920291.png', 'https://oss.yiwofa.com/brand/20210309/202103091157505724268921.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/261020b50ad3b71b90dfdf10f6f7c8d1.png,https://oss.yiwofa.com/brand_banner/20210316/273a8689561f675d3a0c352a93420208.png,https://oss.yiwofa.com/brand_banner/20210316/d79550a1e8e3c600e529b000c5b4f0b6.png', 'MERIDIANI美安尼诞生于1996年，源自公司创始人的妻子Laura Ferraro Crosti一个单纯的触动，「要创造一个用现代精神诠释经典风格的家具品牌」。她期待MERIDIANI美安尼的每件作品都能通过时间的考验，传达充满韵味，优雅自在的生活态度。MERIDIANI美安尼打造了一个全新且辨识度高的家居方式，着眼于当下趋势，永不过时。1996年，热情的Laura与创意总监Andrea Pariso，凭借着不懈的研究与他们三十余年的经验，结合家族生产设备，在意大利以生产高级家具著称的Brianza地区发表了MERIDIANI美安尼的第一个系列产品。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://meridiani.1688.com', 1615273970, 1615903211);
INSERT INTO `p_brand` VALUES (66886, 1898, 'HENGE', 1, 'HENGE', 'https://oss.yiwofa.com/brand/20210309/202103091155543415972533.png', 'https://oss.yiwofa.com/brand/20210309/202103091157252900504817.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/45a5efcf52838f87812f5fdd41436ae2.png,https://oss.yiwofa.com/brand_banner/20210316/fff386877caf2fe7a7fb62bbe066a8b4.png,https://oss.yiwofa.com/brand_banner/20210316/5ddb2c42cf9cc0051305a0305c1c1e23.png', 'HENGE创造的作品是独一无二的杰作，在他们的灵魂中珍惜每一次触碰和所有的情感，在旅行过程中实现他们的生活。HENGE产品都是严格按照手工工艺标准在意大利制造的，并没有采用大批量生产线和工业管理制度，由此以来，在意大利制造的产品世界中，手工工艺仍然是一种独树一帜的宝贵财富，并且与时俱进的保持了与自然的同步。 意大利制造的产品代表了一种设计与生产的方式，我们这种方式备受全世界的赏识和认可。这都源自于众多员工的满腔激情、卓越的制造品质和每一处生产细节中都能体现的精雕细琢。经过时间磨砺的丰富阅历和独特手工工艺是我们产品的内在基因。 HENGE家具产品具有高度的专业化定制工艺。提出的产品方案可以通过从HENGE产品中选择最合适的独有装饰来加以拓展，也可以通过生产特殊定制的产品来使我们客户定制的项目方案卓尔不群。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://henge.1688.com', 1615273970, 1615903546);
INSERT INTO `p_brand` VALUES (66936, 1899, 'FIAM ITALIA', 2, 'FIAM ITALIA', 'https://oss.yiwofa.com/brand/20210309/202103091155505886645647.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157173237798208.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/ea139778d617522e51020075f861fdb5.png,https://oss.yiwofa.com/brand_banner/20210316/0d2602e2c33550a035cc3f937680a5b5.png,https://oss.yiwofa.com/brand_banner/20210316/3890eeede8df23ffc59d080b2cea3ad4.png', 'FIAM ITALIA是意大利闻名遐迩的玻璃家具品牌，萌生于对于玻璃的激情和热爱。巧妙的制作工艺，完美保留了玻璃纯净透明，独特的玻璃家具体现出的却是惊人的固态和精美的造型。意大利品牌FIAM ITALIA创立于1973年，Vittorio Livi创立的意大利艺术玻璃家居品牌，透过不断研发玻璃材质制成的可行性，结合技术精湛的工匠和天马行空的设计创意，让FIAM ITALIA跳脱传统木制家具的思维，创造了一个极具特色的设计家具品牌。在设计面向中，品牌密切与国际设计大师Philippe Stack、Ron Arad、Enzo Mari等合作，融合传统与创新、工艺与当代设计，使FIAM ITALIA成为极致玻璃工艺的代表品牌。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fiamitalia.1688.com', 1615273970, 1615903852);
INSERT INTO `p_brand` VALUES (66986, 1900, 'LAGO', 1, 'LAGO', 'https://oss.yiwofa.com/brand/20210309/202103091156004821442497.png', 'https://oss.yiwofa.com/brand/20210309/202103091157386503243482.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/56729df9f449141e474fb05adc6e927d.png,https://oss.yiwofa.com/brand_banner/20210316/9f0ad4c6b51a086183d2574af7125c59.png,https://oss.yiwofa.com/brand_banner/20210316/edd02ecefc948258f6a66d07cba6230f.png', 'LAGO的历史可以追溯到19世纪，当时Policarpo Lago在贵族别墅和威尼斯教堂坐手工细木生意，下一代继承了他的工作，到了20世纪80年代，LAGO选择专注于客厅与卧室的设计，秉承Lean Production的理念，使用可回收材料，将包装减到最小。作为意大利创新品牌，LAGO对于设计有着全新的理解，不仅要生产产品，更要革新产业链，倡导新的视野与新的生活方式。LAGO是一个全球市场范围内意大利设计的创新品牌。其不断发展的设计理念认为，生产的不仅仅是产品，还有产品的附加价值，能够对整个生产过程进行创新，并且为品质生活提出新的理念和模式。LAGO设计的不仅仅是产品，还设计了品牌语言并邀请消费者进行使用和体验，从而创建从下往上的参与性设计，使能量源泉来自于用户。', 3.00, 583, 611, 612, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lago.1688.com', 1615273970, 1615904267);
INSERT INTO `p_brand` VALUES (67036, 1901, 'B&amp;B Italia', 1, 'B&amp;B Italia', 'https://oss.yiwofa.com/brand/20210310/202103101019085475555067.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019033070953063.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/766de43a6dcce6846b5344e826eaabe8.png,https://oss.yiwofa.com/brand_banner/20210316/6e5147d7cb3caf9cec75b955512dcceb.png,https://oss.yiwofa.com/brand_banner/20210316/2605ff497e0d3ce67f0594662d73f73c.png', '意大利B&amp;B Italia家具将创意、革新和制作工艺完美结合，用极简的设计体现生活品质意大利B&amp;amp;B Italia一直致力于材质创新的研究，公司将营业额的百分之三投入研发，获得专利，例如与拜耳公司共同研发成功的&amp;ldquo;冷发泡聚氨酯&amp;rdquo;，一种可做成一体成型、又富有弹性的沙发材质；还有与杜邦公司合作的&amp;ldquo;达克龙填充物&amp;rdquo;，加在沙发的骨架外，可让沙发不易变形。 在强调高科技、人体工程学的同时，意大利B&amp;amp;B Italia的设计还侧重家具自身功能性，简约，没有任何多余装饰，很好的满足了现代人在繁琐工作和生活中寻找出口，追求心灵安静的精神需求。 意大利B&amp;amp;B Italia的产品展现了意大利设计的历史和成就，让全世界领略到意大利人的想象力、创造力、品味和专业技术。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bitalia.1688.com', 1615273971, 1615904377);
INSERT INTO `p_brand` VALUES (67037, 1902, 'LIGNE ROSET', 1, 'LIGNE ROSET', 'https://oss.yiwofa.com/brand/20210309/202103091156016061930575.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157409980938537.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/62c2409c77f3f3d32f6069b0609baad2.png,https://oss.yiwofa.com/brand_banner/20210316/f63383c520255ea63e0859c14206941c.png,https://oss.yiwofa.com/brand_banner/20210316/a315118e432da32d7df9b485a6746592.png', '对于大多数人而言，LIGNE ROSET品牌是奢华的代名词，代表了优雅的生活方式。LIGNE ROSET因其与最前沿的当代设计师携手合作而闻名，该品牌也为客户提供了生活方式的选择，将其家具产品系列结合了装饰性配件、照明、地毯、纺织品和其他物品。 ROSET集团之所以不同于其它制造商，原因在于其与知名和新兴设计师携手合作的传统。 将坚实的设计理念与技术创新相结合，其已经具备专业工艺和能力来构造和强化全球范围的分销网络。 创新力是LIGNE ROSET品牌的核心理念：如果新型产品要求新型材质或新型生产方法，公司将会设法获得这些材质。产品范围涵盖座椅、家具产品、照明、纺织品、地毯、床上用品。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ligneroset.1688.com', 1615273971, 1615905260);
INSERT INTO `p_brand` VALUES (67087, 1903, 'imperfetto lab', 1, 'imperfetto lab', 'https://oss.yiwofa.com/brand/20210309/202103091155551065534520.png', 'https://oss.yiwofa.com/brand/20210309/202103091157269695568695.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/c4cac8525758c79ecc13d7359652b097.png,https://oss.yiwofa.com/brand_banner/20210316/f354da5f8de84b575e2b386e7744ce80.png,https://oss.yiwofa.com/brand_banner/20210316/f01f13259064f77989186e5b90acc44a.png', '起源于一个家庭的爱，父母是生活的灵魂，而孩子是每一件产品的灵感来源，我们希望将imperfetto lab与世界联系起来，创造有故事的品牌自1992年诞生以来，我们的设计思维与产品在罗马地区产生了一系列反响，并在长久以来我们得到了成长。我们的产品可以来自橄榄树、樱桃树，甚至是一些有故事的旧钢铁。通过艾米莉亚的古罗马精神，我们将一个个具有鲜明对比的景观搬进我们的家，将艺术与生活无缝融合。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://imperfettolab.1688.com', 1615273971, 1615905506);
INSERT INTO `p_brand` VALUES (67137, 1904, 'BRABBU', 1, 'BRABBU', 'https://oss.yiwofa.com/brand/20210309/202103091155142128892143.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156483242537637.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/07a7a12c0ee828747c15a5b439a00435.png,https://oss.yiwofa.com/brand_banner/20210316/204ece7cfc2c5f82035d9871cb6d6e6e.png,https://oss.yiwofa.com/brand_banner/20210316/9bfbe0e69ad9329181e989fdf2a020bd.png', 'BRABBU带给您的不止是一件设计作品，您将获得一个多样性的空间，这个空间与您的个性达成完美的切合。BRABBU是一个设计品牌，反映了一种充满力量和竞争激烈的都市生活。我们设计和生产各种各样的家具，室内装潢，灯具，地毯，艺术和配件，通过产品的材料，质地，气味等产品的内在属性，向我们阐释关于自然和世界的故事。BRABBU带给您的不止是一件设计作品，您将获得一个多样性的空间，这个空间与您的个性达成完美的切合。 BRABBU的设计作品给您提供一份感官上的礼物。每天我们的设计师和工匠寻找最具创新性的材料和技术从而为您的空间带来的值得拥有的舒适性和功能性的体验。', 3.00, 583, 202, 584, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://brabbu.1688.com', 1615273971, 1615905617);
INSERT INTO `p_brand` VALUES (67138, 1905, 'TURRI', 2, 'TURRI', 'https://oss.yiwofa.com/brand/20210309/202103091156225422104517.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158257793963764.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/077523d7bd9874e9075c6a2b4d066c0c.png,https://oss.yiwofa.com/brand_banner/20210316/c19930a4c7f1612114fa151b734ce2cb.png,https://oss.yiwofa.com/brand_banner/20210316/c9a1ebe7f3b33fa0be5cfdf116ae1bca.png', 'Turri公司成立于1925年，目前正自豪地处于第四代家族成员的领导下，已在豪华家居业的国际市场中站稳脚跟，这要归功于公司对产品的不断开发以及对古典传统的不懈追求。顶级高端产品的目标群体是要求极其苛刻的客户，这些客户对细节所体现的工艺具有无比的崇拜。公司成立以来，皮革制品和闻名而独特·的木装饰完全通过手工打造而成，这是只有专业人士才能完成的非常精巧的工艺过程。&amp;ldquo;将奢华存在于古典和现代之中&amp;rdquo;&amp;mdash;&amp;mdash; 这是1925年，意大利人Pietro TURRI的一个伟大构想。正是这样的坚持，成就了TURRI这个领军国际家具界半个多世纪的品牌。自从1925年以来，当第一件家具产品离开Pietro TURRI的生产厂房时，马上就因其优异品质而备受欢迎。 TURRI的今天就是归功于它把经典风格作为一种传统，甚至是一种哲学理念。从1925年生产的第一件柜子直到现在的所有家具，TURRI家具在制作时，都按照三个基础的概念：新颖，可靠，唯一。 一如既往，我们可以使用三个成语来表现TURRI的哲学理念：独出心裁、原汁原味、卓尔不群。无论是单件家具产品还是整体内部装饰项目，这些都渗透到所有产品的设计和生产中。 即使是现代不断地创新，我们仍然对品质标准毫不妥协，正是由于对这种传统经典的热爱和尊崇，我们才能披荆斩棘、不断前行。基于这些前提条件，TURRI格调已经形成了一种关于奢华内部装饰的思维方式，并为我们带来了意大利制造的良好国际声誉和口碑。 对于什么是奢侈品，我们每个人都有自己与众不同的解读。但是对于每个人来说，奢侈品是一种新的情感、一种深深的愉悦、一种能使你乐在其中的理念。在TURRI公司内，对奢侈品孜孜以求的人们总能创造新的灵感。 以卓越的手工艺技术闻名的奢华家具品牌TURRI，由于其对产品细节和品质的精益求精，以及对经典的执着追求而蜚声国际。其家具之木框以质地珍贵的白杨木制作，辅以自十九世纪流传至今的仿古金箔贴法，将传统与现代融入到奢华的生活文化中，风格独具，备受上层人士的亲睐。自欧洲传统古典风格撷取创作之灵感，用意大利奢华精神将恪守纯手工原创和掌控时尚脉络紧密串联，形成TURRI高贵雅致、奢华与舒适并存的整体家具风貌。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://turri.1688.com', 1615273971, 1615906288);
INSERT INTO `p_brand` VALUES (67140, 1907, 'Fredericia', 1, 'Fredericia', 'https://oss.yiwofa.com/brand/20210309/202103091155522451485968.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157208782849932.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/20d4638aff0f5bfb6d19b53576925d18.png,https://oss.yiwofa.com/brand_banner/20210316/1f8c4d3e4ae4d487460956a5a210a813.png,https://oss.yiwofa.com/brand_banner/20210316/755b4280790ad65244d454108bc2673c.png', '丹麦家具品牌FREDERICIA能够确保精美手工工艺的品质。我们致力于打造在日常使用中坚固耐用的独特家具产品。公司的历史可以追溯到一百多年以前，当时既生产以手工工艺为基础的家具产品，也有工业化的机器生产。我们借鉴这种经验是为了确保我们研发的新家具产品具备手工工艺的品质。同时，我们将手工工艺的专业技术和理念融入了现代家具产品的生产过程中，因此我们能够保证在新技术取代传统工艺的同时，产品品质不会有任何丝毫的下降。 我们支持新产品的研发，并采用了一系列的科技与技术工艺，这些工艺并非基于我们历史传承中同样的木工和手工装饰工艺。优质、新颖的家具设计常常随着技术的发展而不断出现，可运用新型材质的新生产技术或方法反过来又能够进一步推动家具产品的设计。当我们采用了塑料注入、3D 型紧固件、钢质或类如钢质的材料时，我们总是会在每一种特定的领域内寻求最好的手工工艺生产方法。 虽然最近有很多生产过程的分支环节进行了外包，我们最后的组装生产仍然是在FREDERICIA镇进行的。在我们自己的工厂内继续生产对我们来说可谓是至关重要，这是为了确保产品的品质并保留精湛的手工工艺，因为这些都能够使我们研发实用可靠的家具产品。 FREDERICIA品牌生产的家具产品品质上乘、设计精美、可靠耐用。我们的家具产品中有很多款式由于其代代相传而名扬四海。我们对完美品质的苛求赋予了家具产品更多的实用性，与生产制造两件无法终身使用的家具产品相比，我们更倾向于生产一件能够终身使用的产品。 我们会遵守当前既有的环保法规的最低标准，我们还会采取更多的环保措施去面向未来。在这些我们将会引入的措施中，我们将会减少能源消耗，还会从产品材质和生产过程中去除危险的物质，并达到满足技术工艺和品质标准的要求。我们会知悉我们原料木材材质和皮革材质的来源，从而来确保公司的供应商已经在环境管理系统进行了相应的记录。', 3.00, 583, 202, 272, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fredericia.1688.com', 1615273971, 1615906750);
INSERT INTO `p_brand` VALUES (67141, 1908, 'Minotti', 1, 'Minotti', 'https://oss.yiwofa.com/brand/20210311/202103111739365699481639.jpg', 'https://oss.yiwofa.com/brand/20210311/202103111739352149149856.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/8ee692a432b83b5eb27af2950aa950c7.png,https://oss.yiwofa.com/brand_banner/20210316/6e1818a04dc035c3b6eb6f858a572ce7.png,https://oss.yiwofa.com/brand_banner/20210316/7cbb111ca86606ee658f35ddc034235b.png', '意大利品牌家具Minotti有着60年的历史，尤其是在扶手椅和沙发制造界中，他代表了意大利家具优雅独特的设计风格意大利奢侈家具品牌Minotti诞生于1950年，Minotti专业生产顶级扶手椅、沙发和客厅家具，在全世界拥有极高的知名度，在亚洲、欧洲、美洲、非洲、大洋洲的30个国家有售。其设计散发着意大利特有的优雅气息，深受布拉德&amp;middot;皮特、黛米摩尔、詹妮弗&amp;middot;洛佩兹等国际明星的青睐。Minotti的设计并不因为时间而褪色，在当今的世界流行趋势中，Minotti以它的产品形象和外观，为一些领先人士提供参考流行观点的依据。并与意大利的著名设计师Rodolfo Dordoni进行长期合作，Minotti含蓄内敛、时尚经典的设计注定了其将在家具业享有盛誉。同时悠久的历史使Minotti相信设计的灵感不会凭空而来，Minotti的品味是在将近50多年的历史基础上形成的，它经过岁月的砺练，不仅在越来越严酷的市场上确立了牢固的地位，更重要的是它获得了新的经验，进一步提升了它的卓著品质，探寻新方向和新技术，发展已知和未知的材料，创造出一件件富有人文内涵、追求永久的经典之作。想要解读Minotti，Allen沙发就是最好的切入点。线条柔滑、比例绝佳、离地高度及尺寸都恰到好处，在确保不损失沙发整体柔和度、也不破坏整体圆状的情况下，将沙发功能发挥得淋漓尽致，尤其表现在扶手的设计上。高高的靠背为坐者的头部和后背提供了全部的支撑；扶手和靠背的内衬垫是模塑的，而可逆坐垫则是由天鹅绒填充；沙发腿是用压铸铝模塑形成。Allen完美继承了Minotti的经典理念。Minotti的产品均使用顶级的面料，依靠熟练和高度专业的技术工人制作而成，所有产品都确保独特、只此一件、且纯意大利制造。Minotti的每件产品都附有真品和保修证书，所有授权经营商都可以提供设计、销售和售后服务。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://minotti.1688.com', 1615273971, 1615907580);
INSERT INTO `p_brand` VALUES (67142, 1909, 'Poltrona Frau', 1, 'Poltrona Frau', 'https://oss.yiwofa.com/brand/20210309/202103091156146043923005.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158075171972650.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/4cd78d7e145ded27be280aa7ff96601f.png,https://oss.yiwofa.com/brand_banner/20210316/33f831597e12a6f6d1b3215b546a9a14.png,https://oss.yiwofa.com/brand_banner/20210316/c140546842c61160a6fc2950b290bca7.png', '诞生于1912年的意大利Poltrona Frau家具品牌，已经有100年的历史了。1926年正式成为意大利王室家具的供应商，近百年来已成为古今整个欧洲皇室家族的专属御用家具。Poltrona Frau集团的所有产品都突出其卓越品质，这一过程始于艰苦细致的原材料选择。生产过程的所有阶段都受到严格的质量控制。从设计阶段到实验创新材料，从美学研究到每一件产品的生产和最终测试。Poltrona Frau品质是在近100年的历史和经验中获得的精湛技艺和手工工业专业知识相结合的结果，Poltrona Frau在精神上保持不变，但也始终准备接受现代生活的挑战。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://poltronafrau.1688.com', 1615273971, 1615908268);
INSERT INTO `p_brand` VALUES (67143, 1910, 'ACERBIS', 1, 'ACERBIS', 'https://oss.yiwofa.com/brand/20210309/202103091155034373382321.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156268217569954.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/bf0c867a8e3d785b504035d066a3f834.png,https://oss.yiwofa.com/brand_banner/20210316/3e0306273fc3583c5f6ad2279823c0d8.png,https://oss.yiwofa.com/brand_banner/20210316/739cd080aae5488d941d5cc27c5892d3.png', '定义好设计，欧洲家居品牌ACERBIS有三个原则，简单、独特、实用。如何使用最少的设计元素打造最与众不同的实用单品，从这些家具中，能够看出设计师们不断尝试的痕迹。ACERBIS见证了意大利设计的萌芽与发展，在家具生产史上具有典型的代表性。公司创建于1870年，至今已经有100年的历史，在上世纪以大胆的设计风格以及考究的制作工艺使其走向辉煌。尤其在电视墙以及餐边柜领域在意大利家具品牌中占领绝对的优势。', 3.00, 583, 608, 610, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://acerbis.1688.com', 1615273971, 1615908374);
INSERT INTO `p_brand` VALUES (67193, 1911, 'Fritz Hansen', 1, 'Fritz Hansen', 'https://oss.yiwofa.com/brand/20210311/202103111715137732283871.jpg', 'https://oss.yiwofa.com/brand/20210311/202103111715138860597885.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/e80ca76ac7bf1bb45194f63862e33bb9.png,https://oss.yiwofa.com/brand_banner/20210316/b124722b59dc8e746066a0c3ef942efe.png,https://oss.yiwofa.com/brand_banner/20210316/3679aaf4a58bcbaedf5d6b2bae0b9afe.png', '丹麦Fritz Hansen的前瞻性设计充分运用了优质的材质。每一处细节都精雕细琢，每一道程序都彻头彻尾，每一处装饰都是外观的一部分，这些设计都独出心裁、清晰可辨。丹麦Fritz Hansen由远见卓识的同名同姓的细工木匠于1872年创立。从此，丹麦Fritz Hansen就自然而然地成为丹麦和国际设计史中不可或缺的一部分。如今，它已成为一个卓尔不群的国际设计品牌。丹麦Fritz Hansen的历史特色为惊人的工艺、独特的设计和优质的内涵。全球各地的领先建构师和家具设计师，经常会用形态优美的和功能强大的家具产品来丰富公司的产品系列，这也完美地运用了创新技术和新型材质。Arne Jacobsen、Poul Kj&amp;aelig;rholm、Piet Hein、Vico Magistretti、Burkhard Vogtherr、Piero Lissoni、Kasper Salto和Morten Voss &amp;mdash;&amp;mdash;名单上的设计师名称不胜枚举，经典而闻名世界的家具产品更是数不胜数。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fritzhansen.1688.com', 1615273971, 1615909103);
INSERT INTO `p_brand` VALUES (67194, 1912, 'EMMEMOBILI', 15, 'EMMEMOBILI', 'https://oss.yiwofa.com/brand/20210309/202103091155479805330038.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157107872620791.jpg', 'https://oss.yiwofa.com/brand_banner/20210316/b476abd900f1561a6e0ca85fa8dfc21b.png,https://oss.yiwofa.com/brand_banner/20210316/b000e359fe1961de995be772d67c778f.png,https://oss.yiwofa.com/brand_banner/20210316/44ccc54a4a0e4044e30e1746c0fa88fb.png', '自创办以来,EMMEMOBILI便成为意大利顶级手工木质家具的代名词。EMMEMOBILI系列产品是由Tagliabue家族于二十世纪八十年代创建的。Tagliabue企业于1879年在Cant&amp;ugrave;创立，正是在创立之初，该公司就已经为航天领域生产制造高品质的测量家具和多层面板。与卓越建筑师的携手合作和丰富地设计生产经验，意味着公司能够在二十世纪三十年代获得米兰三年展设计大奖。目前公司由家族的第四代传人经营管理，他们对国际潮流、创新设计和高品质定制产品具有独到的品味。 技术和材质 在每一道单独的生产程序中，我们都能够保证最高品质的工艺。 对于弯曲的胶合板，轻薄的木板上覆盖了树脂和胶水，并精心置放于模具之中，模具是根据我们预期塑造的形状来设计的。然后就到了加热和压铸的第一阶段，这样木质就可按照预期形态来塑型。随后，一个数控机器开始加工这些最后由手工完成的部件。最后，对各种部件进行组装和抛光。这几乎不能被称为&amp;ldquo;生产线&amp;rdquo;：所有部件都是一次性的。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://emmemobili.1688.com', 1615273971, 1615909963);
INSERT INTO `p_brand` VALUES (67195, 1913, 'Cattelan italia', 1, 'Cattelan italia', 'https://oss.yiwofa.com/brand/20210309/202103091155165645671648.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156525799846014.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/55ddecd1933702abd6986d379053b914.png,https://oss.yiwofa.com/brand_banner/20210317/67372abc9b0a9c68f1d3c2b50dd58338.png,https://oss.yiwofa.com/brand_banner/20210317/8e1b40f4b90ad95a19245be1c7aa29dd.png', 'cattelan italia——室内软装设计家具品牌中的Armani - 由Giorgio Cattelan和他的夫人SILVIA于1979年在威尼斯共同创立。意大利家具cattelan italia品牌是由Giorgio Cattelan和他的夫人SILVIA于1979年在威尼斯共同创立。因其卓越的设计和不俗的做工在美国、欧洲和远东市场取得巨大成功。 cattelan italia大力发展与世界顶尖设计师和建筑师的紧密合作，如Yoshino，Plazzogna，De Longhi等。在Giorgio Cattelan不懈的努力下，cattelan italia远销世界100个国家，广泛应用于豪华酒店、游轮，纽约现代艺术博物馆，赫尔新基歌剧院、法国外交部等重要场所。目前，cattelan italia已经跻身意大利家具业顶级企业行列。', 3.00, 583, 202, 56, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cattelanitalia.1688.com', 1615273971, 1615910902);
INSERT INTO `p_brand` VALUES (67196, 1914, 'Knoll', 1, 'Knoll', 'https://oss.yiwofa.com/brand/20210309/20210309115559122900424.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157348086809645.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/479f17a3cfb7b6d38b0748770877ed09.png,https://oss.yiwofa.com/brand_banner/20210317/cbc364dec339e1ca09262bcf6209ad35.png,https://oss.yiwofa.com/brand_banner/20210317/fcc37ac36f02036c473c1a3bac224f5b.png', '一个引领全球化的办公家具设计与制造公司，是世界现代家具业中领导潮流的著名品牌。不少杰出设计师如埃罗·沙里宁、哈里·贝尔托亚都曾为该公司效力过，很多影响全球的经典家具作品出自诺尔公司。Knoll使用现代设计将人们与他们的工作，生活和世界联系起来。自1938年以来，Knoll在国际上获得了公认的创造工作场所和住宅家具的启发，发展和忍受。今天，Knoll致力于现代设计，Knoll对工作性质的理解以及对可持续设计的奉献，创造出了独特的体贴产品组合，能够响应并适应不断变化的需求。这是Knoll的故事。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://knoll.1688.com', 1615273971, 1615911003);
INSERT INTO `p_brand` VALUES (67197, 1915, 'LUXXU', 2, 'LUXXU', 'https://oss.yiwofa.com/brand/20210309/202103091156041094625068.png', 'https://oss.yiwofa.com/brand/20210309/202103091157458670111737.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/350d5564b55883db53c2143ef24d97bd.png,https://oss.yiwofa.com/brand_banner/20210317/7c94ff354224c0268c0c8ee01df87e71.png,https://oss.yiwofa.com/brand_banner/20210317/bd7d8c3c8154e1641a7b1b32fea57019.png', 'LUXXU产品专注于打造奢华的照明灯具，并将传统的款式与独特的当代表现力加以结合。LUXXU是一种全新的照明体验，品牌提供了一系列能使您梦想成真的产品，并完美结合了经典款式和现代理念。产品采用了精美的材质，如黄铜、玻璃和施华洛世奇水晶，并结合了罕见的手工工艺和当代设计理念。LUXXU的产品都是由照明领域专业打造，集合了经典与现代设计，表现了施华洛世奇水晶的全部美感。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://luxxu.1688.com', 1615273971, 1615911292);
INSERT INTO `p_brand` VALUES (67198, 1916, 'FLEXFORM', 1, 'FLEXFORM', 'https://oss.yiwofa.com/brand/20210309/202103091155507920844666.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157177077763886.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/7173adf13fee6f422462f3102ba522b9.png,https://oss.yiwofa.com/brand_banner/20210317/c9286c6d952cb584501895db86586b2d.png,https://oss.yiwofa.com/brand_banner/20210317/3f0422d6466f863d1d6a5cf05dafe971.png', '通过现代的生产技术并结合传统文化，FLEXFORM的做工精细有目共睹。意大利品牌FLEXFORM起源于1970年，诞生于意大利北部小镇Meda，该小镇因生产顶级工艺家具而闻名于世。FLEXFORM在品牌成立前，其家具已经三代传承，拥有浓厚底蕴。 在过去的半个世纪，FLEXFORM已成为家喻户晓的世界级顶级家具品牌，在沙发和其他家具的生产制造方面有着深厚的专业背景，FLEXFORM所生产的家具都具备很高的手工价值。公司一贯倾向于合作设计，品牌创立至今，与多名国际设计大师有合作关系。 FLEXFORM的成功是建立在一系列价值观之上，而这些价值观也是企业使命的核心所在。意大利制造、永恒优雅、舒适、品质、现代化、美观及耐用。这一战略模式使FLEXFORM成为全球公认的意大利优质家具品牌之一。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://flexform.1688.com', 1615273971, 1615911828);
INSERT INTO `p_brand` VALUES (67248, 1917, 'porada', 3, 'porada', 'https://oss.yiwofa.com/brand/20210309/202103091156147988934411.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158078263760133.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/922c0722785fffa76835b6ac4f3f4f1a.png,https://oss.yiwofa.com/brand_banner/20210317/3b092d44993f3b4a0f495dcd55e7717a.png,https://oss.yiwofa.com/brand_banner/20210317/ae523c307852226b99f7759a51676f7d.png', 'porada诞生于1948年。Porada主要的产品特色是实木家具，大量使用北美胡桃木作为家具主材。porada诞生于1948年。Porada主要的产品特色是实木家具，大量使用北美胡桃木作为家具主材；主要产品为餐桌，餐椅，茶几，边柜等为主。由于使用胡桃木这种纹理优美性质温和的木材，其设计风格也相对更适合东方人使用。 近年来，Porada发展迅速，其产品线也逐渐丰富，推出了更多设计出色的床、沙发、扶手椅等出色产品。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://porada.1688.com', 1615273972, 1615912280);
INSERT INTO `p_brand` VALUES (67249, 1918, 'BOCA DO LOBO', 2, 'BOCA DO LOBO', 'https://oss.yiwofa.com/brand/20210309/202103091155122940661924.png', 'https://oss.yiwofa.com/brand/20210309/202103091156452495619971.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/52206223e09d229929be4ae8fa34589e.png,https://oss.yiwofa.com/brand_banner/20210317/7029d83e22c54f7809ed3f2a4bac7b86.png,https://oss.yiwofa.com/brand_banner/20210317/2cec5661b1e004f11c5619c3b34d9f98.png', '作为美感和卓尔不凡的标志，葡萄牙家具品牌BOCA DO LOBO自从2005年就秉承了形幻美感。其体现着迷幻魅力和独树一帜的工艺，这都融入了闪亮的品牌标识,体现了颇具历史感的现代性。BOCA DO LOBO家具产品独具情感体验、归属感和心境。我们专注于通过打造精美家具产品来激发情感体验，这会由热爱本职的员工在葡萄牙倾心倾力地手工精制家具产品。我们的设计师拥有着无可比拟的智慧来打造家居产品，并能够激发忠实用户的情感共鸣。我们在设计与艺术的前沿，提供最好的产品时绝不会忽视任何的细枝末节。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bocadolobo.1688.com', 1615273972, 1615912423);
INSERT INTO `p_brand` VALUES (67250, 1919, 'Molteni&amp;C', 1, 'Molteni&amp;C', 'https://oss.yiwofa.com/brand/20210310/20210310101910324540109.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019069560727652.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/ba2586487c797ab80f94575f8a32893d.png,https://oss.yiwofa.com/brand_banner/20210317/4456c391154a28151cf49de02fc07a14.png,https://oss.yiwofa.com/brand_banner/20210317/5577031c3225765abb72a2aff1368bf1.png', '作为意大利现代奢华家具的先行者，Molteni&amp;C坚信对产品的艺术鉴赏力是高超技术应用的结果，对每个环节都力求精益求精、一丝不苟。意大利品牌家具Molteni&amp;amp;C建立于1934年，起初只是手工为客户打造专享的家居产品，随着产量的需求增大，Molteni&amp;amp;C于1950年开始拓展经营规模，导入机械化生产技术，以提升品质和增大产能。意大利Molteni&amp;amp;C是意大利悠久柜体历史品牌家具。作为意大利现代奢华家具的先行者，坚信对产品的艺术鉴赏力是高超技术应用的结果，对每个环节都力求精益求精、一丝不苟。&amp;ldquo;内在品质&amp;rdquo;是Molteni&amp;amp;C成立80年来一直推崇并履行的信念，因此，Molteni&amp;amp;C的产品向来是独一无二的。作为世界奢侈品牌Cartier的战略合作伙伴，他们为全球众多奢华宅邸提供家具、订制系列以及全球品质优良的衣橱系列。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://molteni.1688.com', 1615273972, 1615913269);
INSERT INTO `p_brand` VALUES (67302, 1922, 'MALERBA', 0, 'MALERBA', 'https://oss.yiwofa.com/brand/20210309/202103091156049512447796.png', 'https://oss.yiwofa.com/brand/20210309/202103091157473590786268.jpeg', '', 'MALERBA诞生于1946年，它引领最新潮流趋势“至简轻奢 变化多端”是MALERBA家居的宗旨MALERBA作为原厂制造、原装进口的意大利高端家具，营造最为纯正的意大利家居风情，深受各方关注。它是与Fendi Casa、Kenzo Maison、Bentley Home等国际一线家具品牌齐名的奢华品牌。它的设计理念融入了大量东方元素，他们将黑与白、方与圆这些元素完美地结合到家具设计理念中，让其富有东方美感。 ', 3.00, 583, 202, 588, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://malerba.1688.com', 1615273972, 1615273972);
INSERT INTO `p_brand` VALUES (67402, 1924, 'WIENER GTV DESIGN', 0, 'WIENER GTV DESIGN', 'https://oss.yiwofa.com/brand/20210309/202103091156257456261492.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158363061588231.jpg', '', '传统、优雅、功能性和轻盈的风格是WIENER GTV DESIGN产品的综合特色，这都使其产品在最精美华贵的场所能够与众不同、独树一帜。WIENER GTV DESIGN已经研发了编辑项目，成功的融合了传统和现代、传承与创新，并结合了以重编一系列Gebr&uuml;der Thonet经典款式的新生产项目。同时，WIENER GTV DESIGN代表了当代的装饰设计。先进的制造技术应用于创新设计和材质选择，来打造高人气、多目的的装饰项目。真正的原创性、最新解决方案完美的融合了其产品目录中更多经典产品，现在已经在重新生产。例如14号椅凳产品的款式，在1850到1930年间产量可达5000万，因其精美的设计和制造品质而持续生产，到了当今时代，产品仍然是魅力四射，对新一代用户的吸引力丝毫未减。 公司采用了高端生产技术，结合了扬名四海的美称和不断增长的声誉，这都激励了最知名的威尼斯设计师来设计新款的产品。 ', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://wienergtv.1688.com', 1615273975, 1615273975);
INSERT INTO `p_brand` VALUES (67403, 1925, 'Cassina', 1, 'Cassina', 'https://oss.yiwofa.com/brand/20210309/202103091155162992297685.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156523336437812.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/41ed751d6e8b498e5879b6421d19247f.png,https://oss.yiwofa.com/brand_banner/20210317/a1fd984b6029fa6ca475b235913b5a7b.png,https://oss.yiwofa.com/brand_banner/20210317/14cfe4a38e7633ebb165164d55ea00aa.png', '早在十七世纪，意大利Cassina就开始从事教堂木器家具的制作，精湛的工艺与对细节的专注使其在那个时期就赢得人们的尊敬，以至今天的人们仍能在美丽的科莫湖畔的教堂中找到Cassina当年产品的身影Cassina公司产品蕴涵了不同的语言和文化，并在风格和材料方面进行了大胆而广泛的试验。许多Cassina公司的产品在问世之初由于过于前卫而受到业界的质疑。然而，随着时间推移，这些产品最终都为人们所接受，并成为设计的经典之作，与其他产品浑然一体。这也充分体现了Cassina在作品选择上的大胆和高瞻远瞩。这方面著名的产品有马里奥&amp;middot;贝里尼(Mario Bellini)的&amp;ldquo;凯伯椅（Cab Chair）&amp;rdquo;、喜多俊之(Toshiyuki Kita)的&amp;ldquo;眨眼椅（Wink Chair）&amp;rdquo;和帕奥罗&amp;middot;德加内罗(Paolo Deganello)的&amp;ldquo;伊奥椅（Aeo Chair）&amp;rdquo;。 如今，Cassina已成为与诺尔和米勒并驾齐驱的、具有国际声望的大公司，它的产品70%销往世界各地。 作为世界级家具品牌，Cassina有着悠久历史，品牌最早起源于十七世纪。从事教堂木器家具的制作，在那时就以精湛的工艺与对细节的关注深入人心。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cassina.1688.com', 1615273975, 1615913668);
INSERT INTO `p_brand` VALUES (67453, 1926, 'Poliform', 1, 'Poliform', 'https://oss.yiwofa.com/brand/20210309/202103091156144577756473.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158072359198896.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/cb94b8b9d3735e340481fedbac458e2e.png,https://oss.yiwofa.com/brand_banner/20210317/06ee83ca359a21a2d831fa7375ff3511.png,https://oss.yiwofa.com/brand_banner/20210317/570ce5fbc86dca3c6fb92c7b4e6019ef.png', '笔直的线条简洁利落，高贵又优雅。它坚持灵活的设计，让衣柜能够游走在房间的每个角落。Poliform意大利高端家具品牌创立于1942年，产品以衣柜为主力阵容。Poliform 历来与诸多国际知名的设计师、建筑师合作。在现代意大利家居中，家具已经超出了其单纯的实用性功能。在设计风格上，Poliform 始终坚信只有简约的、实用的，才是完美的、永恒的。Poliform之所以成为世界顶级的家具，与它严谨的做工是分不开的，对于细节处的用心处理，决定了家具优秀的品质，使用几十年都能完好无损。Poliform与众多国际著名设计师的合作，将一种常人以前无法拥有的高贵带进了你的生活。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://poliform.1688.com', 1615273976, 1615914316);
INSERT INTO `p_brand` VALUES (67503, 1927, 'Tom Dixon', 15, 'Tom Dixon', 'https://oss.yiwofa.com/brand/20210311/202103111739368998967386.jpg', 'https://oss.yiwofa.com/brand/20210311/202103111739362251765067.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/4273657457c8debf868ad551fb664766.png,https://oss.yiwofa.com/brand_banner/20210317/47432d1463e11b869c1618be2ffcb931.png,https://oss.yiwofa.com/brand_banner/20210317/79a15aa134c8a24fd83903e169ac2f75.png', 'Tom Dixon 于 2002 年设立 Design Research Studio，以每年进行 1~2 个跨界合作的步调，逐渐成为一位全方位设计师。黄铜家居用品也可体现出其设计风。Tom Dixon 是英国知名自学成才的工业设计师，他在1987年为意大利知名家具制造商Cappellini 设计 S Chair，被广大媒体与知名博物馆关注，被MoMa等美术馆收藏，凭借 S 形座椅声名大噪，又在 2000 年因对英国设计所作出的杰出贡献而被授予 OBE 奖（大英帝国军官勋章）。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://tomdixon.1688.com', 1615273976, 1615914859);
INSERT INTO `p_brand` VALUES (67553, 1928, 'GLAS ITALIA', 17, 'GLAS ITALIA', 'https://oss.yiwofa.com/brand/20210309/202103091155534469182058.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157236348955659.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/36e393ce9ddbd4790f8ce40575ce63fe.png,https://oss.yiwofa.com/brand_banner/20210317/8faa50e4fd5310ad9679bcef60d9014e.png,https://oss.yiwofa.com/brand_banner/20210317/2794cee9210fe2116953347d9740e6cc.png', 'Arosio家族在1970年创立的玻璃家具品牌GLAS ITALIA，风格简约现代，让人找不到一丝一毫冗余的装饰元素。意大利一直以来是玻璃之国，聚集了无数的玻璃工厂和小工作室，也不乏几十年甚至百年的吹制玻璃品牌，其玻璃以造型丰富多变和质地轻薄而著名。而Arosio家族在1970年创立的玻璃家具品牌GLAS ITALIA，却反而道而行之，风格简约现代，让人找不到一丝一毫冗余的装饰元素。 同时，GLAS ITALIA也看成是意大利家具设计的一个缩影，其简约也并非是简单，Glas Italia注重和设计师的结合，GLAS ITALIA的是玻璃制品包括有边桌、餐桌、镜子、椅子、书架、储物柜等等，这些几何家具在简约中融入了现代奢华，通透亮泽的玻璃反射出环境从而带出时尚的气质。与世界各著名设计师合作推出的家居产品，更是为GLAS ITALIA注入了丰富的魅力。', 3.00, 583, 202, 56, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://glasitalia.1688.com', 1615273976, 1615915142);
INSERT INTO `p_brand` VALUES (67603, 1929, 'LASVIT', 1, 'LASVIT', 'https://oss.yiwofa.com/brand/20210309/202103091156006287157229.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157389784983635.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/d264e003286e9047a16f0b63a972e822.png,https://oss.yiwofa.com/brand_banner/20210317/8f250992f646732f8f9f2d491fc3da57.png,https://oss.yiwofa.com/brand_banner/20210317/66fb017f7bebdd9c9b635e055b6656a5.png', 'LASVIT集团承接设计与制造，是定制灯饰配件领域、特色玻璃装饰领域以及获奖产品系列领域的佼佼者。其使命是将普通的玻璃打造成精美的灯饰和极具设计感的艺术品。LEON JAKIMIC在2007年创办了LASVIT公司，总部设在捷克，重新诠释了波西米亚玻璃，使其独特的美感得以延续。在短短的几年中，LASVIT已经确立了自己在由吹制玻璃制成的定制灯饰领域和艺术装饰领域中不可撼动的地位。许多著名的设计师和艺术家都争先与其合作，制作出独一无二的玻璃系列。NENDO, ROSS LOVEGROVE, DANIEL LIBESKIND, MAARTEN BAAS, CZECH LEGENDS RENE ROUBICEK和BOREK SIPEK之所以选择LASVIT，是因为LASVIT能够将其前卫的艺术眼光具象化。玻璃艺人们凭借精湛的技艺赋予一块块普通的玻璃新的生命，创作出令人哗然的毕生之作。 LEON JAKIMIC创办LASVIT的一个愿景就是要打造出一个通过光学质量、玻璃材质和独特设计的完美体验。LASVIT的艺术品清单包括适合各种场所的吹制玻璃。无论是私人住宅、公共场所、奢华酒店还是高端奢侈品店，LASVIT吹制玻璃都能打造出独一无二的品味。LASVIT目前在为建筑业广泛地研制和生产特殊形状的镶嵌玻璃。 LASVIT恪守承诺与世界著名设计师ROSS LOVEGROVE, NENDO STUDIO, ARIK LEVY, FABIO NOVEMBRE和MICHAEL YOUNG建立合作，不断创新。LASVIT的项目遍布全球，包括：伦敦、巴黎、布拉格、莫斯科、洛杉矶、香港、新加坡。10间办事处分布于欧洲、亚洲、中东、北美和南美。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lasvit.1688.com', 1615273977, 1615915467);
INSERT INTO `p_brand` VALUES (67653, 1930, 'ESSENTIAL HOME', 0, 'ESSENTIAL HOME', 'https://oss.yiwofa.com/brand/20210309/202103091155486857176304.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157138091667370.jpg', '', '一个坐落在梦幻雅典娜山坡上的中世纪现代家居ESSENTIAL HOME品牌是深思熟虑的波西米亚设计的缩影。其独特的设计，以色彩斑斓的混色材质为特征，将&ldquo;30年代到60年代&rdquo;中重要的历史坐标点融入了当今的设计之中。阴阳之间的和谐，古典与现代之间的和谐，婉约与直率之间的和谐，已经融入了该品牌犀利的折衷主义风格和率直的标志性风格。ESSENTIAL HOME品牌打造了与众不同、亲密无间和舒适宜人的环境氛围，表现了带有中世纪现代标记的奢华家居的精致而优雅的品位。 ', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://essential home.1688.com', 1615273977, 1615273977);
INSERT INTO `p_brand` VALUES (67703, 1931, 'DEKNUDT MIRRORS', 17, 'DEKNUDT MIRRORS', 'https://oss.yiwofa.com/brand/20210309/202103091155442217952250.png', 'https://oss.yiwofa.com/brand/20210309/202103091157039179282839.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/c1b547ed000df8220ab7dff03fd4f263.png,https://oss.yiwofa.com/brand_banner/20210317/b82d1603759935e5682992a26a53020d.png,https://oss.yiwofa.com/brand_banner/20210317/9357950df4e07968d84ba9051cfb557e.png', 'DEKNUDT MIRRORS是一家由Frans Deknudt创立的镜子制作公司，成立于比利时，他们为许多浴室用品公司制作镜子。DEKNUDT MIRRORS致力于通过在感觉和理性之间找到正确的平衡，把传统和经验与创新相结合，为顾客提供全新风格的，美丽的，高品质的镜子。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://deknudtmirrors.1688.com', 1615273977, 1615916254);
INSERT INTO `p_brand` VALUES (67704, 1932, 'FORNASETTI', 15, 'FORNASETTI', 'https://oss.yiwofa.com/brand/20210309/202103091155516517929017.png', 'https://oss.yiwofa.com/brand/20210309/202103091157192316813168.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/1809c10f12e179a1db9d776ca7dd9440.png,https://oss.yiwofa.com/brand_banner/20210317/fc1b8fa65a4d58cb5f44a665e6fdb036.png,https://oss.yiwofa.com/brand_banner/20210317/be5d47052c02a4101388259269fa9baf.png', 'FORNASETTI的作品充满巴洛克式的超现实风，浪漫又别具一格。作为画家、装饰艺术家和商人的Piero Fornasetti擅长视错觉和陷阱艺术表达方式。他的作品中常常充满巴洛克式的超现实风，浪漫又别具一格。从小天资迥异，出生富贵的他因为无法接受上流社会传统的艺术教育，尤其在对人体绘画方面的空间极为局限，于是他放弃学位，自学成才。 Fornasetti不仅受到法国设计师菲利普&amp;bull;斯塔克（Philippe Starck）的赏识，后与意大利著名设计师庞蒂(Gio Ponti)合作过作品若干。他擅长将自己的个性想法投诸于广告、商标和服饰之上，来表达他鲜明的视觉语言，无论是精致、摩登、幽默还是神秘、魔幻：Lina Cavalieri装饰盘系列就是一个典型的例子。&amp;nbsp;', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fornasetti.1688.com', 1615273977, 1615948364);
INSERT INTO `p_brand` VALUES (67705, 1933, 'Eero Aarnio', 3, 'Eero Aarnio', 'https://oss.yiwofa.com/brand/20210309/202103091155478110908786.png', 'https://oss.yiwofa.com/brand/20210309/202103091157101090995586.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/afd9c16ea274e0ca622332054ca04c9f.png,https://oss.yiwofa.com/brand_banner/20210317/5e7182ce1091da04890d63705944f8f5.png,https://oss.yiwofa.com/brand_banner/20210317/fec2f862e7eb688d8f83c73ea950c593.png', 'Eero Aarnio是芬兰设计师和创新者，因上个世纪一些最知名和最受欢迎的家具而闻名。Eero Aarnio以其开创性地使用某些新材料，特别是塑料和玻璃纤维，利用不同寻常的形式打造独一无二的设计。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://eeroaarnio.1688.com', 1615273977, 1615916977);
INSERT INTO `p_brand` VALUES (67755, 1934, 'DIMENSIONE CHI WING LO®', 5, 'DIMENSIONE CHI WING LO®', 'https://oss.yiwofa.com/brand/20210309/202103091155451740316756.png', 'https://oss.yiwofa.com/brand/20210309/202103091157049837315924.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/8224eec4d3085e350a24520dc6dc9360.png,https://oss.yiwofa.com/brand_banner/20210317/25bfd8c175ba5a24bcde62392b53e288.png,https://oss.yiwofa.com/brand_banner/20210317/8fe5f3bc290a15ac329afd1f2bac44ce.png', 'DIMENSIONE CHI WING LO® 是以建筑师卢志荣的名字命名的品牌, 这个品牌的家具是在他的严格指导监督下, 在意大利设计和制作的.他在设计上独特的追求, 在工艺上对细节的把控, 以及在材料选用上的创新, 为家具创造了新的标准, 新的展望. 他对家具设计的爱好和热情成为他的署名, 品牌顺势而生, 被大众认可. DIMENSIONE CHI WING LO&amp;reg; 家具, 设计简洁又多面多能, 谦谨却又推陈出新, 富裕却又珍贵无瑕, 设计和制作能经得起时间的推练, 适应全球各地不同文化背景, 在当今瞬息万变的家具潮流中, 保持永恒. 我们的源起是我们对每件家具注入最诚挚的承诺. 在日后, 整个系列会不断发展出新, 包括新款家具, 灯具, 配饰, 精细配件等. 我们的梦想是创造一套丰富, 充实, 复合的家具系列, 反映我们的设计和质量, 不断地与每个人分享我们现代生活的价值和远景.', 3.00, 583, 202, 586, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://dimensione.1688.com', 1615273977, 1615949247);
INSERT INTO `p_brand` VALUES (67805, 1935, 'EO', 3, 'EO', 'https://oss.yiwofa.com/brand/20210309/202103091155481481754019.png', 'https://oss.yiwofa.com/brand/20210309/202103091157113168716838.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/f607ff4fa5af411c6f16bebfc154182a.png,https://oss.yiwofa.com/brand_banner/20210317/1a3a524e61860aa5fea1f1a4ba369e35.png,https://oss.yiwofa.com/brand_banner/20210317/d8a9414f22d0cd2c8e29e9a8a92925ab.png', '来自丹麦哥本哈根的优质儿童家具。EO代表着纯粹的设计热情。简单干净的线条在其灵魂中有力地和现代的混合。与来自世界各地的创新和独立设计师合作，使该系列的语言具有普遍性。它是充满活力的、真正的高品质产品，每一款产品都是由精湛的工艺和最好的材料精心制作而成。', 3.00, 583, 617, 618, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://eo.1688.com', 1615273977, 1615949432);
INSERT INTO `p_brand` VALUES (67855, 1936, 'ARCADE', 1, 'ARCADE', 'https://oss.yiwofa.com/brand/20210309/202103091155067767582468.png', 'https://oss.yiwofa.com/brand/20210309/202103091156347837898389.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/c52af496984cc6d72e12c3e5a65a2342.png,https://oss.yiwofa.com/brand_banner/20210317/ffa8e6b8e125713f689e28d8fdfb610a.png,https://oss.yiwofa.com/brand_banner/20210317/02d2bcb1266f16bbda594f8c6321a1eb.png', '对ARCADE而言，每次创作都是一次独一无二的感观之旅。他们的每个花瓶都充满了诗意。自1990年成立以来，ARCADE在诸多碰撞和融合中不断发展进步：在创始人Ivan Baj 和众多的玻璃工艺大师之间，水与沙之间，海洋和地球之间，淡水和淡咸水之间，在固体和蒸汽，以及形式和颜色之间。 每一次碰撞和融合或受困于意想不到的环境里或在熟悉的领域开陈创新。得益于所有的这些经历，ARCADE研制出新的花瓶系列。对ARCADE而言，每次创作都是一次独一无二的感观之旅。当我们将其设想成沙粒与人类的相互融合，每个花瓶都充满了诗意。 ARCADE不断进行实验，寻求新的可能性。挖掘海浪、空气、地球和植物的潜力，去冗存简。 ARCADE产品系列将陶瓷碎片和色彩暗潮完美融合。每一个产品系列都是一段全新的旅程，每一件产品都诞生于偶然的碰撞和融合。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://arcade.1688.com', 1615273978, 1615949728);
INSERT INTO `p_brand` VALUES (67856, 1937, 'AROUNDtheTREE', 3, 'AROUNDtheTREE', 'https://oss.yiwofa.com/brand/20210309/202103091155077451396201.png', 'https://oss.yiwofa.com/brand/20210309/202103091156358247546000.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/c59df371f4e96a2da0008ccd479a8da1.png,https://oss.yiwofa.com/brand_banner/20210317/03e158284542cd33b1c951947b7ef98d.png,https://oss.yiwofa.com/brand_banner/20210317/707fab18585880ec985286184cead1ec.png', 'AROUNDtheTREE是一个自豪的葡萄牙户外家具品牌，他们秉承葡萄牙传统文化与价值观，注重产品的细节，致力于打造独一无二的产品。AROUNDtheTREE融合先进技术与古老方法，在设计和自然中完美结合这两个元素，富有创意而又精细地处理着天然的木材，他们专注于细节，每一件产品都拥有着手工制品的独特之美。', 3.00, 583, 202, 56, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://aroundthetree.1688.com', 1615273978, 1615951049);
INSERT INTO `p_brand` VALUES (67906, 1938, 'MENU', 3, 'MENU', 'https://oss.yiwofa.com/brand/20210309/202103091156054618911040.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157503181282648.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/06c0c2fa93656550e308285c270fc41c.png,https://oss.yiwofa.com/brand_banner/20210317/3c9c1e96f538f6a283fa2e49250b06f1.png,https://oss.yiwofa.com/brand_banner/20210317/bd67b2876373b7e09286337e89db9a70.png', '来自丹麦的家族设计公司Menu创建于1978年，Menu传承了斯堪地那维亚设计的冷静、沉稳与现代，推崇「质量」、「实用」与「美感」并行的设计传统，强调在简洁优美的造型中融入人体工学的概念，并且在产品设计的质地上大方展现欧洲工艺设计的精巧技术。Menu 不仅网罗老、中、青设计师，强调『创意』是它的中心理念，menu 在对待创意这回事，尽量放任设计师的想像力，在质材和外型上，不断任由设计师实验和探索。所以 menu 的设计师敢於向现有的生活用品外型提出质疑，也实验将现有的东西以新方式组合。', 3.00, 583, 202, 272, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://menu.1688.com', 1615273978, 1615951523);
INSERT INTO `p_brand` VALUES (67956, 1939, 'CHRISTOPHER BOOTS', 2, 'CHRISTOPHER BOOTS', 'https://oss.yiwofa.com/brand/20210309/202103091155182361587094.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156546234190038.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/0db3a85f74ed3bb1c1bec447d10f3979.png,https://oss.yiwofa.com/brand_banner/20210317/01fdc0d0546c76c8ffb7141826c5ca64.png,https://oss.yiwofa.com/brand_banner/20210317/238f617fbbb61e2341b7a9b144dcc6c5.png', 'CHRISTOPHER BOOTS品牌灯具别致的造型让人印象深刻，呈现出将自然与古典结合的古希腊式审美。Christopher Boots，国际知名的工业设计师，2011年建立了自己的建筑照明设计工作室。Christopher与不同的客户和合作者紧密合作&amp;ndash;包括爱马仕，维多利亚国家画廊和墨尔本Elenberg Fraser，Christopher为他们提供限量版和定制产品。其手工作品--包括灯光，家具和物体--探索建筑和几何结构的有机形状，灵感经常来源于植物，动物和矿物。Christopher的希腊特色体现于他的作品中，神话核心概念不断贯穿融合自然和古典。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://christopherboots.1688.com', 1615273978, 1615951864);
INSERT INTO `p_brand` VALUES (68006, 1940, 'AYTM', 4, 'AYTM', 'https://oss.yiwofa.com/brand/20210309/202103091155094236588206.png', 'https://oss.yiwofa.com/brand/20210309/202103091156389164545545.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/c3b007b502862a9320e8caf1c2695422.png,https://oss.yiwofa.com/brand_banner/20210317/a63fb63d3e34094dfccb64fa6023f41b.png,https://oss.yiwofa.com/brand_banner/20210317/22e89438c02391186ef43379ee7c8486.png', '年轻的丹麦品牌AYTM注重高品质和精致细节、运用与众不同的北欧设计，让人过目难忘。新品牌AYTM的背后是Kathrine和Per Gran Hartvigsen夫妇，他们自2004年以来成功运营了Gran Living ApS公司。自成立以来，该公司已经为顶级家具连锁店设计并导入了优质家居室内装饰，并且具有丰富的趋势发现经验，开发自己的设计，并为家庭生产室内装饰。这一经验现在应该证明对建立AYTM有利。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://aytm.1688.com', 1615273978, 1615952984);
INSERT INTO `p_brand` VALUES (68056, 1941, 'PULPO', 17, 'PULPO', 'https://oss.yiwofa.com/brand/20210309/202103091156153344581052.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158092811893242.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/ab9f7c523096e39312efa5647fe825a0.png,https://oss.yiwofa.com/brand_banner/20210317/f1a3ca999e330268d40637165682d531.png,https://oss.yiwofa.com/brand_banner/20210317/5da4c31627d2adbf120f968f04a55595.png', '创造一些东西的乐趣，与设计师的密切合作。创造物品的乐趣，与设计师的紧密合作，制造厂的高质量产品和辛苦付出，对材料的热爱，以及强大的功能&amp;mdash;&amp;mdash;所有这些都是我们独一无二的产品的重要组成部分。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://pulpo.1688.com', 1615273978, 1615953368);
INSERT INTO `p_brand` VALUES (68106, 1942, 'GINGER&amp;JAGGER', 2, 'GINGER&amp;JAGGER', 'https://oss.yiwofa.com/brand/20210310/202103101019098441394654.png', 'https://oss.yiwofa.com/brand/20210310/202103101019063312538423.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/9c1996914bc6030f68405d856c5d4f4d.png,https://oss.yiwofa.com/brand_banner/20210317/c849ebd641a1620586a9042d7f1dabd6.png,https://oss.yiwofa.com/brand_banner/20210317/06a61de840e5cd05b8298d15c677ca99.png', 'GINGER&amp;JAGGER于2012年在欧洲推出，以创造手工打造的高端当代产品为傲，将大自然的雕塑形状变为永恒，独特的手工艺带来卓越的材料组合技术。品牌GINGER&amp;amp;JAGGER诞生于2012年，成立于葡萄牙的波尔图，其所有设计理念来源于大自然，从地球上各处富有诗意的美景中收集灵感，汲取大自然的流线形状，融合葡萄牙手工艺和一流材质，带来让人印象深刻的室内家具合集。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://gingerjagger.1688.com', 1615273979, 1615954036);
INSERT INTO `p_brand` VALUES (68156, 1943, 'La Chance', 1, 'La Chance', 'https://oss.yiwofa.com/brand/20210309/202103091156001839294082.png', 'https://oss.yiwofa.com/brand/20210309/202103091157376410222484.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/3677c0a98bf17c2a4c0f36223bc8b30c.png,https://oss.yiwofa.com/brand_banner/20210317/37e7c29333dfb0283c5c7cd4a995c3f5.png,https://oss.yiwofa.com/brand_banner/20210317/6710b0377cd7b3e288d2b398fe0f402a.png', 'La Chance是一家集家具、地毯和灯具设计于一体的公司，通过聘请最好的年轻设计师来打造最好的产品是其特色。 La Chance 的宏伟目标是阐释现代风格的法国装饰家具传统。&amp;nbsp;La Chance产品通过使用珍贵的材质，融合了精美、丰富和卓越的设计来打造产品。品牌重新引入了温馨而奢华的理念，旨在打破高冷而中立的概念性设计。La Chance的产品经久耐用，虽然使用时间较长但仍能光亮如新。所有的La Chance产品都由位于欧洲的专业工匠来打造。此外，La Chance专门用于采伐的可再造森林还获得了FSC(森林管理委员会)的持续开发认证。', 3.00, 583, 202, 271, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lachance.1688.com', 1615273979, 1615954299);
INSERT INTO `p_brand` VALUES (68206, 1944, 'GHIDINI1961', 2, 'GHIDINI1961', 'https://oss.yiwofa.com/brand/20210309/202103091155527189552203.png', 'https://oss.yiwofa.com/brand/20210309/202103091157216830998235.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/ff23a0843fc31b3b916a4f13fba8ed2d.png,https://oss.yiwofa.com/brand_banner/20210317/4e8dd67907bddb9e56f88068e4b47f16.png,https://oss.yiwofa.com/brand_banner/20210317/c4c773d105e8d96abac00e7c50b9983a.png', 'GHIDINI1961是意大利布雷西亚地区著名的家具品牌，以黄铜产品而著称。由意大利著名的建筑师与设计师Stefano Giovanni担任艺术指导，与一系列设计师共同探索黄铜这一材质的更多可能性。GHIDINI1961所呈现的设计，秉承精致的华丽感，把金色运用到极致，将艺术造型进行到底。是日常可以使用的&amp;ldquo;艺术品&amp;rdquo;。它的作品涵盖范围广泛，从精美的珠宝盒到餐具再到家具和工业灯具，一应俱全。所有产品表面一律处理成金灿灿的亮面黄铜色，用这种方式将黄铜大限度地凸现出来。', 3.00, 583, 202, 584, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ghidini1961.1688.com', 1615273979, 1615954624);
INSERT INTO `p_brand` VALUES (68256, 1945, 'DUFFY LONDON', 15, 'DUFFY LONDON', 'https://oss.yiwofa.com/brand/20210309/202103091155464646854133.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157069863928244.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/f1dac21f008a5eba8ba4d4a0e4d01481.png,https://oss.yiwofa.com/brand_banner/20210317/c7b982dba76e7411f5ab758258177a88.png,https://oss.yiwofa.com/brand_banner/20210317/b9119f398327d900de81158a152c0340.png', 'DUFFY LONDON的设计是基于概念的，将艺术和功能与重力，几何和幻觉概念相结合。2002年，布莱顿大学毕业生设计创始人Christopher Duffy。很久以前，DUFFY LONDON已经从厨房长大，现在在伦敦进行他们的家具制作魔术。 Christopher Duffy的创意灵感来源于设计师，工匠和制造商，他们将这些概念转化为高质量的作品。 拥有强大的生态证书，一切都是由英国技术熟练的手工人员使用可持续木材和其他环保材料和媒介手工订制。&amp;nbsp;', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://duffylondon.1688.com', 1615273980, 1615954892);
INSERT INTO `p_brand` VALUES (68357, 1948, 'MOROSO', 1, 'MOROSO', 'https://oss.yiwofa.com/brand/20210309/202103091156072011827359.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157555381592855.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/a99b1302528456e8f89c87597a3291ec.png,https://oss.yiwofa.com/brand_banner/20210317/94eb103c2b74065ee8f3f2fe14c2e86a.png,https://oss.yiwofa.com/brand_banner/20210317/c7f156cabc84bdc9ec2f9576639c8d87.png', '意大利MOROSO誉为家具行业的sweetheart(\"甜心\")--她所独具魅力的是色彩奔放而不失优雅的迷人气质，典雅，温馨，而且浪漫，别有意味的回旋，大胆的色块拼盘，无不透露出MOROSO的十足情调。意大利MOROSO，致力于创造出高质量的沙发和扶手椅的品牌。自从1952年意大利MOROSO 就开始与知名设计师，比如Ron Arad、Carlo Colombo、Enrico Franzolini、Marc Newson,、Toshiyuki Kita和Patricia Urquiola 等合作，设计沙发、扶手椅和配饰。 1994年6月24日，MOROSO 成为意大利第一个获得ISO9000和ISO9001认证的家具公司。另外，1999年4月获得ISO14001认证。 意大利MOROSO 沙发，环保、舒适、艺术、合理是其永恒的设计理念，世界著名的戏院、剧场、体育馆、酒店、宾馆、度假区以及世界著名的跨国公司、航空公司与航机都以拥有MOROSO的沙发、座椅为荣。 产品展示 MOROSO 家具主要代表了前卫和稀有艺术在家具上的反映。从结构上看，MOROSO 家具都讲究比较简洁的线条，但线条的组合却又是超大众化的;从风格来看，MOROSO 一般都追求现代简约;从色彩上看，MOROSO 一般都摈弃了镶金镀银，而是以比较大胆的色块组合追求视觉上的强烈冲击。 当然，意大利MOROSO 家具最主要的特点还在于设计师的原创性，集合了现代设计师们无数奇异的构思与灵感，MOROSO 往往具有极强的视觉效果，但却总是让人觉得与&amp;quot;奢华&amp;quot;不沾边，但由于凝聚了大批先锋派设计师毕生的心血，MOROSO 家具在价格上也显示出了极高的定位。因此又被人称为&amp;quot;不动声色的奢华&amp;quot;或&amp;quot;第二眼的奢华&amp;quot;。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://moroso.1688.com', 1615273981, 1615956427);
INSERT INTO `p_brand` VALUES (68407, 1949, 'GUBI', 2, 'GUBI', 'https://oss.yiwofa.com/brand/20210309/202103091155535965609286.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157239889266962.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/adea0dcf88a9901eeb797f2c085d5eaa.png,https://oss.yiwofa.com/brand_banner/20210317/a4c5ba5653f994e8991effb9d0d885eb.png,https://oss.yiwofa.com/brand_banner/20210317/e198888a9530b72ac0a6949fdb3c4c58.png', 'GUBI认为可以给人深入思考的设计特点是通过简单、独特外形、原材料和创新技术挑战时间与空间的转换。1967年，GUBI、Lisbeth Olsen和Jacob三人共同创办了GUBI公司。起初三人侧重于Olsen家具设计和销售纺织品。为了打造自己的品牌，他们开办了一家概念工作室。实际上，他们是第一批将Prada和Helmut Lang引入丹麦的先行家。2001年，他们将目光转向家族企业。从最初的创意转向适合当代潮流的品味，使GUBI在全球设计领域中拥有自己的一席之地。 上世纪30年代到70年代许多被遗忘的经典图标又被GUBI重新找回，来自法国、意大利、英国、西班牙、瑞典、丹麦、匈牙利、德国、日本等世界各地的艺术家、雕塑家、设计师纷纷对其进行了再次创作。GUBI的设计源于对钻石神奇魅力的想法和灵感。与不拘一格的创新型设计师合作，使打造出的每一件产品都能述说一段动人的故事。GUBI呼吁人们从心出发，不走寻常路。一个战略性的举措使我们对冒险进入未知世界充满无尽渴望。当然，一个新设计的问世总是充满风险，但是这种风险又使GUBI领先一步。例如：Komplot设计的首个3D椅子，这款椅子荣获许多奖项，并被MoMa纳入他们的永久系列中。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://gubi.1688.com', 1615273981, 1615956655);
INSERT INTO `p_brand` VALUES (68408, 1950, 'HAY', 1, 'HAY', 'https://oss.yiwofa.com/brand/20210309/202103091155538080129435.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157243718927521.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/09c6f13c6a37477131252ca44019eb26.png,https://oss.yiwofa.com/brand_banner/20210317/30c1dfea90c38bbd7714dd93d844aade.png,https://oss.yiwofa.com/brand_banner/20210317/0b543da3c2c805954fed2e43667cb676.png', '用色恬静又不失活泼的HAY不仅仅在欧洲市场崭露头角，诸多设计同时为纽约当代艺术中心及蓬皮杜博物馆收藏丹麦HAY成立于2002年，是家饰设计品牌。成立之初就抱有再创60年代丹麦家具设计风潮的野心。10年过去，用色恬静又不失活泼的HAY不仅仅在欧洲市场崭露头角，诸多设计同时为纽约当代艺术中心及蓬皮杜博物馆收藏。', 3.00, 583, 202, 586, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://hay.1688.com', 1615273981, 1615957507);
INSERT INTO `p_brand` VALUES (68458, 1951, 'MAGIS', 1, 'MAGIS', 'https://oss.yiwofa.com/brand/20210309/202103091156047577259042.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157472006220811.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/8e8287a50fe2d5bd14e3d8a036009bd0.png,https://oss.yiwofa.com/brand_banner/20210317/2ca9b683899bdddf52e92df939f1d8fb.png,https://oss.yiwofa.com/brand_banner/20210317/55bafe8fa742aff03627110af3139c5c.png', '意大利品牌MAGIS于1976年由被《Wallpaper》选为「10位将改变我们生活方式的人」的Eugenio Perazza创立。这些年他们在设计界以一件件令人无法反驳的精彩作品，向世人证明了自己的价值。意大利MAGIS由Eugenio Perazza创立于1976年 ，旗下商品以造型活泼、时尚前卫、展现生活趣味为品牌特色。MAGIS向来以超越及带领主流市场为宗旨，拥有大量国际顶级设计师。原以塑料家具驰名，后渐渐转而探索更高科技的合成铝、不锈钢片及压铸金属等，结合高科技大量生产家具以及生活用品。', 3.00, 583, 617, 618, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://magis.1688.com', 1615273982, 1615957926);
INSERT INTO `p_brand` VALUES (68508, 1952, 'Viso Project', 1, 'Viso Project', 'https://oss.yiwofa.com/brand/20210309/202103091156244022387295.png', 'https://oss.yiwofa.com/brand/20210309/202103091158328753109520.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/32a5f0b6ba7b94e0ba3ea49e4a991012.png,https://oss.yiwofa.com/brand_banner/20210317/2d8b071acebae370f659928ab5048780.png,https://oss.yiwofa.com/brand_banner/20210317/cdc7566fda4798f68c636212fa3c5ada.png', 'Viso Project追求专业的家居设计，力求为使用者打造出融合艺术与设计的独特生活方式。VISO通过受艺术和设计界启发的深厚根源进行创作，创造出了由欧洲和美国的专业工匠和制造商设计的独特服装和物件。VISO创建单个，限量版物品的协作胶囊系列，其中包括服装，配饰，陶瓷，家居服，行李箱和新颖物品以及许多其他物品。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://visoproject.1688.com', 1615273984, 1615958102);
INSERT INTO `p_brand` VALUES (68558, 1953, 'FLOU', 1, 'FLOU', 'https://oss.yiwofa.com/brand/20210309/202103091155512199277648.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157184198882706.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/c7e7573509a3707dc95af9d2f404a9c7.png,https://oss.yiwofa.com/brand_banner/20210317/caa63c46e68c61b070f7f6057d7290b3.png,https://oss.yiwofa.com/brand_banner/20210317/c502ef7339834ad2eeee1b796463229e.png', 'FLOU在意大利已经有五十多年的历史，自1978年开始，工厂聘请了著名的设计师VicoMagistretti设计了FLOU的第一款床Nathalie，藉此FLOU渐渐成为了一家专著于床具的公司，并且不断推陈出新，成为闻名欧洲乃至世界的经典顶级床具公司。在床的设计制造领域中，FLOU公司一直占据了翘楚地位。FLOU在意大利已经有五十多年的历史，自1978年开始，工厂聘请了著名的设计师VicoMagistretti设计了FLOU的第一款床Nathalie，藉此FLOU渐渐成为了一家专著于床具的公司，并且不断推陈出新，成为闻名欧洲乃至世界的经典顶级床具公司。50多年的历史 它追求自然环保、讲究完美质量和使用寿命，其中Nathalie系列更是被称为床具中的经典。VicoMagistretti和RodolfoDordoni两位著名设计师设计了数款造型完美的床具，而且在床的功能设计上，独具匠心，堪称一流。 Flou的床上用品系列同样新颖别致，或热烈奔放、或淡雅素净，与FLOU床具完美搭配，一起营造浪漫气质和高贵品质，让人远离世事的喧嚣与纷扰。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://flou.1688.com', 1615273988, 1615958613);
INSERT INTO `p_brand` VALUES (68608, 1954, 'KOKET', 2, 'KOKET', 'https://oss.yiwofa.com/brand/20210309/202103091155591407935220.png', 'https://oss.yiwofa.com/brand/20210309/202103091157352484342670.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/3d66ab204efe7b705e1f8e1af3c7f04b.png,https://oss.yiwofa.com/brand_banner/20210317/ceb182da67011f3dc538d96ba53163e0.png,https://oss.yiwofa.com/brand_banner/20210317/cfeb2b6aabafc9d9bc372f3607648c30.png', 'KOKET作为来自意大利的家具品牌，便在愉悦了人们感官的同时，饱含了丰富的艺术细节与异域风情。大胆的设计审美，高影响力的活动，奢华的演示传达KOKET的使命。KOKET的每一件家具都独有个性，深具奢华质感，是家具设计师们的精心之作。KOKET的设计，也是一种充满了冒险、乐趣、激情的生活方式，它肩负着一种引领时尚与性感的使命，每一件作品都如艺术品，值得所有爱好者与使用者典藏。他们总是用创意来诠释经典，用华丽和不拘一格的家具来助你打造时尚、自然而又充满神秘色彩的唯美之家，就连他们的广告也是风格独特，无论是在装饰性还是实用性方面都做了最大化的放大效果。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://koket.1688.com', 1615273989, 1615959235);
INSERT INTO `p_brand` VALUES (68658, 1955, 'Established&amp;SONS', 1, 'Established&amp;SONS', 'https://oss.yiwofa.com/brand/20210310/202103101019093598979834.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019053646912134.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/83ff3177790de5b2d5a5018222301a14.png,https://oss.yiwofa.com/brand_banner/20210317/7dca4043defc2eff0f5cbddb39651cf5.png,https://oss.yiwofa.com/brand_banner/20210317/746c6baed1209f8cd5f7ed40eea623a0.png', 'Established＆Sons是一个英国品牌，代表着当下的设计创新趋势。Established＆Sons是代表当代设计创新的英国品牌。作为倡导个人表达的品牌，它拥有极高的知名度和尊重度，设计爱好者转向Established＆Sons系列，寻找具有风格和个性的富有想象力的产品。 Established＆Sons愿意为艺术家和工匠提供自由，提供原创的开创性思想，演变成卓越的家具和照明系列。 该公司提出有冲击性、挑战和受众范围大的设计。收藏家选择提供特色和谈话点，一些设计推动技术的发展。依靠技术精湛的工匠和尖端的制造技术，设计在极致和不同寻常的产品。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://established.1688.com', 1615273992, 1615959396);
INSERT INTO `p_brand` VALUES (68708, 1956, 'E15', 3, 'E15', 'https://oss.yiwofa.com/brand/20210309/202103091155471597640512.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157083657249671.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/5d8bd498eef4761a9214cef7bf252c56.png,https://oss.yiwofa.com/brand_banner/20210317/4231e66b3529d994945ae3617f3e3f68.png,https://oss.yiwofa.com/brand_banner/20210317/ea9028428c17824080ab2354176ab77b.png', 'E15产品取材精良，在手工制作的生产方式中融入创新理念，因此产品质量稳定、设计新颖。E15的总部设在法兰克福，它拥有遍布全球的零售网络，有超过600家的合作伙伴，并且在法兰克福和米兰开设了旗舰店。除了家具、灯具和配件的生产，E15还与 PHILIPP MAINZER 建筑与设计工作室合作，提供建筑及室内设计服务，在国际范围内开展各个项目。 E15将注重环保作为其家具、灯具和配件生产的重要原则。保证采用可持续和可循环使用的生产材料，它生产的家具经久耐用。由于其原料的获得途径和生产流程绿色无污染，以及定制性的订单操作流程，E15实现了环保节能的循环生产模式。由于对产品质量的严格要求，E15不仅成为传统手工艺的传承者，更推动了其发展与传播，使其成为了一种潮流。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://e15.1688.com', 1615273992, 1615959812);
INSERT INTO `p_brand` VALUES (68758, 1957, 'CIPRIANI HOMOOD', 2, 'CIPRIANI HOMOOD', 'https://oss.yiwofa.com/brand/20210309/202103091155189841533520.png', 'https://oss.yiwofa.com/brand/20210309/202103091156551011864249.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/1866046a018d03524562528c8b60d4d5.png,https://oss.yiwofa.com/brand_banner/20210317/43af939e7f6eeb748936d81bdb3bb991.png,https://oss.yiwofa.com/brand_banner/20210317/69f9f32de11216e1c3d5dae57171c35e.png', '享受简约的奢华设计和温暖精致的产品，这是CIPRIANI HOMOOD永恒不变的追求。CIPRIANI HOMOOD的设立源于创造一种用以表达艺术、奢华和高雅的特别体验的愿景。 创造美，创造稀有的让人惊艳的家庭乐趣。寻求独特产品系列，解锁独特且充满活力的生活。采用简约线条和优质材料，为客户提供独特的个性化服务。 所有产品均采用精心制作的木材和完美和谐的表面处理，独特的压合和内衬以及珍贵的皮革。 在建筑、设计和艺术上展现出现代风格和永恒追求之间的完美融合。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cipriani.1688.com', 1615273994, 1615960090);
INSERT INTO `p_brand` VALUES (68808, 1958, 'CECCOTTI COLLEZIONI', 5, 'CECCOTTI COLLEZIONI', 'https://oss.yiwofa.com/brand/20210309/202103091155169565903988.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156534266625165.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/fbf4e199a25ccf6a23ead76866b08678.png,https://oss.yiwofa.com/brand_banner/20210317/6c43b865da2fff0b17b46a63b0d8aac3.png,https://oss.yiwofa.com/brand_banner/20210317/bbee83059cd35d6fb3f24fb0c38d6234.png', '以高品质的木工家具为主力。经典的设计和高水准的手工生产使CECCOTTI COLLEZIONI闻名于家具领域。CECCOTTI COLLEZIONI是来自意大利的高端家具品牌，由Aviero Ceccotti创立生产于20世纪50年代末期。 它的独具特色，也来自它对每一个组件的精准选择。胡桃木的深沉色调、纹理和质感，体现了家具的沉稳，理性，极好的展现了家具的奢华品质；樱桃木暖色赤红感觉，彰显高贵大气之风。CECCOTTI精选的材质配以玻璃和珍贵的大理石，将它的艺术内涵和工艺价值体现的淋漓尽致，使其奢华艺术之美光荣绽放。 CECCOTTI在材质甄选上有着几近苛刻的要求，除了培育树木所需要的时间，单从原木搁置到可以加工使用就需要20年。而为了能制造优良品质的家具，CECCOTTI通常只采用木纹漂亮、色彩统一的最高等级木材；同时，为了追求产品的优美曲线，CECCOTTI会为了一条完美的弧线而不惜浪费整棵树，只采用不足1/3的原木材料。CECCOTTI的每件产品几乎完全由手工制造、打磨而成，产品的零部件之间都以榫卯结合为主，鲜少使用金属五金，这使得CECCOTTI的产品不仅坚实牢固，柔滑如婴儿肌肤般的木质表面更具纯正的原木质感。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ceccotti.1688.com', 1615273995, 1615960417);
INSERT INTO `p_brand` VALUES (68858, 1959, 'CARL HANSEN &amp; SON', 1, 'CARL HANSEN &amp; SON', 'https://oss.yiwofa.com/brand/20210310/202103101019089068202180.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019044274851426.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/ddbd0dab13bce93262ed10260f297754.png,https://oss.yiwofa.com/brand_banner/20210317/5ddf9f272aa9d93ceed53950a6024592.png,https://oss.yiwofa.com/brand_banner/20210317/66b5e9618b5cd4b51403a8d5ab89792b.png', 'CARL HANSEN&amp;SON在创建自己的公司时带有坚定的信念：杰出的手工工艺和规范有序的生产能够为客户提供价格合理的高端品质家具产品。手工技术工艺含义颇丰。对于我们来说，这就是我们的全部，而且自从CARL HANSEN&amp;amp;SON于1908年在丹麦的欧登塞创立自己的公司时就一直如此。直到现在，我们也一直在强化这种简约而坚定的理念。我们融合了传统木刻技术工艺和最新的技术来生产价值永恒的家具产品。 我们当前生产的大多数家具产品，是由二十世纪三十年代到六十年代的顶尖丹麦建筑师设计的，但是当今每一件家具产品中所蕴含的设计、理念和工艺和当时所处的时代背景是息息相关的。这就是为何我们专注于采用最好的材质、聘请最好的设计师的原因所在，这也一直都是Carl Hansen &amp;amp; Son品牌在全球市场上的立足之本。 在Carl Hansen &amp;amp; Son品牌的产品中，对于不断传承这种可持续发展理念，我们深感责任重大，即生产经久耐用的家具产品，产品源材质来源于可控在造林区，采伐方式尽可能的将对环境的影响降到最低。 我们公司的技术工艺娴熟的能工巧匠们，仍然满腔激情、全心全意帮助我们在Araup工厂出品的每件家具产品中，都保持了同样的高端品质。每一件家具产品都蕴含着前瞻的理念、精细的考量和精湛的手工工艺。这就是为何我们能够讲述每一件家具产品背后故事的原因所在。我们希望我们的家具产品能够融入您精致而美好的生活。', 3.00, 583, 202, 587, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://carlhansen.1688.com', 1615273995, 1615960545);
INSERT INTO `p_brand` VALUES (68908, 1960, 'Campeggi', 3, 'Campeggi', 'https://oss.yiwofa.com/brand/20210309/202103091155158853744757.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156504790198792.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/3de073d92b464e75c2fcf7e918ee04b3.png,https://oss.yiwofa.com/brand_banner/20210317/aace6c58aab68090efa8ed4267bf819b.png,https://oss.yiwofa.com/brand_banner/20210317/c5d585836e5a0a2a83e8f7b6279f2657.png', 'CAMPEGGI 的词典里向您展示这些词汇——舒适、灵活、移动、实用、经济、优雅、游戏以及永远乐此不疲。为避免固步自封，克服停滞不前，重新获得进步和乐趣，CAMPEGGI正在构思一个光明而有活力的新想法，其中的的物体可以根据您居住、生活和改变的乐趣而移动或者变换。 CAMPEGGI系列的产品力求与实际对话，这也会成为未来几年的趋势，这种实际可以为技术创新，摒弃陈腐、眩晕和奢侈，拒绝静态化、追求有活力的智能产品的人们提供宝贵参考。 静止有碍社会进步，停滞不前、没有变化的事物注定消亡;只有直面变化才能存在发展下去。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://campeggi.1688.com', 1615273996, 1615960802);
INSERT INTO `p_brand` VALUES (68958, 1961, 'Cappellini', 1, 'Cappellini', 'https://oss.yiwofa.com/brand/20210309/202103091155154126917254.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156504805436843.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/206e6ed7ced6d0515075edf62cfc435c.png,https://oss.yiwofa.com/brand_banner/20210317/3668bb8b40bf01d5c3859628499e0008.png,https://oss.yiwofa.com/brand_banner/20210317/d32b4824f0bc9a64f0ee3ee9616c5ab8.png', '洛可可艺术传统风格的意大利顶级名牌家具。由于文艺复兴运动带给了人们太深远的影响，它在意大利家具市场一直被认为是意大利18世纪风格家具处于主导地位的供应商。Cappellini以其艳丽、细腻，表面上的感官刺激及造型的结构线条婉转柔、优雅安逸等特点，通过细的差别却能展现全然一新的设计概念，从历史、地理、世界多元文化中萌发出的设计灵感，成为世界奢侈品牌。 设计是一种流行，结合了时尚成为人们日常生活的一部分，通过细的差别却能展现全然一新的概念，这便是成立于1946年的意大利名品家具坎佩乐尼的设计理念。它从诞生的那一刻起，就成为世界当代家具设计的推动者从纽约现代艺术博物馆到法国蓬皮杜文化中心，从波士顿博物馆到东京现代艺术馆，几乎全世界的艺术博物馆都收藏着Cappellini的设计，它向全世界展示了Cappellini对于当代、前卫和实验的理解。Cappellini从历史、地理、世界多元文化中萌发出设计灵感，最后集结出创新的思维，每个创意都是不同元素间对话的基础和简短表达。著名的&amp;ldquo;S&amp;rdquo;椅已成为Cappellini在全世界的设计标志领先、卓越的设计是Cappellini一贯的追求，全世界的优秀设计师在不断更新着Cappellini的产品，赐予这个品牌以力量与鲜明的个性，向人们诠释着当代艺术的意境及其透过最新产品所展现出的全新设计理念。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cappellini.1688.com', 1615273996, 1615961759);
INSERT INTO `p_brand` VALUES (69008, 1962, 'Casamania', 1, 'Casamania', 'https://oss.yiwofa.com/brand/20210309/202103091155161656765713.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156514309138941.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/1ef88224ab3963e4e579a0fd804331e3.png,https://oss.yiwofa.com/brand_banner/20210317/1114555894f1dfedd4f49ea5c8c36502.png,https://oss.yiwofa.com/brand_banner/20210317/c0e22c091fb67d2a07fa8ee3e00a9eb5.png', 'CASAMANIA的设计以其大胆的用色、别致的造型、干净流畅的造型著称，可以为任何空间带来视觉上的和谐。CASAMANIA成立于1984年，书橱系列是公司生产的核心。在1999年，ELIS DOIMO 成为公司总裁。她为CASAMANIA的产品系列带来关键的转折点&amp;mdash;&amp;mdash;建筑师和设计师致力于开发新产品以拓展其市场份额。 2004年起，它开始和GIULIO IACCHETTI、 LUCA NICHETTO、 FABIO NOVEMBRE、 KARIM RASHID以及JOSH OWEN合作：为公司带来新的发展契机&amp;mdash;&amp;mdash;使用塑料并采用视觉刺激的造型。2009年CASAMANIA的生产量呈爆炸式发展。同时，它选择摒弃塑料的使用，并致力于研究新的生产线，通过纯材质更好地表达他们理念，这些纯材质包括：木材、皮革、金属、薄纱。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://casamania.1688.com', 1615273996, 1615962175);
INSERT INTO `p_brand` VALUES (69058, 1963, 'L‘OBJET', 15, 'L‘OBJET', 'https://oss.yiwofa.com/brand/20210309/202103091155598687511851.png', 'https://oss.yiwofa.com/brand/20210309/202103091157372002222605.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/217606d1a8b913be6c09b1599a9c2cfc.png,https://oss.yiwofa.com/brand_banner/20210317/0777a17735d1d53d8c03bc672d40f82a.png,https://oss.yiwofa.com/brand_banner/20210317/2aa6ac3b3dcb7fa8c81034639525e557.png', 'LOBJET是法国著名室内家居用品品牌，由设计师Elad·Yifrach创立，LOBJET的所有产品都来自于他的原创设计，他所设计的咖啡杯和茶杯都是轻奢一族的挚爱。L&amp;#39;OBJET每一件用品和器具都十分高贵大气，呈现独有的艺术美感，哪怕仅仅是一张照片，就足够吸引住你的眼球，并生发一种对生活的无尽感慨，有时就觉得这样的器物其实是一种生活指引，在指向人们通往更为质感的选择。L&amp;#39;OBJET品牌追求精益求精的地步，简直令人叹为观止，它几乎和&amp;ldquo;量产&amp;rdquo;这个词距离很遥远，因为每件器具包括上面高雅的纹理，都是纯手工打造。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lobjet.1688.com', 1615273997, 1615962737);
INSERT INTO `p_brand` VALUES (69108, 1964, 'baxter', 2, 'baxter', 'https://oss.yiwofa.com/brand/20210309/202103091155111540902255.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156438891960473.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/f5b8847c5fdf19f7a1aef2d04781c171.png,https://oss.yiwofa.com/brand_banner/20210317/3612fb42da54415819fa5ca556a1f1d5.png,https://oss.yiwofa.com/brand_banner/20210317/24af5215b0cf8d18687fb86dd099239c.png', 'Baxter旨在打造世界级的独特品牌，为拥有纯粹独特精致生活品味的人群，提供现代艺术奢华的生活品味，创造亘古长青，永世流传的独特经典。baxter的故事起源于20年代，从运用皮革开始。最开始的产业源于一款经典独特风格沙发的生产，这款沙发的优雅独特风格使baxter在业界内成为值得信赖的经典品牌。今天的产品是通过独特的设计，结合团队独特的艺术品味凝聚而成。 如今的baxter已经成为了将技术与艺术相结合的典范，并且改变了单纯的传统制造行业，baxter可以提供集人性化和艺术化于一体的设计方案，向更全面的服务行业转变。形象顾问，建筑师，艺术收藏家和设计师们一起日复一日把创意和实践相结合，才铸就了baxter今日的成功和辉煌。运用最精良的皮革，结合最杰出的制造工艺，baxter旨在打造世界级的独特品牌，为拥有纯粹独特精致生活品味的人群，提供现代艺术奢华的生活品味，创造亘古长青，永世流传的独特经典。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://baxter.1688.com', 1615273997, 1615962850);
INSERT INTO `p_brand` VALUES (69158, 1965, 'BELLAVISTA', 1, 'BELLAVISTA', 'https://oss.yiwofa.com/brand/20210309/202103091155113106805265.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156442980933851.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/46d6d3e6b639d372af0298071549df36.png,https://oss.yiwofa.com/brand_banner/20210317/2bfabe080c712568cdede6bb669197b8.png,https://oss.yiwofa.com/brand_banner/20210317/7006cc50a63658a9ba859d3eabab19f7.png', 'BELLAVISTA致力于保持手工制作的家具工艺的手工艺遗产和技艺，并且每天努力改进其业务。豪华的意大利家具，专门在意大利制造， BELLAVISTA致力于保持手工制作的家具工艺的手工艺遗产和技艺，并且每天努力改进其业务。受到过去审美线条的启发，并借鉴意大利丰富建筑的美感，这些作品呈现出充满活力，浓厚都市气息的外观，并与当代空气相结合。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bellavista.1688.com', 1615273997, 1615962970);
INSERT INTO `p_brand` VALUES (69208, 1966, 'arketipo', 1, 'arketipo', 'https://oss.yiwofa.com/brand/20210309/202103091155074689490492.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156353709692279.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/6ad7b9acce3d3a1126d7d7ac552d388c.png,https://oss.yiwofa.com/brand_banner/20210317/7316b6d66380153574abbdd3ce487b4c.png,https://oss.yiwofa.com/brand_banner/20210317/a59fb65279306745a1a20913faf3492e.png', '“好奇是我们的DNA——这句话肯定了ARKETIPO FIRENZE的创造性灵魂和对美的追求——它领导我们追寻新的沟通形式、新的材料和新的技术。只有用这种方法我们才能为客户提供真正一流的设计和产品质量。公司起源于八十年代，凭借对佛罗伦萨(ARKETIPO &amp;nbsp;FIRENZE)纺织制造质量的一腔热情创造出软垫家具，将高质量和对细节的关注以及充满活力的和永恒的形象相结合。在过去的几年里，它的主要目标是品牌强化和在高端市场的重新定位。 自2008年以来公司拓展了产品系列：除了沙发和扶手椅，还引进了其它配饰系列。这些家具配饰共同呈现出完整的、优雅的、精细同时具备功能性的舒适客厅。呈现出一种简单别致的生活，它将家具文化、传统和功能性紧密结合。 2011年ARKETIPO &amp;nbsp;FIRENZE被意大利Cattelan收购，Cattelan是家具配饰领域的全球领导企业。这对公司而言是一个新时代的开始：保留了过去价值理念的同时保障了公司业务的发展。 今天ARKETIPO &amp;nbsp;FIRENZE 的产品经过约800名经销商畅销意大利、奥地利、瑞士、英国、法国、俄罗斯、澳大利亚和中东。在美国也有相关商场，同时香港、新加坡和台湾市场也变得越来越重要 对ARKETIPO &amp;nbsp;FIRENZE而言，设计就是生命、是风格上的突破、是通过新颖的形式和材料表达自己的价值理念。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://arketipo.1688.com', 1615273997, 1615963588);
INSERT INTO `p_brand` VALUES (69258, 1967, 'SIGMAL2', 15, 'SIGMAL2', 'https://oss.yiwofa.com/brand/20210309/202103091156192006551004.png', 'https://oss.yiwofa.com/brand/20210309/202103091158164462384888.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/06546bce71b8e8d7175b62600d9bc26a.png,https://oss.yiwofa.com/brand_banner/20210317/46ed5ff54f3bf6cbd1b10a22b85794a6.png,https://oss.yiwofa.com/brand_banner/20210317/f48c624d4a60cf310f86aaf54924f354.png', '无数的物品将完全意大利制作与设计和艺术相结合，并与手工技巧和美感交织在一起。陶瓷，珐琅，金属和水晶散布金色釉料，有光泽和彩虹色的光束，决定了照明和室内设计的下一个趋​​势。Simone和Francesca Granchi，从事着一份独特的工作。他们是公司Sigma L2的未来：一家由他们的父母Paolo和Gianna在60年代创立的陶器工厂。50年前，在佛罗伦萨的这家工厂，他们开始烘焙花瓶，灯具和装饰品，这些都是艺术作品的灵感来源，并饰有珐琅，装饰品，触觉饰品，材料涂料，釉料，金银涂料。优秀的气质将空间变成温暖而优雅的氛围。', 3.00, 583, 202, 584, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://sigmal2.1688.com', 1615273998, 1615964115);
INSERT INTO `p_brand` VALUES (69308, 1968, 'MAXALTO', 1, 'MAXALTO', 'https://oss.yiwofa.com/brand/20210309/202103091156052803962169.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157499710666513.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/294d1b93d257806a75d4ab5fe870c095.png,https://oss.yiwofa.com/brand_banner/20210317/9a128823bce95bd8458607811d0032f6.png,https://oss.yiwofa.com/brand_banner/20210317/7c88710548ebf864df24de5773972ff3.png', 'MAXALTO运用传统手工技艺，用卓越的风格诠释木材，营造高品质的生活居家氛围，实现\"超越永恒\"的现代经典。意大利MAXALTO公司成立于1975年，与B&amp;amp;B Italia是兄弟品牌，同属 B&amp;amp;B Italia。MAXALTO 名字来源于意大利威尼托地区方言MASSA ALTO的发音，意为&amp;quot;最高级的&amp;quot;，也因此我们从中看出其品牌价值观。 MAXALTO 的产品整体风格沉稳、大气，从最早期的Afra和Tobia Scarp 开始，MAXALTO 的设计师们就一直坚持从古老的风格中寻找灵感，从近乎失传的传统木工技术中吸取经验。木材是MAXALTO 表达作品内在情感的最主要的元素：从早期产品的胡桃木、红木，到后所用的橡木、黑檀、松木，各种珍贵的木料搭配顶级的漆面处理工艺、做工考究的皮革和精湛的缝纫技术，传统技艺在现代审美的包装下得以华丽新生。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://maxalto.1688.com', 1615273998, 1615964531);
INSERT INTO `p_brand` VALUES (69309, 1969, 'BALERI ITALIA', 1, 'BALERI ITALIA', 'https://oss.yiwofa.com/brand/20210309/202103091155108279199102.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156429596881410.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/2f186aabd74eb5a8022d98a314681438.png,https://oss.yiwofa.com/brand_banner/20210317/81f0200842d537d879dd2e8c8657df0a.png,https://oss.yiwofa.com/brand_banner/20210317/e2bff61f35451095fb82213ad7956309.png', '1984年，Enrico Baleri与Marilisa Baleri联合创立了BALERI ITALIA（曾是“Cerruti Baleri”），这是一家位于意大利贝加莫Albano S. Alessandro的生产高端设计品质家具的公司。BALERI ITALIA&amp;mdash;&amp;mdash;来自意大利的潮流引领者1984年，Enrico Baleri与Marilisa Baleri联合创立了BALERI ITALIA（曾是&amp;ldquo;Cerruti Baleri&amp;rdquo;），这是一家位于意大利贝加莫Albano S. Alessandro的生产高端设计品质家具的公司。 在与知名设计师携手合作期间，例如Alessandro Mendini, Angelo Mangiarotti和Denis Santachiara，BALERI ITALIA推出过众多崭露头角的设计天才，例如年轻的Philippe Starck, Hannes Wettstein和Luigi Baroli。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://baleriitalia.1688.com', 1615273998, 1615964748);
INSERT INTO `p_brand` VALUES (69359, 1970, 'Arflex', 1, 'Arflex', 'https://oss.yiwofa.com/brand/20210309/202103091155072215441923.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156348443300960.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/c87b4aa90e68992e8133bdc7669565eb.png,https://oss.yiwofa.com/brand_banner/20210317/3697ea122d7b659e4aad18d585ad29e1.png,https://oss.yiwofa.com/brand_banner/20210317/7cef4c8783f66d18d03b6b0089e266e1.png', 'ARFLEX非常注重对文化和新技术产品的研究，公司于1951年在米兰IX TRIENNALE正式建立了第一间工厂，组建了销售团队。ARFLEX公司位于意大利CORSO DI PORTA VITTORIA, 其历史和发展有着特殊的意义，并赢得广大消费者的认可。ARFLEX公司的历史闪光点与其主张的创造性完全一致。两年的潜心钻研后，ARFLEX公司于1951年在米兰IX TRIENNALE正式建立了第一间工厂，组建了销售团队。 ARFLEX非常注重对文化和新技术产品的研究。LADY扶手椅、SLEEP-O-MATIC沙发、MARTINGALA扶手椅、FIORENZA扶手椅、FOURLINE扶手椅、LUCANIA椅子、DELFINO扶手椅、ELETTRA和NEPTUNIA椅子，这些经典产品均由BBPR工作室设计完成。除家庭家具外，办公家具和公共空间家具都扩大了产量。 1950-1960年，ARFLEX携手设计师ALBINI、ZANUSO、CARLO和ca&#115;IGLIONI对战后重新探讨现代运动在设计和构架方面的影响进行了重新定义。 1951-1954年，ARFLEX为汽车座椅设计了多款模型，这一新的设计可以替代之前的标准款式。海绵乳胶和松紧带的使用给用户带来更舒适的体验。座套可以任意更换，座椅靠背可以随意调节。 ARFLEX不断努力为那些驾车旅行的人们提供更舒适的装备。 1955-1960年，ARFLEX放眼国际市场，结合社会大众的品味，将产品销往比利时、荷兰、卢森堡、法国、瑞士和西班牙等国。 1969年，在意大利的LIMBIATE建立了新的工厂和展厅。1995年，米兰的展厅重新开放，展出了具有历史性的产品，结合了现代生产线和产品功能性，超越了现代产品的同时，具有独一无二的标志。', 3.00, 583, 202, 592, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://arflex.1688.com', 1615273998, 1615965352);
INSERT INTO `p_brand` VALUES (69409, 1971, 'ALIVAR', 1, 'ALIVAR', 'https://oss.yiwofa.com/brand/20210309/202103091155052544903405.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156302735400302.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/c0c4e0193f5571555cca26007f8f3de9.png,https://oss.yiwofa.com/brand_banner/20210317/5a0e53b9a4e2e48c24640e9678c2a014.png,https://oss.yiwofa.com/brand_banner/20210317/c2ad2baf039c2c20e0c6fe28c79ec063.png', 'ALIVAR成立于1984年，专门制定一些现代化的家具和设计历史的杰作，是国际知名的唯一一家生产最完整、最全面的重塑过去伟大设计师设计的家具和家具配件的公司，非常重视技术创新、设计和建筑领域。Alivar成立于1984年，位于托斯卡纳的佛罗伦萨。 我们是一家充满活力的公司，他们意识到不断发展的技术以及建筑和设计的进步。我们为每个空间生产现代家具，每一个都有独特的风格，但同时保持一致。Alivar的氛围有一个精致的风格，这是一个正在进行的工作，不是固定在单件上，而是整体解决方案。我们与各种材料合作，努力展示每种材料的内在品质，并为即使是最微小的细节设定了高标准。我们的作品是现代的，但不仅仅是时尚; 它们是解读室内装饰的特殊方式。我们提供两种不同的系列 家庭计划和辉煌的生活方式，为忠实于过去，展望未来的当代生活。 家庭计划：由意大利建筑师Giuseppe Bavuso设计的卓越设计和低调优雅的永恒展示。时尚，独特的国际吸引力和全意大利质量的家具。 辉煌的生活方式：轻松简单，舒适和温暖，低调的个性为这个系列中的每件作品定调，创造出亲密，精致和诱人的空间。 我们的设计面向享受奢华和精致家具以及购买意大利风格的消费者，他们欣赏它的天生质量和它所代表的价值。多年来，Alivar凭借完整的愿景赢得了声誉，其结果是客户，经销商和设计师被吸引到我们的公司，为我们的意大利当代生活提供全面的方法，而不仅仅是购买单件产品。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://alivar.1688.com', 1615273999, 1615965927);
INSERT INTO `p_brand` VALUES (69459, 1972, 'Alias', 1, 'Alias', 'https://oss.yiwofa.com/brand/20210309/202103091155048399540350.png', 'https://oss.yiwofa.com/brand/20210309/202103091156297858835517.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/9710152f6947f489881e6607c88ee970.png,https://oss.yiwofa.com/brand_banner/20210317/2a96bc9c88eb1fe407813d33c7d2bc36.png,https://oss.yiwofa.com/brand_banner/20210317/911097954c55dc277474cae446b2fbf8.png', '技术轻巧，多功能，创新。自1979年以来，这些一直是Alias的首要价值，Alias是意大利设计最统一的名称之一。意大利Alias自1979年创立以来：技术优势、多功能性和开拓创新一直都是作为意大利设计知名品牌Alias的首要理念。 促使该公司与一些着名设计师签名密切相关的价值观。经过多年发展壮大的合作关系，Alias已经成功地揭示了每位设计师的独特才能。 由于其特有的交叉使用，Alias设计家具非常适合各种场合的合同用途。由于其多方面的原因，这一使用领域同样适用于这种日益广泛，一致和匹配良好的产品目录。 Alias的故事始于1979年，Giandomenico Belotti的意大利面椅是一张椅子，这是Alias的第一个创作作品，成为纽约现代艺术博物馆收藏的一部分。Alias是Altagamma基金会的成员：自1992年以来，Altagamma基金会将意大利高端企业联合在一起，从事文化和艺术行业，这些公司在创新，顶级质量，设计，服务水平和声望方面获得国际认可。', 3.00, 583, 202, 56, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://alias.1688.com', 1615273999, 1615966971);
INSERT INTO `p_brand` VALUES (69509, 1973, '&amp;tradition', 1, '&amp;tradition', 'https://oss.yiwofa.com/brand/20210310/202103101019083757608798.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019023168431282.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/a3e7ab4b3359125a54fbcb222bc867fb.png,https://oss.yiwofa.com/brand_banner/20210317/8da49f7dace19f8999f119e88dc82384.png,https://oss.yiwofa.com/brand_banner/20210317/bcf697eefdbdf9e27ba63e3afedcb641.png', '&amp;tradition 致力于维护北欧独有的文化与工艺技术，将传统与创新紧密结合丹麦设计公司&amp;amp;tradition成立于2010年,公司设计理念是将传统与创新紧密结合。品牌的设计图鉴涵盖了从1930年至今的家具和灯具设计作品，其中不乏国际设计大师作品。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://tradition.1688.com', 1615273999, 1615967090);
INSERT INTO `p_brand` VALUES (69559, 1974, 'COLLECTION PARTICULIRE', 4, 'COLLECTION PARTICULIRE', 'https://oss.yiwofa.com/brand/20210309/202103091155204228641242.png', 'https://oss.yiwofa.com/brand/20210309/202103091156566081695535.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/fd540f48e4c9203a964d02f748574985.png,https://oss.yiwofa.com/brand_banner/20210317/234fc6896eace1c375a38d06c7fa4fdf.png,https://oss.yiwofa.com/brand_banner/20210317/a989a7a5e9140e09e64e0ede982087bf.png', 'COLLECTION PARTICULIERE是一家法国的家具品牌，他们的产品主要是包括床头灯、装饰镜、实木板凳、实木方桌等等。COLLECTION PARTICULIERE每一款产品都是经过设计师仔细的设计，与其他品牌的家具形成差异化，立志打造自己的专属设计，在满足客户的需求同时还能保证家具独特的风格。它的每个产品都是代表着一种故事。它在制造工艺、成型和装配上，突破了技术的挑战，设计出的每一款产品都是小而精，而且每一款产品都可以满足客户的需求。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://collection.1688.com', 1615274000, 1615967441);
INSERT INTO `p_brand` VALUES (69609, 1975, 'agape', 1, 'agape', 'https://oss.yiwofa.com/brand/20210309/202103091155039712224019.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156283137644013.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/b4f6a5ad72197195343f0abe641be7d5.png,https://oss.yiwofa.com/brand_banner/20210317/4894167b65ff8fe7e98a78784708ec4e.png,https://oss.yiwofa.com/brand_banner/20210317/5c8d9dee3777ea0813128022ebdb669b.png', '自成立以来，天生的设计态度以及与意大利卓越生产对话的愿望使得agape的研究成为意大利制造最有趣的表达之一。agape于1973年由贝内迪尼家族成立于维罗纳，然后转移到曼图亚，因此agape的美学，激情和创新得到了很大程度的启发，使其成为米兰，威尼托和艾米利亚之间的地理中心。该公司诞生于设计浴室的新解读，今天是当代家具的标志之一。自成立以来，天生的设计态度以及与意大利卓越生产对话的愿望使得Agape的研究成为意大利制造最有趣的表达之一。随着时间的推移，公司已经与工业和手工业公司建立了丰富的合作网络，并与其分享对质量和创新的热情。', 3.00, 583, 202, 586, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://agape.1688.com', 1615274000, 1615967918);
INSERT INTO `p_brand` VALUES (69659, 1976, 'Utopia&amp;Utility', 15, 'Utopia&amp;Utility', 'https://oss.yiwofa.com/brand/20210310/202103101019103908559467.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019079089539006.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/2b4c9a84c8a74f89cfa483fde9c02488.png,https://oss.yiwofa.com/brand_banner/20210317/304c267f0cc8e8ae402db427845f95a8.png,https://oss.yiwofa.com/brand_banner/20210317/882f4b4bcca006971dc6a44c3f50c417.png', 'Utopia&amp;Utility于2012年由Pia 和Moritz两兄妹成立，与世界各地的工匠合作，专注于手工产品的设计和生产。这个兄妹设计经营团队携手合作，旨在强调手工艺之美，同时激发人们对设计价值的理解。Utopia&amp;amp;Utility - 该品牌2012年由Pia 和Moritz两兄妹成立，与世界各地的工匠合作，专注于手工产品的设计和生产。这个兄妹设计经营团队携手合作，旨在强调手工艺之美，同时激发人们对设计价值的理解。Utopia &amp;amp; Utility将实用功能和设计美学紧密结合。&amp;quot;我们相信万事万物都值得被创作，更值得被完美的创造！从创意产生到做出成品，我们所做的一切都是通过美让生活更丰富多彩！&amp;quot;', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://utopia.1688.com', 1615274001, 1615968190);
INSERT INTO `p_brand` VALUES (69709, 1977, 'TECNOLUMEN', 3, 'TECNOLUMEN', 'https://oss.yiwofa.com/brand/20210309/202103091156207141110743.png', 'https://oss.yiwofa.com/brand/20210309/202103091158201154229367.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/0c1a70b879aaca04313028485e272a9f.png,https://oss.yiwofa.com/brand_banner/20210317/5609c71e7e6603118feedcb0cddec1e3.png,https://oss.yiwofa.com/brand_banner/20210317/97f39175dcfb8cab409f988e103068c2.png', 'TECNOLUMEN是德国知名的灯具品牌，于1980年创立，主要设计台灯、落地灯，产品简约，设计独特TECNO LUMEN一直代表着具有强烈个性和永恒设计的灯具。他们的创作重点是包豪斯时代的原创。精致的工艺，优质的材料，个性和坚持原创，使TECNO LUMEN系列成为现实：精致的设计系列。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://tecnolumen.1688.com', 1615274001, 1615968378);
INSERT INTO `p_brand` VALUES (69710, 1978, 'INGO MAURER', 3, 'INGO MAURER', 'https://oss.yiwofa.com/brand/20210309/202103091155556440689526.png', 'https://oss.yiwofa.com/brand/20210309/202103091157279908919752.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/0f596293ba6c97e81a24dada6a9d44c7.png,https://oss.yiwofa.com/brand_banner/20210317/28d2453cf96821eb985e9eb064a15a93.png,https://oss.yiwofa.com/brand_banner/20210317/7ce59952a2db03a93f6a354a16c27d91.png', '自1960年代中期以来，Ingo Maurer一直在设计不寻常的灯具，照明系统和物体，他在自己的公司制造企业家并在全球范围内销售。这就是为什么我们可以毫不妥协地实施自己的想法。Ingo Maurer几十年来一直与他的团队合作 - 他称他为员工 - 多年来已经发展到60多人。在慕尼黑施瓦布地址自1970年以来一直保持不变，但被发现在慕尼黑郊区新空间的生产和装运帝国路47号至2005年后院后仍然变得非常紧张。这为一个大型展厅创造了空间- 第二个到纽约，并在欧洲唯一。他很漂亮，但做了很多工作。 从灯具和照明系统的设计，展览和展台看，项目区域出现了。我们收到越来越多的项目请求：照明设计和室内设计工作。该项目现在是我们的活动，让一只手来实现自己的想法，创造另一方面，对于订约当局或更高版本的用户梦幻般的，令人愉快和刺激的空间英戈&amp;middot;毛雷尔的重要组成部分。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ingomaurer.1688.com', 1615274001, 1615968755);
INSERT INTO `p_brand` VALUES (69711, 1979, 'FENDI CASA', 0, 'FENDI CASA', 'https://oss.yiwofa.com/brand/20210309/202103091155499981159656.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157162954830880.jpg', '', '意大利品牌FENDI CASA美居是FENDI品牌以家居装饰延展的一项协作计划。自FENDI CASA美居系列于 1989年问世以来，在全新的家具领域，FENDI不断大胆做出创新尝试。FENDI从未停止过开拓崭新的创作空间。为了迎合不断变化的时尚生活品位，FENDI不断开发新的关联项目，FENDI CASA美居是FENDI品牌以家居装饰延展的一项协作计划。 自FENDI CASA美居系列于 1989年问世以来，在全新的家具领域，FENDI不断大胆做出创新尝试。在奢侈家居品牌中，有人说Armani冷艳，Gucci简约，FENDI则有一种&ldquo;玩奢华于股掌之上&rdquo;的惊人魄力。 大量皮草、皮革、绸缎、马鞍缝法的皮毛、流苏的皮革、印花织物的运用，让人一进FENDI CASA的展厅就仿佛跌进奢华的海洋&mdash;&mdash;每件家具看起来都那么雍容美艳，每个细节都尽善尽美，单是压纹就有鳄鱼压纹、蜥蝎压纹、蟒蛇纹、鱼纹等数十种不同的珍稀动物皮纹，它们所呈现出的已不仅是奢华，而是一种永恒经典与贵族气度。 FENDI CASA本身所钟爱的巴洛克图腾也象征了这一点&mdash;&mdash;它的每一件家具都要凭其华贵不凡的个性停留在历史的沙床。 ', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://fendicasa.1688.com', 1615274001, 1615274001);
INSERT INTO `p_brand` VALUES (69761, 1980, 'Mogg', 1, 'Mogg', 'https://oss.yiwofa.com/brand/20210309/202103091156066097774583.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157545707857742.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/5d368373bd158e1e8a42e348b6b19b3d.png,https://oss.yiwofa.com/brand_banner/20210317/aab46a273a936d57e02986ba589a8133.png,https://oss.yiwofa.com/brand_banner/20210317/68b4520f5a6c2b57816f591d745ffa5d.png', 'MOGG 是一家新的家具公司，于2012年在米兰举行的Salone del Mobile开幕。Mogg的产品具有明显的标志性，具有强大的内涵和独特的细节。 如今，Mogg在25个代理商的支持下分布在世界各地。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://mogg.1688.com', 1615274002, 1615969616);
INSERT INTO `p_brand` VALUES (69811, 1981, 'GIOBAGNARA', 1, 'GIOBAGNARA', 'https://oss.yiwofa.com/brand/20210309/202103091155531058197141.png', 'https://oss.yiwofa.com/brand/20210309/202103091157229995409474.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/7e77a62a2413fb805ed2c820106efbe8.png,https://oss.yiwofa.com/brand_banner/20210318/b0ecc8066f696ecbc59a77c59f02296c.png,https://oss.yiwofa.com/brand_banner/20210318/a12d41076c27e819d97ac75b34e3ecc0.png', 'GIOBAGNARA是一家位于意大利热那亚的高端皮具制造商，自1999年以来，它提供一些最好的设计和室内装饰店，建筑工作室，超级游艇和私人飞机项目，集中体现意大利工艺和专注于生活艺术。从最初的草图到最终的手工制作，每件GioBagnara Bespoke产品都是为了确保满足客户的每一个期望。作为裁缝，GIOBAGNARA可以用其皮革产品&amp;ldquo;打扮&amp;rdquo;私人住宅，喷气式飞机或游艇。客户可以自由选择各种选择，从最好的意大利皮革到shagreen或鳄鱼皮.GIOBAGNARA在皮革和线上都有各种颜色可供选择。我们可以个性化金属和木制部件，针脚图案，以及任何可能需要的徽标，刺绣或压花。然后，GIOBAGNARA的专家和经验丰富的团队将根据客户的具体要求精心制作皮革产品。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://giobagnara.1688.com', 1615274003, 1616032388);
INSERT INTO `p_brand` VALUES (69861, 1982, 'APPARATUS', 4, 'APPARATUS', 'https://oss.yiwofa.com/brand/20210309/202103091155063329303442.png', 'https://oss.yiwofa.com/brand/20210309/202103091156335757260554.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/d606da1dcc8a8168c217e3f7bb90c112.png,https://oss.yiwofa.com/brand_banner/20210318/5bd61cf6092ba33642fd44b5dfcde7fb.png,https://oss.yiwofa.com/brand_banner/20210318/e18315a123a1fe4a3de63747f886ef30.png', 'Apparatus 工作室位于纽约，他们善于将一些老式的照明材料，比如黄铜、大理石、皮革、陶瓷等，进行有趣地搭配组合，并通过手工制造出独特、简约又具有空间高级感的作品。美国灯饰品牌 Apparatus 是有于纽约的设计工作室成立的，该工作室的创始人是 Gabriel Hendifar 和 Jeremy Anderson ，他们的设计风格一直以独特的审美和新颖的创意为主，专注老式灯具材料的有趣结合，将一切普通的材料打造出非凡的作品。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://apparatus.1688.com', 1615274003, 1616032892);
INSERT INTO `p_brand` VALUES (69911, 1983, 'MICHAEL ANASTASSIADES', 1, 'MICHAEL ANASTASSIADES', 'https://oss.yiwofa.com/brand/20210309/202103091156058178462128.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157522549282030.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/f46accd92a59fc46ae4ce14197727c9d.png,https://oss.yiwofa.com/brand_banner/20210318/8c7b031d733c41e1c7a35db9daf15d0e.png,https://oss.yiwofa.com/brand_banner/20210318/91865a63cc7f2b9834139dc982199778.png', 'MICHAEL ANASTASSIADES的作品既实用、功能可靠，外表又充满诗情画意和神秘感。MICHAEL ANASTASSIADES是土生土长的塞浦路斯岛人，在伦敦帝国理工医学院接受过土木工程师的正式教育，此后又在皇家艺术学院（Royal College of Art）继续深造工业设计。 1994年，他创建了自己的工作室，并在2007年推出其同名品牌。自此以后，他与生产其设计产品的供应商和工艺师建立起了密切的合作关系。这种合作模式进展非常顺利，FLOS、Puiforcat、Lobmeyr等品牌以及瑞典设计机构Svenskt Tenn都曾找上门来谋求与其合作的机会。', 3.00, 583, 202, 273, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://michael.1688.com', 1615274003, 1616033109);
INSERT INTO `p_brand` VALUES (69912, 1984, 'pallucco', 1, 'pallucco', 'https://oss.yiwofa.com/brand/20210309/202103091156116652790081.png', 'https://oss.yiwofa.com/brand/20210309/202103091158033532276886.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/91b82f767520c9c7027dafb701604021.png,https://oss.yiwofa.com/brand_banner/20210318/0cc5727d7c86e8264cf96180980bfec1.png,https://oss.yiwofa.com/brand_banner/20210318/4c73e1d9905a1daf77cc899b14cd694b.png', 'pallucco乐于去探索艺术、建筑和设计的边界，他们的设计带有意大利的热情奔放，在实用的基础上有着天马行空的想象力，多元化是他们的标签。pallucco是专业生产灯饰的品牌，在20世纪70年代由建筑师Paolo Pallucco创立于意大利罗马，80年代初，公司搬到了威尼托地区，并立即脱颖而出。Pallucco的众多设计师们都为光而痴狂，用自己的奇思妙想不断给人们带来无限的生活灵感和积极的能量，随着时光的流逝而愈发醇厚。', 3.00, 583, 202, 267, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://pallucco.1688.com', 1615274003, 1616033355);
INSERT INTO `p_brand` VALUES (69962, 1985, 'pinetti', 1, 'pinetti', 'https://oss.yiwofa.com/brand/20210309/202103091156149376920501.png', 'https://oss.yiwofa.com/brand/20210309/202103091158068619346928.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/c72508b4b28ad9afb1277884abf12631.png,https://oss.yiwofa.com/brand_banner/20210318/94c9c78a4d25f96bc2584445c819ed58.png,https://oss.yiwofa.com/brand_banner/20210318/d582e4eeb982cc2e61da9eeebbaf11d6.png', '对细节的关注，量身定制的设计，不妥协的品质以及周到和准时的服务是Pinetti与更加雄心勃勃的项目竞争的指导方针和支柱。Pinetti 是一个创立于1983年的意大利品牌，继承了意大利良好的制作工艺，手工历史和人文情怀，主张绿色环保的理念，提倡循环使用植鞣革，旨在使原材料的利用率最大化。Pinetti也一直致力于对传统手工艺的传承与创新，积极将高科技与精良的手工技艺结合，打造奢华配饰的小宇宙，宛如艺术的产品早已成为高端酒店、公寓及游艇室内外配饰的首选。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://pinetti.1688.com', 1615274005, 1616033643);
INSERT INTO `p_brand` VALUES (70012, 1986, 'vitra', 1, 'vitra', 'https://oss.yiwofa.com/brand/20210311/202103111715135135971290.jpg', 'https://oss.yiwofa.com/brand/20210311/202103111715124284971325.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/d62863c44f6429e7217a9b8852a66256.png,https://oss.yiwofa.com/brand_banner/20210318/bd6125a964f4562b761da601a4e443ad.png,https://oss.yiwofa.com/brand_banner/20210318/476be19531f39d21e6c8ba4274700691.png', 'vitra在设计界有着举足轻重的影响力。不只体现在产品制造，还凝聚在因Vitra而生的大师建筑和别致空间里。vitra是欧洲排名前五的家具品牌，Vitra是一家成立于1950年的瑞士设计产品制造商，他们的产品和概念均在瑞士形成。Vitra的目标是创造既美观又极富功能性的室内设计、家具以及装饰品。他们会录制Vitra Fiction系列短片，讲述一些可能发生在任何人身上的家庭故事。作为演员阵容的一部分，Vitra的家具和物件展现了特殊的时刻和日常生活场景。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://vitra.1688.com', 1615274012, 1616034783);
INSERT INTO `p_brand` VALUES (70062, 1987, 'NATUZZI', 1, 'NATUZZI', 'https://oss.yiwofa.com/brand/20210311/202103111715133586725119.jpg', 'https://oss.yiwofa.com/brand/20210311/202103111715111934684785.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/6a2d92c5eb318e558ad3a081a2675c69.png,https://oss.yiwofa.com/brand_banner/20210318/b3a643a7206bbb2d542fd80fb6a248c7.png,https://oss.yiwofa.com/brand_banner/20210318/50aeae85a1bf02b4e2e96f8d49bdd102.png', 'NATUZZI集团于1959年在意大利TARANTO创立，现任CEO和设计总监帕斯库勒·NATUZZI开创了一个针对当地市场，生产沙发和手工扶手椅的小工厂。历经40多年发展，NATUZZI集团已经成为全球沙发业的佼佼者，其生产的沙发和椅子在全球范围内遍布五大洲123个国家和地区，在1000多个专卖店进行销售，有600多万家庭使用，是意大利最好的家具生产商之一。 NATUZZI产品拥有沙发、扶手椅、配件产品都在为顾客提供绝对放松的享受。在夜间，几个沙发就可以合并为一张沙发床，为了达到极度的舒适，沙发都会有一些手动或电动的放松装置。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://natuzzi.1688.com', 1615274014, 1616035285);
INSERT INTO `p_brand` VALUES (70162, 1989, 'erba', 1, 'erba', 'https://oss.yiwofa.com/brand/20210309/202103091155483356639865.png', 'https://oss.yiwofa.com/brand/20210309/202103091157118084985591.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/9f740c2c2281df5e939d8fc1a3babf2f.png,https://oss.yiwofa.com/brand_banner/20210318/541f0b72c4de4c1e09dc0356879d2598.png,https://oss.yiwofa.com/brand_banner/20210318/4a429f5c6f3053d1c2a509ae051a3587.png', '优雅，独特，意大利制造的传统和其它优质设计。ERBA Italia成立于2007年，位于布里安扎中心地带，该地区是世界闻名的沙发、扶手椅和装饰配件制造商集中地。 Grass是由我们的设计师兼艺术总监Giorgio Soressi提出的一种全新的生活概念。 创造经典的产品，意味着要考虑到所有的特征，从美学理论与功能，到独特的材质选择并关注细节。ERBA ITALIA家具恰如其分的做到了这一点，通过家具的内在特征融入创意个性的设计，创造出富有艺术性的作品。 如今， ERBA ITALIA家具每个产品都仿佛讲述着一个由美学、功能质量、风格与技艺构成的曼妙故事。种类丰富的全新沙发以极简的设计缔造超凡脱俗的高级感，一种全新的形式衍生出一种更加均匀和平衡的艺术美感。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://erba.1688.com', 1615274017, 1616035720);
INSERT INTO `p_brand` VALUES (70212, 1990, 'GIORGETTI', 1, 'GIORGETTI', 'https://oss.yiwofa.com/brand/20210309/202103091155532883757795.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157233077120457.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/e44d0adb545aabd3cb88333eb96f64c6.png,https://oss.yiwofa.com/brand_banner/20210318/27f76aac6b5554cc93b26a8f9b53ccac.png,https://oss.yiwofa.com/brand_banner/20210318/17bda11094a7aab2b30d6729e44dbf4b.png', '意大利GIORGETTI家具一直坚持使用最好的木材，选取每种木材最优质的部分来制作家具，比如枫木、樱桃木、黑檀木、山毛榉木、红檀木以及胡桃木等，产品大部由分手工组装，以确保每一件产品的品质。1898年，创始人Luigi Giorgetti在意大利梅达城Meda创立了GIORGETTI。起初，只是8个人的小工坊，后来因生产雕刻木制家具的卓越手工艺而名声大噪，发展为40余人的工厂。凭着国际化的视野以及对外国文化专注的探索，意大利GIORGETTI在竞争中脱颖而出。1920年，意大利GIORGETTI打入美国市场，向其出口雕刻半成品。 随后，公司持续发展，成为一家综合性企业，业务遍及意大利并逐渐渗透到更多欧洲国家。后来，凭着在德国、荷兰新开的两家分公司，以及在米兰开设新展厅，意大利GIORGETTI巩固了其在欧洲的市场地位。 80年代末意大利GIORGETTI进入品牌转型期， 携手著名建筑师Massimo Scolari；威尔士亲王查尔斯的建筑教授Leon Krier以及艺术家卢志荣等，为GIORGETTI融入建筑力学元素，丰富了现代家具的设计和造型，在原有木质家具基础之上，融合多种材质的无间结合，由此确立了GIORGETTI在意大利现代家具业自成一体的风格。 意大利GIORGETTI家具产品的主要采用实木材质，善用木材的物理特性、自然纹理和种类丰富的颜色打造产品。意大利GIORGETTI不断挖掘各种材质的艺术潜力，选取每种木材最优质的部分来制作家具，比如枫木、樱桃木、黑檀木、山毛榉木、红檀木以及胡桃木等，意大利GIORGETTI一直坚持使用最好的木材，产品大部由分手工组装，以确保每一件产品的品质。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://giorgetti.1688.com', 1615274019, 1616036102);
INSERT INTO `p_brand` VALUES (70312, 1992, 'arper', 1, 'arper', 'https://oss.yiwofa.com/brand/20210309/202103091155078897564451.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156361418171731.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/d54afa8658d6c2219590d3bb51eaac96.png,https://oss.yiwofa.com/brand_banner/20210318/b8e6ed9a31c5d9c65d660444b5f36141.png,https://oss.yiwofa.com/brand_banner/20210318/020f3f313f2fa24e7323a879559795b7.png', '意大利arper家具以现代风格为主：大胆运用各种色彩，造型别具一格颇有艺术气息和个性。意大利arper的成功可追溯至1989年，公司总裁Luigi Feltrin成立了一间皮革厂，由他的儿子Mauro和Claudio组织和管理。 在20世纪90年代末，意大利arper作出一大改革，将arper带领到另一个以设计作为主导的家具公司，在材料和技术的使用和规模带来了一个显著的变化。后续和Lievore Altherr Monlina设计公司的合作，研发了一系列新产品，更成为arper的另一个重要里程碑。 意大利arper家具以现代风格家具为主，大胆运用各种色彩来诠释家具，造型上更是别具一格，颇有艺术气息和个性。以灵活的几何造型和流畅的线条为特色，并以此为基点，在色彩和外形上做出延伸，诞生了一系列富有整体风格的作品。意大利arper家具采用胶合板材料制作，一体式设计，外形按照一定的规则延展，保持简约实用的外貌，在使用上也十分灵活。', 3.00, 583, 202, 270, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://arper.1688.com', 1615274023, 1616036521);
INSERT INTO `p_brand` VALUES (70362, 1993, 'ARETI', 1, 'ARETI', 'https://oss.yiwofa.com/brand/20210309/202103091155069303291252.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156343606677771.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/8a222114be414722c1034245766403da.png,https://oss.yiwofa.com/brand_banner/20210318/4ae3d41f820bb5deb6a576d358749482.png,https://oss.yiwofa.com/brand_banner/20210318/12713bfe37f9263132d01c59f171314c.png', '英国Areti设计的灯具，形状简单，俏皮可爱，能给你的生活带来不一样的光明和心情。Atelier Areti是姐妹Gwendolyn Kerschbaumer和Guillane Kerschbaumer设计的一个设计工作室。 Areti主要设在伦敦，并与欧洲制造商合作，主要在德国。 格温多林19​​76年出生于奥地利因斯布鲁克，是奥地利/法国人。 她获得了北卡罗来纳州杜克大学雕塑专业的视觉艺术学士学位。 她获得了哈佛大学的建筑硕士学位和苏黎世ETH的高级建筑研究（可持续建筑）硕士学位。 除此之外，Gwendolyn在纽约Peter Eisenman Architects，Kleihues und Kleihues Berlin，MVRDV Rotterdam和Wiel Arets Architects建筑事务所工作。 Gwendolyn曾在&amp;#39;laba&amp;#39;/ EPFL进行研究3年，研究当代建筑，城市设计和规划领域的发展。 Guillane于1981年出生于奥地利因斯布鲁克，是奥地利/法国人。 她在巴黎索邦大学学习艺术史和考古学之前，先后在巴黎完成了艺术基础课程，接受了DEUG。 她继续在2006年毕业的中央圣马丁学习产品设计。在 与她的妹妹Gwendolyn一起创建Atelier Areti之前，Guillane曾在伦敦工作过多年，担任室内设计师。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://areti.1688.com', 1615274025, 1616036717);
INSERT INTO `p_brand` VALUES (70412, 1994, 'Dauny', 0, 'Dauny', 'https://oss.yiwofa.com/brand/20210309/202103091155209747904059.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156584711389179.jpg', '', '在瑞士生产的羽绒制品和羽绒制品，Dauny遵循瑞士标准严格控制质量。Dauny在材料和工艺上没有妥协，是对生活、幸福和享受的积极态度的反映。高质量的羽绒被和枕头对你的睡眠质量有决定性的影响。而良好的睡眠则是生活质量的先决条件。简而言之:睡得好的人享受生活。 ', 3.00, 583, 202, 589, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://dauny.1688.com', 1615274025, 1615274025);
INSERT INTO `p_brand` VALUES (70413, 1995, 'PASCALE GIRARDIN', 1, 'PASCALE GIRARDIN', 'https://oss.yiwofa.com/brand/20210309/202103091156133487215569.png', 'https://oss.yiwofa.com/brand/20210309/202103091158059244383421.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/fc39431e61641b940819a205d586f406.png,https://oss.yiwofa.com/brand_banner/20210318/a5413d1708e0859027da6181f8288c5e.png,https://oss.yiwofa.com/brand_banner/20210318/a03192670a17ceb01dc775a67aafa410.png', '我们的设计公司位于蒙特利尔。专为全球豪华酒店业创造高端餐具和建筑设计作品。创始人Pascale Girardin凭借其作为视觉艺术家和设计师的作品赢得了无数奖项和荣誉，包括Pierre-Pag&amp;eacute;奖和加拿大艺术委员会的多次认可。最近的项目包括在巴黎的Printemps Hausman，上海浦东的四季广场以及与纽约的Harry Winston的特别合作的大型装置。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://pascale.1688.com', 1615274025, 1616036961);
INSERT INTO `p_brand` VALUES (70463, 1996, 'LEE BROOM', 1, 'LEE BROOM', 'https://oss.yiwofa.com/brand/20210309/202103091156008800349634.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157394741842785.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/1695f1dd7739caebfa77d7e89a26a026.png,https://oss.yiwofa.com/brand_banner/20210318/a4bd85f2ac99aeae4ce2ca0616e86aa5.png,https://oss.yiwofa.com/brand_banner/20210318/0656f5fd8a166bac5321049a345a1429.png', '天才设计师、英国产品和室内设计的领军人物之一LEE BROOM的个人家具品牌LEE BROOM设计，生产并销售自己的品牌并进行独特的室内设计。他是英国领先产品设计师和室内设计师之一。 &amp;nbsp; 产品的生产过程完全符合Broom的人生观。从2007年开始他发布了75件标有自己品牌的家具和灯具单品，同时还为其他品牌创造了20件产品。他参与完成了超过40个零售商店、餐馆和酒吧的室内设计。并且同知名品牌Christian Louboutin和Mulberry合作设计。 &amp;nbsp; 2015年Broom在白金汉宫由女王授予女王企业奖，这是英国成功企业的最高荣誉。此外Broom获得了20多个奖项，2013年，他设计的著名灯具产品&amp;rdquo;Crystal Bulb&amp;rdquo;第四次在连续三年中获得英国设计大奖。 戏剧学院的学习对他创作初期有很大的戏剧性和叙事性的影响。17岁获得了一个时尚设计奖项后，Broom的职业生涯发生了转向。这带领他遇到并为传奇设计大师Vivienne Westwood工作，之后他又在伦敦中央圣马丁学院学习时装专业。', 3.00, 583, 202, 266, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lee broom.1688.com', 1615274025, 1616037313);
INSERT INTO `p_brand` VALUES (70513, 1997, 'Orsi', 14, 'Orsi', 'https://oss.yiwofa.com/brand/20210309/202103091156114019260465.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158031225177185.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/8b3c4f6256905171ed0afa76d26f4a51.png,https://oss.yiwofa.com/brand_banner/20210318/a2795fbabc2abc0bc450d92686ecc284.png,https://oss.yiwofa.com/brand_banner/20210318/80e05bfc6fdbb5592a73b92fc319863a.png', '经过两个多世纪的发展，Orsi已经拥有了大量的技术经验和文化积淀，开发出有效率和灵活的生产结构，能够满足每个家具要求。经过两个多世纪的发展，Orsi已经拥有了大量的技术经验和文化积淀，开发出有效率和灵活的生产结构，能够满足每个家具要求。 审美需求、技术技能和对工艺品的热情，与国际客户的沟通，以及与世界各地室内设计师和建筑师的交流，使得Orsi品牌变得更加成熟、独特，并在不断创新的同时保持自己不变的风格和线条。 个人家居设计满足高品质的质量要求，我们通过制作一系列乃至数百件独特的产品，为客户提供完整的服务：从技术风格的支持、建设性的设计到最终专业的制造。正由于这些原因，许多意大利和国外建筑师和设计师选择 Orsi为世界各地的别墅、酒店、公共区域设计家具。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://orsi.1688.com', 1615274026, 1616037519);
INSERT INTO `p_brand` VALUES (70563, 1998, 'verreum', 1, 'verreum', 'https://oss.yiwofa.com/brand/20210309/202103091156235674961950.png', 'https://oss.yiwofa.com/brand/20210309/202103091158283045852173.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/50564dc7c96d77aec3eab5665ff2a96a.png,https://oss.yiwofa.com/brand_banner/20210318/be27a8d3f30ab3327b084dcc35e941ab.png,https://oss.yiwofa.com/brand_banner/20210318/2f61d0d67f381f893e8627eeb1cfae41.png', 'verreum这个名字来自“Verre” - 法语玻璃 - 和“Um” - 捷克工艺。顾名思义，verreum的目标是恢复传统的玻璃制造工艺。verreum成立于2009年，位于捷克共和国布拉格，由Pavel Weiser创立。verreum这个名字来自&amp;ldquo;Verre&amp;rdquo; - 法语玻璃 - 和&amp;ldquo;Um&amp;rdquo; - 捷克工艺。顾名思义，verreum的目标是恢复传统的玻璃制造工艺，Pavel Weiser的愿景的重点是银色玻璃制造的复兴 - 欧洲一种被遗忘的技术，verreum希望重新发明，结合新技术和新设计语言。verreum与捷克和国际设计师合作创作产品，除了在Novy Bor生产自己独特的玻璃吹制和镀银设施的镀银玻璃外，还与其他捷克玻璃厂合作，致力于维护玻璃制作波西米亚的传统。 verreum还是欧洲项目&amp;ldquo;Glass is Tomorrow&amp;rdquo;的共同组织者，其目的是促进欧洲玻璃制造商和设计师之间的合作。', 3.00, 583, 202, 273, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://verreum.1688.com', 1615274027, 1616037690);
INSERT INTO `p_brand` VALUES (70613, 1999, 'KATHARINA EISENKOCK', 1, 'KATHARINA EISENKOCK', 'https://oss.yiwofa.com/brand/20210309/202103091155576168163160.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157326234373557.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/1c6dddfbce14d1b400c85b635af2d2c0.png,https://oss.yiwofa.com/brand_banner/20210318/ee16130b05ad47ad530961017ff2f2d7.png,https://oss.yiwofa.com/brand_banner/20210318/a629332f3136815864336d19fa9e07bb.png', '在伦敦东部，奥地利设计师KATHARINA EISENKOCK在当代设计文化中创造出精致而精致的物件。KATHARINA EISENKOCK是一位设计师，他的实践涉及到家具和产品的制作，其雕塑的简单性和功能性受到了材料的不同用途的影响。Eisenkoeck对古老技术和工艺过程的复兴非常感兴趣，并将其带入了一个新的环境中，特别是在她的皮革作品中。她的设计方法可以被描述为一种通过材料实验的实践研究，目的是创造出一种持久但又具有独特性的物品。 Eisenkoeck的木工技术始于她在Graz艺术与设计学校Ortwein的职业生涯的早期阶段。在进入设计师行业之前，她在维也纳的技术大学经历了建筑学的教育。一年后，她在伦敦巴艺术设计与环境学院的中央圣马丁学院完成了学士学位。这使她成为了Lomography的室内设计师和展览设计师，她曾在诸如里约热内卢de Janeiro, Los Angeles, Tokyo等城市工作过，并在lomo画廊的店面进行管理。手工制作产品的美丽和质量一直让她回到了设计师的职业。2011年，她决定建立自己的工作室，并于2012年毕业于剑桥大学艺术学院(Camberwell College of Arts)攻读硕士学位。', 3.00, 583, 202, 585, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://katharina.1688.com', 1615274027, 1616037856);
INSERT INTO `p_brand` VALUES (70663, 2000, 'Artek', 1, 'Artek', 'https://oss.yiwofa.com/brand/20210309/202103091155083555391361.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156368848824605.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/d03d07d940208ebf29e0441b31012f5a.png,https://oss.yiwofa.com/brand_banner/20210318/406be61cb49a8744f4eda44e80e57e49.png,https://oss.yiwofa.com/brand_banner/20210318/7a31750dd04cd6bcb1e70d5eeab3916b.png', 'Artek成立于1935年，由四个年轻的理想主义者：Alvar和Aino Aalto，Maire Gullichsen和Nils-Gustav Hahl共同创办，其中Alver Aalto是芬兰著名建筑师、室内家饰设计师，被称为“北欧设计之父”。Artek于1935年由四位年轻的理想主义者成立于赫尔辛基：Alvar和Aino Aalto，Maire Gullichsen和Nils-Gustav Hahl。他们的目标是&amp;ldquo;通过展览和其他教育手段销售家具并促进现代生活文化。&amp;rdquo; 为了与创始人的激进精神保持一致，Artek今天仍然是现代设计领域的创新者，在设计，建筑和艺术的交叉点开发新产品。 Artek系列由芬兰大师和国际着名设计师设计的家具，灯饰和配饰组成。它代表清晰度，功能性和诗意简洁。 Artek这个名字是对&amp;ldquo;艺术&amp;rdquo;和&amp;ldquo;技术&amp;rdquo;的综合 - 对20世纪20年代突显的国际现代主义运动的核心概念。沃尔特格罗皮乌斯是现代主义的支持者，他创造了&amp;ldquo;艺术与技术 - 一种新的统一&amp;rdquo;的座右铭。科技被理解为包括科学和工业生产方法，而艺术的概念超越了美术，涵盖了建筑和设计。 现代主义旨在实现这两个领域的富有成效的联合。同样的愿望指导了Artek的创始人对公司的命名。', 3.00, 583, 202, 586, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://artek.1688.com', 1615274036, 1616038144);
INSERT INTO `p_brand` VALUES (70713, 2001, 'BENTLEY', 2, 'BENTLEY', 'https://oss.yiwofa.com/brand/20210309/202103091155119489921225.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156448046942847.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/20fc4d8802ce9e18ea5a137213c81e07.png,https://oss.yiwofa.com/brand_banner/20210318/a475b388d0799f7fcaaa6dc1185e4d40.png,https://oss.yiwofa.com/brand_banner/20210318/930121e6fdba5ae5bb4489989f8e1834.png', '英国汽车品牌BENTLEY(宾利)跨足家具设计业，透过豪华而细致的手工技法，打造出最具典雅氛围的精品家具。BENTLEY家居的皮料选用与BENTLEY汽车同产地同等级的牛皮，以皮质细腻且无瘢痕的皮革再剔除破损及不对称的部位，确保每件BENTLEY家具外表美观并经久耐用。BENTLEY家居对顶级皮质的甄选在&amp;ldquo;苛求&amp;rdquo;中发挥到极致，以营造奢华、舒适的居住空间。 而木质饰板的木材则来自世界各地的珍稀良木：楠木、白蜡木、枫木等。经精心甄选的木材无不呈现出木质本身原始色泽与曼妙花纹，保留顶级材质所蕴含的自然品质和独特光彩。BENTLEY的木质饰板运用面积较大的树干切片，制作时还要考虑木纹的对称性，以形成自然的对称花纹，更见珍稀与奢华，细看细腻温润的天然木纹无不凝炼时间的光华。 配色方面BENTLEY家居采用了丰盈的象牙白与烟褐灰作为主色调，配以浅米黄与乳白色为缀饰。BENTLEY的经典设计语言被融入家居细节当中：精妙的皮革编织设计勾勒出产品柔软、灵动的线条轮廓；座舱内饰中标志性的独特菱形格纹装饰同样被应用于全新家具产品的设计之中，自成一格。 BENTLEY家居结合传统英国车手精神与全新当代英格兰风格，突显BENTLEY车主的优雅与活力。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bentley.1688.com', 1615274038, 1616038352);
INSERT INTO `p_brand` VALUES (70763, 2002, 'Longhi', 2, 'Longhi', 'https://oss.yiwofa.com/brand/20210309/202103091156027879798868.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157434933485159.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/f098988f2d83c1206a7ae71be949859d.png,https://oss.yiwofa.com/brand_banner/20210318/329f046aef831fa16ef92bfa074ac7c1.png,https://oss.yiwofa.com/brand_banner/20210318/341f390d0f12d9cb0d710fd4bb160d0a.png', '意大利家居设计中对品味的注重在LONGHI这里得到了充分的印证。LONGHI有自己恢宏的智慧设计体系，从不盲目随波逐流，骨子里有着逼人贵气与气质。这种不张扬的华丽，内敛的气度使它深受世界各地广大新贵们的青睐，几乎成为新贵的御用家居品牌。1940年，BrunoLONGHI的父亲和母亲在帕尔马，将他们的创意转化为高品质产品。他们的每一件产品都堪称艺术品，精细到每一个细节，包括皮革装饰、木制家具、箱包皮具等等。高品质和品牌的独特风格是LONGHI与众不同的元素。20世纪90年代LONGHI人气上涨，极受热爱精致高雅风格的消费者欢迎。', 3.00, 583, 202, 587, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://longhi.1688.com', 1615274051, 1616039045);
INSERT INTO `p_brand` VALUES (70913, 2005, 'VISPRING', 7, 'VISPRING', 'https://oss.yiwofa.com/brand/20210309/202103091156245747304831.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158335974156703.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/b70abfb0ad80b9c1a2cadef873d50baa.png,https://oss.yiwofa.com/brand_banner/20210318/38ec7f358be11bc74a6cd36d001b556e.png,https://oss.yiwofa.com/brand_banner/20210318/f7722278ea1a74949442cfb7ddf2f08d.png', '始于1901年的VISPRING，拥有最舒适的睡眠体验。在20世纪初，一位名叫詹姆斯马歇尔的英国工程师向妻子献上了最珍贵的礼物 - 一个完美的夜晚睡眠。他的床垫开创性地使用了单独的独立式钢弹簧，带来无与伦比的舒适度，使得VISPRING成为奢华的代名词。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://vispring.1688.com', 1615274058, 1616039229);
INSERT INTO `p_brand` VALUES (70963, 2006, 'TRECA', 1, 'TRECA', 'https://oss.yiwofa.com/brand/20210309/202103091156216426942957.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158223433948578.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/da05d6a26389e2293fb5633632d64767.png,https://oss.yiwofa.com/brand_banner/20210318/9a48f28749740f845ac9886b38694d71.png,https://oss.yiwofa.com/brand_banner/20210318/91c408cc9ad768d6ac891e71aa15cd1e.png', 'TRECA于1922年在法国Alsace成立，享有“睡眠奢侈品”的美誉。精湛的手工工艺，尖端的环保理念和法国高级定制的优秀传统，成就了TRECA法国顶级床垫第一品牌的地位。TRECA的设计尤其尊重传统，特别注重细节，床体的设计全部都由欧洲名师执掌，床品始终以提供用户优质睡眠为核心，力求满足客户各种需求、适应各种环境。TRECA的床垫总是选用品质最好的纯天然材质，并使用纯手工制作，天然、新颖、抗过敏的舒适软床，总能带给消费者最完美的的睡眠品质，被视为全球睡眠艺术品。在90年多年的制床历史中，TRECA赢得了众多世界名人政要的亲睐，如法国前总统希拉克、法国前总统萨科齐、俄罗斯总统普京、德国总理默克尔、国际影星苏菲&amp;bull;玛索、GUCCI老板佛朗索瓦&amp;bull;皮诺、NBA球星托尼&amp;bull;帕克、沙特阿拉伯皇室成员、印度皇室成员以及不少其他显赫人物。', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://treca.1688.com', 1615274059, 1616039353);
INSERT INTO `p_brand` VALUES (71013, 2007, 'Hästens', 3, 'Hästens', 'https://oss.yiwofa.com/brand/20210309/202103091155539915959904.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157248013350505.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/0be5c405e2bccdb196612472ecf39cfb.png,https://oss.yiwofa.com/brand_banner/20210318/29c7530a1c4f6f5b2924403989d86161.png,https://oss.yiwofa.com/brand_banner/20210318/8ce3ae8b907cd89a9b7effa94ce6ac98.png', '世界上能够将这两种特质完美融合的材质无疑是源于自然的。始于1852年的海丝腾最具代表性的材质——马尾毛，是目前世界上最适合作为床垫的填充物的材质。海丝腾起初主要以生产马鞍和其他马具为主。制作马鞍的主要填充材料是马尾毛，在当时马毛作为理想床垫的填充物已经成为常识。这家生产马鞍的制造商起初只提供订单制作的床垫。订单源源不断，使得海丝腾的业务开始转向制作床具，床具生产慢慢地成为了海丝腾的主要业务。海丝腾的商标名称（Hast，瑞典语&amp;ldquo;马&amp;rdquo;）和标志即由此而来。 手工和质量是如今依然秉承手工制作和天然选材的海丝腾床具的重心。海丝腾是在所有床具生产商当中被授予室内外环保的瑞典天鹅生态纺织标签-Tex生态纺织认证和瑞典全标准Mbelfakta 认证的唯一生产商。海丝腾床具，无论是宫廷还是民间，都深受喜爱，并从1952年开始，成为被尊敬的瑞典国王卡尔十六世古斯塔夫古斯塔夫钦定的皇家供应。 在床具已进入大规模生产的时代，唯有海丝腾坚持用手工的方式制作床具。这家顶级品牌坚信：要制作出真正的杰作，只有靠一种方法，即手工制作。基于此理念，每张海丝腾床都是在瑞典Koping历史悠久的作坊中，由技术精湛的工匠悉心打造而成。 到今天，海丝腾延续这种高成本的生产方式已有160年之久，而且这种工艺在家族中流传了五代，并已自成体系。 选购一张好床，保暖和透气是最需要考虑的因素。这不仅跟床具所选用的材质有关，也跟制作工艺密不可分。 世界上能够将这两种特质完美融合的材质无疑是源于自然的。海丝腾最具代表性的材质&amp;mdash;&amp;mdash;马尾毛，可以说是最通风、最有弹性、最软硬适宜的填充物。每一股马尾毛都拥有着与生俱来的内置微型通风系统，通过具有毛细作用的凹管导出湿气，并导入新鲜空气，使睡眠中人体所产生的热气和湿气都能藉马尾毛导出床垫，从而保持床垫的干爽、温度和柔软。 此外，为了让保暖的效果达到最佳，海丝腾床具采用了纯手工分层制作的工艺，有着几十年制床工艺的海丝腾技师，亲手将纯马尾毛、棉花和羊毛均匀地分层铺放，尽管不同款型的床具层数不一样，但是最少都达到十几层，这样一层一层的铺放工序正是保证海丝腾达到绝对舒适的关键因素之一。海丝腾的制床技术可以说是世界独一无二的，也是别人很难企及的，因为它并不是某一天发明出来的，而是在海丝腾160年历史中经过不断地试验和', 3.00, 583, 202, 590, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://hästens.1688.com', 1615274060, 1616039481);
INSERT INTO `p_brand` VALUES (71063, 2009, 'LEMA', 1, 'LEMA', 'https://oss.yiwofa.com/brand/20210309/202103091156016859471407.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157399827366412.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/6ca2a54a1f221fc2d5797624cf2de0cf.png,https://oss.yiwofa.com/brand_banner/20210318/a003fa37224af16fa7dbd8851b595b5a.png,https://oss.yiwofa.com/brand_banner/20210318/6d948df03e4639f8215062f72aaf9a00.png', '意大利LEMA的所有产品均有一个共同点那就是舒适，透露出慢生活的理念，通过使用柔和的色彩使专用房间有一个放松的氛围，让生活得到质的提高。重视产品质量，强大的工艺体现在每一件家具里，这就是意大利LEMA。 40多年来，该公司设计和制造的家具全方位的为众多家庭服务。对于意大利LEMA来说，质量意味着家具的设计和生产系统符合特定且严格的标准。所有产品由一条主线连接在一起&amp;mdash;&amp;mdash;那就是舒适。从最好的木材到金属材料，从水晶到面料和装饰:每一块都是由最好的原材料制成以确保美学和功能两方面的耐用性和最大功效。', 3.00, 583, 202, 203, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lema.1688.com', 1615274061, 1616039838);
INSERT INTO `p_brand` VALUES (71216, 2019, 'HERMES', 0, 'HERMES', 'https://oss.yiwofa.com/brand/20210309/202103091155544851763809.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157257617810812.jpg', '', 'HERMES一直秉承着超凡卓越、极至绚烂的设计理念，造就优雅之极的传统典范。HERMES，法国著名时装及奢侈品的品牌，早在20世纪来临之时，爱马仕就已成为法国式奢华消费品的典型代表。 创立于1837年的HERMES以制造高级马具起家，从20世纪初开始涉足高级服装业，上世纪五六十年代起陆续推出香水、西服、鞋饰、瓷器等产品，成为全方位横跨生活的品位代表。坚持自我、不随波逐流的HERMES多年来一直保持着简约自然的风格，&ldquo;追求真我，回归自然&rdquo;是HERMES设计的目的，让所有的产品至精至美、无可挑剔是HERMES的一贯宗旨。HERMES品牌所有的产品都选用最上乘的高级材料，注重工艺装饰，细节精巧，以其优良的质量赢得了良好的信誉。 ', 3.00, 583, 202, 273, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://hermes.1688.com', 1615274064, 1615274064);
INSERT INTO `p_brand` VALUES (71266, 2020, 'DUNN', 4, 'DUNN', 'https://oss.yiwofa.com/brand/20210309/202103091155467688307360.png', 'https://oss.yiwofa.com/brand/20210309/202103091157074551711520.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/9936a1be5d1df0f3c828325a0aa6f7d3.png,https://oss.yiwofa.com/brand_banner/20210318/bc544538ad67efe0a0bcc3cc4f6feb6f.png,https://oss.yiwofa.com/brand_banner/20210318/fc4b9be6b5dd70b8aa04daa55e50a416.png', 'DUNN是一家小型的家具设计和制造公司，2010年由设计师​​Asher Rodriquez-Dunn创办，它是在工艺和冒险精神的探索中诞生。DUNN的作品是对本世纪中叶现代美学的当代诠释，凭借可持续的做法和对材料的尊重，按照最高标准制造每一件产品，不断追求工作与娱乐之间的微妙平衡，努力做到永远做得更好，永不忘记沉迷于冒险的一面。', 3.00, 583, 202, 487, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://dunn.1688.com', 1615274064, 1616040066);
INSERT INTO `p_brand` VALUES (71417, 2046, 'PP Mobler', 1, 'PP Mobler', 'https://oss.yiwofa.com/brand/20210309/202103091156157912964877.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158085384169192.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/d69942e6be6397ecdab87f76cd387e7e.png,https://oss.yiwofa.com/brand_banner/20210318/9d55ddb1fa5f6263ba1aeebe0b50c73d.png,https://oss.yiwofa.com/brand_banner/20210318/728e63dab5895c189997ec3134fe3324.png', 'PP Mobler动机一直是爱好木材，并坚信技术，创造力和工艺可以结合在一起，追求品质。PP Mobler是一家家族丹麦细木工车间，成立于1953年，具有制作高品质设计家具的强大传统。动机一直是爱好木材，并坚信技术，创造力和工艺可以结合在一起，追求品质。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ppmobler.1688.com', 1615274069, 1616041720);
INSERT INTO `p_brand` VALUES (71467, 2059, 'Kettal', 1, 'Kettal', 'https://oss.yiwofa.com/brand/20210309/202103091155579858859107.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157338322256371.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/83483f60a17b68d70cfa5af0aeb7898c.png,https://oss.yiwofa.com/brand_banner/20210318/3f501e2ad15bb7c4eff88e47586394c3.png,https://oss.yiwofa.com/brand_banner/20210318/71bb711fe46a0d2a711ea1e03ab2b36d.png', 'Kettal擅用时尚的表现手法来诠释传统理念。其编藤家具，基于传统的编制方法，采用高科技合成纤维和金属铝结构，使得产品具备时轻便的特性。KETTAL总部坐落于西班牙巴塞罗那中部的一个沿海小镇，创始日期 1964年成立于欧洲的家族式企业。在这个风光秀丽的小镇上，诞生了不少经典之作。自品牌创立之初，KETTAL一直致力于高端户外家具的设计与创新。21世纪初，对Hugonet和Triconfort的收购，为KETTAL注入了新的血液与活力。 KETTAL与全球最顶尖的设计师保持想好的合作，如著名设计师Patricia Urquiola, Rodolfo Dordoni, Hella Jongerlius, Jasper Morrison 等。 除了每年定期发行的新品外，KETTAL还可按客户的需求定制，为客户量身打造独一无二的专属家具，一直是国际顶尖旅游业、俱乐部会所和高端住宅的首选。 KETTAL深谙科技与研究的重要性，一直走在产品创新最前沿，致力于创作出最高品质的作品。此外，KETTAL崇尚环保，其产品所使用的均是公认无污染的原材料，比如漆，都是可回收的生态漆。', 3.00, 583, 202, 273, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://kettal.1688.com', 1615274071, 1616042173);
INSERT INTO `p_brand` VALUES (71567, 2008, 'Alvarae', 0, 'Alvarae', 'https://oss.yiwofa.com/brand/20210309/202103091155051650403652.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156307841413580.jpg', '', '我们的设计过程深受日常生活的影响。从文化、教育到生活体验，每一件设计都迎合了特定的个体。我们从这些日常的灵感开始，引导我们进入新的想法。设计师们不断用新的创新挑战自己。从工艺美术时代到在大规模生产中引入塑料，设计已经发生了巨大的变化。今天，ALVARAE通过使用碳来迎接结合现有技术和手艺的新挑战。&nbsp; 在ALVARAE，我们相信碳纤维不仅适用于重型应用，而且可以通过当代设计应用于日常生活中。我们的产品范围从家具到配件，带有独特的美学和形式，只有碳才有可能。我们不仅以美学意图进行设计，还创作出能够激发日常生活的功能性雕塑。&nbsp; 我们的设计过程深受我们日常生活的影响。从文化，教育到人生体验，每一件设计都迎合了特定的个人。我们从这些每日灵感开始，将我们带入新的想法。 ', 3.00, 583, 202, 271, 0, 1, 0, 1, 100, 1000, 0, 0.000, 1, 1, 1, 'https://alvarae.1688.com', 1615274080, 1615274080);
INSERT INTO `p_brand` VALUES (71617, 2010, 'HOUSE OF FINN JUHL', 1, 'HOUSE OF FINN JUHL', 'https://oss.yiwofa.com/brand/20210309/202103091155547664186418.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157263861565156.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/2f3d69188992df3a4e02e055e8a03371.png,https://oss.yiwofa.com/brand_banner/20210318/5f4426cd9265601db3e62bef4f0c2cfa.png,https://oss.yiwofa.com/brand_banner/20210318/589ed35fa0bd311331eb2aafce128595.png', '这是一个关于缅怀的故事，一个品牌的诞生源于一件定制家具，匠人们对行业的热爱让这个家具最终衍生出其他产品，而被留下来的，除了那个被缅怀的名字，还有一份美好的品质2001年，受Finn Juhl的遗孀Hanne Wilhelm Hansen的信任和委托，我们开始独家生产并重新推出Finn Juhl所拥有的雕刻和代表性家具。如今，Finn Juhl独家系列包括40多件经典杰作，所有产品的生产均以对原创遗产的最大程度的尊重，以及对质量的严格要求为前提。对于我们而言，冒险进入Finn Juhl的设计世界，就像开启了一趟愉快的旅行，过程中在形状、美学和独特的设计细节方面不断收获惊喜。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://houseoffinnjuhl.1688.com', 1615274087, 1616044249);
INSERT INTO `p_brand` VALUES (71667, 2011, 'Fontana Arte', 1, 'Fontana Arte', 'https://oss.yiwofa.com/brand/20210309/202103091155513655902025.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157188087488092.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/e0ff9a15a655e377c845bc11f97eb7cd.png,https://oss.yiwofa.com/brand_banner/20210318/3abd9a9db9d1c619731ee6130a2d1c87.png,https://oss.yiwofa.com/brand_banner/20210318/8e911c4768e96c04e8d9b50c67487c0c.png', '意大利四大名灯品牌之一，历史悠久的意大利设计品牌，由著名建筑工业设计师Gio Ponti先生创办于1932年。Fontana Arte是第一家在室内设计领域不断强化自身品牌的意大利公司。公司与众多国际设计行业的设计师携手合作，并研发了将工匠工艺与前瞻性设计相结合的设计风格。 &amp;nbsp; 二十世纪八十年代对于Fontana Arte来说是一段潮气蓬勃的文艺复兴时期。公司于1998年获得的Compasso d &amp;#39; oro大奖，体现了由公司新股东Carlo Guglielmi和艺术总监Gae Aulenti引领之下的创新能力。 &amp;nbsp; 如今，Fontana Arte是一个扬名四海、环保意识强的国际知名品牌，其追求卓越的传统一直未曾改变，并继续坚持了品质上乘、风格独特的全新设计理念。Gio Ponti的基础设计理念比以往任何时候都更加明确：专注于设计并打造出在社会潮流变革中里。 &amp;nbsp; Fontana Arte所有的灯具在功能性与安全性上都有卓越表现,在设计风格上，简约时尚，以擅长的玻璃工艺结合现代感强的不锈钢，为居室空间带来灵动的光影。', 3.00, 583, 202, 265, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://fontanaarte.1688.com', 1615274093, 1616044656);
INSERT INTO `p_brand` VALUES (71767, 2013, 'Nidi', 3, 'Nidi', 'https://oss.yiwofa.com/brand/20210309/202103091156089844848789.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157582309902639.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/55c13fcd67970476c88d1d8e49ac2816.png,https://oss.yiwofa.com/brand_banner/20210318/66db8bd009d48bd1480fb30b45ca0bf7.png,https://oss.yiwofa.com/brand_banner/20210318/40df54e9a69cfb58f5f6dc5921319c37.png', '专为儿童及青少年空间推出的Nidi，讲究高水准的设计、品质、工艺细节与服务。Nidi起源于意大利北部特雷维索的一家创立于1953年的家具公司Battistella，Battistella是意大利第一家开始生产层压儿童卧室家具的公司。 Nidi最初关注的是儿童，然后是青少年。产品设计一改过往呆板的儿童生活空间。在美学，人体工学，安全性和功能性上重点设计，这是儿童家具最关注的方面，整体打造出来的空间既能吸引儿童青少年，家长又无需担心安全问题，让儿童房成为随时随地可以放松玩耍、学习和成长的最佳场所。 Nidi全系列家具品项，都有超N种色彩可以选择，不难发现品牌设计师鼓励家长与孩子们，多尝试用不同的色彩搭配出更缤纷、有活力的儿童王国，进而激发成长期的想象力与创意。最吸引人的还有，细心设想儿童及青少年成长所需的机能层面，全系列家具都能互相搭配使用，灵活组装床架、衣橱、展示柜及桌椅，在不同成长阶段重新拆掉、变换组装方式，满足每一时期的需求；让动手装扮儿童房，成为亲子一起动动脑、创意思考的互动游戏。', 3.00, 583, 202, 586, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://nidi.1688.com', 1615274101, 1616045404);
INSERT INTO `p_brand` VALUES (71867, 2025, 'FLOS', 1, 'FLOS', 'https://oss.yiwofa.com/brand/20210309/202103091155509406861255.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157179939563699.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/ef47a8de5a89038b5665b9334d756367.png,https://oss.yiwofa.com/brand_banner/20210318/f2380cfde423fd663b1047303609e3f0.png,https://oss.yiwofa.com/brand_banner/20210318/46c94f6fa08d1de2ed50ae074f4fd329.png', '意大利FLOS灯具会给人耳目一新的感觉，在它外观上可以看到现代风格与古典风格的融合意大利FLOS灯具 &amp;ndash; 是时尚设计与一流加工技术的代名词。该公司产品的超群之处在于其典雅的造型与优美的线条。灯具会给人耳目一新的感觉，在它外观上可以看到现代风格与古典风格的融合。产品由世界知名设计师：切泽尔.卡西纳，吉诺.卡文那，飞利浦.斯塔尔克，艾舍利以及皮埃尔.泽科莫.卡斯丁里尼等设计。高质量与知名设计师的参与研发使得FLOS产品能够长期在灯具市场上一枝独秀。许多产品成为时尚与经典的典范。因此业界许多专家也将FLOS的设计风格称为&amp;ldquo;贵族式风格&amp;rdquo;。意大利FLOS产品不断引领时尚潮流。该品牌是灯具界极少数几家能够长期生产同一系列产品的企业。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://flos.1688.com', 1615274120, 1616045554);
INSERT INTO `p_brand` VALUES (71868, 2026, 'BROKIS', 17, 'BROKIS', 'https://oss.yiwofa.com/brand/20210309/202103091155146566476813.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156491949365607.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/1f90d10bd3c2a0366bfc2288d1909c5f.png,https://oss.yiwofa.com/brand_banner/20210318/b96c0da908aee9ff33007df3f8c80376.png,https://oss.yiwofa.com/brand_banner/20210318/04081f7e04cd642b4cd80865c5319256.png', 'BROKIS 的总部设在捷克共和国，起源自1809年，为许多灯具生产灯罩和灯具配件的Janstejn 玻璃工坊，以生产高规格的波西米亚玻璃儿闻名。BROKIS 的总部设在捷克共和国，起源自1809年，为许多灯具生产灯罩和灯具配件的Janstejn 玻璃工坊，以生产高规格的波西米亚玻璃儿闻名，1997年起，创办人Rabell继而成立了BROKIS灯具品牌，他们将生命奉献在生产精致的照明产品，具有生产品质优良的玻璃的经验，再加上与世界各地知名设计师的结合，创造了当代照明艺术的手工生产风格，他们的成功也证明了一个杰出的设计必须和最佳品质相辅相成。 BROKIS公司是一家充满活力的新企业，公司根据最新设计趋势制定出独具特色的企业战略，无时限解决方案体现了深刻的简洁性、经济性和融合性，以及具有非凡诗情画意的造型，营造出梦幻般的意境。Brokis制造的灯具让家居和办公室别具一格，该公司近年来获得了多项殊荣，其中，中生代设计师 Lucie Koldov&amp;aacute;和Dana Yeffeta的系列作品尤为突出。', 3.00, 583, 595, 597, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://brokis.1688.com', 1615274120, 1616045826);
INSERT INTO `p_brand` VALUES (71918, 2027, 'CTO LIGHTING', 1, 'CTO LIGHTING', 'https://oss.yiwofa.com/brand/20210309/202103091155202277550745.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156574075377009.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/0e2eeda624d5851ea63d0f37b6232faf.png,https://oss.yiwofa.com/brand_banner/20210318/39e51bbb3d9fe67287aef0464f939f13.png,https://oss.yiwofa.com/brand_banner/20210318/1a172c8bf0484b2f881df144c64b26db.png', '英国CTO LIGHTING灯具品牌：手工制作，工匠只采用最上等的材料来自英国的手工制作奢华灯具品牌CTO LIGHTING，手工工匠只选用最上等的材质，其客户包括: DAVID COLLINS, STUDIO KO。', 3.00, 583, 595, 599, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ctolighting.1688.com', 1615274120, 1616046048);
INSERT INTO `p_brand` VALUES (71919, 2028, 'FOSCARINI', 1, 'FOSCARINI', 'https://oss.yiwofa.com/brand/20210309/202103091155518063387386.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157198759284424.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/dac7069ef8034e61085775ff532174e4.png,https://oss.yiwofa.com/brand_banner/20210318/45ede7ac9aea92a14b81ec5e6bcac6e7.png,https://oss.yiwofa.com/brand_banner/20210318/1d8cdd68393fb1257e605c6bc9e43d0b.png', '意大利FOSCARINI灯具致力将传统口吹玻璃工艺运用于现代灯具设计，以精致的手工玻璃艺术表现灯具的造型及光影美感，奠定了该品牌高品质的稳定基础意大利FOSCARINI于1981年成立于威尼斯，创立初期致力将传统口吹玻璃工艺运用于现代灯具设计，以精致的手工玻璃艺术表现灯具的造型及光影美感，奠定了该品牌高品质的稳定基础；意大利FOSCARINI灯具涵蓋了多样化的素材及许多经典的现代灯具代表作品。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://foscarini.1688.com', 1615274120, 1616046417);
INSERT INTO `p_brand` VALUES (71969, 2029, 'davide groppi', 1, 'davide groppi', 'https://oss.yiwofa.com/brand/20210309/202103091155416435367863.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156593617555901.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/86597e3f17a228361dc9088e9a5a53b7.png,https://oss.yiwofa.com/brand_banner/20210318/97a7af602ad3fc725caec4d4d3d7f401.png,https://oss.yiwofa.com/brand_banner/20210318/b68f1c8689ec82ecb09a8c4b9a6ecb7e.png', 'davide groppi的灯具不仅是简单地作为灯具，而是作为生活的意义。所有一切都源自于二十世纪八十年代晚期的意大利历史文化中心皮亚琴察镇的一家小型实验室。 在发明和制造他的第一款灯具产品，并决定简单使用他自己的名字来作为公司的名称。 开拓创新的独立性和满腔激情，不寻常规的管理方式，他与时俱进得学习，并研发了原创产品的自有品牌，目前畅销于全球各地。 简约、轻量、富有情感和创意发明，是davide groppi设计的每一款灯具或照明产品的基本组成部分。', 3.00, 583, 595, 601, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://davidegroppi.1688.com', 1615274121, 1616046733);
INSERT INTO `p_brand` VALUES (72019, 2030, 'KINETURA', 1, 'KINETURA', 'https://oss.yiwofa.com/brand/20210309/202103091155583039884257.png', 'https://oss.yiwofa.com/brand/20210309/202103091157336457722704.jpeg', 'https://oss.yiwofa.com/brand_banner/20210318/0a9bb0976ee01d68c4594700ace4b1fd.png,https://oss.yiwofa.com/brand_banner/20210318/e712ec82bf66e94dfe6a615b7ba72487.png,https://oss.yiwofa.com/brand_banner/20210318/9345cf6244be365f93f6a6fc63c8260c.png', '比利时灯饰品牌Kinetura，结合光调制和物理转化，运用可持续照明和可控制系统，创造了具有专利的先进照明装置。灯本质上是沉默的，但在Kinetura却变成了动感的、可变化的，让空间的氛围与生活趣味上升到一个全新的高度。Kinetura运用非常节能的LED光源，使灯的表面向内弯曲的转变只需要很少的能源，并不需要热身就可以改变形状。一个简单的调光器就可以控制灯的强度和转换，并可以集成到家庭自动化系统中。灯的形状与光的调制同时进行，灯越张开，光线就越明亮。', 3.00, 583, 595, 599, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://kinetura.1688.com', 1615274121, 1616046925);
INSERT INTO `p_brand` VALUES (72020, 2031, 'Catellani&amp;Smith', 1, 'Catellani&amp;Smith', 'https://oss.yiwofa.com/brand/20210310/202103101019091255198272.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019048491954106.jpg', 'https://oss.yiwofa.com/brand_banner/20210318/7b91daf75249932b5d0fb9cf42990a50.png,https://oss.yiwofa.com/brand_banner/20210318/264cda485b609f9f82298c9107cf8638.png,https://oss.yiwofa.com/brand_banner/20210318/3ef183d7f7d9364216be69f79d76024b.png', 'CATELLANI&amp;SMITH的不同寻常之处在于，公司刚成立时属于手工艺产业，但是如今却凭借最先进的技术成长为照明行业的领军企业。意大利灯饰灯具CATELLANI&amp;amp;SMITH品牌创立于1989年，在1985年Carlo Catellani和Logan Smith在位于Menorca的Balearic岛会面之后，即产生了设计生产装饰性灯具和日常用品的想法。 1992年，公司的行政部门和厂房总部迁址到Villa Di Serio，这是位于意大利伦巴第的贝加莫五公里以外的一个小镇。行政部门被设置在可以俯瞰山谷的一个经过翻新的旧厂房里，生产在两个不同的区域进行：一个位于河岸边，另一个位于工业区域的新厂房里，这里有着大片的明亮空间和布满茉莉花的梯田。屋顶造型就像一个表面为砾石材质的印度大花瓶，塑有一尊从各个方位都能看到的佛像。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://catellan.1688.com', 1615274121, 1616047327);
INSERT INTO `p_brand` VALUES (72070, 2032, 'Marset', 1, 'Marset', 'https://oss.yiwofa.com/brand/20210309/202103091156051337240564.png', 'https://oss.yiwofa.com/brand/20210309/202103091157487812925020.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/09ad33c1443a9f44f2ca14caa45c5ed4.png,https://oss.yiwofa.com/brand_banner/20210319/98e710efebc893001da3b51735cca978.png,https://oss.yiwofa.com/brand_banner/20210319/1b8f861232454b30d65c5e5579a22bbc.png', 'Marset的灯具既具备了普通灯具所应该具备的照明功能，还用别出心裁的设计将照明功能无限放大。Marset灯具的最大特点就是能够与周围环境和谐地融合，并在不知不觉间为使用者创造出梦幻般的灯光效果。Marset的灯具精致而现代。他们照顾在不同的细微差别和影响下的光线，创造出具有性格的氛围，提高客户的生活质量。他们致力于创造一流设计，帮助确保每个产品完美无缺。Marset力求产生创新，灵巧的装置，在旅途中点燃观众的感官。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://marset.1688.com', 1615274121, 1616132481);
INSERT INTO `p_brand` VALUES (72120, 2033, 'NEMO', 1, 'NEMO', 'https://oss.yiwofa.com/brand/20210309/202103091156087061614535.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157578839563405.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/ae41b86d8c518451f5ec40c4b579d490.png,https://oss.yiwofa.com/brand_banner/20210319/cd90caa6dca4f8620ae2ccdc8ceff546.png,https://oss.yiwofa.com/brand_banner/20210319/b4e486881835004c0c24c57cbb33caed.png', 'NEMO公司于1993创建于米兰，是一家照明领域内以顶尖设计来不断开拓创新的全球领军企业。在照明设计与制造领域内已经成为了一家标志性企业，这都源自于由意大利设计所激发的灵感创新。NEMO的成功之路源自于过去二十年中意大利设计史。NEMO由Cassina S.p.A.的创始人Franco Cassina和Carlo Forcolini于1993年创立，他们迫切的感受到，植根于意大利设计传统的产品方案急需开拓创新。正是由于已成为意大利设计标志性方案的各类产品，Nemo已经在全球的照明设计领域内取得了遥遥领先的优势和地位。 在种类丰富的产品系列中，NEMO创建了卓尔不群的主打系列产品，该产品系列由为公司的现代化设计方案倾心倾力的设计师们亲自操刀设计而成：主要有Le Corbusier，Vico Magistretti，Franco Albini，Charlotte Perriand和Kazuhide Takahama。 NEMO品牌隶属于Federico Palazzari。去年，Nemo荣获了一系列重要奖项。Roberto Paoli设计的TRU灯饰和Angeletti Ruzza设计的Gi&amp;ograve;灯饰被提名为Compasso d&amp;rsquo;Oro 的ADI Design Index设计大奖。此外，TRU灯饰被提名为2015年度优秀产品设计大奖。 NEMO通过不断研发无与伦比的灯饰产品，从而在照明领域开创了独树一帜的产品系列，主打产品系列，其设计师也是现代设计中最重要风向标：主要有Le Corbusier，Charlotte Perriand，Vico Magistretti，Franco Albini和Kazuhide Takahama。 NEMO品牌由于Le Corbusier设计的Projecteur 365产品方案而荣获了&amp;ldquo;2013年度墙纸最佳设计大奖&amp;rdquo;。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://nemo.1688.com', 1615274122, 1616133486);
INSERT INTO `p_brand` VALUES (72121, 2034, 'Artemide', 1, 'Artemide', 'https://oss.yiwofa.com/brand/20210309/202103091155086168977326.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156373316504042.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/8bc7c2dd634849bc17347502d368a49e.png,https://oss.yiwofa.com/brand_banner/20210319/96c5efd6a7f9c2252642b9f3fed98b43.png,https://oss.yiwofa.com/brand_banner/20210319/4a1d3f6329e56da97718532cdd26ee7d.png', 'Artemide成立于1960年并且是全球家喻户晓的知名灯具品牌之一，被列为国际等级的当代设计代表作品, 同时也展示在世界各大现代艺术博物馆和世界设计产品收藏系列.Artemide成立于1960年并且是全球家喻户晓的知名灯具品牌之一, 值得注意的还有Artemide所坚持的&amp;quot;人类之光The Human Light&amp;quot; 的哲学概念. 如今Artemide更是和设计, 革新以及意大利制造生产的名词画上等号. 同时藉由设计产品, Artemide也为国际设计的历史贡献很多, 例如Elisse（1967年,设计师维科 马吉斯德地Vico Magistretti）, 托勒密Tolomeo（1989年, 设计师米歇尔 德 鲁奇Michele De Lucchi和约翰 卡罗法西纳Giancarlo Fassina）和管道Pipe（2004年, 设计师赫梭Herzog和德 梅隆De Meuron）这些全部都有得到黄金指南针奖Compasso d&amp;#39;Oro. 在1994年Artemide获得黄金指南针奖Compasso d&amp;#39;Oro所颁发的终身成就奖以及在1997年具有相当声望的欧洲国际设计奖, 除此之外, Artemide的灯具还被列为国际等级的当代设计代表作品, 同时也展示在世界各大现代艺术博物馆和世界设计产品收藏系列。', 3.00, 583, 595, 601, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://artemide.1688.com', 1615274122, 1616133903);
INSERT INTO `p_brand` VALUES (72171, 2035, 'DEDON', 3, 'DEDON', 'https://oss.yiwofa.com/brand/20210309/202103091155436362996208.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157023368405705.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/940d52ed18918bc24f30f833a7528126.png,https://oss.yiwofa.com/brand_banner/20210319/7d6c5bd08f7088290cee7c2466ff7129.png,https://oss.yiwofa.com/brand_banner/20210319/930746656d72d1b914e37dea945b07db.png', '斗转星移二十年，Bobby创办的公司已经是全球首发的户外家具品牌，其产品设立了质量、设计和购买欲望的标准，并不断地提升此标准。你可以说DEDON的故事起源于1990年的慕尼黑病床上。正是在这里,效力于拜仁慕尼黑足球俱乐部的前程似锦的年轻守门员Bobby Dekeyser，刚刚从重创中恢复过来，他突然决定离开职业运动生涯来追求自己的真正人生梦想。&amp;ldquo;我只知道我想成为一名企业家,&amp;rdquo;他解释说，正是在医院里，我创立了DEDON品牌。&amp;rdquo; 但是通往现代环境的创业之路已经明显不同于Bobby当时所在的环境。 &amp;ldquo;我们对我们将会卖什么产品也毫无概念，&amp;rdquo;他这样承认到。最终&amp;ldquo;理念被确认为与您的家人和朋友在美妙的环境中一起度过，共同打造美好的明天。&amp;rdquo; 但是他带给这项任务的理念&amp;mdash;&amp;mdash;决心、毅力、自力更生、灵活性。虽然面对他的艰难困苦和千难万阻总是络绎不绝、源源不断，但他仍把这些理念铭刻到了我们公司的DNA中。 到了2005年，DEDON成为一个家喻户晓的品牌。这在很大程度上归功于公司有越来越多设计师的加盟。新款产品，例如Frank Ligthart的《叶子》和《方尖碑》获得了&amp;ldquo;红点&amp;rdquo;设计大奖和其它的世界著名奖项。当德国世界杯足球队的照片在荣登2006年的ORBIT上时，这使得了Frinier的未来设计上升到了平流层&amp;mdash;&amp;mdash;甚至连布拉德&amp;bull;皮特在购买时也不得不排队等候。 如今，DEDON已经迎来了二十年华诞。仅仅在过去的十年里，我们的团队人数已经从三个人增长到了3000人。我们公司出品的卓越户外家具，质量和设计无与伦比，现在分销与全球范围内八十多个国家，而且在设计与生产中涵盖如此众多的新项目&amp;mdash;&amp;mdash;从Philippe Starck和Jean-Marie Massaud系列产品，到Bruce Weber的新活动，再到原创度高的新式DEDON花园和DEDON地域理念&amp;mdash;&amp;mdash;我们几乎欣喜若狂、无法自抑。', 3.00, 583, 595, 601, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://dedon.1688.com', 1615274122, 1616134388);
INSERT INTO `p_brand` VALUES (72221, 2036, 'Louis Poulsen', 1, 'Louis Poulsen', 'https://oss.yiwofa.com/brand/20210309/202103091156034522868938.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157443919357253.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/43fa0e798a7a8c5584cd8e17dd499173.png,https://oss.yiwofa.com/brand_banner/20210319/37503d945e82f647e0a330c5d141cee4.png,https://oss.yiwofa.com/brand_banner/20210319/5d1271a6498821af009d6d55017660cd.png', '灯光对于人类的幸福至关重要，LOUIS POULSEN力求创造和谐、舒适的灯饰。传奇人物Poul henningsen最先提出“舒适要素”的理念，这也是LOUIS POULSEN产品热销世界各地的重要原因。成立于1874 年，著名的丹麦国际灯具品牌，有着悠久的品牌历史，旗下员工超过1000 名，其分公司遍布于法国、德国、日本、美国、香港及北欧各国。简约风格的设计造型。 积极的致力于创造高端的设计艺术品，特别是对于灯饰品的创新，更是其公司不断努力的目标。 注重作品的外型的要求及使用机能的完美搭配。 多年来LOUIS POULSEN 积极致力于视觉艺术品的创作，对于灯饰品的创新，更是其设计师群不断努力的目标，对于作品的优雅外型的要求上，和使用机能如何完美搭配，是其最骄傲出众的优势，对于简洁风格的诉求，使 &amp;nbsp;Louis Poulsen 更加永垂不朽，也让其成为国际上第一流的知名品牌。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://louis.1688.com', 1615274122, 1616134728);
INSERT INTO `p_brand` VALUES (72271, 2037, 'TERZANI', 1, 'TERZANI', 'https://oss.yiwofa.com/brand/20210309/202103091156209065799745.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158203797815656.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/577b011c514aeb9a21276129b7ade875.png,https://oss.yiwofa.com/brand_banner/20210319/02f9ef0d8422ea3019ec5500ef745f3c.png,https://oss.yiwofa.com/brand_banner/20210319/5f015c34521ff5766f863109afbd0cc2.png', '意大利品牌灯具TERZANI公司于1972年成立于意大利佛罗伦萨，致力于将传统意大利工艺与现代技术相结合，制作融合艺术、奢华与设计感的灯饰。其产品参加过在米兰、巴黎、莫斯科等地举行的各大展会。意大利品牌灯具TERZANI公司于1972年成立于意大利佛罗伦萨，致力于将传统意大利工艺与现代技术相结合，制作融合艺术、奢华与设计感的灯饰。其产品参加过在米兰、巴黎、莫斯科等地举行的各大展会。 公司创始人Sergio TERZANI和CEO Nicolas TERZANI，创立了TERZANI实验室，开发和检验新的材料、技术和创意，以更进一步推动灯具设计实验。 TERZANI委任享誉盛名的艺术家，包括Nigel Coates、Maurizio Galante、Christian Lava 、Dodo Arlsan进行设计，他们各自独特的创意理念为TERZANI众多的产品系列做出了贡献。 TERZANI凭借最新、最著名的系列迈出了革新进程的下一步&amp;mdash;&amp;mdash;以一个工业领导者的身份为灯饰行业的未来创造适宜的发展环境，在此环境下TERZANI将注意力集中在新的创意上，继续重新定义奢华灯具创造之路。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://terzani.1688.com', 1615274122, 1616134983);
INSERT INTO `p_brand` VALUES (72321, 2038, 'LOLLI e MEMMOLI', 1, 'LOLLI e MEMMOLI', 'https://oss.yiwofa.com/brand/20210309/202103091156023531968699.png', 'https://oss.yiwofa.com/brand/20210309/202103091157428122541186.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/3274644ff322e3982255e65e4f241548.png,https://oss.yiwofa.com/brand_banner/20210319/63ec785c15345d46c0835011029840da.png,https://oss.yiwofa.com/brand_banner/20210319/0bb17658e97436da19cb2ebf14cfa9db.png', '1993年，LOLLI e MEMMOLI品牌首次亮相。 两位建筑师伊万·洛利（Ivan Lolli）和马里奥·梅莫利（Mario Memmoli）独立管理当下的潮流，受极简主义美学的强烈影响，完全解构了一种照明传统，如水晶吊灯，以现代品格重塑其身份。对于Fuori Salone来说，Lolli e Memmoli陈列室被转变为一个实验空间，其中新的颜色和形式的最新型号的系列Viet实现了折射和透明效果总是惊人和意想不到的。 与此同时，整个设计周的枝形吊灯Viet都是米兰Tombolini精品店的嘉宾。Lolli e Memmoli悬浮水晶的优雅光芒完美彰显着名时装店的精致氛围。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lollie.1688.com', 1615274122, 1616135164);
INSERT INTO `p_brand` VALUES (72322, 2039, 'BOCCI', 1, 'BOCCI', 'https://oss.yiwofa.com/brand/20210309/202103091155124795421863.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156461421591905.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/ef19cc2c9f630fa52e61106d68a5c8c1.png,https://oss.yiwofa.com/brand_banner/20210319/9a691ea82de761ffd1de6068e0e93b55.png,https://oss.yiwofa.com/brand_banner/20210319/cb65c350aa7dd786abd9f37dcae8629b.png', '加拿大BOCCI灯具擅长使用灯泡、线和铁丝做出造型有趣的实验性灯具加拿大Bocci是设计师Omer Arbel 在温哥华创立的灯具品牌。Arbel擅长使用灯泡、线和铁丝做出造型有趣的实验性灯具。他到目前为止最出名的设计&amp;mdash;&amp;mdash;系列28(28 Series)还曾在英国伦敦V&amp;amp;A博物馆开展。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bocci.1688.com', 1615274122, 1616135392);
INSERT INTO `p_brand` VALUES (72323, 2040, 'VIBIA', 1, 'VIBIA', 'https://oss.yiwofa.com/brand/20210309/202103091156239903266928.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158305425549940.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/b3ab283df22252388ef3d64a9bb31bdc.png,https://oss.yiwofa.com/brand_banner/20210319/716f7ed42668a656e230d941c57afe53.png,https://oss.yiwofa.com/brand_banner/20210319/90cabb4eacf8476d7b924e51dacf5afa.png', '光是塑造世界的一种原始力量，而现在人类利用灯光创造个性化的微世界。VIBIA的使命是通过提供适当的灯光照明使每个人都能更容易找到自己并通过我们一系列独特的照明产品启发消费者、设计师以及灯光设计专业人士的创造力和品味。西班牙品牌VIBIA成立于1987年，设计风格和FLOS相似，非常简约和现代。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://vibia.1688.com', 1615274122, 1616135777);
INSERT INTO `p_brand` VALUES (72324, 2041, 'Roll&amp;Hill', 1, 'Roll&amp;Hill', 'https://oss.yiwofa.com/brand/20210310/202103101019102034764868.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019074247383078.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/8c405eed22876f92c725b924172c4b45.png,https://oss.yiwofa.com/brand_banner/20210319/51c59f92d2c2f31afd4a00d851464826.png,https://oss.yiwofa.com/brand_banner/20210319/499d95c95627bf23b49354ab8d88ce32.png', 'Roll＆Hill与当今优秀的独立设计师合作，共同创造出一系列美丽独特的照明灯具。Roll＆Hill与当今优秀的独立设计师合作，共同创造出一系列美丽独特的照明灯具。Roll＆Hill于2010年由Jason Miller创立，他作为设计师和制片人的经验激励了他创建一家可以利用独立设计师的公司，同时提供更多与精品工作室相关的优势。Roll＆Hill致力于按需生产，可以根据客户的需求定制每件产品。 Roll＆Hill总部位于布鲁克林的日落公园，部分零件是手工组装的，一次制作一盏灯。Roll＆Hill的作品来源于丰富的材质的调色板，包括黄铜，青铜，皮革，木材，手工打结的绳索和吹制玻璃。Roll＆Hill的设计师经常将历史元素与当代形式相结合，创造出熟悉而又全新的灯具。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://rollhill.1688.com', 1615274122, 1616136154);
INSERT INTO `p_brand` VALUES (72374, 2042, 'Delightfull', 1, 'Delightfull', 'https://oss.yiwofa.com/brand/20210309/202103091155444649610001.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157041499844982.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/64df18a3d62e4cb8f37b3a6cbdf25958.png,https://oss.yiwofa.com/brand_banner/20210319/5c867011fd5194e5e57ed510324643b0.png,https://oss.yiwofa.com/brand_banner/20210319/fb331d0ffe8bbfd3373a8869c95dc21d.png', 'Delightfull照明在每一处细节中都体现了一种个性、一种心境和一种强烈的情感。与Delightfull世界共享精华、传承经典。通过我们勤劳的双手，将激情和专注化为我们打造的产品，由此而诞生了Delightfull的惊世杰作。DELIGHTFULL中的独树一帜的产品系列称为Heritage，其产品方案能够为您提供多种多样的高品质照明灯具产品，并可适合多种环境氛围和空间。&amp;nbsp;', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://delightfull.1688.com', 1615274122, 1616136524);
INSERT INTO `p_brand` VALUES (72375, 2043, 'Barovier&amp;Toso', 14, 'Barovier&amp;Toso', 'https://oss.yiwofa.com/brand/20210310/202103101019087662807627.jpg', 'https://oss.yiwofa.com/brand/20210310/202103101019046811667836.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/20649c600b831021296da70a58debaf4.png,https://oss.yiwofa.com/brand_banner/20210319/2c3b27f38be24c2633f9855bd3e1d148.png,https://oss.yiwofa.com/brand_banner/20210319/2bf90d215e9a1d31e55351ad08d307d2.png', '意大利品牌Barovier &amp; Toso致力于打造「高端纯手工制作水晶灯」，灯具经历过 700 多年岁月的流转与市场的考验。全球最古老的玻璃工业家族Barovier&amp;amp;Toso，成立于公元1295年威尼斯慕拉诺(Murano)小岛。Angelo Barovier在欧洲文艺复兴时期，研发出一种接近水晶般清亮剔透的玻璃，从此&amp;ldquo;水晶玻璃&amp;rdquo;工艺的独家配方，让Barovier&amp;amp;Toso成为无可取代的灯具精品。 七百多年以来坚持工匠手工制技术，与天然矿物染色，经过1400度的高温淬炼，成就晶透的水晶玻璃艺术灯具。Barovier&amp;amp;Toso深受顶级市场喜爱，时尚品牌Dolce &amp;amp; Gabbana、Louis Vuitton、Cartier等特定店面，与法国设计师Philippe Starck设计的Bon餐厅、巴黎George V饭店，以及全球顶级饭店Four Seasons、Marriot、Hyatt、Ritz-Carlton等，都能看见Barovier&amp;amp;Toso特别为之订制的华丽灯具。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://barovier.1688.com', 1615274122, 1616136890);
INSERT INTO `p_brand` VALUES (72377, 2045, 'Cameron Design House', 2, 'Cameron Design House', 'https://oss.yiwofa.com/brand/20210309/202103091155148032774283.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156496128776131.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/d11ea2093000a5c62b19ccdb03edb93c.png,https://oss.yiwofa.com/brand_banner/20210319/6bfc9937710df0c27cdf7302d28dcf88.png,https://oss.yiwofa.com/brand_banner/20210319/3369eaebced0776c117dacb99da0fcfc.png', 'Cameron Design House是一家英国照明设计和制造公司，由设计师IanCameron创立，提供独特的当代和定制的照明设计。Cameron Design House产品的设计和制造过程的每一步都在PrimroseHill工作室内部进行，以确保质量和创意控制。因此，他们能够根据您的需求量身定制设计，或与您合作，为您的空间提供独特的定制解决方案。Cameron的设计审美从他童年探访到了宁静的斯堪的纳维亚的乡村，以及繁华的伦敦城市开始培养起来。Cameron的形式和功能同样重视，结合了自然，设计和技术元素，创造出美丽，现代和雕塑的特色照明装置。 Cameron从西伦敦的一个小车库开始，逐渐扩大，在新罕布什尔山开设我们的第一个&amp;ldquo;工作展厅&amp;rdquo;。后来又搬迁到圣约翰斯伍德的梦幻展，进行内部设计和制作，以确保每件作品的最高水平的做工和创意控制。 我们定期开放工作室，预约时可以观看。 Cameron Design House的作品开始在世界各地流通（从纽约世界贸易中心到沙特阿拉伯的皇室），他们希望建立一个全球性的英国品牌，提倡创新，认真和优质的设计。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cameron.1688.com', 1615274122, 1616136977);
INSERT INTO `p_brand` VALUES (72427, 2047, 'Lindsey Adelman', 2, 'Lindsey Adelman', 'https://oss.yiwofa.com/brand/20210309/202103091156017397520496.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157413959578902.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/e81677158dadc8afe9bd77d0dae9e5cb.png,https://oss.yiwofa.com/brand_banner/20210319/c755365915b93f37155d2cc51525c183.png,https://oss.yiwofa.com/brand_banner/20210319/666ae9b63b598ba9172fb0efb38bd475.png', 'Lindsey Adelman，的吊灯设计新颖，是产业与自然交叉融合的独特作品。Lindsey Adelman，纽约照明设计的宠儿，她的吊灯设计新颖，是产业与自然交叉融合的独特作品。2006年，Adelman在纽约建立了她的工作室。如今，她管理着一个15人的团队，并将当地工匠们的制作联系起来。她设计制作的那些玻璃球全是在布鲁克林手工制作出来。Adelman的重心是照明设计，但她最近也开始涉足珠宝、容器、瓷砖和壁纸，甚至延伸到材料范围&amp;mdash;&amp;mdash;木材、混凝土、瓷器、黄金和有限元。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lindsey.1688.com', 1615274122, 1616137069);
INSERT INTO `p_brand` VALUES (72429, 2049, 'OLuce', 2, 'OLuce', 'https://oss.yiwofa.com/brand/20210309/202103091156108963951955.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158017755646547.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/e6c810187ab14caae0b660fd45412759.png,https://oss.yiwofa.com/brand_banner/20210319/c6af0fc2a9840e0c99008bac748cfe0b.png,https://oss.yiwofa.com/brand_banner/20210319/a0b918d5768e8b0991932fce81b9e7f8.png', '意大利OLuce灯具由设计大师 Giuseppe Ostuni 创办，这是一间历史悠久，经验丰富的意大利灯具设计公司，OLuce的产品丰富，创意性十足。意大利OLuce灯具成立于1945年，由朱塞佩创办，是如今仍活跃于市场上的历史最悠久的意大利照明设计公司。OLuce由设计大师 Giuseppe Ostuni 成立，是一间历史悠久，经验丰富的意大利灯具设计公司，OLuce的产品丰富，创意性十足。2001年，Euroluce的O Luce展品采用了白色穆拉诺玻璃晶石和透明有机玻璃线管。此展品由Laudani &amp;amp; Romanelli和Ferdi Giardini操刀设计，他们提出了一种设计方案，超越了自身的功能性并转向了颇具诗意的设计。 公司秉承了OLuce设计理念，不断倾听来自国际市场上对照明设计的回馈，继续沿着设计之路不断前行。这个小型设计师团队随后又额外吸纳了美国设计师Tim Power，芬兰设计师Harri Koskinen和意大利设计师Carlo Colombo。最后，也称作Nendo的日本的年轻设计师Oki Sato加入了OLuce团队。但是这已经不再是OLuce的历史，而是OLuce对当代设计领域的倾力巨献。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://oluce.1688.com', 1615274122, 1616137191);
INSERT INTO `p_brand` VALUES (72480, 2051, 'SELETTI', 1, 'SELETTI', 'https://oss.yiwofa.com/brand/20210309/202103091156182471550488.png', 'https://oss.yiwofa.com/brand/20210309/202103091158142381340698.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/64973699f91d7726aefb321db1fe63d3.png,https://oss.yiwofa.com/brand_banner/20210319/1da2d5c0e2247575382827a1d7f9c734.png,https://oss.yiwofa.com/brand_banner/20210319/3f810b942f73af5f226e981626cf05af.png', 'SELETTI被誉为家具视觉的进化史。自1964年成立以来，公司一直致力于发挥专业性，服务性和最重要的产品研究的无尽性，追求改进，创新和创意。SELETTI，将设计与波普艺术联系在一起。从1964年起，曼托瓦Cicognara的SELETTI 一直遵循专业服务和不断研究的原则，致力于创新和创新。该公司专注于设计项目和创意特色的意大利家具。 包含艺术品和日常生活图标的收藏品，传达形状和功能信息，向客户展示独特、个性化和有趣的生活方式。今天，SELETTI 致力于新作品的创作，这是一个在美的理念中不断前进的旅程。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://seletti.1688.com', 1615274123, 1616137335);
INSERT INTO `p_brand` VALUES (72580, 2053, 'VANESSA MITRANI', 1, 'VANESSA MITRANI', 'https://oss.yiwofa.com/brand/20210309/202103091156232722693786.png', 'https://oss.yiwofa.com/brand/20210309/202103091158272663316146.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/d83818ed42a48a20085b6c6118775069.png,https://oss.yiwofa.com/brand_banner/20210319/cefda84171feb8ac8ec1be50719b1ad9.png,https://oss.yiwofa.com/brand_banner/20210319/b2751d645b92be936a2661ae95e1095e.png', 'vanessa mitrani品牌是法国本土以设计、生产玻璃器皿的装饰品工厂，玻璃与陶瓷的结合，富有创意，诠释了动物世界的欲望。Vanessa Mitrani的作品证明了玻璃仍然是一种生活，创造性和鼓舞人心的材料。Vanessa Mitrani的每一件作品都是手工吹制，随机的过程打造出独一无二的手工美感。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://vanessa.1688.com', 1615274123, 1616137918);
INSERT INTO `p_brand` VALUES (72630, 2054, 'SLAMP', 1, 'SLAMP', 'https://oss.yiwofa.com/brand/20210309/202103091156193338181877.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158167345672571.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/5906e8e857207bd81a97a93b49a34981.png,https://oss.yiwofa.com/brand_banner/20210319/5f2cd76271c8c4933ebe1174999d3d4e.png,https://oss.yiwofa.com/brand_banner/20210319/52bd8b96a0c686c9a44f06a01d66a420.png', '1994年创立SLAMP公司时，公司目标是在意大利设计领域内打造一些前所未有的新产品：公司能够提供提供高端品质的灯具产品，艺术工匠对产品细节的关注也能满足工业生产的卓越品质要求。产品采用了注册专利的创新材质，独树一帜，清晰易辨。1994年创立SLAMP公司时，公司目标是在意大利设计领域内打造一些前所未有的新产品：公司能够提供提供高端品质的灯具产品，艺术工匠对产品细节的关注也能满足工业生产的卓越品质要求。产品采用了注册专利的创新材质，独树一帜，清晰易辨。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://slamp.1688.com', 1615274123, 1616138601);
INSERT INTO `p_brand` VALUES (72680, 2055, 'KUNDALINI', 1, 'KUNDALINI', 'https://oss.yiwofa.com/brand/20210309/202103091155597231151578.png', 'https://oss.yiwofa.com/brand/20210309/202103091157363305143569.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/0fbf4c29837fa6d63afa0687cd8c369f.png,https://oss.yiwofa.com/brand_banner/20210319/1a0b4291cd91faca7ef032f8864fe5fb.png,https://oss.yiwofa.com/brand_banner/20210319/9de0b2324c8f4d4fa9baa80426a3716b.png', 'KUNDALINI——1996 年成立于意大利玻璃重镇Murano，以精致的意大利工艺制造，让闻名的国宝级工艺，继续发扬。KUNDALINI的成功之处源自其对产品的艺术设计不断深入的理解，以及和国际知名建筑师设计师的紧密合作。KUNDALINI强调灯光不仅是照亮屋内空间，更要能够闪耀内心的自我； 其不遗余力地在材料开发上，灯身设计上，以高标准、富创新性自我要求，讲究空间氛围和光影变化，创造出满足视觉和心灵的视觉盛宴。', 3.00, 583, 595, 599, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://kundalini.1688.com', 1615274123, 1616138770);
INSERT INTO `p_brand` VALUES (72730, 2056, 'Coelux', 1, 'Coelux', 'https://oss.yiwofa.com/brand/20210309/202103091155196124904460.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156561872661474.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/25167784bf45046ffb6c126dd02778ed.png,https://oss.yiwofa.com/brand_banner/20210319/ee572cdbb61af94d25909ef4d24f3b16.png,https://oss.yiwofa.com/brand_banner/20210319/0f901ed1a479dfe73954734c7abca205.png', 'Coelux是一家由物理学家Paolo Di Trapani创立的以模拟自然光为亮点的照明公司。CoeLux&amp;reg;总部坐落于著名的科莫湖附近的ComoNExT科技园区，他们是第一个在人工装置中实现模拟天空和太阳的照明公司。通过使用高端技术实现人们连接到真正的自然光感觉，CoeLux&amp;reg;为照明/建筑/地产行业提供新的解决方案（大大提升了地下空间的附加值）。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://coelux.1688.com', 1615274123, 1616138913);
INSERT INTO `p_brand` VALUES (72731, 2057, 'Carpyen', 1, 'Carpyen', 'https://oss.yiwofa.com/brand/20210309/202103091155156889389802.png', 'https://oss.yiwofa.com/brand/20210309/202103091156507986865103.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/26ea8474fd13696a1eb201ea25917297.png,https://oss.yiwofa.com/brand_banner/20210319/6e66d86d5458cf762b3289c7577d8015.png,https://oss.yiwofa.com/brand_banner/20210319/914a25e3a93931f6711672063ae53e42.png', 'Carpyen Lighting是一家现代化的照明公司，于1948年在西班牙巴塞罗那成立。Carpyen Lighting的作品从充满活力的原始国际大都市中汲取灵感。他们的设计遵循极简主义，线条流畅，线条简洁。从雕塑，引人注目的Nura 2 LED吊灯到优雅，功能齐全的Nirvana迷你台灯，Carpyen的灯具充满活力和高品质。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://carpyen.1688.com', 1615274123, 1616139234);
INSERT INTO `p_brand` VALUES (72781, 2058, 'bover', 1, 'bover', 'https://oss.yiwofa.com/brand/20210309/202103091155138888750163.png', 'https://oss.yiwofa.com/brand/20210309/202103091156468173189532.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/2f2e0a4ff52ea89d15e67dec3f1e2bbf.png,https://oss.yiwofa.com/brand_banner/20210319/072dd4b46048eeba4cfa58b5d92503d5.png,https://oss.yiwofa.com/brand_banner/20210319/bae4f8243fa728d8542e1211a46a4120.png', '1996年，Joana Bover在巴塞罗那创立了BOVER。经过20年的市场开发，最初作为建筑师朋友项目的餐巾纸上的草图已经发展成为现代照明领域的领先公司之一，在美国拥有自己的子公司并在国家开展业务全世界。尽管Bover品牌持续增长，但Joana Bover始终如一地坚持其原始愿景。她相信永恒的设计，会产生一种永不过时的风格，能够适应未来，而不会大张旗鼓。Bover的产品专为大空间设计，提供高度舒适性和照明性能', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://bover.1688.com', 1615274124, 1616139680);
INSERT INTO `p_brand` VALUES (72831, 2061, 'ITALAMP', 1, 'ITALAMP', 'https://oss.yiwofa.com/brand/20210309/202103091155561946486572.png', 'https://oss.yiwofa.com/brand/20210309/202103091157289343827464.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/c5923f3e99c8a10439c400a91b2be253.png,https://oss.yiwofa.com/brand_banner/20210319/c2013890eba96c740482fbbd4df08fd1.png,https://oss.yiwofa.com/brand_banner/20210319/b9ba3dea8a7c19657f4421e1de8aa513.png', 'ITALAMP由Matteo Vitadello创建于1975年，一路走来，凭借着当初的创意和热情获得了今天的成功，逐渐成长为业界的标杆，ITALAMP的成功，不仅仅归功于其精致美观的产品，还原于其对灯具意义的新颖独到诠释。ITALAMP有古典和现代两种风格，尤其是现代系列，大胆尝试各种材质，使水晶灯跳脱原有的认知，ITALAMP的现代系列，运用大酒杯、绑绳来表现水晶灯性感的一面，甚至连灯脚都有女人脚踝的曲线，近来像Versace、Fendi Casa、Provasi等家具也常搭配该品牌的灯具', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://italamp.1688.com', 1615274125, 1616140777);
INSERT INTO `p_brand` VALUES (72881, 2070, 'Licht im Raum', 2, 'Licht im Raum', 'https://oss.yiwofa.com/brand/20210309/202103091156012421502788.png', 'https://oss.yiwofa.com/brand/20210309/202103091157404385144748.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/0ea445f9dc28b4da82f5224578617849.png,https://oss.yiwofa.com/brand_banner/20210319/52158723de137b4058ff78f17e575e59.png,https://oss.yiwofa.com/brand_banner/20210319/e2922d2833441c4bc7ca78dc08f7f596.png', 'Licht im Raum、Dinnebier Licht以及Lichtturm为同一企业集团内的三家公司，享有共同的历史和传统。到目前为止，集团已经发展成为一家行业领先的照明设计机构之一。60年来，Licht im Raum一直在生产高品质的设计灯具，具有现代，永恒经典的气质，经典手工和传统的生产方法是他们的特色。公司的首要任务是为行政大楼、教堂和其他公共场所提供专业照明设计，此外，也为私人住宅提供照明灯具，并生产该公司自己的灯具系列。', 3.00, 583, 595, 602, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://licht.1688.com', 1615274130, 1616140930);
INSERT INTO `p_brand` VALUES (72931, 2062, 'L’Atelier du Vin', 1, 'L’Atelier du Vin', 'https://oss.yiwofa.com/brand/20210309/202103091156042959831457.png', 'https://oss.yiwofa.com/brand/20210309/202103091157463926507993.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/22dc40db8e8bf2f3db62fe480cdd73e7.png,https://oss.yiwofa.com/brand_banner/20210319/f904043fd7396d8944fb36dd7e518b33.png,https://oss.yiwofa.com/brand_banner/20210319/c950fe646fb616837e7221832246dd69.png', '自1926年以来，L’Atelier du Vin就专门从事葡萄酒酿造、装瓶和服务的供应和设备生产。如今，凭借其不断研究，已经成为唯一一个涵盖酒窖到玻璃杯的葡萄酒生活专家。L&amp;rsquo;Atelier du Vin的设计灵感来源于葡萄酒生产商，无论是在法国还是其他地方，种植葡萄和酿造葡萄酒的男性女性为他们提供了选择道路的基准。不管是在设计还是在功能方面，他们都希望扩大、品尝和分享葡萄酒的乐趣。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://duvin.1688.com', 1615274135, 1616141366);
INSERT INTO `p_brand` VALUES (72981, 2063, 'Nude Glass', 1, 'Nude Glass', 'https://oss.yiwofa.com/brand/20210309/202103091156095698479597.png', 'https://oss.yiwofa.com/brand/20210309/202103091157592871189238.jpeg', 'https://oss.yiwofa.com/brand_banner/20210319/f69fe93888ca71cf9b97276aefac0073.png,https://oss.yiwofa.com/brand_banner/20210319/63971c649a99d0b07ebd92cbb3121ffd.png,https://oss.yiwofa.com/brand_banner/20210319/adeb357f952924f26032cbab2a54a067.png', '手工制作的玻璃的精湛和工艺是NUDE的标志。NUDE以其手工制作的玻璃器皿方式而自豪，专注于手工制作的纯晶体玻璃，可以吹制，压制或压制成型。简单就是纯粹。简单至关重要。简洁的想法是NUDE的指导原则。NUDE将一切都精制到其本质，整理和提炼。这使得最终对象易于理解和使用。结果完美地反映在NUDE结晶玻璃中。NUDE始终站在创新理念的最前沿，并与广泛的艺术家和设计师一起开展动态合作。NUDE以自己勇敢，不守规矩和个性而自豪，我们的产品提供无与伦比的质量和想象力。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://nudeglass.1688.com', 1615274136, 1616142273);
INSERT INTO `p_brand` VALUES (73031, 2064, 'AXO light', 1, 'AXO light', 'https://oss.yiwofa.com/brand/20210309/202103091155095666156565.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156384137157982.jpg', 'https://oss.yiwofa.com/brand_banner/20210319/02a9fd05c771e2936f097a1cbcf0b549.png,https://oss.yiwofa.com/brand_banner/20210319/2757c6adadc38788d6d44749a9364e30.png,https://oss.yiwofa.com/brand_banner/20210319/c0bc4fe5f4789b1af82930fb074e6997.png', '意大利Axo Light灯具是高端室内照明领先企业，被誉为意大利灯具制造界中最具活力的公司意大利Axo Light设计照明于1996年创建于威尼斯(Venice)内陆地区，从一开始就将意大利对设计的热情和强烈的国际关注意识相结合，很快成为高端室内照明行业中的领先企业，被誉为意大利灯具制造界中最具活力的公司。  意大利Axo Light设计照明于2009年针对项目定制领域推出 Lightecture 线。专为大空间设计，由十一个标准尺寸达 180cm 系列产品组成；这种前卫、高科技照明解决方案符合节能光源需求不断增长的趋势。其包含超过5000种颜色和光线变化以及3D文件和光度数据，即使面对最挑剔的客户，也可以根据客户需求提供定制化解决方案。 &amp;nbsp;', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://axolight.1688.com', 1615274137, 1616142574);
INSERT INTO `p_brand` VALUES (73081, 2065, 'ANGLEPOISE', 14, 'ANGLEPOISE', 'https://oss.yiwofa.com/brand/20210309/202103091155057445822294.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156321926902456.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/d39a5d461bc86fcd913fcc3f85fb926e.png,https://oss.yiwofa.com/brand_banner/20210317/7bfffbcb3aedb864200e231fca77dfb5.png,https://oss.yiwofa.com/brand_banner/20210317/319a29ee3c6f261214f3ee7f3319e17f.png', '源自1932年的英伦经典照明设计，登上英国邮票的国民品牌。&amp;nbsp;ANGLEPOISE是英国最具指标性与代表性的灯饰品牌，以经典的悬臂工程概念搭配新式弹簧，巧妙地保持完美的平衡与精准度呈现。 &amp;nbsp; &amp;nbsp;', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://anglepoise.1688.com', 1615274138, 1615969887);
INSERT INTO `p_brand` VALUES (73131, 2066, 'ALESSI', 1, 'ALESSI', 'https://oss.yiwofa.com/brand/20210309/202103091155046544847498.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156294128780335.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/d8e667ea4d9a6e4c5a85b4fbfe4c1d1d.png,https://oss.yiwofa.com/brand_banner/20210317/ccbb314b55766c6b81198ff2288aa268.png,https://oss.yiwofa.com/brand_banner/20210317/19ff8550e92383c8f170a81bfaa0317d.png', 'ALESSI是家用设计制造商，以「意大利风格设计的工厂」全球闻名。他们深信一切器物的成形，即使外型再渺小，也是创意与科技的伟大结晶。ALESSI创自1921年，ALESSI创始人乔凡尼&amp;middot;艾烈希 (Giovanni Alessi) 於意大利北方人时地灵的奥美良市(Omegna)买下一小块土地成立ALESSI公司，自此ALESSI成为工艺、艺术与品味的代名词。 ALESSI著重生活创意，设计出许许多多颠覆传统家庭用具的作品，每件产品的背后，都有它诗意的感性体验与充满幽默的戏虐趣味， 当然，也无怪乎它动不动就抱走许多国际性比赛的设计大赏，甚或被罗浮宫或纽约现代博物馆指名典藏， 这全归功於ALESSI对自身品质、设计理念与意大利风格的执着。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://alessi.1688.com', 1615274139, 1615969314);
INSERT INTO `p_brand` VALUES (73181, 2073, 'Mineheart', 15, 'Mineheart', 'https://oss.yiwofa.com/brand/20210309/202103091156059674247313.png', 'https://oss.yiwofa.com/brand/20210309/202103091157529062466892.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/e771bb5da7147cf35a652e2b05f55d9c.png,https://oss.yiwofa.com/brand_banner/20210317/eb866fd86a07f5497df0733f2c1a4c98.png,https://oss.yiwofa.com/brand_banner/20210317/0cb50c4462c735a1dad8d6aed14e94c3.png', 'Mineheart在2010年由设计师Brendan Young和Vanessa Battaglia在英国创立，大多数的Mineheart产品都是在英国设计、制造和组装的，生产和质量得到了很好的控制，具有更大的灵活性，还能够为客户提供定制服务。Mineheart来自英国伦敦，这是一个十分有爱的室内设计品牌。品牌名字取自莎士比亚的诗句&amp;amp;ldquo;Mine eye and heart...&amp;amp;rdquo;（我之眼与心......），饱含深意地寓意着我们每日目之所及的生活器物应该不止具有功能性，更需要包含着内心的故事、爱意与艺术，因此，我们的生活才会变得更有意义。这样的品牌理念当然也延续到了它的产品中。Mineheart的墙纸设计常常与艺术家合作，灵感取自于有故事的物件或历史，融合传统花纹与当代设计，使用环保性能的材料，让不同的经典系列有着不同的室内装饰功能。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://mineheart.1688.com', 1615274142, 1615967967);
INSERT INTO `p_brand` VALUES (73231, 2067, 'PAOLA PARONETTO', 3, 'PAOLA PARONETTO', 'https://oss.yiwofa.com/brand/20210309/202103091156129258781887.png', 'https://oss.yiwofa.com/brand/20210309/202103091158051794248776.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/ffe8d1ff827efe2e76e739ed80c677e0.png,https://oss.yiwofa.com/brand_banner/20210317/341dc4186916ecc3258b822c19423e88.png,https://oss.yiwofa.com/brand_banner/20210317/2569d7897b1bddd3d16ddf4319c4ac48.png', 'PAOLA PARONETTO的理念取得了成功，她的产品已在意大利和国外广为流传Paola Paronetto于1965年出生于Pordenone。 她在1988年开始接受陶瓷培训，学习了使用粘土的主要技术。她的艺​​术发展包括各种各样的经历，从不断的实验到自己的制作，再到着名的Meridiana陶瓷学院的教学。 在诠释喜爱当代设计的公众的品味和倾向时，她在工作中绝不受此限制。 她的实验是源于大自然和正式内容简洁的深刻美感的自发结果。 目前她主要在纸粘土上工作。 她的系列从纯粹的装饰物品，有时从显着的尺寸到日常物品， 专为那些喜欢用精致和独特物品环绕自己的人设计和艺术交流的空间。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://paola.1688.com', 1615274150, 1615966557);
INSERT INTO `p_brand` VALUES (73281, 2068, 'NAHOOR', 1, 'NAHOOR', 'https://oss.yiwofa.com/brand/20210309/202103091156078923177952.png', 'https://oss.yiwofa.com/brand/20210309/202103091157567848791830.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/975957968edd7dade1b0f6d7146f1e9f.png,https://oss.yiwofa.com/brand_banner/20210317/f62b7a29a1ad80acc918a187d7c8d43d.png,https://oss.yiwofa.com/brand_banner/20210317/61070c185f9a47488c97491ba1ed3624.png', 'Nahoor的产品是William Pianta的创造性工作的结果，他通过传承意大利设计的过去，通过从日益增长的生活体验和更新技术中获取的动机重新诠释它。每个产品结构的精加工过程都是由最优秀和最有经验的意大利工匠制作的。 由多个阶段和工艺和手动步骤打断的过程，允许从基本结构获得材料结果，但本质上是复杂的。 通过考虑每个客户的个性化需求，确保&amp;ldquo;量身定制&amp;rdquo;的服务，定制的生产过程需要灵活性和耐心。 卓越的产品修整工作以及材料和饰面的组合使每个Nahoor产品独特且不可重复。', 3.00, 583, 595, 599, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://nahoor.1688.com', 1615274152, 1615966016);
INSERT INTO `p_brand` VALUES (73331, 2069, 'FOSCARINI DIESEL', 4, 'FOSCARINI DIESEL', 'https://oss.yiwofa.com/brand/20210309/202103091155527164537910.png', 'https://oss.yiwofa.com/brand/20210309/202103091157202678839714.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/fe4273d3d14eb3c50c35034aa31af262.png,https://oss.yiwofa.com/brand_banner/20210317/3e28cfc2cd28bcb6352a92b81d0a91b0.png,https://oss.yiwofa.com/brand_banner/20210317/87d45b97e98c0df37e1bd3e971a40a94.png', '\"Foscarini作为对灯光艺术和灯具研发有着完美追求的“光影大师”与意大利教父级潮流品牌Diesel共同演绎了光影之魂与摇滚精神的奇幻魅力\"Foscarini与Diesel 合作系列有多元化表达语言&amp;mdash;&amp;mdash;从工业设计到复古，从时尚潮流到极简主义，从光影艺术到摇滚精神，都一一表达了Foscarini对生活方式的解读。这一合作系列包含40多种不同的产品，延续了Foscarini对材质的讲究，一些甚至从未在灯具上使用过的材料，也因此被赋予了新的使用价值。外形与风格都保持着极简工业设计和摇滚精神所表达的强烈情感，让生活拥有意想不到的精致体验。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://foscarinidiesel.1688.com', 1615274153, 1615964066);
INSERT INTO `p_brand` VALUES (73381, 2071, 'PAOLA C.', 1, 'PAOLA C.', 'https://oss.yiwofa.com/brand/20210309/202103091156121359667907.png', 'https://oss.yiwofa.com/brand/20210309/202103091158039068723170.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/2720747d7f73a123ccda6c9188170bf6.png,https://oss.yiwofa.com/brand_banner/20210317/a22e2b3a8b50f55acfa89e4adba6b039.png,https://oss.yiwofa.com/brand_banner/20210317/88295f96a596d4a3e828d890d0f6241f.png', 'Paola C.的观点超越了正式设计的理念，提供了时间和时尚的优雅维度。取材广泛的PAOLA C是一个来自时尚浪漫之都&amp;mdash;&amp;mdash;意大利米兰的充满新意与活力的高端手工餐具品牌，由意大利艺术家和欧洲顶级设计师Aldo Cibic、Jaime Hayon协同一众新锐国际设计师团队，在阿尔多&amp;middot;赛比克的艺术指导下创作而来，以致力于维护目标创造现实，优雅和诗意简单但不凡的餐具。', 3.00, 583, 595, 600, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://paolac.1688.com', 1615274166, 1615963612);
INSERT INTO `p_brand` VALUES (73382, 2072, 'TUNTO', 3, 'TUNTO', 'https://oss.yiwofa.com/brand/20210309/202103091156221602758877.png', 'https://oss.yiwofa.com/brand/20210309/202103091158255828419344.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/9e1d1bdae852ecdf4d53ed1c07598e53.png,https://oss.yiwofa.com/brand_banner/20210317/699f6e3243339dbd313a82df5c22075a.png,https://oss.yiwofa.com/brand_banner/20210317/139f1a5b00a030eb6304f68c820a0b35.png', 'Tunto Design创造了创新的照明概念，将可持续木质材料与最新技术创新相结合。Tunto Design是一家领先的LED和OLED灯具制造商，通过将木材和电子学与室内制造的技术融合在一起，创造出流行设计照明产品。多年来，Tunto Design凭借其创新理念、创造性设计和先进的技术，获得众多国际奖项，在全球得到广泛认可。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://tunto.1688.com', 1615274166, 1615962889);
INSERT INTO `p_brand` VALUES (73432, 2074, 'BRAND VAN EGMOND', 15, 'BRAND VAN EGMOND', 'https://oss.yiwofa.com/brand/20210309/202103091155143933250367.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156487581413897.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/e79983611377f757172ec9f3c4a198e0.png,https://oss.yiwofa.com/brand_banner/20210317/67a04e5ad9d21c6091ed284d804ca2ef.png,https://oss.yiwofa.com/brand_banner/20210317/47b26f13a19b3db90acb8a0867de4961.png', 'BRAND VAN EGMOND荷兰皇室御用手工定制品牌品质之经典。BRAND VAN EGMOND是荷兰的先锋独立设计品牌，以现代并极具诗意美感的灯具设计闻名。凭着独特的设计理念和制作工艺，以梦幻、美妙、浪漫，或者性感、古典、优雅、时尚的姿态，Brand van Egmond 的每套作品&amp;ldquo;读&amp;rdquo;起来都像一个故事，而故事中的气氛则会渗透到每个微小细节，继而慢慢&amp;ldquo;点燃&amp;rdquo;空间。', 3.00, 583, 595, 596, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://vanegmond.1688.com', 1615274173, 1615962367);
INSERT INTO `p_brand` VALUES (73739, 2101, 'INARCHI', 1, 'INARCHI', 'https://oss.yiwofa.com/brand/20210309/202103091155553050112566.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157275639781510.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/34d5455a636e40fc519bd956ed87f403.png,https://oss.yiwofa.com/brand_banner/20210317/2c834de07ed7616032a1122bedbd03e4.png,https://oss.yiwofa.com/brand_banner/20210317/6d58c8d9180a77ac0989c0edcbfa4022.png', '对于极简主义的挑战性艺术，INARCHI每毫米都在其中。整洁设计的工艺，前所未有的美学价值和深刻的功能。自2015年Euroluce首次亮相以来，Inarchi已经在装饰照明方面有所表现。Inarchi以极简主义设计推动创意的前沿，成功打动建筑师和室内设计师寻找新概念，从而将他们的项目带入生活。', 3.00, 583, 595, 598, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://inarchi.1688.com', 1615274195, 1615961680);
INSERT INTO `p_brand` VALUES (73789, 2077, 'Valcucine', 1, 'Valcucine', 'https://oss.yiwofa.com/brand/20210309/202103091156237975281746.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158268414805993.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/49cde1312d0299f696a436378b043500.png,https://oss.yiwofa.com/brand_banner/20210317/93f326f535fdce39d9c5b2f17597ef4f.png,https://oss.yiwofa.com/brand_banner/20210317/964af8017368d538d473cacf45693a53.png', 'Valcucine素以精细工艺、独特物料和环保理念享誉欧洲，广受欧洲设计业与建筑业的肯定和赞赏，在欧洲市场占据不可动摇的地位，成为贵族生活的象征。Valcucine是意大利顶级厨房品牌，英国皇室指定御用厨房，Valcucine完美的设计，不被短期的时尚所取代或影响，超越流行。除此之外，精致细腻的手工艺结合高科技技术，完美诠释意大利顶级贵族的生活。', 3.00, 583, 604, 605, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://valcucine.1688.com', 1615274202, 1615960690);
INSERT INTO `p_brand` VALUES (73839, 2078, 'ernestomeda', 1, 'ernestomeda', 'https://oss.yiwofa.com/brand/20210309/202103091155485021537559.png', 'https://oss.yiwofa.com/brand/20210309/202103091157124627523750.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/66a2565b235889ce5006ec01bb0c4720.png,https://oss.yiwofa.com/brand_banner/20210317/7ac362326b085c87187bf140ba5b85d8.png,https://oss.yiwofa.com/brand_banner/20210317/ca25e9f3203676ffe30ebfb1891c5c6e.png', '当我们设计一个完整的厨房时，我们也会考虑所安装地的其他配件，关注每一个细节，以保证完全与你心意相吻合。我们创造一个厨房，空间和谐是至关重要的。 通过创新设计，尖端技术，不断的研发和对质量的执着追求，促进全球意识的发展。 工业能力与工作哲学的结合，与公司战略保持一致，促进合同企业的发展。在意大利，合同企业为房地产开发商推广新项目和联合营销活动提供一揽子服务。 Ernestomeda也成功地满足了各个出口市场的的需求，其广泛的分类在产品定制和各种价格范围内有效竞争。', 3.00, 583, 604, 605, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ernestomeda.1688.com', 1615274202, 1615960105);
INSERT INTO `p_brand` VALUES (73939, 2080, 'LSA', 2, 'LSA', 'https://oss.yiwofa.com/brand/20210309/202103091156035978258157.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157459333924681.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/0770fd803f61834e5b93dbdb8aedb744.png,https://oss.yiwofa.com/brand_banner/20210317/176bf8a931ce6f1da1b0fb97e1ae2941.png,https://oss.yiwofa.com/brand_banner/20210317/ffc4af2779d11c80fd332723771a2cbb.png', '英国LSA International 的Handmade百年传承的工匠精神，将玻璃的剔透质感发挥到极致，独特的设计巧思兼具了使用与美感的平衡，也替玻璃艺术开启了新的生命力。LSA从1972年就开始创作玻璃与瓷器，期间创造了无数作品，从花瓶容器、陶瓷餐具等各种造型的酒杯，种类琳琅满目。注入了工匠情感的手工玻璃制品，每一款皆是经典而且实用的作品。', 3.00, 583, 604, 606, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lsa.1688.com', 1615274203, 1615959173);
INSERT INTO `p_brand` VALUES (74190, 2106, 'Moooi', 15, 'Moooi', 'https://oss.yiwofa.com/brand/20210309/202103091156069139805830.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157549567517420.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/cb11d41cb3e3fe456aad89cb814ca745.png,https://oss.yiwofa.com/brand_banner/20210317/b28b09c608e91fe93b633e2d6793cea5.png,https://oss.yiwofa.com/brand_banner/20210317/d2bdc40ec2a5ea92b8d594dca14fd418.png', '十多年以来，MOOOI以其璀璨夺目的创新设计，点亮、启示并诱惑了整个世界。在2001年由MARCEL WANDERS和CASPER VISSERS以他们的母语荷兰语中的&amp;ldquo;优美&amp;rdquo;一词来加以命名的&amp;mdash;&amp;mdash;品牌中的第三个&amp;ldquo;O&amp;rdquo;代表了美感和独特的附加价值。自从2015年9月1日以来，ROBIN BEVERS就接替了MOOOI合伙创始人CASPER VISSERS的职位，担任MOOOI的首席执行官。 自2013年以来，公司的艺术指导工作由MARCEL WANDERS和DESIR&amp;Eacute;E DE JONG负责。两位颇具创新力的灵魂人物引领了公司的创新潜力。两个创造性的领导者给公司带来更大的创造性潜力。WANDERS和VISSERS维系了对品牌的影响力，同时也负责整体的设计方案选择。除了MARCEL WANDERS的设计，MOOOI的产品目录中还包含了一系列其它国家和国际知名设计师的作品。这些其中的设计师包括：JURGEN BEY, BERTJAN POT, MAARTEN BAAS, JAIME HAYON, NERI &amp;amp; HU, JOOST VAN BLEISWIJK, STUDIO JOB和NIKA ZUPANC。 MOOOI产品系列的风格独特而大胆、活泼而细腻，并且坚信设计是一种热爱。产品永恒的美感拥有独特的古典特质，并融合了现代的时尚感。这种融合使品牌专注于明星产品的生产制造。 MOOOI设计独树一帜的融合了照明、家具和配套附件产品，这在日常起居的室内空间展现的淋漓尽致，MOOOI打造了以各种图案和颜色来装饰的内部环境来适应各种不同风格的空间，并使不同年龄、不同文化和不同性格的人们爱上自己的家居环境。这种意想不到的家居理念为生活带来了全新的理念，并激励着MOOOI公司用一点魔力点亮整个美好生活。产品所在之处，视域在变换，每个人都能停下来感受这种闲情逸致，在这里文化和阅历达到了完美的融合，并使得家居环境更加优美，更加独特。', 3.00, 583, 623, 624, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://moooi.1688.com', 1615274212, 1615957213);
INSERT INTO `p_brand` VALUES (74191, 2107, 'Serge LESAGE', 1, 'Serge LESAGE', 'https://oss.yiwofa.com/brand/20210309/202103091156186461930012.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158153551228300.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/8c7d27a61e9ef10a5ea175de1ca52aba.png,https://oss.yiwofa.com/brand_banner/20210317/90712e7a770dac14c58798af3ad25471.png,https://oss.yiwofa.com/brand_banner/20210317/0bd47c35b17bd3f5c665559bf008bad8.png', 'Serge LESAGE是顶级和量身定做的现代地毯领域的重要参与者，也是装饰者和建筑师的真正合作伙伴。自1984年成立以来，SERGE LESAGE专注于设计、制造和销售高品质的现代地毯。Serge LESAGE于1984年创立，专注于设计、制造和销售高品质的现代地毯于世界各地。抱持著对于专业室内装饰的使命，设计一系列特殊纹理的图腾与颜色，顾客也可以在超过400种颜色中来挑选设计属于自己的地毯。并有方形、椭圆形、圆形等多种形状和图腾可供选择。 Serge LESAGE对于商品品质格外非常注重，材质包括纯羊毛、蚕丝、亚麻、皮革、剑麻等，这些材料都经过严密的选配，每张地毯达到最高的舒适度、收边、美感和耐久性。', 3.00, 583, 623, 624, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://serge.1688.com', 1615274212, 1615956570);
INSERT INTO `p_brand` VALUES (74241, 2108, 'Quagliotti', 2, 'Quagliotti', 'https://oss.yiwofa.com/brand/20210309/202103091156156785847556.png', 'https://oss.yiwofa.com/brand/20210309/202103091158097960786241.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/735c5653f48bd4bbdfe28299e8f0899b.png,https://oss.yiwofa.com/brand_banner/20210317/343a043481301aa6f835b94a67224018.png,https://oss.yiwofa.com/brand_banner/20210317/eb50f935764db6a9e5934b2b3ad1ece4.png', '意大利家纺品牌Quagliotti是一家致力于奢华亚麻系列面料生产的企业，是意大利少数几家织造公司之一，至今已经走过80多年的辉煌历史，从纱线到成品，百分之一百意大利制造，以传统工艺结合现代新技术，完美展现织物独特的花色。意大利家纺品牌Quagliotti是一家致力于奢华亚麻系列面料生产的企业，是高贵奢华的代名词，从别致优雅的桌布到精益求精的床上用品，Quagliotti所有系列产品都使用高品质的棉布、亚麻和丝绸，给使用者带来无与伦比的奢华体验。', 3.00, 583, 623, 629, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://quagliotti.1688.com', 1615274212, 1615955742);
INSERT INTO `p_brand` VALUES (74291, 2116, 'Culti', 2, 'Culti', 'https://oss.yiwofa.com/brand/20210309/202103091155205429882457.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156572693673366.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/5ce7d8ede34004606a3311c859532ff7.png,https://oss.yiwofa.com/brand_banner/20210317/345e5c159e3cbf5fb0a1b6fa41029f6f.png,https://oss.yiwofa.com/brand_banner/20210317/9a406b1cdb236e233aa0314e18bc9604.png', 'Alessandro Agrati于1990年创立品牌CULTI MILANO，历经多年的努力，CULTI MILANO俨然成为优雅生活的代名词，致力于打造非凡产品，完美融合时尚设计感，淳朴材质与素雅配色于一体。九零年代初期，CULTI MILANO推出市面上首款芦苇杆扩香，灵感来于手工编织的藤篮，CULTI MILANO发现，将众多枝藤浸泡于香水之中，香味将逐渐散发到空间之间，稳定且持续地使空气中充满香气。', 3.00, 583, 623, 625, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://culti.1688.com', 1615274212, 1615955095);
INSERT INTO `p_brand` VALUES (74341, 2109, 'MY FRAGRANCES', 1, 'MY FRAGRANCES', 'https://oss.yiwofa.com/brand/20210309/202103091156076340500396.png', 'https://oss.yiwofa.com/brand/20210309/202103091157568671980972.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/b1e5c49501e82eb88043cfb50e6f961e.png,https://oss.yiwofa.com/brand_banner/20210317/6f8fc9cf514c55162d825833a1b850d0.png,https://oss.yiwofa.com/brand_banner/20210317/55f1e2b8f2efa63b00dea6de8b00da2f.png', 'My Fragrances始终相信卓越的价值。强大的工匠传统和意大利制造产品所固有的典型设计文化是他们所做出的每一个选择的核心。My Fragrances 是来自意大利的香薰品牌。出于对生活的热爱以及给顾客幸福感受的宗旨，品牌成立至今，所有的产品从配方到设计，从图形到包装，都力求完美。', 3.00, 583, 623, 625, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://myfragrances.1688.com', 1615274213, 1615953304);
INSERT INTO `p_brand` VALUES (74391, 2104, 'nomon', 1, 'nomon', 'https://oss.yiwofa.com/brand/20210309/202103091156091210509683.png', 'https://oss.yiwofa.com/brand/20210309/202103091157585361938406.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/42b94bc6e26de6ef85ea124fb50b00b7.png,https://oss.yiwofa.com/brand_banner/20210317/f5781bb55335013a8e8928086bb24f8f.png,https://oss.yiwofa.com/brand_banner/20210317/46545f80e3edd53a4fae94047b62b40a.png', 'nomon的成果是：设计前卫，采用创新技术，手工制作的优质原创时钟。nomon是室内时钟行业的领导者，在60多个国家设有办事处。 他们设计和制作极具视觉效果的作品，时钟不再仅仅只作为家居配件，而是作为主要物品，用以装饰家庭、办公室、招待会以及各种设施的墙壁。 nomon的成果是：设计前卫，采用创新技术，手工制作的优质原创时钟。 nomon与客户保持密切的个人和专业关系，携手并进，以最平稳最有效的方式推进合作，促进企业发展。', 3.00, 583, 623, 627, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://nomon.1688.com', 1615274214, 1615952495);
INSERT INTO `p_brand` VALUES (74441, 2094, 'cc-tapis', 17, 'cc-tapis', 'https://oss.yiwofa.com/brand/20210309/202103091155167022646368.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091156529588879210.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/dcbfe6dc827924b3ffc945a0d446a557.png,https://oss.yiwofa.com/brand_banner/20210317/9352f3c42ea114e5b14aef7e82517b3c.png,https://oss.yiwofa.com/brand_banner/20210317/4bf8d3e587ec76b70aac5fef0fbf7fcf.png', 'cc-tapis品牌由传统波斯工坊Maison Chamszadeh创立于2011年，公司成立于1943年，因其手工编织的地毯品质而闻名于法国市场。所有CC-Tapis&amp;reg;的地毯产品都是由尼泊尔的藏族专业工匠手工编织而成。对于选用材质这种古老文化传统的尊崇，在公司的生态环保生产过程的每一阶段都体现的淋漓尽致，从手旋纺织而成的软质喜马拉雅羊毛，到使用净化过的雨水来洗涤完成品，都凸显了每一件CC-Tapis&amp;reg;地毯产品的匠心独具。在整个生产过程中，从不使用化学物质、酸剂或人造纤维。与大批量生产不同的是，CC-Tapis&amp;reg;旨在向那些理解和欣赏高端产品的用户们提供专属定制服务，因为三个月的生产周期里蕴含着永恒的文化传承。', 3.00, 583, 623, 624, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://cc-tapis.1688.com', 1615274214, 1615916946);
INSERT INTO `p_brand` VALUES (74491, 2114, 'Petr Weigl', 15, 'Petr Weigl', 'https://oss.yiwofa.com/brand/20210309/202103091156137696325784.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091158064390825050.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/54448bef98bb65fa95712156db8c76c7.png,https://oss.yiwofa.com/brand_banner/20210317/69dc7d3d61bdb7a5b0cbaf682937af86.png,https://oss.yiwofa.com/brand_banner/20210317/43d985022bde6c1a99284e413d13e2cc.png', '在艺术家Petr Weigl的熟练手中，清水混凝板拥有了新的生命。它被伪装成原始大理石或石灰石，富有生动的姿态，吸引眼球。Petr Weigl是一位艺术家，擅长运用陶瓷、混凝土和金属等材质，制作出精美的当代艺术作品。他出生于英格兰，父亲是一位流浪艺术家。曾是一位平面设计师的他，于2001年的时候选择听从自己的内心，进入了陶瓷艺术这一行业并重新进入圣马丁中央大学学习。 &amp;nbsp; Petr Weigl从他的过去，现在以及他如何在这个世界上定位自己等想法中寻找灵感。深入分析了个人魅力、心理学以及人与人之间互相影响的内在哲学。同样他也强调&amp;ldquo;母性&amp;rdquo;的魅力，大力倡导包容与寻找不完美中的完美。 &amp;nbsp; 他觉得，每件艺术作品都变化，从某个角度体现并诠释了哲学、情感和内心自我反省的复杂感官。他的作品往往令人惊叹，看似简单中带着复杂的思考，并将其所表达的故事娓娓道来。 &amp;nbsp; Petr Weigl的作品多次出现在国际艺术博览会巡回展上，并有许多私人收藏家，商业机构和艺术爱好者等购买与收藏。', 3.00, 583, 623, 628, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://petr.1688.com', 1615274215, 1615915635);
INSERT INTO `p_brand` VALUES (74642, 2097, 'KOSE', 15, 'KOSE', 'https://oss.yiwofa.com/brand/20210309/202103091155595406667203.png', 'https://oss.yiwofa.com/brand/20210309/202103091157359964166937.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/58187693c0f2de8945805a998393de69.png,https://oss.yiwofa.com/brand_banner/20210317/fe4516103da16de3c32ce7d86c46df4f.png', '来自意大利的KOSE品牌，旨在重新发现第三世纪古老工艺的魅力，每一件产品全部由工匠根据古老的技术手工制成。KOSE系列产品全部在意大利生产，这赋予产品独一无二的特性，每一件产品全部由工匠根据古老的技术手工制成，为客户提供理想的产品和服务。其设计感线条简洁、伴随着个性从而产生美感的KOSE花瓶，只是放着其美感都可以感受到主人独特的品格。', 3.00, 583, 623, 626, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://kose.1688.com', 1615274221, 1615914750);
INSERT INTO `p_brand` VALUES (74744, 2102, 'Dinosaur Designs', 15, 'Dinosaur Designs', 'https://oss.yiwofa.com/brand/20210309/202103091155455311577836.png', 'https://oss.yiwofa.com/brand/20210309/202103091157054524404660.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/efd4e818c1ce797938560a873b26d543.png,https://oss.yiwofa.com/brand_banner/20210317/aa74de21d4f37e2746a7330f429a837f.png,https://oss.yiwofa.com/brand_banner/20210317/18af6e6520d14995b0a40cd72a749e4a.png', 'Dinosaur Designs诞生于1987年，是Louise Olsen和Stephen Ormandy 在修读艺术专业时联合创立的珠宝及家居用品品牌。Dinosaur Designs的作品设计是一种色彩与形式的哲学，手工制作的方式赋予每件作品独特的细微差别。他们以树脂为制作原料，在每个系列中添加银色、黄铜和玻璃元素进行创意设计。设计师的创作灵感完美驾驭与诠释了作品所表达的意境，充分表现出艺术融于时尚的设计概念。', 3.00, 583, 623, 626, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://dinosaur.1688.com', 1615274246, 1615914195);
INSERT INTO `p_brand` VALUES (74794, 2103, 'GARDECO', 17, 'GARDECO', 'https://oss.yiwofa.com/brand/20210309/202103091155525344603342.png', 'https://oss.yiwofa.com/brand/20210309/202103091157213459564906.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/407d75b794a545460bd06102bb2d07a1.png,https://oss.yiwofa.com/brand_banner/20210317/7576bf6e03fd3f30b78d94490257be3a.png,https://oss.yiwofa.com/brand_banner/20210317/80944a26c91ac95db381dbfe13290b52.png', 'GARDECO是一家比利时公司，成立于1999年9月，他们提供来自世界各地的手工制品，在世界各地的商店销售。GARDECO目标是通过专卖店、设计商店、博物馆商店、美术馆、建筑师和室内设计师向更广泛的观众介绍优秀的设计师和艺术家。', 3.00, 583, 623, 628, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://gardeco.1688.com', 1615274248, 1615913443);
INSERT INTO `p_brand` VALUES (74844, 2105, 'DEDAR', 17, 'DEDAR', 'https://oss.yiwofa.com/brand/20210309/202103091155433709924087.jpg', 'https://oss.yiwofa.com/brand/20210309/202103091157017613868012.jpg', 'https://oss.yiwofa.com/brand_banner/20210317/d5ab34ff559ab750427e3140f111922f.png,https://oss.yiwofa.com/brand_banner/20210317/575db51f94d783fd104d7917fd2d8e5f.png,https://oss.yiwofa.com/brand_banner/20210317/e90ab7f2ca839f1130d83aa4cf0a8696.png', 'DEDAR的面料结合了珍贵的色彩和纹理，并将纤维科技与研究成果结合在一起。为窗帘，室内装潢和永久优雅的墙面布料提供各种解决方案。Dedar Milano专注于室内设计，自1976年以来，我们一直在加深对手工工艺的了解，不断进行风格探索，追求带有强烈色彩的精致面料。 图案，刺绣，和颜色丰富了材料的多样性，以创造面料，窗帘，饰物，墙纸和其他独特的装饰面料。DEDAR成立于1976年，是一间家庭经营的面料房屋，以其先进的现代系列展现个人风格。位于科莫附近的Dedar实验室通过与那些最熟悉生产优质面料技术的工匠和纺织专家进行对话，实现创新，实现产品完美。 自2011年以来，DEDAR是爱马仕合作伙伴，生产和销售家居布料和壁纸系列，并在所有DEDAR展示厅展出。', 3.00, 583, 623, 638, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://dedar.1688.com', 1615274268, 1615912259);
INSERT INTO `p_brand` VALUES (74994, 2113, 'sophie-elizabeth thompson', 1, 'sophie-elizabeth thompson', 'https://oss.yiwofa.com/brand/20210309/202103091156207282678678.png', 'https://oss.yiwofa.com/brand/20210309/202103091158177218532429.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/92c9008d12bdaea280c97a7fdd7f6c11.png,https://oss.yiwofa.com/brand_banner/20210317/6cd7e7b438ad4e388ce93008d27d6488.png,https://oss.yiwofa.com/brand_banner/20210317/e8ac0460b9eb21eac3c7be44bb4d5e3e.png', '对sophie-elizabeth thompson的创造性探索是对她周围世界的一种平静的自然潜意识回应。它反映了在自然和人造物体中发现的形式的本质以及它们在生活中彼此的物理关系。对sophie-elizabeth thompson的创造性探索是对她周围世界的一种平静的自然潜意识回应。它反映了在自然和人造物体中发现的形式的本质以及它们在生活中彼此的物理关系。 各种雕塑和雕塑组合的装置几乎可以创建任何尺寸以适应任何国际位置。在不同的媒体上工作，包括石膏和粘土，以制作青铜和树脂的小版本以及陶瓷和陶瓷石器中的独特作品。', 3.00, 583, 623, 628, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://sophie.1688.com', 1615274292, 1615911463);
INSERT INTO `p_brand` VALUES (75044, 2115, 'Lorenzo Mazza', 15, 'Lorenzo Mazza', 'https://oss.yiwofa.com/brand/20210309/202103091156034630766916.png', 'https://oss.yiwofa.com/brand/20210309/202103091157437646451970.jpeg', 'https://oss.yiwofa.com/brand_banner/20210317/405b8fe4d96f3e576e61defd4b18550f.png,https://oss.yiwofa.com/brand_banner/20210317/441baae1876636d88182f89afe881cb8.png,https://oss.yiwofa.com/brand_banner/20210317/da0386e3d8c13c13111646fd6bcb1833.png', '到目前为止，他参加了七十多个展览。他的画作经常用于电影和电视，广告和时尚：它们经常出现在室内设计杂志的封面上。Lorenzo Mazza毕业于米兰理工大学的建筑学专业，专业是未来主义戏剧和风景。他的论文导师是艺术评论家Mario de Micheli，他因此有机会专注于他的绘画才能。 作为插画家和平面设计师，Mazza实现了一些记录封面，这些封面由Mazzotta在国际目录中发布，随后在70年代展出。Mazza继续抽象绘画并在官方频道的展览中展示他的作品，直到1986年他被邀请参加米兰的双年展博物馆。同年，他获得了Sartirana城堡青年艺术家双年展的奖项。 1986年，他开始与米兰的Galleria delle Ore合作，在那里他有机会见到其他艺术家，如Collina，Bussotti，Meloni，Ghinzani，Vago，Ruggero Savino。 因为Permanente，他被邀请参加德国和Pemanente博物馆的展览，成为新一代的七位年轻艺术家之一。1990年，他在RAI工作室实现了罗马电视欧洲电视台的动画图形。 他继续在Galleria delle Ore举办展览，与一群艺术家同伴--Borghi，Casali和Spagnulo--以及由Renato Galbusera创作的Venature集团，包括Petrus，Papetti，Pignatelli。他于1992年被选为Permanente艺术委员会成员。', 3.00, 583, 623, 628, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://lorenzo.1688.com', 1615274295, 1615910975);
INSERT INTO `p_brand` VALUES (75344, 2123, 'AK47 Design', 3, 'AK47 Design', 'https://oss.yiwofa.com/brand/20210309/202103091155042894719768.png', 'https://oss.yiwofa.com/brand/20210309/202103091156286847448421.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/ac78f897a440ed6d917ecefb7f54d195.png,https://oss.yiwofa.com/brand_banner/20210316/c82b1a4c8ae2f72cfc5d802f0ee3c06c.png,https://oss.yiwofa.com/brand_banner/20210316/38368dca67a933696e6f9c3f4b3c7051.png', 'Ak47专门生产户外火炕、花园家具和装饰品。它展示了设计与实用之间的完美结合。Ak47成为一个被世界各地户外风格爱好者所喜爱的设计公司，集简洁外观和复杂实用性之间完美结合的设计公司，用安全的火堆将人聚拢，让人感到安慰和温暖。', 3.00, 583, 641, 649, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://ak47.1688.com', 1615274326, 1615910113);
INSERT INTO `p_brand` VALUES (75494, 2126, 'TRE-P＆TRE-Più', 1, 'TRE-P＆TRE-Più', 'https://oss.yiwofa.com/brand/20210309/202103091156212317626840.png', 'https://oss.yiwofa.com/brand/20210309/202103091158212923358597.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/7f5a6c5ac190e88cfd469db1017a57aa.png,https://oss.yiwofa.com/brand_banner/20210316/a9d5d074dd47e91d31161b7637772597.png,https://oss.yiwofa.com/brand_banner/20210316/991b91f27a45807bc8c5d0996188e298.png', 'TRE-P＆TRE-Più是一个来自于意大利的知名门业品牌，旗下产品主要有各种卧室门、玻璃门、推拉门等。TRE-P＆TRE-Pi&amp;ugrave;做好立足于当下的每一步。现阶段TRE-P＆TRE-Pi&amp;ugrave;取得的每一步成就都是它和它的设计师们共同缔造的。 TRE-P＆TRE-Pi&amp;ugrave;的每一位设计师都在诠释个人喜好、最新功能、美学和技术解决方案的过程中，不断创新、追求完美、技术革新。这也是TRE-P&amp;amp;TRE-PI&amp;Ugrave;赖以成功的特质。 不论是现代风格或是浪漫技术风格，TRE-P＆TRE-Pi&amp;ugrave;一直致力于平衡功能和质量之间的点，提供完美的家居解决方案。为每一位消费者提供最优质的家居服务。', 3.00, 583, 650, 655, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://trep.1688.com', 1615274333, 1615909389);
INSERT INTO `p_brand` VALUES (75495, 2127, 'ADIELLE', 1, 'ADIELLE', 'https://oss.yiwofa.com/brand/20210309/202103091155033638659581.png', 'https://oss.yiwofa.com/brand/20210309/202103091156272157380971.jpeg', 'https://oss.yiwofa.com/brand_banner/20210316/19d581308aaf0c3cc2503bef9c7fdec4.png,https://oss.yiwofa.com/brand_banner/20210316/209d045a1baabb1ed1dcca6697d900be.png,https://oss.yiwofa.com/brand_banner/20210316/563ea49ab2f740896185457ec40207b5.png', 'ADIELLE是来自意大利的年轻品牌，专门设计室内门，该品牌希望通过设计让门不仅仅是房间的一部分，而是能够成为增加房间亮点的装饰物。ADL门的目的是通过变成不划分空间的开口来区分，但同时将它们分开并联合起来，形成Ludwig Mies van der Rohe称之为&amp;ldquo;流动空间&amp;rdquo;的东西。对风格实践和对材料的细致研究 - 特别是铝和玻璃的结合 - 使其卡发展出一种超越纯粹的审美精湛技艺的折衷主义思想，引领他在创新之地的设计作品具有高技术负荷的功能。', 3.00, 583, 650, 655, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://adielle.1688.com', 1615274333, 1615908762);
INSERT INTO `p_brand` VALUES (75496, 1189, 'FULLCOM', 1, 'FULLCOM', 'https://oss.yiwofa.com/brand/20210310/c0e23426f9076e02f47da92c5e30d019.jpg', 'https://oss.yiwofa.com/brand/20210310/c0e23426f9076e02f47da92c5e30d019.jpg', 'https://oss.yiwofa.com/brand/20210310/b273599d4350dd6bc3176d6c496c3bf3.jpg', '都市新贵专宠，极简舒适的权威代表', 2.50, 1, 12, 23, 0, 1, 0, 1, 100, 1, 0, 0.000, 1, 2, 0, '', 1615365091, 1619022902);
INSERT INTO `p_brand` VALUES (75497, 1189, 'HC28', 1, 'HC28', 'https://oss.yiwofa.com/brand_banner/20210310/f3f0d95c8f01251cef881fb49e298884.png', 'https://oss.yiwofa.com/case/20210310/19c96cb6be924a323dd2cc2734112270.jpg', 'https://oss.yiwofa.com/brand/20210310/cebfaf3f4b6af4c1c723481229d670d2.jpg', '设计团队由梁志天领衔，众多国际一线设计师倾力打造国内一线现代家居品牌', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 2, 0, 0.000, 0, 2, 0, '', 1615368136, 1619022901);
INSERT INTO `p_brand` VALUES (75499, 2180, 'MDQS', 2, '摩登轻奢', 'https://oss.yiwofa.com/brand/20210326/818acd0998481fc5bab22e57834a3796.jpg', 'https://oss.yiwofa.com/brand_banner/20210326/aff5e13eb9ddc797a8972c1df32a735c.jpg', 'https://oss.yiwofa.com/brand_banner/20210326/aff5e13eb9ddc797a8972c1df32a735c.jpg', '线条勾勒出的几何之美，流露着时尚潮流的气息且有别样的审美情趣，线条共舞给人亦动亦静的视觉享受，无意间迷失在几何构筑的时尚空间。\n跨界艺术的摩登，金属增添的生活摩登感，低调内敛中蕴含着无尽的能量。', 2.00, 1, 12, 27, 0, 1, 0, 1, 1, 100, 0, 0.010, 1, 1, 1, '', 1616737831, 1620269874);
