INSERT INTO `p_brand` VALUES (75505, 226, 'ZSSMSJJ', 1, '中山市美硕家居', 'https://oss.yiwofa.com/brand/20210429/362fdb78497b48b37c9245139c1bc30d.png', 'https://oss.yiwofa.com/brand_banner/20210508/0ecfaed2562bd8d3d4eb37516ba3091d.png', 'https://oss.yiwofa.com/brand_banner/20210508/5957f253939372eb556f0f8d70417f37.png,https://oss.yiwofa.com/brand_banner/20210508/dbea720c050e91e953da438d2d5ae9c7.png,https://oss.yiwofa.com/brand_banner/20210508/91bf684c5bd60b4de3064f6d01d86f97.png', '中山市美硕家居制品有限公司是一家专业家居饰品研发，设计，生产，销售为一体的生产设计公司，专业开发生产软装工艺品，有专业的产品开发团队，产品出口美国及中东，并为国内的软装设计公司，家具厂商提供软装产品。', 3.00, 3, 133, 0, 0, 1, 0, 1, 1, 1000, 0, 0.030, 1, 1, 0, '', 1619424640, 1628127834);
INSERT INTO `p_brand` VALUES (75506, 226, 'SMKDT', 1, '圣马可地毯', 'https://oss.yiwofa.com/brand_banner/20210427/e6d6b0235499e815a82f34e2383563fb.png', 'https://oss.yiwofa.com/brand_banner/20210427/e6d6b0235499e815a82f34e2383563fb.png', 'https://oss.yiwofa.com/brand/20210427/905f7a9e14ad8ba9262f54425bae3011.png', '圣马可地毯是一家集自主设计、研发、生产、销售和进出口为一体的地毯专业制造商\n注：进口产品请下单前咨询库存！', 3.00, 583, 623, 624, 0, 1, 0, 1, 1, 1000, 0, 0.013, 1, 1, 1, '', 1619487810, 1619668134);
