INSERT INTO `p_brand` VALUES (75509, 2659, 'JZJP', 1, '匠作居品', 'https://oss.yiwofa.com/brand/20210506/f0bc91b7c87b3dc4fc9ea970296a502b.jpg', 'https://oss.yiwofa.com/brand_banner/20210506/2dd903a62fe41508f8d0f74a39cdf624.jpg', 'https://oss.yiwofa.com/brand_banner/20210506/18b907a2b7da0c803904a880f3900f7b.jpg,https://oss.yiwofa.com/brand_banner/20210506/084f059532de814739c5e801d15a673b.jpg,https://oss.yiwofa.com/brand_banner/20210506/b2fc597f9a5c953aa96ce37650debbf9.jpg', '是一家集设计研发，生产智造为核心的工厂；专注于目前minotti、poliform、baxter流行款式的研发生产。匠心之作，居家臻品！', 2.30, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 0, 1, 1, '', 1620277335, 1620277335);
INSERT INTO `p_brand` VALUES (75510, 3016, 'Y', 2, '玉麒麟', 'https://oss.yiwofa.com/brand/20210515/94792742ab23757050f27067e03bf154.jpg', 'https://oss.yiwofa.com/brand_banner/20210515/2efd76ce4753fe78050ba20529113a7c.jpeg', 'https://oss.yiwofa.com/brand_banner/20210515/b7a40f406a0384348591b285a2003f86.png,https://oss.yiwofa.com/brand_banner/20210515/375ffc3c1a3e70ec39805d3207f64662.jpeg,https://oss.yiwofa.com/brand_banner/20210515/c707f6239c4b6bdb768878e0b7911fcd.png', '创立于2008年，是一家集生产、研发、销售于一体的家纺品牌公司。玉麒麟墙布（英文Yokylin）是绍兴楚润纺织品有限公司旗下品牌之一。该品牌于2013年注册正式进入墙布市场。以打造行业十大品牌墙布为发展目标，以生产、研发高端墙布为品牌墙布的依托，以整体家装为发展理念。品牌用企业法人作为形象代言人，充分体现真实性和可信度，获得了广大渠道商和消费者的认可。品牌以“选择玉麒麟，幸福带回家”为广告语，一语双关的阐述了品牌的寓意和祝福，深受消费者喜爱。', 1.80, 8, 140, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1621071959, 1621071959);
INSERT INTO `p_brand` VALUES (75511, 226, 'blossomHSY', 1, 'blossom花丝雨', 'https://oss.yiwofa.com/brand/20210517/301ba4daf33ced452e0bac02933ae8dc.jpg', 'https://oss.yiwofa.com/brand_banner/20210528/850bf25c5641d279e63b10f69adbacb9.jpg', 'https://oss.yiwofa.com/brand_banner/20210517/3920528af9c1e3b94f1d6e3cc9aa7756.jpg,https://oss.yiwofa.com/brand_banner/20210517/e3bb4d10cdeb10031694089fa94bcf96.jpg,https://oss.yiwofa.com/brand_banner/20210517/a46a1c42cb4725d089284fdd7b7288dd.jpg', '令高家居，创立于2002年, 源于古老波西米亚一个美丽的传说，自创立伊始，就深深烙上了优雅浪漫的高贵印记。深圳市令高花艺有限公司，在2011年更名为深圳市令高家居饰品有限公司，2014年更名为深圳市令高家居产业有限公司，公司致力于提倡自然、原生态、富质感的生活哲学，凭借自主设计、生产、销售一体的良好优势和对家居行业的深刻理解与独特诠释，设立以现代、简欧为主调，辅以其他风格的丰富产品线，秉承“倡导家居文化，创造美好生活”的使命，关注客户对高品质生活的需求，带给热爱生活并注重生活品质的人们精致的生活体验；令高家居旗下品牌：blossom、花丝雨、令高家居、好运九九、蕴悤谕素，先后设立仿真花、树脂器皿、蜡烛、香薰四大工厂，生产的产品广泛应用于大型商场、酒店、样板房等高档场所。创新赋予产品生命，品质决定产品健康，令高家居强大的创新研发能力和卓越的品质管理，不断的提升着产品价值，赢得了越来越多社会大众的信赖，在原生态生活逐渐离我们远去的时候，令高家居将再次点燃人们对自由奔放和原味生活的憧憬与向往。', 3.00, 6, 310, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1621231434, 1622169905);
INSERT INTO `p_brand` VALUES (75512, 3116, 'JBJ', 2, '金柏居', 'https://oss.yiwofa.com/brand/20210521/f9e0a0eb52265144644b0b7b748cf844.jpg', 'https://oss.yiwofa.com/brand_banner/20210521/426c27c778f4f0f6411d90c229499178.jpg', 'https://oss.yiwofa.com/brand_banner/20210521/749a5fd0f2302a8db1d5bddb73c5f561.jpg,https://oss.yiwofa.com/brand_banner/20210521/1b75dfa2631fc091126251cfba771ecd.jpg,https://oss.yiwofa.com/brand_banner/20210521/41482a34a5ed5af4d3d33413e895ce30.jpg', '成都金柏居家私制造有限公司成立于1992年，坐落在天府之国、巴蜀之都——成都。\n金柏居家私，原名成都峨眉家私制造有限公司，2012年公司搬 迁至邛崃市羊安工业园，\n经过近三十年的飞速发展，成为一家集研发、生产、销售和品牌包装运营为一体的现代化大\n型家私制造龙头企业\n公司现有员工800余人，厂房展厅面积10万余平米，设有成品制造厂、定制制造厂、\n床垫制造厂及马来西亚成品制造分厂等多个厂区。公司主营各类实木、板式套房和皮艺、\n布艺等软体家具，平均每年推出2-3款适应市场主流需求的新品套房系列，产品涉及北欧、\n新中式、现代、小美、田园、极简、轻奢等多个风格，基本涵盖了当下市场主流需求。\n从成立之日开始，铂森家私始终将为消费者提供健康、环保、绿色的优质家具为己任，不断优化生产线\n设备，提高环保生产标准。2005年，公司产品经过国家质量测试中心测试被评为“符合国家质量有害物质限\n量标准的绿色环保产品”并在2010年荣获“中国著名品牌”、“中国十佳套房家具”等荣誉称号且在业内率\n先通过了“ISO90012008国际质量体系认证”、“CQC环保质量认证”等国家家居品质环保标准。', 2.50, 1, 14, 47, 0, 1, 0, 1, 1, 1000, 0, 0.010, 1, 1, 1, '', 1621587846, 1633763469);
