INSERT INTO `p_brand` VALUES (75514, 2385, 'MLB', 2, '美利邦', 'https://oss.yiwofa.com/brand/20210524/593d4a3a5e22a9f99abec453e156a790.png', 'https://oss.yiwofa.com/brand_banner/20210524/214fe32c913f59334a6735fce48c0d68.jpg', 'https://oss.yiwofa.com/brand_banner/20210524/96ecc0275b61a92ffb163405435db86b.jpg,https://oss.yiwofa.com/brand_banner/20210524/7a0e2c175619da6ae90061819fe97398.jpg,https://oss.yiwofa.com/brand_banner/20210524/bce8c9fa22c11eb4e4ee9c1e4dcf6a9c.jpg', '美利邦是为F、B、C端客户提供上门服务的全国家居修护服务平台，服务范围包含：家居修护，家居保护，家居深度清洁保养，家居改色焕新，家居消毒杀菌，车辆内饰改色翻新，养护护理，环境治理等专业家居服务。\n自筹建以来，经过层层考核和筛选，入驻有交付能力，交付经验，交付时效，交付保障专业家居修护师近20万，服务范围覆盖全国600多个一二线城市，及2853个三线/四线/区/级，已服务众多企业用户和广大消费者，深受客户好评。', 1.00, 11, 245, 274, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1621836607, 1621846013);
INSERT INTO `p_brand` VALUES (75515, 3177, 'WJL', 2, '窝家里', 'https://oss.yiwofa.com/brand/20210525/b13d0d723b9d8dd82953f8d0970e67da.jpg', 'https://oss.yiwofa.com/brand_banner/20210525/f4795746842d03f8b8d1e7200a99cae3.png', 'https://oss.yiwofa.com/brand_banner/20210525/846b1cc07ae45cda86abd8f839f837ca.png,https://oss.yiwofa.com/brand_banner/20210525/f7a66975443f1f0ffc8d90e1d2fc9d45.png,https://oss.yiwofa.com/brand_banner/20210525/f4795746842d03f8b8d1e7200a99cae3.png', '窝家里物联网服务', 2.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1621930794, 1621931724);
INSERT INTO `p_brand` VALUES (75516, 1802, 'RFGJJJ', 7, '融峰国际家居', 'https://oss.yiwofa.com/brand/20210601/31c54ec9f2fdfadb9dad32e77599ddb3.jpg', 'https://oss.yiwofa.com/brand_banner/20210601/4da41ca513abb7a237066a96530128f6.jpg', 'https://oss.yiwofa.com/brand_banner/20210601/676f02107f6e214552001ec44d746b7f.jpg,https://oss.yiwofa.com/brand_banner/20210601/c85d6c0e294608d065758bbad986aa25.jpg,https://oss.yiwofa.com/brand_banner/20210601/fec45e029c945d3f81ee8c5b9b87c3d9.jpg', '融峰品牌成立于1998年，总部位于中国“家具之都”——东莞厚街，家具界有这样一句话：世界家具看中国，中国家具看广东，广东家具看厚街，所以厚街家具在全世界都是非常闻名的。咱们融峰品牌在厚街是非常有实力的，融峰成立到现在已经有19年的历史，是一家集研发设计、生产制造、营销运营为一体的大型家居企业，拥有2000多名专业人才，2个现代化生产中心，2万平方实景体验展示厅。在国内拥有300多家专卖店、主要分布在红星美凯龙、月星家居、居然之家、欧亚达等这些国内一线品牌商场。咱们的产品还远销国外30多个国家，美国、日本、韩国等等.在成立初期的时候，融峰国际家居以国际化步伐推进建设，从德国、意大利引进多条先进生产线，同时长期美国著名的家具设计师合作，将美欧文化与中国文化相结合，成功推出了多个原创品牌，把家具从单纯的使用价值提升到了整体家居文化的高度，受到消费者的认可。', 1.00, 1, 12, 27, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1622536676, 1622536676);
