INSERT INTO `p_brand` VALUES (75518, 3321, 'YSML', 12, '伊莎美伦', 'https://oss.yiwofa.com/brand/20210607/a982446c331313c602769fa179adefcd.jpg', 'https://oss.yiwofa.com/brand_banner/20210611/95dc9d137ec949093da7dbca4abdf0b3.jpg', 'https://oss.yiwofa.com/brand_banner/20210607/43c0c7afd42c85bd8619cc0e242d60c1.jpg,https://oss.yiwofa.com/brand_banner/20210607/7f4e2cf7b9671be44b0616356ed19416.jpg,https://oss.yiwofa.com/brand_banner/20210607/35677cd17f45818dcdfbf0d2ed7fe855.jpg', '『 伊莎美伦 ISAMAYLON』20余年只专注新古典家居。风格以意式新古典为主，英美新古典为辅。\n先后斩获7项行业荣誉称号、5项专业资质证书、20余项国家外观设计专利，10次登上电视荧幕（非诚勿扰1次、湖南卫视2次、热播剧5次、CCTV发现之旅频道1次、新闻联播1次）。2019年浙商名家居品牌联盟重点推荐品牌，2017-2020年红星美凯龙推荐家居绿色环保入围品牌、2017年央视发现之旅频道『匠心智造』展播品牌、2019年度浙江省家具行业精英企业的荣誉称号、2019湖南卫视『天天向上』栏目唯一指定合作品牌。', 2.00, 1, 17, 72, 0, 1, 0, 1, 1, 1000, 0, 0.050, 1, 1, 1, '', 1623050327, 1623891033);
INSERT INTO `p_brand` VALUES (75519, 3324, 'DHJJ', 7, '帝豪家具', 'https://oss.yiwofa.com/brand/20210609/8bfaf4d7a9ddd40f58de0ee8cbd3f6f4.jpg', 'https://oss.yiwofa.com/brand_banner/20210610/432d62fa12771cdc06f641c6686d251f.jpg', 'https://oss.yiwofa.com/brand_banner/20210610/1ae4f9c5da993cfc2eccb0a3d6f22981.jpg,https://oss.yiwofa.com/goods/20210608/04cf4fce460e7d8d7887e81b61e35c29.png,https://oss.yiwofa.com/brand_banner/20210610/a0de19234c1ad2684ac87858b3e7525f.jpg', '帝豪家具成立于1999年，座落于浙江家具生产基地-玉环，本公司是从事高档实木家具的制造企业，拥有资深专业技术和丰富管理经验的团队，长期为客户提供优质高效的服务。公司秉承“诚信为本，品质优先，从我做起，追求卓越”的经营理念，我们将注入更多的热情，更大的努力，与广大新、老客户保持良好的长期合作伙伴关系，携手共创美好未来。', 3.00, 1, 12, 27, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1623308494, 1623312073);
