INSERT INTO `p_brand` VALUES (75521, 2579, 'HBSQB', 1, '红宝石墙布', 'https://oss.yiwofa.com/brand/20210620/22eb574d58081eab22d3c037532806b9.jpg', 'https://oss.yiwofa.com/goods/20210624/7029181cee310f8fa94c6b0d45bd6f42.jpg', 'https://oss.yiwofa.com/brand_banner/20210620/b9bd54aabb4924b112324f453bb4eecd.jpg,https://oss.yiwofa.com/goods/20210624/1b9053b51770cdccf7fdbf20b447f83b.jpg,https://oss.yiwofa.com/goods/20210624/f2f124b1fb430c15db978af8602fd8cb.jpg', '红宝石墙布品牌隶属于浙江红饰和家居有限公司，公司坐落于有着2500年历史的古城绍兴，拥有多年纺织品织造经验，在工艺、材质及品质管理方面有着丰富地经验，达到行业一流水平。', 3.00, 8, 140, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1624178466, 1624502895);
INSERT INTO `p_brand` VALUES (75522, 2579, 'LKT', 1, '兰客厅', 'https://oss.yiwofa.com/goods/20210624/8919e8a037a971286c9931ee659449a1.jpg', 'https://oss.yiwofa.com/goods/20210624/bd669fa7f835dbc49a01da4d441593db.jpg', 'https://oss.yiwofa.com/goods/20210624/aa4bf6ef4dcb6951ad44171acb7512f2.jpg,https://oss.yiwofa.com/goods/20210624/a7ca2ddd7be2af3b0eea8c17f7d2288d.jpg,https://oss.yiwofa.com/goods/20210624/f2f124b1fb430c15db978af8602fd8cb.jpg', '中国窗帘品牌化拓局者，窗帘定型工艺的奠基人.\n2020年，兰客厅以“七星级窗帘定制”的雄姿重装上阵，推进渠道建设、终端销售和品牌价值整体升级，开启窗帘行业新纪元。兰客厅是完全靠专业、实力、孜孜以求、潜心修炼，历经市场检验、建立客户口碑走到今天的。', 2.85, 7, 230, 316, 0, 1, 0, 1, 4, 1000, 0, 0.000, 0, 2, 1, '', 1624181024, 1624502760);
INSERT INTO `p_brand` VALUES (75523, 2579, 'DZL', 1, '碟之帘', 'https://oss.yiwofa.com/goods/20210624/60a213250c405a1c42d1c212a5331366.jpg', 'https://oss.yiwofa.com/goods/20210624/bd669fa7f835dbc49a01da4d441593db.jpg', 'https://oss.yiwofa.com/goods/20210624/a7ca2ddd7be2af3b0eea8c17f7d2288d.jpg,https://oss.yiwofa.com/goods/20210624/aa4bf6ef4dcb6951ad44171acb7512f2.jpg,https://oss.yiwofa.com/goods/20210624/bd669fa7f835dbc49a01da4d441593db.jpg', '蝶之帘成品窗帘直击传统窗帘之痛，\n将困惑与问题具体化、精准化，\n看到问题的本质成了解决问题的根本\n蝶之帘成品窗帘\n邀您一起共同探索成品窗帘发展之道', 5.00, 7, 230, 316, 0, 1, 0, 1, 5, 1000, 0, 0.000, 0, 2, 1, '', 1624182291, 1624502773);
INSERT INTO `p_brand` VALUES (75524, 2579, 'MSCD', 1, '慕思床垫', 'https://oss.yiwofa.com/brand/20210621/6038e1e51897c830e46f355c9b3fbde0.png', 'https://oss.yiwofa.com/goods/20210620/e96669610bb8e5b08f93a3b6b9fd21c2.jpeg', 'https://oss.yiwofa.com/goods/20210620/14f66b5411d81bb8f2532f2e1e9a6776.jpeg', '慕思床垫是慕思健康睡眠股份有限公司[1]将人体工程学和睡眠环境学融入到寝具的设计中而制造的产品。公司成立于2004年，定位为全球健康睡眠资源整合者，专业致力于人体健康睡眠研究，从事整套健康睡眠系统的研发、生产及营销。', 2.30, 10, 134, 0, 0, 1, 0, 1, 5, 1000, 0, 0.000, 0, 2, 1, '', 1624235325, 1631948542);
INSERT INTO `p_brand` VALUES (75525, 2579, 'GTMJ', 7, '宫廷名匠', 'https://oss.yiwofa.com/brand/20210621/1c0c96364696f326cf2922c80ace93f0.jpg', 'https://oss.yiwofa.com/goods/20210621/20558a02f2ad3041204995d4d810d8fc.png', 'https://oss.yiwofa.com/goods/20210621/199af28c67f9ef4355775b5e2d8c04eb.png,https://oss.yiwofa.com/goods/20210621/53e0fdf1e451f5d58c667896d830b621.png,https://oss.yiwofa.com/goods/20210621/3a1abae85d265c14fa98dbb258ac2921.png', '宫廷名匠家具(集团)位于世界制造中心之称的广东省东莞市，2009年6月从广东省中山市迁至东莞市，专业生产中/高档欧美风格的家具，主要使用在别墅配套和民用家具为基础，产品远销欧洲、美国、中东等国家，目前正在开发国内市场', 2.20, 1, 12, 27, 0, 1, 0, 1, 6, 1000, 0, 0.000, 0, 2, 1, '', 1624238826, 1631948700);
INSERT INTO `p_brand` VALUES (75526, 2579, 'DF', 2, '蒂凡', 'https://oss.yiwofa.com/brand/20210621/c6f25a2e8710c90f8cf7a71e2a19ea99.jpg', 'https://oss.yiwofa.com/goods/20210705/0b03fb2cb0d1baea5c5233a2864d811f.jpg', 'https://oss.yiwofa.com/goods/20210705/c8812968335ebffadfb0d6c2bd30bc8f.jpg,https://oss.yiwofa.com/goods/20210705/403eb07cf2ee56b06d94ec0bb4d17dfd.jpg,https://oss.yiwofa.com/goods/20210705/b2c131b696a8453c1258ff9c286d3382.jpg', '蒂凡家具是一家专业从事整体家具设计及定做为一体的综合型公司，公司秉承“独具匠心，精雕细琢”的工匠产品设计理念和专业化、人性化的员工服务体系为客户提供尊贵体验，进而缔造品牌传播价值', 2.20, 1, 16, 400, 0, 1, 0, 1, 7, 1000, 0, 0.000, 0, 2, 1, '', 1624241711, 1625468488);
INSERT INTO `p_brand` VALUES (75527, 66, 'HBW', 6, '黄博文', 'https://oss.yiwofa.com/brand_banner/20210622/983f86db008b180f05d4ee4fb0e48927.png', 'https://oss.yiwofa.com/brand_banner/20210622/d3fc2f991a2671c1b287cf8ca326f7e8.png', 'https://oss.yiwofa.com/brand_banner/20210622/5cf7b4ef1720e5a57ef89803a72bb898.png,https://oss.yiwofa.com/brand_banner/20210622/e873f26e281b0495e5f4de5ac08dd0fd.png,https://oss.yiwofa.com/brand_banner/20210622/a59527c0d1c1dcd8d3dacbeb81015b92.png', '这是一个全新的时代', 5.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1624265500, 1624428142);
INSERT INTO `p_brand` VALUES (75535, 3502, 'BOSALI', 3, 'BOSALI', 'https://oss.yiwofa.com/brand/20210624/5fc2dcf0f9ec085e52536052a48aa532.png', 'https://oss.yiwofa.com/brand_banner/20210624/6adf34fc3d446ee6e3fa9968db3f4c57.png', 'https://oss.yiwofa.com/brand_banner/20210624/6231bb2f361543b61cfbc896a67f86dd.jpg,https://oss.yiwofa.com/brand_banner/20210624/ea9b62bed683944e747eec889623f382.jpg', '\"BOSALI\"北欧森林秉承二十世纪北欧设计学派室内与家具设计风格。纯粹、洗练、朴实的北欧现代设计，是世界上最具影响力的设计风格。北欧风格以\"简洁\"著称于世，井影响到后来的\"极简主义\"、\"后现代\"等风格。北欧风格的简洁被推到极致，只用线条、色块来区分点缀。北欧设计风格的家具简洁、直接、功能化且贴近自然，一份宁静的北欧风情，绝非是蛊惑人心的虚华设计。\n\n北欧家具表现出对形式和装饰的节制，对传统价值的尊重，对天然材料的偏爱，对形式和功能的统一，对手工品质的推崇。\n\n北欧森林家具\"风格即生活\"的理念无处不在。\"BOSALI\"以人为本的设计思想、功能主义的设计方法、传统工艺与现代技术的结合、宁静自然的北欧现代生活方式，是BOSALI设计的源泉。\n\n\"BOSALI\"北欧森林始终坚持为大众营造更美好的日常生活。这份坚持，让都市人在北欧风情家居生活中得以舒展和自由呼吸。\n\n\"BOSALI\"是自主研发、生产、销售、配套设计、方案服务为一体的全方位外资优秀家具企业。公司占地面积两万平方米，拥有雄厚的技术实力及先进设备，BOSALI将北欧现代简约风格带到中国，并在各大中城市建立加盟专卖店。', 2.50, 1, 18, 76, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1624505038, 1624505038);
INSERT INTO `p_brand` VALUES (75536, 2579, 'YMYP', 2, '优美优品', 'https://oss.yiwofa.com/brand_banner/20210624/319df225aa14ea5fc99f58e7beed08d4.jpg', 'https://oss.yiwofa.com/goods/20210624/34ace1b9ccfa4bb7388ffcebe024ed8d.jpg', 'https://oss.yiwofa.com/goods/20210624/40b5e9e3b1f6a9354ee6464727d6e522.jpg,https://oss.yiwofa.com/goods/20210624/e1d3e1cbc60c1efd532f941c878e1eb1.jpg,https://oss.yiwofa.com/goods/20210624/be735b927572e9618c8be0ad26eddaeb.jpg', 'UMUP 成立于1998年，为国内、国外一线知名品牌代工，产品远销欧美、中东等海外市场，为品牌的发展奠定了坚实基础。20年的品牌代工经验对高端家具的工艺标准和生产管理积累了深厚沉淀。2017年成立自主品牌，并打造专业的研发、生产、销售和售后服务团队。初期内销以定制产品为主，后期经过充分的市场调研和客户反馈，陆续推出轻奢新美式、意式轻奢、意式简奢、意式简奢、意式极简的常规系列产品，以精湛工艺和品质服务，在极短时间便赢得市场的高度认可和广泛好评。', 2.30, 1, 17, 73, 0, 1, 0, 1, 8, 1000, 0, 0.000, 0, 2, 1, '', 1624518037, 1631948730);
