INSERT INTO `p_brand` VALUES (75545, 3565, 'ZGXGS', 2, '众工新故式', 'https://oss.yiwofa.com/brand/20210628/2832aed6773855b2f1b18f14433c9e53.png', 'https://oss.yiwofa.com/brand_banner/20210628/5276ef46302aaa27fa8048ff8d074cc8.jpg', 'https://oss.yiwofa.com/brand_banner/20210628/6fde13f41066f6957c7e726dac3c26d4.jpg,https://oss.yiwofa.com/brand_banner/20210628/e0db845faaacbe7906b08b63b62c6de4.jpg,https://oss.yiwofa.com/brand_banner/20210628/db7e18011601830e9d23cf3c9e465586.jpg', '我是广东东莞众工实业众工家具人。我们有近万平的标准厂房车间，多年的家具制造经验，我们专注乌金木时尚家具。您有客户选款搭配乌金木时尚家具的方案，我们都可以配合您落地', 3.00, 1, 12, 27, 0, 1, 0, 1, 1, 1000, 0, 0.010, 1, 1, 1, '', 1624871437, 1624872316);
