INSERT INTO `p_brand` VALUES (75547, 3321, 'MT', 1, '蜜太', 'https://oss.yiwofa.com/brand/20210630/ab4614b68e73c196ad30e8bb27f75b1b.jpg', 'https://oss.yiwofa.com/brand_banner/20210630/fd5abaa0daa00ba7dbca3a449b1c3f50.jpg', 'https://oss.yiwofa.com/brand_banner/20210630/90f80e03f603e54471cb3da36d46cbae.jpg,https://oss.yiwofa.com/brand_banner/20210630/b198b9e01fb811a5dba355be101025a4.jpg,https://oss.yiwofa.com/brand_banner/20210630/05263d156b7d5d213f006091c3ad59dd.jpg', '『 蜜太 MIITIME』开创中国新现代家具风格，以“不复杂 高端年轻生活”著称。通过高端的皮革、金属、石材、木质、色彩等新现代家具设计与工艺，新现代家具生活态度和店铺体验感消费，传递男人对女人的爱“蜜太——甜蜜太太”品牌精神，为中国城市家庭带来高端年轻生活的新现代家具高端服务。\n\n『 蜜太 MIITIME』品牌隶属浙江维拉利家具有限公司，厂房面积超过4万平米，引进德国豪迈(HOMAG)进口生产线和6S柔性化生产体系。现由杭州、宁波等一二线城市实体店向全国辐射。', 2.00, 1, 18, 414, 0, 1, 0, 1, 2, 1000, 0, 0.050, 1, 1, 1, '', 1625033952, 1625033952);
INSERT INTO `p_brand` VALUES (75548, 1806, 'K', 2, '卡缤', 'https://oss.yiwofa.com/brand/20210630/70092b056d0202b6f2197855bb9a5537.jpg', 'https://oss.yiwofa.com/brand/20210630/70092b056d0202b6f2197855bb9a5537.jpg', 'https://oss.yiwofa.com/brand_banner/20210630/94f578b9b84a0e41d738ef10b6d00af6.jpg,https://oss.yiwofa.com/brand_banner/20210630/5839bf84604603bb65963b62b3c576fb.jpg,https://oss.yiwofa.com/brand_banner/20210630/7649f4e6e834eb2c2a9e719cfe3b4e0f.jpg', '卡缤著名意大利设计师潜心研发，结合意大利流行趋势和中国消费者需求，引领现代轻奢家具流行趋势', 2.35, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1625045151, 1625045202);
INSERT INTO `p_brand` VALUES (75549, 3321, 'MKS', 7, '麦克斯', 'https://oss.yiwofa.com/brand/20210708/5c8c3545a5a779b69472ee55dd6812cd.jpg', 'https://oss.yiwofa.com/brand_banner/20210630/fd5abaa0daa00ba7dbca3a449b1c3f50.jpg', 'https://oss.yiwofa.com/brand_banner/20210708/8bb984c618e56f3a910a0d8134f1b611.jpg,https://oss.yiwofa.com/brand_banner/20210708/3c2b1ca0683c72b1b5485cc5baefad37.jpg,https://oss.yiwofa.com/brand_banner/20210708/0fdbec6fe3aa9af7053b24b20d245d95.jpg', '新美式家具『MAX 麦克斯』，是真正美式文化在精神上的一脉相承。它体量小，色彩轻，线条简洁，工艺材料多元化。\n它没有古典反复的奢华，而是融入东方元素和审美情趣，更简约优雅，更包容得体。在舒适优雅的基础上，打造出集\n生活趣味与艺术氛围于一体的美式潮家。\n『 MAX 麦克斯』隶属浙江维拉利家具有限公司，厂房面积超过4万平米，引进德国豪迈(HOMAG)进口生产线和6S柔性化生产体系。\n从消费者关注的健康舒适，环保智能方面着手，构建了代表欧式经典品牌『伊莎美伦』『迪诺瓦』『麦克斯』，新现代品牌『蜜太』为主的\n品牌矩阵，实现从制造型企业到服务型企业跨度。通过家具的功能或附加价值，实现消费者追求优雅时尚的生活方式的需求。', 2.00, 1, 13, 380, 382, 1, 0, 1, 1, 1000, 0, 0.050, 1, 1, 1, '', 1625730290, 1625730290);
