INSERT INTO `p_brand` VALUES (75606, 3948, 'SINOMAXSNCD', 8, 'SINOMAX赛诺床垫', 'https://oss.yiwofa.com/brand/20210813/fac9a226f00429b40c11dd7a20549807.png', 'https://oss.yiwofa.com/brand_banner/20210813/a2ce351c342e8ca657cff0488a447fa9.jpg', 'https://oss.yiwofa.com/brand_banner/20210813/7f3d09fe9e8b409948a1cf7fa2f635e9.jpg', 'SINOMAX赛诺是业内知名的慢回弹产品销售商、制造商及分销商盛诺集团（1418.HK）的旗舰品牌，提供床垫、枕头、桌椅、舒压、儿童、按摩等多系列家居用品，全天候、全方位，为全家人提供支持与呵护。\n赛诺拥有中国和美国两大研究中心，并获得多家权威机构的科研技术支持。专业的独家“赛诺太空科研”、“赛诺健康科研”技术，让赛诺产品的功能和品质达到全新高度，开启大众健康新生活。', 4.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.010, 0, 1, 1, '', 1628818632, 1628819054);
INSERT INTO `p_brand` VALUES (75656, 4076, 'JBL', 14, '嘉博朗', 'https://oss.yiwofa.com/brand/20210821/44eae024103ab6810c2e9030389c9f2d.png', 'https://oss.yiwofa.com/brand_banner/20210821/9b213d95374c112ca70539d7687e98a2.png', 'https://oss.yiwofa.com/brand_banner/20210821/deecd44d19392b1fbf02e4632ffb71c6.png,https://oss.yiwofa.com/brand_banner/20210821/b0332425bec00f53671d558eba8e7fcc.png,https://oss.yiwofa.com/brand_banner/20210821/ae435d5916093c06aec4d6f1afb412cb.png', '嘉博朗专业生产雪尼尔提花地毯、簇绒系列地毯等换洗地毯，是国内较大的换洗地毯生产商我们公司拥有世界先进的大针数电子提花龙头、意大利进口织机等一大批先进设备，每年可以生产上百万平米的地毯。产品主要销往各省会城市以及日本、美国、西欧等发达国家的高端市场！ 产品设计融合东方和西方的设计的理念，花色风格、质地手感能够满足世界不同地区、不同文化、不同人群的审美需求。外观清新舒雅、高贵脱俗，既有舒适的手感，又有极好的装饰效果。便于保养，清洗，可以用于客房、卧室、客厅、卫浴、厨房等各种场合！选择嘉博朗，就是选择了品位！', 3.00, 4, 179, 0, 0, 1, 0, 1, 100, 1000, 0, 0.010, 1, 1, 1, 'https://jiajuditan.1688.com', 1629458813, 1629513395);
