INSERT INTO `p_brand` VALUES (75658, 4106, 'BLZS', 1, '百林众森', 'https://oss.yiwofa.com/brand/20210827/71c19922f634c5da3292cb80c813d7e6.png', 'https://oss.yiwofa.com/brand_banner/20210827/901d1985f75176a9f69716e4d43a7cbd.png', 'https://oss.yiwofa.com/brand_banner/20210827/c6812f34ed93eeaf7830841cf07d0393.jpg,https://oss.yiwofa.com/brand/20210827/71c19922f634c5da3292cb80c813d7e6.png,https://oss.yiwofa.com/brand_banner/20210827/901d1985f75176a9f69716e4d43a7cbd.png', '我们公司是2009年成立的，到现在有12年了。公司有原有3家工厂，300多生产员工，生产4个系列，包括：新中式系列（紫檀色/黑色/原木色），美式3色（胡桃色/黑檀色/象牙白），北欧系列/地中海系列。现在跟着趋势发展主推极简轻奢系列风格产品。\n我们月产值在1千2百万以上，月销售额在1千万以上，工厂在鹤山市桃园镇第三工业区（后搬至佛山龙江）。之前一直是给金富雅做代加工的，但是给别人做代工始终不是长久之计，于2017年3月展会以后，我们成立了我们现在的百林众森，公司注册名字原《森启居》现《百林众森》，直接面对经销商，现在主推国内。\n我们营销团队有30余人，采用半军事化管理，早晚2会。而且所有入职人员一律培训上岗，并用一对一老员工带动新员工。\n我们公司的体系是：经销商影响经销商，同行影响同行，高层服务于中层，中层服务于基层。奖励机制是：基层大于中高层。处罚机制是：高层大于中基层。', 2.25, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 0, 1, 1, '', 1630030358, 1630030358);
INSERT INTO `p_brand` VALUES (75659, 3632, 'YL·T', 5, '云庐·檀', 'https://oss.yiwofa.com/brand/20210827/6e0e2f10c4c6fe0e4fd74c1709c5cacf.jpg', 'https://oss.yiwofa.com/brand_banner/20210827/5da4554c6d59e8091af06647b2d2dda3.jpg', 'https://oss.yiwofa.com/brand_banner/20210827/f306d38def1c387cdb1275822b5c9e9b.jpg,https://oss.yiwofa.com/brand_banner/20210827/cf26369e6938f24ff1566494575844d3.jpg', '新中式家具', 3.50, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1630045519, 1630045519);
INSERT INTO `p_brand` VALUES (75660, 4097, 'SPJ', 2, '尚品居', 'https://oss.yiwofa.com/brand/20210901/0bca87370b469a5ca5d9372e17cae0e9.png', 'https://oss.yiwofa.com/brand_banner/20210901/dcc5e80e81859572f5761addcb21885e.png', 'https://oss.yiwofa.com/brand_banner/20210901/e8c00e28f969725d48498df27ee4c171.png,https://oss.yiwofa.com/brand_banner/20210901/1fb9572a43dcc41c17a1c0bb618ebf50.jpg,https://oss.yiwofa.com/brand_banner/20210901/d8dcae3f897e27cc6c02d55b4cdc432a.png', 'SPRING(尚品居家具)于2008年创立于中国家具之都--深圳。\n       近十年来公司一直秉承以消费者需求为核心理念，务实，创新，稳步发展。现尚品居家具旗下现有两大系列—法式新古典系列，极简轻奢系列。\n　　 “CLEAN  FACE素颜”法式新古典系列，是国内唯一一家采用桃花芯全实木，座包采用进口高弹纯海绵加乳胶，五金采用进口镀金五金件，面板采用奥古曼火焰纹加上纯贝壳手工镶嵌工艺......的新古典系列。真材实料加上产品创新差异化明显，更适合国内高端人士对品质的追求，使得“素颜”迅速遍布大江南北，并远销国外。\n      \n       荣誉永远属于历史，未来尚品居家具会继续秉承企业优良传统，不断开拓创新，为广大消费者提供更加优质的产品和服务！', 3.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1630465901, 1630465901);
INSERT INTO `p_brand` VALUES (75661, 4275, 'SLL', 2, '圣朗伦', 'https://oss.yiwofa.com/brand/20210907/4321a4a1bf34bf4349593ccbcea176eb.png', 'https://oss.yiwofa.com/brand_banner/20210907/32c442475a8dbfc7c3db8f9207ef1aff.png', 'https://oss.yiwofa.com/brand_banner/20210907/0a361484160e9702f2318ce21adf0bec.jpg,https://oss.yiwofa.com/brand_banner/20210907/047816edd99004faabf436588afcfcbd.jpg,https://oss.yiwofa.com/brand_banner/20210907/1d46397bf392a2090d7afaf5f17fbe01.jpg', '这里包含圣朗伦对生活美学，环境，装饰与品位的完整空间。时下，圣朗伦也更加注重探索潮流与风尚的轻奢，摩登的设计理念，引入更多潮流元素与经典设计相映衬，建立起更加丰盈的圣朗伦美学资产。', 2.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1631001514, 1631001908);
INSERT INTO `p_brand` VALUES (75662, 4251, 'GOMMAPIUMA', 1, 'GOMMAPIUMA', 'https://oss.yiwofa.com/brand/20210911/91c1f0e0d0f38f297ba1c0515567100f.png', 'https://oss.yiwofa.com/brand_banner/20210905/591962bca7bab4af59a604cc77213eee.jpg', 'https://oss.yiwofa.com/brand_banner/20210911/8c8355a930eea5db624bd6a84b7e0c7d.png', '源自1929年澳大利亚寝具百年老品牌：GOMMAPIUMA乳胶寝具让您更享受大自然的感觉\nSapsalatex是欧洲知名品牌，GOMMAPIUMA乳胶专利技术也是世界闻名的，由于采用设备成本相对较高，可以大幅度的生产，产品的耐用性和透气性也是非常好，天然纯乳胶的密度达到一个平衡点。', 3.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 0, 1, 1, '', 1631352275, 1631352275);
