INSERT INTO `p_brand` VALUES (75670, 3632, 'MY', 3, '榻榻木语', 'https://oss.yiwofa.com/brand/20211005/0d0449dab8cc514416b3cc4e5be323f2.jpg', 'https://oss.yiwofa.com/brand_banner/20211005/eb88c84da99e74e7782167b6f5869812.jpg', 'https://oss.yiwofa.com/brand_banner/20211005/eb88c84da99e74e7782167b6f5869812.jpg', '佛山市伟傲家具有限公司是一家专业研发、 制造、 销售青少年儿童家具的大型民营企业。 从成立到 今天，经过不断地探索、不断地总 结、不断地提 升，在遍布全国的经销商的支 持下，到今天我们 已经取得了累累硕果，公 司现有各类中高级管理 和研发人员60多人， 员工200多人，拥有从意大 利，德国进口的 全套大型木工机械设备100多台 （套），现 代化的厂房逾30000平方米。伟傲旗 下《榻榻木语》、《纳美利亚》、《爱多点》、 《美卡琳娜》，品牌产品正风靡全国及世界 主要 国家和地区，并获得了专家和消费者的 一致好评.', 3.50, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.000, 0, 2, 1, '', 1633416572, 1634797576);
