INSERT INTO `p_brand` VALUES (75672, 4453, 'ZSWB', 2, '致尚伟邦', 'https://oss.yiwofa.com/brand/20211014/486cd975103015dd26d0cee14dd79e0c.jpg', 'https://oss.yiwofa.com/brand_banner/20211014/31ff2426d7a8b423daa356f477e96469.jpg', 'https://oss.yiwofa.com/brand_banner/20211014/226cf8ee931fcf2600bcf69435dd7378.jpg,https://oss.yiwofa.com/brand_banner/20211014/b7181e6de6592c9e2dc15ee79368d0f1.jpg,https://oss.yiwofa.com/brand_banner/20211014/fbc1992d43ada175fb68376527070ff2.jpg', '致尚伟邦家居是双久集团下的民用品牌，集研发、生产、销售为一体的大型企业，公司制造中心位于中国家具之都佛山龙江，占地四万多平方米，公司员工300多人，有民用事业部，工程项目事业部，高定事业部及电商部。在东莞营销中心及佛山制造中心自有展厅3000多平方米，公司致力于打造现代美学高端家居品牌', 3.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 0, 1, 1, '', 1634194567, 1634195220);
