INSERT INTO `p_brand` VALUES (75676, 4379, 'YR', 16, '越然', 'https://oss.yiwofa.com/brand/20211118/2ec89a031e6779b53a195e4b789f0a5e.png', 'https://oss.yiwofa.com/brand_banner/20211118/dbe8b719feda45006a12c09e630c67c7.jpg', 'https://oss.yiwofa.com/brand_banner/20211118/ab42965ab11a1a8351c56ded455a44cd.jpg,https://oss.yiwofa.com/brand_banner/20211118/d13817b5957348e853481d80470cb4d0.jpg,https://oss.yiwofa.com/brand_banner/20211118/ba41acf5b06c01f385d901e8c9eb7424.jpg', '集研发、生产、销售为一体的大型企业，公司制造中心位于中国家具之都佛山龙江，占地四万多平方米，公司员工300多人，有民用事业部，工程项目事业部，高定事业部及电商部。在东莞营销中心及佛山制造中心自有展厅3000多平方米，公司致力于打造现代美学高端家居品牌', 3.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 1, 1, 1, '', 1637202205, 1637891610);
INSERT INTO `p_brand` VALUES (75677, 4379, 'YS', 16, '扬狮', 'https://oss.yiwofa.com/brand/20211126/9de47afe818b05dfcbde9e2b84e8cabb.png', 'https://oss.yiwofa.com/brand_banner/20211126/6675f8cecb44a933c3cd14ccc44de483.jpg', 'https://oss.yiwofa.com/brand_banner/20211126/4a5e60272576026d64cecbdfc1964c2a.jpg,https://oss.yiwofa.com/brand_banner/20211126/6675f8cecb44a933c3cd14ccc44de483.jpg,https://oss.yiwofa.com/brand_banner/20211126/7fe0a8e8ab04981187133e13c8a0c1e4.jpg', '扬狮家具是一个拥有二十多年的家具生产设计的经验了，转主义设计生产欧美式家具，所以在这块领域已经达到了国内顶尖的水准了，无论是在外观还是材质上都是比较符合大众消费者的要求的，所以在家具选择的时候扬狮家具也是一个不错的选择，纯手工雕花工艺、手工精致打磨技术延续着传统家具的传承，旗下十多个不同风格的品牌，选择的方面更为宽阔。', 3.00, 0, 0, 0, 0, 1, 0, 1, 1, 1000, 0, 0.012, 0, 1, 1, '', 1637893029, 1637893029);
