INSERT INTO `p_brand` VALUES (75680, 0, '', 0, '艺贝子', 'https://oss.yiwofa.com/brand/20210106/01a40196ae8ba7a5d3609e2f139a1e8d.png', '', '', '东莞市艺贝家居饰品有限公司是家居饰品、树脂工艺品、玻璃饰品、工艺礼品摆件、婚庆礼品等产品专业生产加工的公司，拥有完整、科学的质量管理体系。东莞市艺贝家居饰品有限公司的诚信、实力和产品质量获得业界的认可。\n我司成立于2004年，位于中国大陆制造之都-东莞,我们一直秉承“客户第一，诚信至上”的原则理念； 是具研发、生产、销售的全面一体模式；主营：各类家居饰品,办公饰品,酒店工程饰品,室内照明灯具灯饰、出口树脂工艺品系列等.适合于各大家具企业展览厅、卖场、专卖店、家居配饰，房地产,样品房和广告摄影场景摆设，酒店娱乐城装饰等……\n2010年4月5日，我厂正式涉足国内家居行业市场，由外贸转型，我们拥有生产厂房近3000余平米，内销独立注浆部800多平米，库房5000多平米，员工110多名，产品种类过千余款，现已开始多元化丰富产品特性，这一年来我们栽过很多跟头，也犯过很多错误，另我们欣慰的是大家依然如此信任和支持我们，这是我们的动力，更是坚持的方向，我们定会更加努力，研发出更多物美价廉的产品，望大家继续支持.....\n热诚欢迎各界新老朋友前来参观、考察、洽谈业务。', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.000, 0, 0, 1, '', 0, 0);
