INSERT INTO `p_brand` VALUES (75695, 0, '', 0, '慧狐智创', 'https://oss.yiwofa.com/brand/20201207/639138a3df61f465ac7beedc3e732e3c.png', '', '', '中山市慧歆灯饰有限公司是工程灯具、酒店灯具、客房灯、水晶大堂灯、现代特色灯、家居灯具、客厅灯 餐厅吊灯 吧台吊灯 美式灯 简约现代灯具 台灯、落地灯、壁灯、LED声控感应吸顶灯等产品专业生产加工的公司，拥有完整、科学的质量管理体系。中山市慧歆灯饰有限公司的诚信、实力和产品质量获得业界的认可。欢迎各界朋友莅临参观、指导和业务洽谈。 主营室内装饰花灯，应用广泛：酒店宾馆KTV大堂灯、家居客厅卧室灯、展厅造型灯、楼盘感应过道灯、酒吧前台灯、按设计师，定位不同的风格来搭配适合您的灯具！欢迎来图订做！来电咨询！', 3.00, 0, 0, 0, 0, 1, 0, 1, 100, 1000, 0, 0.000, 0, 0, 0, '', 0, 0);
